INSERT INTO `JobCode` (`id`, `creationDate`, `code`, `name`, `major`, `minor`, `broad`, `detailed`, `description`, `framework`, `url`) VALUES (1,'2023-02-27 20:34:31.765151','11-0000','Management Occupations','Management Occupations',NULL,NULL,'Management Occupations','','bls',NULL),(2,'2023-02-27 20:34:31.967657','11-1000','Top Executives','Management Occupations','Top Executives',NULL,'Top Executives','','bls',NULL),(3,'2023-02-27 20:34:32.049442','11-1010','Chief Executives','Management Occupations','Top Executives','Chief Executives','Chief Executives','','bls',NULL),(4,'2023-02-27 20:34:32.135569','11-1011','Chief Executives','Management Occupations','Top Executives','Chief Executives','Chief Executives','Determine and formulate policies and provide overall direction of companies or private and public sector organizations within guidelines set up by a board of directors or similar governing body. Plan, direct, or coordinate operational activities at the highest level of management with the help of subordinate executives and staff managers.','bls',NULL),(5,'2023-02-27 20:34:32.235425','11-1020','General and Operations Managers','Management Occupations','Top Executives','General and Operations Managers','General and Operations Managers','','bls',NULL),(6,'2023-02-27 20:34:32.323630','11-1021','General and Operations Managers','Management Occupations','Top Executives','General and Operations Managers','General and Operations Managers','Plan, direct, or coordinate the operations of public or private sector organizations, overseeing multiple departments or locations. Duties and responsibilities include formulating policies, managing daily operations, and planning the use of materials and human resources, but are too diverse and general in nature to be classified in any one functional area of management or administration, such as personnel, purchasing, or administrative services. Usually manage through subordinate supervisors. Excludes First-Line Supervisors.','bls',NULL),(7,'2023-02-27 20:34:32.388855','11-1030','Legislators','Management Occupations','Top Executives','Legislators','Legislators','','bls',NULL),(8,'2023-02-27 20:34:32.450244','11-1031','Legislators','Management Occupations','Top Executives','Legislators','Legislators','Develop, introduce, or enact laws and statutes at the local, tribal, state, or federal level. Includes only workers in elected positions.','bls',NULL),(9,'2023-02-27 20:34:32.510497','11-2000','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers',NULL,'Advertising, Marketing, Promotions, Public Relations, and Sales Managers','','bls',NULL),(10,'2023-02-27 20:34:32.565975','11-2010','Advertising and Promotions Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Advertising and Promotions Managers','Advertising and Promotions Managers','','bls',NULL),(11,'2023-02-27 20:34:32.624505','11-2011','Advertising and Promotions Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Advertising and Promotions Managers','Advertising and Promotions Managers','Plan, direct, or coordinate advertising policies and programs or produce collateral materials, such as posters, contests, coupons, or giveaways, to create extra interest in the purchase of a product or service for a department, an entire organization, or on an account basis.','bls',NULL),(12,'2023-02-27 20:34:32.683245','11-2020','Marketing and Sales Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Marketing and Sales Managers','Marketing and Sales Managers','','bls',NULL),(13,'2023-02-27 20:34:32.740128','11-2021','Marketing Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Marketing and Sales Managers','Marketing Managers','Plan, direct, or coordinate marketing policies and programs, such as determining the demand for products and services offered by a firm and its competitors, and identify potential customers. Develop pricing strategies with the goal of maximizing the firm’s profits or share of the market while ensuring the firm’s customers are satisfied. Oversee product development or monitor trends that indicate the need for new products and services.','bls',NULL),(14,'2023-02-27 20:34:32.816869','11-2022','Sales Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Marketing and Sales Managers','Sales Managers','Plan, direct, or coordinate the actual distribution or movement of a product or service to the customer. Coordinate sales distribution by establishing sales territories, quotas, and goals and establish training programs for sales representatives. Analyze sales statistics gathered by staff to determine sales potential and inventory requirements and monitor the preferences of customers.','bls',NULL),(15,'2023-02-27 20:34:32.878494','11-2030','Public Relations and Fundraising Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Public Relations and Fundraising Managers','Public Relations and Fundraising Managers','','bls',NULL),(16,'2023-02-27 20:34:32.936355','11-2032','Public Relations Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Public Relations and Fundraising Managers','Public Relations Managers','Plan, direct, or coordinate activities designed to create or maintain a favorable public image or raise issue awareness for their organization or client.','bls',NULL),(17,'2023-02-27 20:34:32.999521','11-2033','Fundraising Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Public Relations and Fundraising Managers','Fundraising Managers','Plan, direct, or coordinate activities to solicit and maintain funds for special projects or nonprofit organizations.','bls',NULL),(18,'2023-02-27 20:34:33.056741','11-3000','Operations Specialties Managers','Management Occupations','Operations Specialties Managers',NULL,'Operations Specialties Managers','','bls',NULL),(19,'2023-02-27 20:34:33.129296','11-3010','Administrative Services and Facilities Managers','Management Occupations','Operations Specialties Managers','Administrative Services and Facilities Managers','Administrative Services and Facilities Managers','','bls',NULL),(20,'2023-02-27 20:34:33.190274','11-3012','Administrative Services Managers','Management Occupations','Operations Specialties Managers','Administrative Services and Facilities Managers','Administrative Services Managers','Plan, direct, or coordinate one or more administrative services of an organization, such as records and information management, mail distribution, and other office support services. Medical records administrators are included in “Medical and Health Services Managers” (11-9111). Excludes “Facilities Managers” (11-3013) and “Purchasing Managers” (11-3061).','bls',NULL),(21,'2023-02-27 20:34:33.254178','11-3013','Facilities Managers','Management Occupations','Operations Specialties Managers','Administrative Services and Facilities Managers','Facilities Managers','Plan, direct, or coordinate operations and functionalities of facilities and buildings. May include surrounding grounds or multiple facilities of an organization’s campus. Excludes “Administrative Services Managers” (11-3012), “Property, Real Estate, and Community Association Managers” (11-9141), “First-Line Supervisors of Building and Grounds Cleaning and Maintenance Workers” (37-1010), “First-Line Supervisors of Mechanics and Repairers” (49-1011), and “Maintenance and Repair Workers, General” (49-9071).','bls',NULL),(22,'2023-02-27 20:34:33.315542','11-3020','Computer and Information Systems Managers','Management Occupations','Operations Specialties Managers','Computer and Information Systems Managers','Computer and Information Systems Managers','','bls',NULL),(23,'2023-02-27 20:34:33.369647','11-3021','Computer and Information Systems Managers','Management Occupations','Operations Specialties Managers','Computer and Information Systems Managers','Computer and Information Systems Managers','Plan, direct, or coordinate activities in such fields as electronic data processing, information systems, systems analysis, and computer programming. Excludes “Computer Occupations” (15-1211 through 15-1299).','bls',NULL),(24,'2023-02-27 20:34:33.424182','11-3030','Financial Managers','Management Occupations','Operations Specialties Managers','Financial Managers','Financial Managers','','bls',NULL),(25,'2023-02-27 20:34:33.471080','11-3031','Financial Managers','Management Occupations','Operations Specialties Managers','Financial Managers','Financial Managers','Plan, direct, or coordinate accounting, investing, banking, insurance, securities, and other financial activities of a branch, office, or department of an establishment. Excludes “Financial Risk Specialists” (13-2054).','bls',NULL),(26,'2023-02-27 20:34:33.537884','11-3050','Industrial Production Managers','Management Occupations','Operations Specialties Managers','Industrial Production Managers','Industrial Production Managers','','bls',NULL),(27,'2023-02-27 20:34:33.593753','11-3051','Industrial Production Managers','Management Occupations','Operations Specialties Managers','Industrial Production Managers','Industrial Production Managers','Plan, direct, or coordinate the work activities and resources necessary for manufacturing products in accordance with cost, quality, and quantity specifications.','bls',NULL),(28,'2023-02-27 20:34:33.653911','11-3060','Purchasing Managers','Management Occupations','Operations Specialties Managers','Purchasing Managers','Purchasing Managers','','bls',NULL),(29,'2023-02-27 20:34:33.710527','11-3061','Purchasing Managers','Management Occupations','Operations Specialties Managers','Purchasing Managers','Purchasing Managers','Plan, direct, or coordinate the activities of buyers, purchasing officers, and related workers involved in purchasing materials, products, and services. Includes wholesale or retail trade merchandising managers and procurement managers.','bls',NULL),(30,'2023-02-27 20:34:33.770611','11-3070','Transportation, Storage, and Distribution Managers','Management Occupations','Operations Specialties Managers','Transportation, Storage, and Distribution Managers','Transportation, Storage, and Distribution Managers','','bls',NULL),(31,'2023-02-27 20:34:33.820957','11-3071','Transportation, Storage, and Distribution Managers','Management Occupations','Operations Specialties Managers','Transportation, Storage, and Distribution Managers','Transportation, Storage, and Distribution Managers','Plan, direct, or coordinate transportation, storage, or distribution activities in accordance with organizational policies and applicable government laws or regulations. Includes logistics managers.','bls',NULL),(32,'2023-02-27 20:34:33.881727','11-3110','Compensation and Benefits Managers','Management Occupations','Operations Specialties Managers','Compensation and Benefits Managers','Compensation and Benefits Managers','','bls',NULL),(33,'2023-02-27 20:34:33.948331','11-3111','Compensation and Benefits Managers','Management Occupations','Operations Specialties Managers','Compensation and Benefits Managers','Compensation and Benefits Managers','Plan, direct, or coordinate compensation and benefits activities of an organization. Job analysis and position description managers are included in “Human Resources Managers” (11-3121).','bls',NULL),(34,'2023-02-27 20:34:34.004946','11-3120','Human Resources Managers','Management Occupations','Operations Specialties Managers','Human Resources Managers','Human Resources Managers','','bls',NULL),(35,'2023-02-27 20:34:34.054579','11-3121','Human Resources Managers','Management Occupations','Operations Specialties Managers','Human Resources Managers','Human Resources Managers','Plan, direct, or coordinate human resources activities and staff of an organization. Excludes managers who primarily focus on compensation and benefits (11-3111) and training and development (11-3131).','bls',NULL),(36,'2023-02-27 20:34:34.111361','11-3130','Training and Development Managers','Management Occupations','Operations Specialties Managers','Training and Development Managers','Training and Development Managers','','bls',NULL),(37,'2023-02-27 20:34:34.169624','11-3131','Training and Development Managers','Management Occupations','Operations Specialties Managers','Training and Development Managers','Training and Development Managers','Plan, direct, or coordinate the training and development activities and staff of an organization.','bls',NULL),(38,'2023-02-27 20:34:34.228569','11-9000','Other Management Occupations','Management Occupations','Other Management Occupations',NULL,'Other Management Occupations','','bls',NULL),(39,'2023-02-27 20:34:34.280000','11-9010','Farmers, Ranchers, and Other Agricultural Managers','Management Occupations','Other Management Occupations','Farmers, Ranchers, and Other Agricultural Managers','Farmers, Ranchers, and Other Agricultural Managers','','bls',NULL),(40,'2023-02-27 20:34:34.327913','11-9013','Farmers, Ranchers, and Other Agricultural Managers','Management Occupations','Other Management Occupations','Farmers, Ranchers, and Other Agricultural Managers','Farmers, Ranchers, and Other Agricultural Managers','Plan, direct, or coordinate the management or operation of farms, ranches, greenhouses, aquacultural operations, nurseries, timber tracts, or other agricultural establishments. May hire, train, and supervise farm workers or contract for services to carry out the day-to-day activities of the managed operation. May engage in or supervise planting, cultivating, harvesting, and financial and marketing activities. Excludes “First-Line Supervisors of Farming, Fishing, and Forestry Workers” (45-1011).','bls',NULL),(41,'2023-02-27 20:34:34.391879','11-9020','Construction Managers','Management Occupations','Other Management Occupations','Construction Managers','Construction Managers','','bls',NULL),(42,'2023-02-27 20:34:34.458590','11-9021','Construction Managers','Management Occupations','Other Management Occupations','Construction Managers','Construction Managers','Plan, direct, or coordinate, usually through subordinate supervisory personnel, activities concerned with the construction and maintenance of structures, facilities, and systems. Participate in the conceptual development of a construction project and oversee its organization, scheduling, budgeting, and implementation. Includes managers in specialized construction fields, such as carpentry or plumbing.','bls',NULL),(43,'2023-02-27 20:34:34.524597','11-9030','Education and Childcare Administrators','Management Occupations','Other Management Occupations','Education and Childcare Administrators','Education and Childcare Administrators','','bls',NULL),(44,'2023-02-27 20:34:34.587968','11-9031','Education and Childcare Administrators, Preschool and Daycare','Management Occupations','Other Management Occupations','Education and Childcare Administrators','Education and Childcare Administrators, Preschool and Daycare','Plan, direct, or coordinate academic or nonacademic activities of preschools or childcare centers and programs, including before- and after-school care. Excludes “Preschool Teachers, Except Special Education” (25-2011) and “Childcare Workers” (39-9011).','bls',NULL),(45,'2023-02-27 20:34:34.646884','11-9032','Education Administrators, Kindergarten through Secondary','Management Occupations','Other Management Occupations','Education and Childcare Administrators','Education Administrators, Kindergarten through Secondary','Plan, direct, or coordinate the academic, administrative, or auxiliary activities of kindergarten, elementary, or secondary schools.','bls',NULL),(46,'2023-02-27 20:34:34.705152','11-9033','Education Administrators, Postsecondary','Management Occupations','Other Management Occupations','Education and Childcare Administrators','Education Administrators, Postsecondary','Plan, direct, or coordinate student instruction, administration, and services, as well as other research and educational activities, at postsecondary institutions, including universities, colleges, and junior and community colleges.','bls',NULL),(47,'2023-02-27 20:34:34.762529','11-9039','Education Administrators, All Other','Management Occupations','Other Management Occupations','Education and Childcare Administrators','Education Administrators, All Other','All education administrators not listed separately.','bls',NULL),(48,'2023-02-27 20:34:34.822564','11-9040','Architectural and Engineering Managers','Management Occupations','Other Management Occupations','Architectural and Engineering Managers','Architectural and Engineering Managers','','bls',NULL),(49,'2023-02-27 20:34:34.873993','11-9041','Architectural and Engineering Managers','Management Occupations','Other Management Occupations','Architectural and Engineering Managers','Architectural and Engineering Managers','Plan, direct, or coordinate activities in such fields as architecture and engineering or research and development in these fields. Excludes “Natural Sciences Managers” (11-9121).','bls',NULL),(50,'2023-02-27 20:34:34.935186','11-9050','Food Service Managers','Management Occupations','Other Management Occupations','Food Service Managers','Food Service Managers','','bls',NULL),(51,'2023-02-27 20:34:34.990363','11-9051','Food Service Managers','Management Occupations','Other Management Occupations','Food Service Managers','Food Service Managers','Plan, direct, or coordinate activities of an organization or department that serves food and beverages. Excludes “Chefs and Head Cooks” (35-1011).','bls',NULL),(52,'2023-02-27 20:34:35.047451','11-9070','Entertainment and Recreation Managers','Management Occupations','Other Management Occupations','Entertainment and Recreation Managers','Entertainment and Recreation Managers','','bls',NULL),(53,'2023-02-27 20:34:35.107683','11-9071','Gambling Managers','Management Occupations','Other Management Occupations','Entertainment and Recreation Managers','Gambling Managers','Plan, direct, or coordinate gambling operations in a casino. May formulate house rules.','bls',NULL),(54,'2023-02-27 20:34:35.159360','11-9072','Entertainment and Recreation Managers, Except Gambling','Management Occupations','Other Management Occupations','Entertainment and Recreation Managers','Entertainment and Recreation Managers, Except Gambling','Plan, direct, or coordinate entertainment and recreational activities and operations of a recreational facility, including cruise ships and parks.','bls',NULL),(55,'2023-02-27 20:34:35.208561','11-9080','Lodging Managers','Management Occupations','Other Management Occupations','Lodging Managers','Lodging Managers','','bls',NULL),(56,'2023-02-27 20:34:35.276217','11-9081','Lodging Managers','Management Occupations','Other Management Occupations','Lodging Managers','Lodging Managers','Plan, direct, or coordinate activities of an organization or department that provides lodging and other accommodations. Excludes “Food Service Managers” (11-9051) in lodging establishments.','bls',NULL),(57,'2023-02-27 20:34:35.330785','11-9110','Medical and Health Services Managers','Management Occupations','Other Management Occupations','Medical and Health Services Managers','Medical and Health Services Managers','','bls',NULL),(58,'2023-02-27 20:34:35.389102','11-9111','Medical and Health Services Managers','Management Occupations','Other Management Occupations','Medical and Health Services Managers','Medical and Health Services Managers','Plan, direct, or coordinate medical and health services in hospitals, clinics, managed care organizations, public health agencies, or similar organizations.','bls',NULL),(59,'2023-02-27 20:34:35.445403','11-9120','Natural Sciences Managers','Management Occupations','Other Management Occupations','Natural Sciences Managers','Natural Sciences Managers','','bls',NULL),(60,'2023-02-27 20:34:35.499769','11-9121','Natural Sciences Managers','Management Occupations','Other Management Occupations','Natural Sciences Managers','Natural Sciences Managers','Plan, direct, or coordinate activities in such fields as life sciences, physical sciences, mathematics, statistics, and research and development in these fields. Excludes “Computer and Information Systems Managers” (11-3021) and “Architecture and Engineering Managers” (11-9041).','bls',NULL),(61,'2023-02-27 20:34:35.558434','11-9130','Postmasters and Mail Superintendents','Management Occupations','Other Management Occupations','Postmasters and Mail Superintendents','Postmasters and Mail Superintendents','','bls',NULL),(62,'2023-02-27 20:34:35.611092','11-9131','Postmasters and Mail Superintendents','Management Occupations','Other Management Occupations','Postmasters and Mail Superintendents','Postmasters and Mail Superintendents','Plan, direct, or coordinate operational, administrative, management, and support services of a U.S. post office; or coordinate activities of workers engaged in postal and related work in assigned post office.','bls',NULL),(63,'2023-02-27 20:34:35.669189','11-9140','Property, Real Estate, and Community Association Managers','Management Occupations','Other Management Occupations','Property, Real Estate, and Community Association Managers','Property, Real Estate, and Community Association Managers','','bls',NULL),(64,'2023-02-27 20:34:35.716880','11-9141','Property, Real Estate, and Community Association Managers','Management Occupations','Other Management Occupations','Property, Real Estate, and Community Association Managers','Property, Real Estate, and Community Association Managers','Plan, direct, or coordinate the selling, buying, leasing, or governance activities of commercial, industrial, or residential real estate properties. Includes managers of homeowner and condominium associations, rented or leased housing units, buildings, or land (including rights-of-way).','bls',NULL),(65,'2023-02-27 20:34:35.779531','11-9150','Social and Community Service Managers','Management Occupations','Other Management Occupations','Social and Community Service Managers','Social and Community Service Managers','','bls',NULL),(66,'2023-02-27 20:34:35.835332','11-9151','Social and Community Service Managers','Management Occupations','Other Management Occupations','Social and Community Service Managers','Social and Community Service Managers','Plan, direct, or coordinate the activities of a social service program or community outreach organization. Oversee the program or organization’s budget and policies regarding participant involvement, program requirements, and benefits. Work may involve directing social workers, counselors, or probation officers.','bls',NULL),(67,'2023-02-27 20:34:35.892093','11-9160','Emergency Management Directors','Management Occupations','Other Management Occupations','Emergency Management Directors','Emergency Management Directors','','bls',NULL),(68,'2023-02-27 20:34:35.948391','11-9161','Emergency Management Directors','Management Occupations','Other Management Occupations','Emergency Management Directors','Emergency Management Directors','Plan and direct disaster response or crisis management activities, provide disaster preparedness training, and prepare emergency plans and procedures for natural (e.g., hurricanes, floods, earthquakes), wartime, or technological (e.g., nuclear power plant emergencies or hazardous materials spills) disasters or hostage situations.','bls',NULL),(69,'2023-02-27 20:34:36.009763','11-9170','Personal Service Managers','Management Occupations','Other Management Occupations','Personal Service Managers','Personal Service Managers','','bls',NULL),(70,'2023-02-27 20:34:36.060667','11-9171','Funeral Home Managers','Management Occupations','Other Management Occupations','Personal Service Managers','Funeral Home Managers','Plan, direct, or coordinate the services or resources of funeral homes. Includes activities such as determining prices for services or merchandise and managing the facilities of funeral homes. Excludes “Morticians, Undertakers, and Funeral Arrangers” (39-4031).','bls',NULL),(71,'2023-02-27 20:34:36.118386','11-9179','Personal Service Managers, All Other','Management Occupations','Other Management Occupations','Personal Service Managers','Personal Service Managers, All Other','All personal service managers not listed separately. Excludes “Financial Specialists” (13-2000). Daycare Managers are included in Education and Childcare Administrators, Preschool and Daycare (11-9031).','bls',NULL),(72,'2023-02-27 20:34:36.177037','11-9190','Miscellaneous Managers','Management Occupations','Other Management Occupations','Miscellaneous Managers','Miscellaneous Managers','','bls',NULL),(73,'2023-02-27 20:34:36.218932','11-9199','Managers, All Other','Management Occupations','Other Management Occupations','Miscellaneous Managers','Managers, All Other','All managers not listed separately.','bls',NULL),(74,'2023-02-27 20:34:36.264694','13-0000','Business and Financial Operations Occupations','Business and Financial Operations Occupations',NULL,NULL,'Business and Financial Operations Occupations','','bls',NULL),(75,'2023-02-27 20:34:36.307128','13-1000','Business Operations Specialists','Business and Financial Operations Occupations','Business Operations Specialists',NULL,'Business Operations Specialists','','bls',NULL),(76,'2023-02-27 20:34:36.348218','13-1010','Agents and Business Managers of Artists, Performers, and Athletes','Business and Financial Operations Occupations','Business Operations Specialists','Agents and Business Managers of Artists, Performers, and Athletes','Agents and Business Managers of Artists, Performers, and Athletes','','bls',NULL),(77,'2023-02-27 20:34:36.395364','13-1011','Agents and Business Managers of Artists, Performers, and Athletes','Business and Financial Operations Occupations','Business Operations Specialists','Agents and Business Managers of Artists, Performers, and Athletes','Agents and Business Managers of Artists, Performers, and Athletes','Represent and promote artists, performers, and athletes in dealings with current or prospective employers. May handle contract negotiation and other business matters for clients.','bls',NULL),(78,'2023-02-27 20:34:36.451282','13-1020','Buyers and Purchasing Agents','Business and Financial Operations Occupations','Business Operations Specialists','Buyers and Purchasing Agents','Buyers and Purchasing Agents','','bls',NULL),(79,'2023-02-27 20:34:36.501989','13-1021','Buyers and Purchasing Agents, Farm Products','Business and Financial Operations Occupations','Business Operations Specialists','Buyers and Purchasing Agents','Buyers and Purchasing Agents, Farm Products','Purchase farm products either for further processing or resale. Includes tree farm contractors, grain brokers and market operators, grain buyers, and tobacco buyers. May negotiate contracts.','bls',NULL),(80,'2023-02-27 20:34:36.554576','13-1022','Wholesale and Retail Buyers, Except Farm Products','Business and Financial Operations Occupations','Business Operations Specialists','Buyers and Purchasing Agents','Wholesale and Retail Buyers, Except Farm Products','Buy merchandise or commodities, other than farm products, for resale to consumers at the wholesale or retail level, including both durable and nondurable goods. Analyze past buying trends, sales records, price, and quality of merchandise to determine value and yield. Select, order, and authorize payment for merchandise according to contractual agreements. May conduct meetings with sales personnel and introduce new products. May negotiate contracts. Includes assistant wholesale and retail buyers of nonfarm products. Excludes “Procurement Clerks” (43-3061).','bls',NULL),(81,'2023-02-27 20:34:36.612839','13-1023','Purchasing Agents, Except Wholesale, Retail, and Farm Products','Business and Financial Operations Occupations','Business Operations Specialists','Buyers and Purchasing Agents','Purchasing Agents, Except Wholesale, Retail, and Farm Products','Purchase machinery, equipment, tools, parts, supplies, or services necessary for the operation of an establishment. Purchase raw or semifinished materials for manufacturing. May negotiate contracts. Excludes “Buyers and Purchasing Agents, Farm Products” (13-1021) and “Wholesale and Retail Buyers, Except Farm Products” (13-1022).','bls',NULL),(82,'2023-02-27 20:34:36.664920','13-1030','Claims Adjusters, Appraisers, Examiners, and Investigators','Business and Financial Operations Occupations','Business Operations Specialists','Claims Adjusters, Appraisers, Examiners, and Investigators','Claims Adjusters, Appraisers, Examiners, and Investigators','','bls',NULL),(83,'2023-02-27 20:34:36.722299','13-1031','Claims Adjusters, Examiners, and Investigators','Business and Financial Operations Occupations','Business Operations Specialists','Claims Adjusters, Appraisers, Examiners, and Investigators','Claims Adjusters, Examiners, and Investigators','Review settled claims to determine that payments and settlements are made in accordance with company practices and procedures. Confer with legal counsel on claims requiring litigation. May also settle insurance claims. Excludes “Fire Inspectors and Investigators” (33-2021).','bls',NULL),(84,'2023-02-27 20:34:36.772468','13-1032','Insurance Appraisers, Auto Damage','Business and Financial Operations Occupations','Business Operations Specialists','Claims Adjusters, Appraisers, Examiners, and Investigators','Insurance Appraisers, Auto Damage','Appraise automobile or other vehicle damage to determine repair costs for insurance claim settlement. Prepare insurance forms to indicate repair cost or cost estimates and recommendations. May seek agreement with automotive repair shop on repair costs.','bls',NULL),(85,'2023-02-27 20:34:36.818999','13-1040','Compliance Officers','Business and Financial Operations Occupations','Business Operations Specialists','Compliance Officers','Compliance Officers','','bls',NULL),(86,'2023-02-27 20:34:36.863031','13-1041','Compliance Officers','Business and Financial Operations Occupations','Business Operations Specialists','Compliance Officers','Compliance Officers','Examine, evaluate, and investigate eligibility for or conformity with laws and regulations governing contract compliance of licenses and permits, and perform other compliance and enforcement inspection and analysis activities not classified elsewhere. Excludes “Financial Examiners\" (13-2061), “Tax Examiners and Collectors, and Revenue Agents” (13-2081), “Occupational Health and Safety Specialists” (19-5011), “Occupational Health and Safety Technicians” (19-5012), “Transportation Security Screeners” (33-9093), “Agricultural Inspectors” (45-2011), “Construction and Building Inspectors” (47-4011), and “Transportation Inspectors” (53-6051).','bls',NULL),(87,'2023-02-27 20:34:36.909380','13-1050','Cost Estimators','Business and Financial Operations Occupations','Business Operations Specialists','Cost Estimators','Cost Estimators','','bls',NULL),(88,'2023-02-27 20:34:36.950241','13-1051','Cost Estimators','Business and Financial Operations Occupations','Business Operations Specialists','Cost Estimators','Cost Estimators','Prepare cost estimates for product manufacturing, construction projects, or services to aid management in bidding on or determining price of product or service. May specialize according to particular service performed or type of product manufactured.','bls',NULL),(89,'2023-02-27 20:34:36.994415','13-1070','Human Resources Workers','Business and Financial Operations Occupations','Business Operations Specialists','Human Resources Workers','Human Resources Workers','','bls',NULL),(90,'2023-02-27 20:34:37.046512','13-1071','Human Resources Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Human Resources Workers','Human Resources Specialists','Recruit, screen, interview, or place individuals within an organization. May perform other activities in multiple human resources areas. Excludes “Compensation, Benefits, and Job Analysis Specialists” (13-1141) and “Training and Development Specialists” (13-1151).','bls',NULL),(91,'2023-02-27 20:34:37.103223','13-1074','Farm Labor Contractors','Business and Financial Operations Occupations','Business Operations Specialists','Human Resources Workers','Farm Labor Contractors','Recruit and hire seasonal or temporary agricultural laborers. May transport, house, and provide meals for workers.','bls',NULL),(92,'2023-02-27 20:34:37.154851','13-1075','Labor Relations Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Human Resources Workers','Labor Relations Specialists','Resolve disputes between workers and managers, negotiate collective bargaining agreements, or coordinate grievance procedures to handle employee complaints. Excludes equal employment opportunity (EEO) officers, who are included in “Compliance Officers” (13-1041).','bls',NULL),(93,'2023-02-27 20:34:37.212690','13-1080','Logisticians and Project Management Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Logisticians and Project Management Specialists','Logisticians and Project Management Specialists','','bls',NULL),(94,'2023-02-27 20:34:37.268951','13-1081','Logisticians','Business and Financial Operations Occupations','Business Operations Specialists','Logisticians and Project Management Specialists','Logisticians','Analyze and coordinate the ongoing logistical functions of a firm or organization. Responsible for the entire life cycle of a product, including acquisition, distribution, internal allocation, delivery, and final disposal of resources. Excludes “Transportation, Storage, and Distribution Managers” (11-3071) and “Project Management Specialists” (13-1082).','bls',NULL),(95,'2023-02-27 20:34:37.321279','13-1082','Project Management Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Logisticians and Project Management Specialists','Project Management Specialists','Analyze and coordinate the schedule, timeline, procurement, staffing, and budget of a product or service on a per project basis. Lead and guide the work of technical staff. May serve as a point of contact for the client or customer. Excludes “Management Occupations” (11-0000), “Logisticians” (13-1081), “Meeting, Convention, and Event Planners” (13-1121), and “Production, Planning, and Expediting Clerks” (43-5061).','bls',NULL),(96,'2023-02-27 20:34:37.375060','13-1110','Management Analysts','Business and Financial Operations Occupations','Business Operations Specialists','Management Analysts','Management Analysts','','bls',NULL),(97,'2023-02-27 20:34:37.415082','13-1111','Management Analysts','Business and Financial Operations Occupations','Business Operations Specialists','Management Analysts','Management Analysts','Conduct organizational studies and evaluations, design systems and procedures, conduct work simplification and measurement studies, and prepare operations and procedures manuals to assist management in operating more efficiently and effectively. Includes program analysts and management consultants. Excludes “Computer Systems Analysts” (15-1211) and “Operations Research Analysts” (15-2031).','bls',NULL),(98,'2023-02-27 20:34:37.460758','13-1120','Meeting, Convention, and Event Planners','Business and Financial Operations Occupations','Business Operations Specialists','Meeting, Convention, and Event Planners','Meeting, Convention, and Event Planners','','bls',NULL),(99,'2023-02-27 20:34:37.507748','13-1121','Meeting, Convention, and Event Planners','Business and Financial Operations Occupations','Business Operations Specialists','Meeting, Convention, and Event Planners','Meeting, Convention, and Event Planners','Coordinate activities of staff, convention personnel, or clients to make arrangements for group meetings, events, or conventions.','bls',NULL),(100,'2023-02-27 20:34:37.550807','13-1130','Fundraisers','Business and Financial Operations Occupations','Business Operations Specialists','Fundraisers','Fundraisers','','bls',NULL),(101,'2023-02-27 20:34:37.592397','13-1131','Fundraisers','Business and Financial Operations Occupations','Business Operations Specialists','Fundraisers','Fundraisers','Organize activities to raise funds or otherwise solicit and gather monetary donations or other gifts for an organization. May design and produce promotional materials. May also raise awareness of the organization’s work, goals, and financial needs.','bls',NULL),(102,'2023-02-27 20:34:37.640704','13-1140','Compensation, Benefits, and Job Analysis Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Compensation, Benefits, and Job Analysis Specialists','Compensation, Benefits, and Job Analysis Specialists','','bls',NULL),(103,'2023-02-27 20:34:37.682910','13-1141','Compensation, Benefits, and Job Analysis Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Compensation, Benefits, and Job Analysis Specialists','Compensation, Benefits, and Job Analysis Specialists','Conduct programs of compensation and benefits and job analysis for employer. May specialize in specific areas, such as position classification and pension programs.','bls',NULL),(104,'2023-02-27 20:34:37.729064','13-1150','Training and Development Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Training and Development Specialists','Training and Development Specialists','','bls',NULL),(105,'2023-02-27 20:34:37.774418','13-1151','Training and Development Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Training and Development Specialists','Training and Development Specialists','Design or conduct work-related training and development programs to improve individual skills or organizational performance. May analyze organizational training needs or evaluate training effectiveness. Excludes “Career/Technical Education Teachers, Postsecondary” (25-1194) and “Other Teachers and Instructors” (25-3000). Flight instructors are included with “Aircraft Pilots and Flight Engineers” (53-2010).','bls',NULL),(106,'2023-02-27 20:34:37.827488','13-1160','Market Research Analysts and Marketing Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Market Research Analysts and Marketing Specialists','Market Research Analysts and Marketing Specialists','','bls',NULL),(107,'2023-02-27 20:34:37.873015','13-1161','Market Research Analysts and Marketing Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Market Research Analysts and Marketing Specialists','Market Research Analysts and Marketing Specialists','Research conditions in local, regional, national, or online markets. Gather information to determine potential sales of a product or service, or plan a marketing or advertising campaign. May gather information on competitors, prices, sales, and methods of marketing and distribution. May employ search marketing tactics, analyze web metrics, and develop recommendations to increase search engine ranking and visibility to target markets. Excludes “Web and Digital Interface Designers” (15-1255), “Art Directors” (27-1011), “Graphic Designers” (27-1024), and “Public Relations Specialists” (27-3031).','bls',NULL),(108,'2023-02-27 20:34:37.923796','13-1190','Miscellaneous Business Operations Specialists','Business and Financial Operations Occupations','Business Operations Specialists','Miscellaneous Business Operations Specialists','Miscellaneous Business Operations Specialists','','bls',NULL),(109,'2023-02-27 20:34:37.962913','13-1199','Business Operations Specialists, All Other','Business and Financial Operations Occupations','Business Operations Specialists','Miscellaneous Business Operations Specialists','Business Operations Specialists, All Other','All business operations specialists not listed separately.','bls',NULL),(110,'2023-02-27 20:34:38.004509','13-2000','Financial Specialists','Business and Financial Operations Occupations','Financial Specialists',NULL,'Financial Specialists','','bls',NULL),(111,'2023-02-27 20:34:38.046823','13-2010','Accountants and Auditors','Business and Financial Operations Occupations','Financial Specialists','Accountants and Auditors','Accountants and Auditors','','bls',NULL),(112,'2023-02-27 20:34:38.086186','13-2011','Accountants and Auditors','Business and Financial Operations Occupations','Financial Specialists','Accountants and Auditors','Accountants and Auditors','Examine, analyze, and interpret accounting records to prepare financial statements, give advice, or audit and evaluate statements prepared by others. Install or advise on systems of recording costs or other financial and budgetary data. Excludes “Tax Examiners and Collectors, and Revenue Agents” (13-2081).','bls',NULL),(113,'2023-02-27 20:34:38.132127','13-2020','Property Appraisers and Assessors','Business and Financial Operations Occupations','Financial Specialists','Property Appraisers and Assessors','Property Appraisers and Assessors','','bls',NULL),(114,'2023-02-27 20:34:38.178062','13-2022','Appraisers of Personal and Business Property','Business and Financial Operations Occupations','Financial Specialists','Property Appraisers and Assessors','Appraisers of Personal and Business Property','Appraise and estimate the fair value of tangible personal or business property, such as jewelry, art, antiques, collectibles, and equipment. Includes workers who appraise both personal and business property as well as real estate. May also appraise land. Excludes “Claims Adjusters, Examiners, and Investigators” (13-1031), “Insurance Appraisers, Auto Damage” (13-1032), “Appraisers and Assessors of Real Estate” (13-2023), and “Tax Examiners and Collectors, and Revenue Agents” (13-2081).','bls',NULL),(115,'2023-02-27 20:34:38.225791','13-2023','Appraisers and Assessors of Real Estate','Business and Financial Operations Occupations','Financial Specialists','Property Appraisers and Assessors','Appraisers and Assessors of Real Estate','Appraise real estate, exclusively, and estimate its fair value. May assess taxes in accordance with prescribed schedules. Excludes “Appraisers of Personal and Business Property” (13-2022).','bls',NULL),(116,'2023-02-27 20:34:38.270390','13-2030','Budget Analysts','Business and Financial Operations Occupations','Financial Specialists','Budget Analysts','Budget Analysts','','bls',NULL),(117,'2023-02-27 20:34:38.315413','13-2031','Budget Analysts','Business and Financial Operations Occupations','Financial Specialists','Budget Analysts','Budget Analysts','Examine budget estimates for completeness, accuracy, and conformance with procedures and regulations. Analyze budgeting and accounting reports. Excludes “Financial and Investment Analysts” (13-2051).','bls',NULL),(118,'2023-02-27 20:34:38.363414','13-2040','Credit Analysts','Business and Financial Operations Occupations','Financial Specialists','Credit Analysts','Credit Analysts','','bls',NULL),(119,'2023-02-27 20:34:38.406301','13-2041','Credit Analysts','Business and Financial Operations Occupations','Financial Specialists','Credit Analysts','Credit Analysts','Analyze credit data and financial statements of individuals or firms to determine the degree of risk involved in extending credit or lending money. Prepare reports with credit information for use in decisionmaking. Excludes “Financial Risk Specialists” (13-2054).','bls',NULL),(120,'2023-02-27 20:34:38.452286','13-2050','Financial Analysts and Advisors','Business and Financial Operations Occupations','Financial Specialists','Financial Analysts and Advisors','Financial Analysts and Advisors','','bls',NULL),(121,'2023-02-27 20:34:38.493463','13-2051','Financial and Investment Analysts','Business and Financial Operations Occupations','Financial Specialists','Financial Analysts and Advisors','Financial and Investment Analysts','Conduct quantitative analyses of information involving investment programs or financial data of public or private institutions, including valuation of businesses. Excludes “Budget Analysts” (13-2031), “Financial Risk Specialists” (13-2054), and “Securities, Commodities, and Financial Services Sales Agents” (41-3031).','bls',NULL),(122,'2023-02-27 20:34:38.536484','13-2052','Personal Financial Advisors','Business and Financial Operations Occupations','Financial Specialists','Financial Analysts and Advisors','Personal Financial Advisors','Advise clients on financial plans using knowledge of tax and investment strategies, securities, insurance, pension plans, and real estate. Duties include assessing clients\' assets, liabilities, cash flow, insurance coverage, tax status, and financial objectives. May also buy and sell financial assets for clients. Excludes “Securities, Commodities, and Financial Services Sales Agents” (41-3031).','bls',NULL),(123,'2023-02-27 20:34:38.596004','13-2053','Insurance Underwriters','Business and Financial Operations Occupations','Financial Specialists','Financial Analysts and Advisors','Insurance Underwriters','Review individual applications for insurance to evaluate degree of risk involved and determine acceptance of applications.','bls',NULL),(124,'2023-02-27 20:34:38.645120','13-2054','Financial Risk Specialists','Business and Financial Operations Occupations','Financial Specialists','Financial Analysts and Advisors','Financial Risk Specialists','Analyze and measure exposure to credit and market risk threatening the assets, earning capacity, or economic state of an organization. May make recommendations to limit risk. Excludes “Credit Analysts” (13-2041).','bls',NULL),(125,'2023-02-27 20:34:38.699158','13-2060','Financial Examiners','Business and Financial Operations Occupations','Financial Specialists','Financial Examiners','Financial Examiners','','bls',NULL),(126,'2023-02-27 20:34:38.760494','13-2061','Financial Examiners','Business and Financial Operations Occupations','Financial Specialists','Financial Examiners','Financial Examiners','Enforce or ensure compliance with laws and regulations governing financial and securities institutions and financial and real estate transactions. May examine, verify, or authenticate records.','bls',NULL),(127,'2023-02-27 20:34:38.811113','13-2070','Credit Counselors and Loan Officers','Business and Financial Operations Occupations','Financial Specialists','Credit Counselors and Loan Officers','Credit Counselors and Loan Officers','','bls',NULL),(128,'2023-02-27 20:34:38.851732','13-2071','Credit Counselors','Business and Financial Operations Occupations','Financial Specialists','Credit Counselors and Loan Officers','Credit Counselors','Advise and educate individuals or organizations on acquiring and managing debt. May provide guidance in determining the best type of loan and explain loan requirements or restrictions. May help develop debt management plans or student financial aid packages. May advise on credit issues, or provide budget, mortgage, bankruptcy, or student financial aid counseling.','bls',NULL),(129,'2023-02-27 20:34:38.899154','13-2072','Loan Officers','Business and Financial Operations Occupations','Financial Specialists','Credit Counselors and Loan Officers','Loan Officers','Evaluate, authorize, or recommend approval of commercial, real estate, or credit loans. Advise borrowers on financial status and payment methods. Includes mortgage loan officers and agents, collection analysts, loan servicing officers, loan underwriters, and payday loan officers.','bls',NULL),(130,'2023-02-27 20:34:38.943775','13-2080','Tax Examiners, Collectors and Preparers, and Revenue Agents','Business and Financial Operations Occupations','Financial Specialists','Tax Examiners, Collectors and Preparers, and Revenue Agents','Tax Examiners, Collectors and Preparers, and Revenue Agents','','bls',NULL),(131,'2023-02-27 20:34:38.985130','13-2081','Tax Examiners and Collectors, and Revenue Agents','Business and Financial Operations Occupations','Financial Specialists','Tax Examiners, Collectors and Preparers, and Revenue Agents','Tax Examiners and Collectors, and Revenue Agents','Determine tax liability or collect taxes from individuals or business firms according to prescribed laws and regulations.','bls',NULL),(132,'2023-02-27 20:34:39.029602','13-2082','Tax Preparers','Business and Financial Operations Occupations','Financial Specialists','Tax Examiners, Collectors and Preparers, and Revenue Agents','Tax Preparers','Prepare tax returns for individuals or small businesses. Excludes “Accountants and Auditors” (13-2011).','bls',NULL),(133,'2023-02-27 20:34:39.073981','13-2090','Miscellaneous Financial Specialists','Business and Financial Operations Occupations','Financial Specialists','Miscellaneous Financial Specialists','Miscellaneous Financial Specialists','','bls',NULL),(134,'2023-02-27 20:34:39.118856','13-2099','Financial Specialists, All Other','Business and Financial Operations Occupations','Financial Specialists','Miscellaneous Financial Specialists','Financial Specialists, All Other','All financial specialists not listed separately.','bls',NULL),(135,'2023-02-27 20:34:39.166665','15-0000','Computer and Mathematical Occupations','Computer and Mathematical Occupations',NULL,NULL,'Computer and Mathematical Occupations','','bls',NULL),(136,'2023-02-27 20:34:39.213768','15-1200','Computer Occupations','Computer and Mathematical Occupations','Computer Occupations',NULL,'Computer Occupations','','bls',NULL),(137,'2023-02-27 20:34:39.261257','15-1210','Computer and Information Analysts','Computer and Mathematical Occupations','Computer Occupations','Computer and Information Analysts','Computer and Information Analysts','','bls',NULL),(138,'2023-02-27 20:34:39.309243','15-1211','Computer Systems Analysts','Computer and Mathematical Occupations','Computer Occupations','Computer and Information Analysts','Computer Systems Analysts','Analyze science, engineering, business, and other data processing problems to develop and implement solutions to complex applications problems, system administration issues, or network concerns. Perform systems management and integration functions, improve existing computer systems, and review computer system capabilities, workflow, and schedule limitations. May analyze or recommend commercially available software.','bls',NULL),(139,'2023-02-27 20:34:39.355749','15-1212','Information Security Analysts','Computer and Mathematical Occupations','Computer Occupations','Computer and Information Analysts','Information Security Analysts','Plan, implement, upgrade, or monitor security measures for the protection of computer networks and information. Assess system vulnerabilities for security risks and propose and implement risk mitigation strategies. May ensure appropriate security controls are in place that will safeguard digital files and vital electronic infrastructure. May respond to computer security breaches and viruses. Excludes “Computer Network Architects” (15-1241).','bls',NULL),(140,'2023-02-27 20:34:39.404180','15-1220','Computer and Information Research Scientists','Computer and Mathematical Occupations','Computer Occupations','Computer and Information Research Scientists','Computer and Information Research Scientists','','bls',NULL),(141,'2023-02-27 20:34:39.450406','15-1221','Computer and Information Research Scientists','Computer and Mathematical Occupations','Computer Occupations','Computer and Information Research Scientists','Computer and Information Research Scientists','Conduct research into fundamental computer and information science as theorists, designers, or inventors. Develop solutions to problems in the field of computer hardware and software.','bls',NULL),(142,'2023-02-27 20:34:39.494287','15-1230','Computer Support Specialists','Computer and Mathematical Occupations','Computer Occupations','Computer Support Specialists','Computer Support Specialists','','bls',NULL),(143,'2023-02-27 20:34:39.540653','15-1231','Computer Network Support Specialists','Computer and Mathematical Occupations','Computer Occupations','Computer Support Specialists','Computer Network Support Specialists','Analyze, test, troubleshoot, and evaluate existing network systems, such as local area networks (LAN), wide area networks (WAN), cloud networks, servers, and other data communications networks. Perform network maintenance to ensure networks operate correctly with minimal interruption. Excludes “Computer Network Architects” (15-1241) and “Network and Computer Systems Administrators” (15-1244).','bls',NULL),(144,'2023-02-27 20:34:39.590482','15-1232','Computer User Support Specialists','Computer and Mathematical Occupations','Computer Occupations','Computer Support Specialists','Computer User Support Specialists','Provide technical assistance to computer users. Answer questions or resolve computer problems for clients in person, via telephone, or electronically. May provide assistance concerning the use of computer hardware and software, including printing, installation, word processing, electronic mail, and operating systems. Excludes “Network and Computer Systems Administrators” (15-1244).','bls',NULL),(145,'2023-02-27 20:34:39.635398','15-1240','Database and Network Administrators and Architects','Computer and Mathematical Occupations','Computer Occupations','Database and Network Administrators and Architects','Database and Network Administrators and Architects','','bls',NULL),(146,'2023-02-27 20:34:39.682464','15-1241','Computer Network Architects','Computer and Mathematical Occupations','Computer Occupations','Database and Network Administrators and Architects','Computer Network Architects','Design and implement computer and information networks, such as local area networks (LAN), wide area networks (WAN), intranets, extranets, and other data communications networks. Perform network modeling, analysis, and planning, including analysis of capacity needs for network infrastructures. May also design network and computer security measures. May research and recommend network and data communications hardware and software. Excludes “Information Security Analysts” (15-1212), “Computer Network Support Specialists” (15-1231), and “Network and Computer Systems Administrators” (15-1244).','bls',NULL),(147,'2023-02-27 20:34:39.731847','15-1242','Database Administrators','Computer and Mathematical Occupations','Computer Occupations','Database and Network Administrators and Architects','Database Administrators','Administer, test, and implement computer databases, applying knowledge of database management systems. Coordinate changes to computer databases. Identify, investigate, and resolve database performance issues, database capacity, and database scalability. May plan, coordinate, and implement security measures to safeguard computer databases. Excludes “Information Security Analysts” (15-1212) and “Database Architects” (15-1243).','bls',NULL),(148,'2023-02-27 20:34:39.775331','15-1243','Database Architects','Computer and Mathematical Occupations','Computer Occupations','Database and Network Administrators and Architects','Database Architects','Design strategies for enterprise databases, data warehouse systems, and multidimensional networks. Set standards for database operations, programming, query processes, and security. Model, design, and construct large relational databases or data warehouses. Create and optimize data models for warehouse infrastructure and workflow. Integrate new systems with existing warehouse structure and refine system performance and functionality. Excludes “Database Administrators” (15-1242).','bls',NULL),(149,'2023-02-27 20:34:39.823718','15-1244','Network and Computer Systems Administrators','Computer and Mathematical Occupations','Computer Occupations','Database and Network Administrators and Architects','Network and Computer Systems Administrators','Install, configure, and maintain an organization’s local area network (LAN), wide area network (WAN), data communications network, operating systems, and physical and virtual servers. Perform system monitoring and verify the integrity and availability of hardware, network, and server resources and systems. Review system and application logs and verify completion of scheduled jobs, including system backups. Analyze network and server resource consumption and control user access. Install and upgrade software and maintain software licenses. May assist in network modeling, analysis, planning, and coordination between network and data communications hardware and software. Excludes “Information Security Analysts” (15-1212), “Computer Network Support Specialists” (15-1231), and “Computer User Support Specialists” (15-1232).','bls',NULL),(150,'2023-02-27 20:34:39.873534','15-1250','Software and Web Developers, Programmers, and Testers','Computer and Mathematical Occupations','Computer Occupations','Software and Web Developers, Programmers, and Testers','Software and Web Developers, Programmers, and Testers','','bls',NULL),(151,'2023-02-27 20:34:39.917641','15-1251','Computer Programmers','Computer and Mathematical Occupations','Computer Occupations','Software and Web Developers, Programmers, and Testers','Computer Programmers','Create, modify, and test the code and scripts that allow computer applications to run. Work from specifications drawn up by software and web developers or other individuals. May develop and write computer programs to store, locate, and retrieve specific documents, data, and information.','bls',NULL),(152,'2023-02-27 20:34:39.964550','15-1252','Software Developers','Computer and Mathematical Occupations','Computer Occupations','Software and Web Developers, Programmers, and Testers','Software Developers','Research, design, and develop computer and network software or specialized utility programs. Analyze user needs and develop software solutions, applying principles and techniques of computer science, engineering, and mathematical analysis. Update software or enhance existing software capabilities. May work with computer hardware engineers to integrate hardware and software systems, and develop specifications and performance requirements. May maintain databases within an application area, working individually or coordinating database development as part of a team.','bls',NULL),(153,'2023-02-27 20:34:40.013187','15-1253','Software Quality Assurance Analysts and Testers','Computer and Mathematical Occupations','Computer Occupations','Software and Web Developers, Programmers, and Testers','Software Quality Assurance Analysts and Testers','Develop and execute software tests to identify software problems and their causes. Test system modifications to prepare for implementation. Document software and application defects using a bug tracking system and report defects to software or web developers. Create and maintain databases of known defects. May participate in software design reviews to provide input on functional requirements, operational characteristics, product designs, and schedules.','bls',NULL),(154,'2023-02-27 20:34:40.055460','15-1254','Web Developers','Computer and Mathematical Occupations','Computer Occupations','Software and Web Developers, Programmers, and Testers','Web Developers','Develop and implement websites, web applications, application databases, and interactive web interfaces. Evaluate code to ensure that it is properly structured, meets industry standards, and is compatible with browsers and devices. Optimize website performance, scalability, and server-side code and processes. May develop website infrastructure and integrate websites with other computer applications. Excludes “Special Effects Artists and Animators” (27-1014).','bls',NULL),(155,'2023-02-27 20:34:40.110840','15-1255','Web and Digital Interface Designers','Computer and Mathematical Occupations','Computer Occupations','Software and Web Developers, Programmers, and Testers','Web and Digital Interface Designers','Design digital user interfaces or websites. Develop and test layouts, interfaces, functionality, and navigation menus to ensure compatibility and usability across browsers or devices. May use web framework applications as well as client-side code and processes. May evaluate web design following web and accessibility standards, and may analyze web use metrics and optimize websites for marketability and search engine ranking. May design and test interfaces that facilitate the human-computer interaction and maximize the usability of digital devices, websites, and software with a focus on aesthetics and design. May create graphics used in websites and manage website content and links. Excludes “Special Effects Artists and Animators” (27-1014) and “Graphic Designers” (27-1024).','bls',NULL),(156,'2023-02-27 20:34:40.158490','15-1290','Miscellaneous Computer Occupations','Computer and Mathematical Occupations','Computer Occupations','Miscellaneous Computer Occupations','Miscellaneous Computer Occupations','','bls',NULL),(157,'2023-02-27 20:34:40.199561','15-1299','Computer Occupations, All Other','Computer and Mathematical Occupations','Computer Occupations','Miscellaneous Computer Occupations','Computer Occupations, All Other','All computer occupations not listed separately. Excludes “Computer and Information Systems Managers” (11-3021), “Compu