 learning to extract and analyze information from large structured and unstructured datasets. Visualize, interpret, and report data findings. May create dynamic data reports. Excludes “Statisticians” (15-2041), “Cartographers and Photogrammetrists” (17-1021), and “Health Information Technologists and Medical Registrars” (29-9021).','bls',NULL),(169,'2023-02-27 20:34:40.713018','15-2090','Miscellaneous Mathematical Science Occupations','Computer and Mathematical Occupations','Mathematical Science Occupations','Miscellaneous Mathematical Science Occupations','Miscellaneous Mathematical Science Occupations','','bls',NULL),(170,'2023-02-27 20:34:40.759120','15-2099','Mathematical Science Occupations, All Other','Computer and Mathematical Occupations','Mathematical Science Occupations','Miscellaneous Mathematical Science Occupations','Mathematical Science Occupations, All Other','All mathematical scientists not listed separately.','bls',NULL),(171,'2023-02-27 20:34:40.805930','17-0000','Architecture and Engineering Occupations','Architecture and Engineering Occupations',NULL,NULL,'Architecture and Engineering Occupations','','bls',NULL),(172,'2023-02-27 20:34:40.849148','17-1000','Architects, Surveyors, and Cartographers','Architecture and Engineering Occupations','Architects, Surveyors, and Cartographers',NULL,'Architects, Surveyors, and Cartographers','','bls',NULL),(173,'2023-02-27 20:34:40.893021','17-1010','Architects, Except Naval','Architecture and Engineering Occupations','Architects, Surveyors, and Cartographers','Architects, Except Naval','Architects, Except Naval','','bls',NULL),(174,'2023-02-27 20:34:40.947253','17-1011','Architects, Except Landscape and Naval','Architecture and Engineering Occupations','Architects, Surveyors, and Cartographers','Architects, Except Naval','Architects, Except Landscape and Naval','Plan and design structures, such as private residences, office buildings, theaters, factories, and other structural property. Excludes “Landscape Ar