ruction, and other purposes.','bls',NULL),(179,'2023-02-27 20:34:41.181041','17-2000','Engineers','Architecture and Engineering Occupations','Engineers',NULL,'Engineers','','bls',NULL),(180,'2023-02-27 20:34:41.226472','17-2010','Aerospace Engineers','Architecture and Engineering Occupations','Engineers','Aerospace Engineers','Aerospace Engineers','','bls',NULL),(181,'2023-02-27 20:34:41.270025','17-2011','Aerospace Engineers','Architecture and Engineering Occupations','Engineers','Aerospace Engineers','Aerospace Engineers','Perform engineering duties in designing, constructing, and testing aircraft, missiles, and spacecraft. May conduct basic and applied research to evaluate adaptability of materials and equipment to aircraft design and manufacture. May recommend improvements in testing equipment and techniques.','bls',NULL),(182,'2023-02-27 20:34:41.321420','17-2020','Agricultural Engineers','Architecture and Engineering Occupations','Engineers','Agricultural Engineers','Agricultural Engineers','','bls',NULL),(183,'2023-02-27 20:34:41.367299','17-2021','Agricultural Engineers','Architecture and Engineering Occupations','Engineers','Agricultural Engineers','Agricultural Engineers','Apply knowledge of engineering technology and biological science to agricultural problems concerned with power and machinery, electrification, structures, soil and water conservation, and processing of agricultural products.','bls',NULL),(184,'2023-02-27 20:34:41.408159','17-2030','Bioengineers and Biomedical Engineers','Architecture and Engineering Occupations','Engineers','Bioengineers and Biomedical Engineers','Bioengineers and Biomedical Engineers','','bls',NULL),(185,'2023-02-27 20:34:41.452226','17-2031','Bioengineers and Biomedical Engineers','Architecture and Engineering Occupations','Engineers','Bioengineers and Biomedical Engineers','Bioengineers and Biomedical Engineers','Apply knowledge of engineering, biology, chemistry, computer science, and biomechanical principles to the 