 test computer or computer-related equipment for commercial, industrial, military, or scientific use. May supervise the manufacturing and installation of computer or computer-related equipment and components. Excludes “Software Developers” (15-1252) and “Web Developers” (15-1254).','bls',NULL),(192,'2023-02-27 20:34:41.794129','17-2070','Electrical and Electronics Engineers','Architecture and Engineering Occupations','Engineers','Electrical and Electronics Engineers','Electrical and Electronics Engineers','','bls',NULL),(193,'2023-02-27 20:34:41.839194','17-2071','Electrical Engineers','Architecture and Engineering Occupations','Engineers','Electrical and Electronics Engineers','Electrical Engineers','Research, design, develop, test, or supervise the manufacturing and installation of electrical equipment, components, or systems for commercial, industrial, military, or scientific use. Excludes “Computer Hardware Engineers” (17-2061).','bls',NULL),(194,'2023-02-27 20:34:41.881775','17-2072','Electronics Engineers, Except Computer','Architecture and Engineering Occupations','Engineers','Electrical and Electronics Engineers','Electronics Engineers, Except Computer','Research, design, develop, or test electronic components and systems for commercial, industrial, military, or scientific use employing knowledge of electronic theory and materials properties. Design electronic circuits and components for use in fields such as telecommunications, aerospace guidance and propulsion control, acoustics, or instruments and controls. Excludes “Computer Hardware Engineers” (17-2061).','bls',NULL),(195,'2023-02-27 20:34:41.936819','17-2080','Environmental Engineers','Architecture and Engineering Occupations','Engineers','Environmental Engineers','Environmental Engineers','','bls',NULL),(196,'2023-02-27 20:34:41.980369','17-2081','Environmental Engineers','Architecture and Engineering Occupations','Engineers','Environmental Engineers','Environmental Engineers','Research, design, plan,