s','Miscellaneous Engineers','','bls',NULL),(213,'2023-02-27 20:34:42.813161','17-2199','Engineers, All Other','Architecture and Engineering Occupations','Engineers','Miscellaneous Engineers','Engineers, All Other','All engineers not listed separately. Excludes “Sales Engineers” (41-9031), “Locomotive Engineers” (53-4011), and “Ship Engineers” (53-5031).','bls',NULL),(214,'2023-02-27 20:34:42.858552','17-3000','Drafters, Engineering Technicians, and Mapping Technicians','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians',NULL,'Drafters, Engineering Technicians, and Mapping Technicians','','bls',NULL),(215,'2023-02-27 20:34:42.905897','17-3010','Drafters','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Drafters','Drafters','','bls',NULL),(216,'2023-02-27 20:34:42.971190','17-3011','Architectural and Civil Drafters','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Drafters','Architectural and Civil Drafters','Prepare detailed drawings of architectural and structural features of buildings or drawings and topographical relief maps used in civil engineering projects, such as highways, bridges, and public works. Use knowledge of building materials, engineering practices, and mathematics to complete drawings.','bls',NULL),(217,'2023-02-27 20:34:43.016600','17-3012','Electrical and Electronics Drafters','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Drafters','Electrical and Electronics Drafters','Prepare wiring diagrams, circuit board assembly diagrams, and layout drawings used for the manufacture, installation, or repair of electrical equipment.','bls',NULL),(218,'2023-02-27 20:34:43.062239','17-3013','Mechanical Drafters','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Drafters','Mechanical Draft