nder the direction of engineering staff or scientists. May assist in the development of environmental remediation devices.','bls',NULL),(226,'2023-02-27 20:34:43.432342','17-3026','Industrial Engineering Technologists and Technicians','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Engineering Technologists and Technicians, Except Drafters','Industrial Engineering Technologists and Technicians','Apply engineering theory and principles to problems of industrial layout or manufacturing production, usually under the direction of engineering staff. May perform time and motion studies on worker operations in a variety of industries for purposes such as establishing standard production rates or improving efficiency.','bls',NULL),(227,'2023-02-27 20:34:43.480452','17-3027','Mechanical Engineering Technologists and Technicians','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Engineering Technologists and Technicians, Except Drafters','Mechanical Engineering Technologists and Technicians','Apply theory and principles of mechanical engineering to modify, develop, test, or adjust machinery and equipment under direction of engineering staff or physical scientists.','bls',NULL),(228,'2023-02-27 20:34:43.532183','17-3028','Calibration Technologists and Technicians','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Engineering Technologists and Technicians, Except Drafters','Calibration Technologists and Technicians','Execute or adapt procedures and techniques for calibrating measurement devices, by applying knowledge of measurement science, mathematics, physics, chemistry, and electronics, sometimes under the direction of engineering staff. Determine measurement standard suitability for calibrating measurement devices. May perform preventive maintenance on equipment. May perform corrective actions to address identified calibration problems. Excludes “Medical Equipment Preparers” (31-9093) and “Timing Device Assemblers and Adjusters” (51-2061).','bls',NULL),(229,'2023-02-27 20:34:43.577899','17-3029','Engineering Technologists and Technicians, Except Drafters, All Other','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Engineering Technologists and Technicians, Except Drafters','Engineering Technologists and Technicians, Except Drafters, All Other','All engineering technologists and technicians, except drafters, not listed separately.','bls',NULL),(230,'2023-02-27 20:34:43.622664','17-3030','Surveying and Mapping Technicians','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Surveying and Mapping Technicians','Surveying and Mapping Technicians','','bls',NULL),(231,'2023-02-27 20:34:43.673799','17-3031','Surveying and Mapping Technicians','Architecture and Engineering Occupations','Drafters, Engineering Technicians, and Mapping Technicians','Surveying and Mapping Technicians','Surveying and Mapping Technicians','Perform surveying and mapping duties, usually under the direction of an engineer, surveyor, cartographer, or photogrammetrist, to obtain data used for construction, mapmaking, boundary location, mining, or other purposes. May calculate mapmaking information and create maps from source data, such as surveying notes, aerial photography, satellite data, or other maps to show topographical features, political boundaries, and other features. May verify accuracy and completeness of maps. Excludes “Cartographers and Photogrammetrists” (17-1021), “Surveyors\" (17-1022), and “Geoscientists, Except Hydrologists and Geographers” (19-2042).','bls',NULL),(232,'2023-02-27 20:34:43.727755','19-0000','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Occupations',NULL,NULL,'Life, Physical, and Social Science Occupations','','bls',NULL),(233,'2023-02-27 20:34:43.771581','19-1000','Life Scientists','Life, Physical, and Social Science Occupations','Life Scientists',NULL,'Life Scientists','','bls',NULL),(234,'2023-02-27 20:34:43.814950','19-1010','Agricultural and Food Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Agricultural and Food Scientists','Agricultural and Food Scientists','','bls',NULL),(235,'2023-02-27 20:34:43.858656','19-1011','Animal Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Agricultural and Food Scientists','Animal Scientists','Conduct research in the genetics, nutrition, reproduction, growth, and development of domestic farm animals.','bls',NULL),(236,'2023-02-27 20:34:43.899739','19-1012','Food Scientists and Technologists','Life, Physical, and Social Science Occupations','Life Scientists','Agricultural and Food Scientists','Food Scientists and Technologists','Use chemistry, microbiology, engineering, and other sciences to study the principles underlying the processing and deterioration of foods; analyze food content to determine levels of vitamins, fat, sugar, and protein; discover new food sources; research ways to make processed foods safe, palatable, and healthful; and apply food science knowledge to determine best ways to process, package, preserve, store, and distribute food.','bls',NULL),(237,'2023-02-27 20:34:43.955477','19-1013','Soil and Plant Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Agricultural and Food Scientists','Soil and Plant Scientists','Conduct research in breeding, physiology, production, yield, and management of crops and agricultural plants or trees, shrubs, and nursery stock, their growth in soils, and control of pests; or study the chemical, physical, biological, and mineralogical composition of soils as they relate to plant or crop growth. May classify and map soils and investigate effects of alternative practices on soil and crop productivity.','bls',NULL),(238,'2023-02-27 20:34:44.001836','19-1020','Biological Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Biological Scientists','Biological Scientists','','bls',NULL),(239,'2023-02-27 20:34:44.043996','19-1021','Biochemists and Biophysicists','Life, Physical, and Social Science Occupations','Life Scientists','Biological Scientists','Biochemists and Biophysicists','Study the chemical composition or physical principles of living cells and organisms, their electrical and mechanical energy, and related phenomena. May conduct research to further understanding of the complex chemical combinations and reactions involved in metabolism, reproduction, growth, and heredity. May determine the effects of foods, drugs, serums, hormones, and other substances on tissues and vital processes of living organisms.','bls',NULL),(240,'2023-02-27 20:34:44.088255','19-1022','Microbiologists','Life, Physical, and Social Science Occupations','Life Scientists','Biological Scientists','Microbiologists','Investigate the growth, structure, development, and other characteristics of microscopic organisms, such as bacteria, algae, or fungi. Includes medical microbiologists who study the relationship between organisms and disease or the effects of antibiotics on microorganisms.','bls',NULL),(241,'2023-02-27 20:34:44.138292','19-1023','Zoologists and Wildlife Biologists','Life, Physical, and Social Science Occupations','Life Scientists','Biological Scientists','Zoologists and Wildlife Biologists','Study the origins, behavior, diseases, genetics, and life processes of animals and wildlife. May specialize in wildlife research and management. May collect and analyze biological data to determine the environmental effects of present and potential use of land and water habitats.','bls',NULL),(242,'2023-02-27 20:34:44.187410','19-1029','Biological Scientists, All Other','Life, Physical, and Social Science Occupations','Life Scientists','Biological Scientists','Biological Scientists, All Other','All biological scientists not listed separately.','bls',NULL),(243,'2023-02-27 20:34:44.231960','19-1030','Conservation Scientists and Foresters','Life, Physical, and Social Science Occupations','Life Scientists','Conservation Scientists and Foresters','Conservation Scientists and Foresters','','bls',NULL),(244,'2023-02-27 20:34:44.291116','19-1031','Conservation Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Conservation Scientists and Foresters','Conservation Scientists','Manage, improve, and protect natural resources to maximize their use without damaging the environment. May conduct soil surveys and develop plans to eliminate soil erosion or to protect rangelands. May instruct farmers, agricultural production managers, or ranchers in best ways to use crop rotation, contour plowing, or terracing to conserve soil and water; in the number and kind of livestock and forage plants best suited to particular ranges; and in range and farm improvements, such as fencing and reservoirs for stock watering. Excludes “Zoologists and Wildlife Biologists” (19-1023) and “Foresters” (19-1032).','bls',NULL),(245,'2023-02-27 20:34:44.339479','19-1032','Foresters','Life, Physical, and Social Science Occupations','Life Scientists','Conservation Scientists and Foresters','Foresters','Manage public and private forested lands for economic, recreational, and conservation purposes. May inventory the type, amount, and location of standing timber, appraise the timber’s worth, negotiate the purchase, and draw up contracts for procurement. May determine how to conserve wildlife habitats, creek beds, water quality, and soil stability, and how best to comply with environmental regulations. May devise plans for planting and growing new trees, monitor trees for healthy growth, and determine optimal harvesting schedules.','bls',NULL),(246,'2023-02-27 20:34:44.388223','19-1040','Medical Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Medical Scientists','Medical Scientists','','bls',NULL),(247,'2023-02-27 20:34:44.428434','19-1041','Epidemiologists','Life, Physical, and Social Science Occupations','Life Scientists','Medical Scientists','Epidemiologists','Investigate and describe the determinants and distribution of disease, disability, or health outcomes. May develop the means for prevention and control.','bls',NULL),(248,'2023-02-27 20:34:44.476410','19-1042','Medical Scientists, Except Epidemiologists','Life, Physical, and Social Science Occupations','Life Scientists','Medical Scientists','Medical Scientists, Except Epidemiologists','Conduct research dealing with the understanding of human diseases and the improvement of human health. Engage in clinical investigation, research and development, or other related activities. Includes physicians, dentists, pharmacologists, and medical pathologists who primarily conduct research. Practitioners who primarily provide medical or dental care or dispense drugs are included in “Healthcare Diagnosing or Treating Practitioners” (29-1000).','bls',NULL),(249,'2023-02-27 20:34:44.528171','19-1090','Miscellaneous Life Scientists','Life, Physical, and Social Science Occupations','Life Scientists','Miscellaneous Life Scientists','Miscellaneous Life Scientists','','bls',NULL),(250,'2023-02-27 20:34:44.570358','19-1099','Life Scientists, All Other','Life, Physical, and Social Science Occupations','Life Scientists','Miscellaneous Life Scientists','Life Scientists, All Other','All life scientists not listed separately.','bls',NULL),(251,'2023-02-27 20:34:44.618118','19-2000','Physical Scientists','Life, Physical, and Social Science Occupations','Physical Scientists',NULL,'Physical Scientists','','bls',NULL),(252,'2023-02-27 20:34:44.661305','19-2010','Astronomers and Physicists','Life, Physical, and Social Science Occupations','Physical Scientists','Astronomers and Physicists','Astronomers and Physicists','','bls',NULL),(253,'2023-02-27 20:34:44.702937','19-2011','Astronomers','Life, Physical, and Social Science Occupations','Physical Scientists','Astronomers and Physicists','Astronomers','Observe, research, and interpret astronomical phenomena to increase basic knowledge or apply such information to practical problems.','bls',NULL),(254,'2023-02-27 20:34:44.750375','19-2012','Physicists','Life, Physical, and Social Science Occupations','Physical Scientists','Astronomers and Physicists','Physicists','Conduct research into physical phenomena, develop theories on the basis of observation and experiments, and devise methods to apply physical laws and theories. Excludes “Biochemists and Biophysicists” (19-1021).','bls',NULL),(255,'2023-02-27 20:34:44.800140','19-2020','Atmospheric and Space Scientists','Life, Physical, and Social Science Occupations','Physical Scientists','Atmospheric and Space Scientists','Atmospheric and Space Scientists','','bls',NULL),(256,'2023-02-27 20:34:44.841542','19-2021','Atmospheric and Space Scientists','Life, Physical, and Social Science Occupations','Physical Scientists','Atmospheric and Space Scientists','Atmospheric and Space Scientists','Investigate atmospheric phenomena and interpret meteorological data, gathered by surface and air stations, satellites, and radar to prepare reports and forecasts for public and other uses. Includes weather analysts and forecasters whose functions require the detailed knowledge of meteorology.','bls',NULL),(257,'2023-02-27 20:34:44.886832','19-2030','Chemists and Materials Scientists','Life, Physical, and Social Science Occupations','Physical Scientists','Chemists and Materials Scientists','Chemists and Materials Scientists','','bls',NULL),(258,'2023-02-27 20:34:44.928760','19-2031','Chemists','Life, Physical, and Social Science Occupations','Physical Scientists','Chemists and Materials Scientists','Chemists','Conduct qualitative and quantitative chemical analyses or experiments in laboratories for quality or process control or to develop new products or knowledge. Excludes “Biochemists and Biophysicists” (19-1021) and “Geoscientists, Except Hydrologists and Geographers” (19-2042).','bls',NULL),(259,'2023-02-27 20:34:44.973148','19-2032','Materials Scientists','Life, Physical, and Social Science Occupations','Physical Scientists','Chemists and Materials Scientists','Materials Scientists','Research and study the structures and chemical properties of various natural and synthetic or composite materials, including metals, alloys, rubber, ceramics, semiconductors, polymers, and glass. Determine ways to strengthen or combine materials or develop new materials with new or specific properties for use in a variety of products and applications. Includes glass scientists, ceramic scientists, metallurgical scientists, and polymer scientists.','bls',NULL),(260,'2023-02-27 20:34:45.015331','19-2040','Environmental Scientists and Geoscientists','Life, Physical, and Social Science Occupations','Physical Scientists','Environmental Scientists and Geoscientists','Environmental Scientists and Geoscientists','','bls',NULL),(261,'2023-02-27 20:34:45.058637','19-2041','Environmental Scientists and Specialists, Including Health','Life, Physical, and Social Science Occupations','Physical Scientists','Environmental Scientists and Geoscientists','Environmental Scientists and Specialists, Including Health','Conduct research or perform investigation for the purpose of identifying, abating, or eliminating sources of pollutants or hazards that affect either the environment or public health. Using knowledge of various scientific disciplines, may collect, synthesize, study, report, and recommend action based on data derived from measurements or observations of air, food, soil, water, and other sources. Excludes “Zoologists and Wildlife Biologists” (19-1023), “Conservation Scientists” (19-1031), “Forest and Conservation Technicians” (19-4071), “Occupational Health and Safety Specialists” (19-5011), “Fish and Game Wardens” (33-3031), and “Forest and Conservation Workers” (45-4011).','bls',NULL),(262,'2023-02-27 20:34:45.105518','19-2042','Geoscientists, Except Hydrologists and Geographers','Life, Physical, and Social Science Occupations','Physical Scientists','Environmental Scientists and Geoscientists','Geoscientists, Except Hydrologists and Geographers','Study the composition, structure, and other physical aspects of the Earth. May use geological, physics, and mathematics knowledge in exploration for oil, gas, minerals, or underground water; or in waste disposal, land reclamation, or other environmental problems. May study the Earth’s internal composition, atmospheres, and oceans, and its magnetic, electrical, and gravitational forces. Includes mineralogists, paleontologists, stratigraphers, geodesists, and seismologists.','bls',NULL),(263,'2023-02-27 20:34:45.150930','19-2043','Hydrologists','Life, Physical, and Social Science Occupations','Physical Scientists','Environmental Scientists and Geoscientists','Hydrologists','Research the distribution, circulation, and physical properties of underground and surface waters; and study the form and intensity of precipitation and its rate of infiltration into the soil, movement through the earth, and return to the ocean and atmosphere.','bls',NULL),(264,'2023-02-27 20:34:45.197915','19-2090','Miscellaneous Physical Scientists','Life, Physical, and Social Science Occupations','Physical Scientists','Miscellaneous Physical Scientists','Miscellaneous Physical Scientists','','bls',NULL),(265,'2023-02-27 20:34:45.244501','19-2099','Physical Scientists, All Other','Life, Physical, and Social Science Occupations','Physical Scientists','Miscellaneous Physical Scientists','Physical Scientists, All Other','All physical scientists not listed separately.','bls',NULL),(266,'2023-02-27 20:34:45.286373','19-3000','Social Scientists and Related Workers','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers',NULL,'Social Scientists and Related Workers','','bls',NULL),(267,'2023-02-27 20:34:45.334228','19-3010','Economists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Economists','Economists','','bls',NULL),(268,'2023-02-27 20:34:45.375909','19-3011','Economists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Economists','Economists','Conduct research, prepare reports, or formulate plans to address economic problems related to the production and distribution of goods and services or monetary and fiscal policy. May collect and process economic and statistical data using sampling techniques and econometric methods. Excludes “Market Research Analysts and Marketing Specialists” (13-1161).','bls',NULL),(269,'2023-02-27 20:34:45.424132','19-3020','Survey Researchers','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Survey Researchers','Survey Researchers','','bls',NULL),(270,'2023-02-27 20:34:45.470742','19-3022','Survey Researchers','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Survey Researchers','Survey Researchers','Plan, develop, or conduct surveys. May analyze and interpret the meaning of survey data, determine survey objectives, or suggest or test question wording. Includes social scientists who primarily design questionnaires or supervise survey teams. Excludes “Market Research Analysts and Marketing Specialists” (13-1161) and “Statisticians” (15-2041).','bls',NULL),(271,'2023-02-27 20:34:45.533206','19-3030','Psychologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Psychologists','Psychologists','','bls',NULL),(272,'2023-02-27 20:34:45.573974','19-3032','Industrial-Organizational Psychologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Psychologists','Industrial-Organizational Psychologists','Apply principles of psychology to human resources, administration, management, sales, and marketing problems. Activities may include policy planning; employee testing and selection, training, and development; and organizational development and analysis. May work with management to organize the work setting to improve worker productivity.','bls',NULL),(273,'2023-02-27 20:34:45.621912','19-3033','Clinical and Counseling Psychologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Psychologists','Clinical and Counseling Psychologists','Assess, diagnose, and treat mental and emotional disorders of individuals through observation, interview, and psychological tests. Help individuals with distress or maladjustment understand their problems through their knowledge of case history, interviews with patients, and theory. Provide individual or group counseling services to assist individuals in achieving more effective personal, social, educational, and vocational development and adjustment. May design behavior modification programs and consult with medical personnel regarding the best treatment for patients. Excludes “Psychiatrists” (29-1223).','bls',NULL),(274,'2023-02-27 20:34:45.667337','19-3034','School Psychologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Psychologists','School Psychologists','Diagnose and implement individual or schoolwide interventions or strategies to address educational, behavioral, or developmental issues that adversely impact educational functioning in a school. May address student learning and behavioral problems and counsel students or families. May design and implement performance plans, and evaluate performance. May consult with other school-based personnel.','bls',NULL),(275,'2023-02-27 20:34:45.711282','19-3039','Psychologists, All Other','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Psychologists','Psychologists, All Other','All psychologists not listed separately.','bls',NULL),(276,'2023-02-27 20:34:45.754099','19-3040','Sociologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Sociologists','Sociologists','','bls',NULL),(277,'2023-02-27 20:34:45.799406','19-3041','Sociologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Sociologists','Sociologists','Study human society and social behavior by examining the groups and social institutions that people form, as well as various social, religious, political, and business organizations. May study the behavior and interaction of groups, trace their origin and growth, and analyze the influence of group activities on individual members.','bls',NULL),(278,'2023-02-27 20:34:45.842293','19-3050','Urban and Regional Planners','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Urban and Regional Planners','Urban and Regional Planners','','bls',NULL),(279,'2023-02-27 20:34:45.887753','19-3051','Urban and Regional Planners','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Urban and Regional Planners','Urban and Regional Planners','Develop comprehensive plans and programs for use of land and physical facilities of jurisdictions, such as towns, cities, counties, and metropolitan areas.','bls',NULL),(280,'2023-02-27 20:34:45.932031','19-3090','Miscellaneous Social Scientists and Related Workers','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','','bls',NULL),(281,'2023-02-27 20:34:45.976020','19-3091','Anthropologists and Archeologists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','Anthropologists and Archeologists','Study the origin, development, and behavior of human beings. May study the way of life, language, or physical characteristics of people in various parts of the world. May engage in systematic recovery and examination of material evidence, such as tools or pottery remaining from past human cultures, in order to determine the history, customs, and living habits of earlier civilizations.','bls',NULL),(282,'2023-02-27 20:34:46.020220','19-3092','Geographers','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','Geographers','Study the nature and use of areas of the Earth’s surface, relating and interpreting interactions of physical and cultural phenomena. Conduct research on physical aspects of a region, including land forms, climates, soils, plants, and animals, and conduct research on the spatial implications of human activities within a given area, including social characteristics, economic activities, and political organization, as well as researching interdependence between regions at scales ranging from local to global.','bls',NULL),(283,'2023-02-27 20:34:46.062948','19-3093','Historians','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','Historians','Research, analyze, record, and interpret the past as recorded in sources, such as government and institutional records, newspapers and other periodicals, photographs, interviews, films, electronic media, and unpublished manuscripts, such as personal diaries and letters.','bls',NULL),(284,'2023-02-27 20:34:46.104203','19-3094','Political Scientists','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','Political Scientists','Study the origin, development, and operation of political systems. May study topics, such as public opinion, political decisionmaking, and ideology. May analyze the structure and operation of governments, as well as various political entities. May conduct public opinion surveys, analyze election results, or analyze public documents. Excludes “Survey Researchers” (19-3022).','bls',NULL),(285,'2023-02-27 20:34:46.145347','19-3099','Social Scientists and Related Workers, All Other','Life, Physical, and Social Science Occupations','Social Scientists and Related Workers','Miscellaneous Social Scientists and Related Workers','Social Scientists and Related Workers, All Other','All social scientists and related workers not listed separately.','bls',NULL),(286,'2023-02-27 20:34:46.186304','19-4000','Life, Physical, and Social Science Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians',NULL,'Life, Physical, and Social Science Technicians','','bls',NULL),(287,'2023-02-27 20:34:46.222455','19-4010','Agricultural and Food Science Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Agricultural and Food Science Technicians','Agricultural and Food Science Technicians','','bls',NULL),(288,'2023-02-27 20:34:46.262932','19-4012','Agricultural Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Agricultural and Food Science Technicians','Agricultural Technicians','Work with agricultural scientists in plant, fiber, and animal research, or assist with animal breeding and nutrition. Set up or maintain laboratory equipment and collect samples from crops or animals. Prepare specimens or record data to assist scientists in biology or related life science experiments. Conduct tests and experiments to improve yield and quality of crops or to increase the resistance of plants and animals to disease or insects.','bls',NULL),(289,'2023-02-27 20:34:46.307589','19-4013','Food Science Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Agricultural and Food Science Technicians','Food Science Technicians','Work with food scientists or technologists to perform standardized qualitative and quantitative tests to determine physical or chemical properties of food or beverage products. Includes technicians who assist in research and development of production technology, quality control, packaging, processing, and use of foods.','bls',NULL),(290,'2023-02-27 20:34:46.348369','19-4020','Biological Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Biological Technicians','Biological Technicians','','bls',NULL),(291,'2023-02-27 20:34:46.387890','19-4021','Biological Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Biological Technicians','Biological Technicians','Assist biological and medical scientists. Set up, operate, and maintain laboratory instruments and equipment, monitor experiments, collect data and samples, make observations, and calculate and record results. May analyze organic substances, such as blood, food, and drugs.','bls',NULL),(292,'2023-02-27 20:34:46.428336','19-4030','Chemical Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Chemical Technicians','Chemical Technicians','','bls',NULL),(293,'2023-02-27 20:34:46.468990','19-4031','Chemical Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Chemical Technicians','Chemical Technicians','Conduct chemical and physical laboratory tests to assist scientists in making qualitative and quantitative analyses of solids, liquids, and gaseous materials for research and development of new products or processes, quality control, maintenance of environmental standards, and other work involving experimental, theoretical, or practical application of chemistry and related sciences.','bls',NULL),(294,'2023-02-27 20:34:46.510855','19-4040','Environmental Science and Geoscience Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Environmental Science and Geoscience Technicians','Environmental Science and Geoscience Technicians','','bls',NULL),(295,'2023-02-27 20:34:46.553215','19-4042','Environmental Science and Protection Technicians, Including Health','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Environmental Science and Geoscience Technicians','Environmental Science and Protection Technicians, Including Health','Perform laboratory and field tests to monitor the environment and investigate sources of pollution, including those that affect health, under the direction of an environmental scientist, engineer, or other specialist. May collect samples of gases, soil, water, and other materials for testing.','bls',NULL),(296,'2023-02-27 20:34:46.595596','19-4043','Geological Technicians, Except Hydrologic Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Environmental Science and Geoscience Technicians','Geological Technicians, Except Hydrologic Technicians','Assist scientists or engineers in the use of electronic, sonic, or nuclear measuring instruments in laboratory, exploration, and production activities to obtain data indicating resources such as metallic ore, minerals, gas, coal, or petroleum. Analyze mud and drill cuttings. Chart pressure, temperature, and other characteristics of wells or bore holes.','bls',NULL),(297,'2023-02-27 20:34:46.649104','19-4044','Hydrologic Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Environmental Science and Geoscience Technicians','Hydrologic Technicians','Collect and organize data concerning the distribution and circulation of ground and surface water, and data on its physical, chemical, and biological properties. Measure and report on flow rates and ground water levels, maintain field equipment, collect water samples, install and collect sampling equipment, and process samples for shipment to testing laboratories. May collect data on behalf of hydrologists, engineers, developers, government agencies, or agriculture. Excludes “Hydrologists” (19-2043).','bls',NULL),(298,'2023-02-27 20:34:46.694248','19-4050','Nuclear Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Nuclear Technicians','Nuclear Technicians','','bls',NULL),(299,'2023-02-27 20:34:46.732189','19-4051','Nuclear Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Nuclear Technicians','Nuclear Technicians','Assist nuclear physicists, nuclear engineers, or other scientists in laboratory, power generation, or electricity production activities. May operate, maintain, or provide quality control for nuclear testing and research equipment. May monitor radiation.','bls',NULL),(300,'2023-02-27 20:34:46.774152','19-4060','Social Science Research Assistants','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Social Science Research Assistants','Social Science Research Assistants','','bls',NULL),(301,'2023-02-27 20:34:46.815260','19-4061','Social Science Research Assistants','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Social Science Research Assistants','Social Science Research Assistants','Assist social scientists in laboratory, survey, and other social science research. May help prepare findings for publication and assist in laboratory analysis, quality control, or data management. Excludes “Teaching Assistants, Postsecondary” (25-9044).','bls',NULL),(302,'2023-02-27 20:34:46.856424','19-4070','Forest and Conservation Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Forest and Conservation Technicians','Forest and Conservation Technicians','','bls',NULL),(303,'2023-02-27 20:34:46.899323','19-4071','Forest and Conservation Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Forest and Conservation Technicians','Forest and Conservation Technicians','Provide technical assistance regarding the conservation of soil, water, forests, or related natural resources. May compile data pertaining to size, content, condition, and other characteristics of forest tracts under the direction of foresters, or train and lead forest workers in forest propagation and fire prevention and suppression. May assist conservation scientists in managing, improving, and protecting rangelands and wildlife habitats. Excludes “Conservation Scientists” (19-1031) and “Foresters” (19-1032).','bls',NULL),(304,'2023-02-27 20:34:46.941125','19-4090','Miscellaneous Life, Physical, and Social Science Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Miscellaneous Life, Physical, and Social Science Technicians','Miscellaneous Life, Physical, and Social Science Technicians','','bls',NULL),(305,'2023-02-27 20:34:46.980232','19-4092','Forensic Science Technicians','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Miscellaneous Life, Physical, and Social Science Technicians','Forensic Science Technicians','Collect, identify, classify, and analyze physical evidence related to criminal investigations. Perform tests on weapons or substances, such as fiber, hair, and tissue to determine significance to investigation. May testify as expert witnesses on evidence or crime laboratory techniques. May serve as specialists in area of expertise, such as ballistics, fingerprinting, handwriting, or biochemistry.','bls',NULL),(306,'2023-02-27 20:34:47.021612','19-4099','Life, Physical, and Social Science Technicians, All Other','Life, Physical, and Social Science Occupations','Life, Physical, and Social Science Technicians','Miscellaneous Life, Physical, and Social Science Technicians','Life, Physical, and Social Science Technicians, All Other','All life, physical, and social science technicians not listed separately.','bls',NULL),(307,'2023-02-27 20:34:47.064628','19-5000','Occupational Health and Safety Specialists and Technicians','Life, Physical, and Social Science Occupations','Occupational Health and Safety Specialists and Technicians',NULL,'Occupational Health and Safety Specialists and Technicians','','bls',NULL),(308,'2023-02-27 20:34:47.099535','19-5010','Occupational Health and Safety Specialists and Technicians','Life, Physical, and Social Science Occupations','Occupational Health and Safety Specialists and Technicians','Occupational Health and Safety Specialists and Technicians','Occupational Health and Safety Specialists and Technicians','','bls',NULL),(309,'2023-02-27 20:34:47.137721','19-5011','Occupational Health and Safety Specialists','Life, Physical, and Social Science Occupations','Occupational Health and Safety Specialists and Technicians','Occupational Health and Safety Specialists and Technicians','Occupational Health and Safety Specialists','Review, evaluate, and analyze work environments and design programs and procedures to control, eliminate, and prevent disease or injury caused by chemical, physical, and biological agents or ergonomic factors. May conduct inspections and enforce adherence to laws and regulations governing the health and safety of individuals. May be employed in the public or private sector.','bls',NULL),(310,'2023-02-27 20:34:47.179934','19-5012','Occupational Health and Safety Technicians','Life, Physical, and Social Science Occupations','Occupational Health and Safety Specialists and Technicians','Occupational Health and Safety Specialists and Technicians','Occupational Health and Safety Technicians','Collect data on work environments for analysis by occupational health and safety specialists. Implement and conduct evaluation of programs designed to limit chemical, physical, biological, and ergonomic risks to workers.','bls',NULL),(311,'2023-02-27 20:34:47.219906','21-0000','Community and Social Service Occupations','Community and Social Service Occupations',NULL,NULL,'Community and Social Service Occupations','','bls',NULL),(312,'2023-02-27 20:34:47.259693','21-1000','Counselors, Social Workers, and Other Community and Social Service Specialists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists',NULL,'Counselors, Social Workers, and Other Community and Social Service Specialists','','bls',NULL),(313,'2023-02-27 20:34:47.300762','21-1010','Counselors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Counselors','','bls',NULL),(314,'2023-02-27 20:34:47.335467','21-1011','Substance Abuse and Behavioral Disorder Counselors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Substance Abuse and Behavioral Disorder Counselors','Counsel and advise individuals with alcohol, tobacco, drug, or other problems, such as gambling and eating disorders. May counsel individuals, families, or groups or engage in prevention programs. Excludes “Psychologists” (19-3032 through 19-3039), “Mental Health Counselors” (21-1014), and “Social Workers” (21-1021 through 21-1029) providing these services.','bls',NULL),(315,'2023-02-27 20:34:47.377585','21-1012','Educational, Guidance, and Career Counselors and Advisors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Educational, Guidance, and Career Counselors and Advisors','Advise and assist students and provide educational and vocational guidance services.','bls',NULL),(316,'2023-02-27 20:34:47.417734','21-1013','Marriage and Family Therapists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Marriage and Family Therapists','Diagnose and treat mental and emotional disorders, whether cognitive, affective, or behavioral, within the context of marriage and family systems. Apply psychotherapeutic and family systems theories and techniques in the delivery of services to individuals, couples, and families for the purpose of treating such diagnosed nervous and mental disorders. Excludes “Psychologists” (19-3032 through 19-3039) and “Social Workers” (21-1020).','bls',NULL),(317,'2023-02-27 20:34:47.458891','21-1014','Mental Health Counselors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Mental Health Counselors','Counsel and advise individuals and groups to promote optimum mental and emotional health, with an emphasis on prevention. May help individuals deal with a broad range of mental health issues, such as those associated with addictions and substance abuse; family, parenting, and marital problems; stress management; self-esteem; or aging. Excludes “Psychologists” (19-3030), “Social Workers” (21-1020), and “Psychiatrists” (29-1223).','bls',NULL),(318,'2023-02-27 20:34:47.502619','21-1015','Rehabilitation Counselors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Rehabilitation Counselors','Counsel individuals to maximize the independence and employability of persons coping with personal, social, and vocational difficulties that result from birth defects, illness, disease, accidents, aging, or the stress of daily life. Coordinate activities for residents of care and treatment facilities. Assess client needs and design and implement rehabilitation programs that may include personal and vocational counseling, training, and job placement. Excludes “Occupational Therapists” (29-1122).','bls',NULL),(319,'2023-02-27 20:34:47.551221','21-1019','Counselors, All Other','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Counselors, All Other','All counselors not listed separately.','bls',NULL),(320,'2023-02-27 20:34:47.600469','21-1020','Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Social Workers','','bls',NULL),(321,'2023-02-27 20:34:47.645291','21-1021','Child, Family, and School Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Child, Family, and School Social Workers','Provide social services and assistance to improve the social and psychological functioning of children and their families and to maximize the family well-being and the academic functioning of children. May assist parents, arrange adoptions, and find foster homes for abandoned or abused children. In schools, they address such problems as teenage pregnancy, misbehavior, and truancy. May also advise teachers.','bls',NULL),(322,'2023-02-27 20:34:47.690917','21-1022','Healthcare Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Healthcare Social Workers','Provide individuals, families, and groups with the psychosocial support needed to cope with chronic, acute, or terminal illnesses. Services include advising family caregivers. Provide patients with information and counseling, and make referrals for other services. May also provide case and care management or interventions designed to promote health, prevent disease, and address barriers to access to healthcare.','bls',NULL),(323,'2023-02-27 20:34:47.748189','21-1023','Mental Health and Substance Abuse Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Mental Health and Substance Abuse Social Workers','Assess and treat individuals with mental, emotional, or substance abuse problems, including abuse of alcohol, tobacco, and/or other drugs. Activities may include individual and group therapy, crisis intervention, case management, client advocacy, prevention, and education.','bls',NULL),(324,'2023-02-27 20:34:47.797221','21-1029','Social Workers, All Other','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Social Workers, All Other','All social workers not listed separately.','bls',NULL),(325,'2023-02-27 20:34:47.849544','21-1090','Miscellaneous Community and Social Service Specialists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','','bls',NULL),(326,'2023-02-27 20:34:47.897048','21-1091','Health Education Specialists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Health Education Specialists','Provide and manage health education programs that help individuals, families, and their communities maximize and maintain healthy lifestyles. Use data to identify community needs prior to planning, implementing, monitoring, and evaluating programs designed to encourage healthy lifestyles, policies, and environments. May link health systems, health providers, insurers, and patients to address individual and population health needs. May serve as resource to assist individuals, other health professionals, or the community, and may administer fiscal resources for health education programs. Excludes “Community Health Workers” (21-1094).','bls',NULL),(327,'2023-02-27 20:34:47.951613','21-1092','Probation Officers and Correctional Treatment Specialists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Probation Officers and Correctional Treatment Specialists','Provide social services to assist in rehabilitation of law offenders in custody or on probation or parole. Make recommendations for actions involving formulation of rehabilitation plan and treatment of offender, including conditional release and education and employment stipulations.','bls',NULL),(328,'2023-02-27 20:34:47.999312','21-1093','Social and Human Service Assistants','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Social and Human Service Assistants','Assist other social and human service providers in providing client services in a wide variety of fields, such as psychology, rehabilitation, or social work, including support for families. May assist clients in identifying and obtaining available benefits and social and community services. May assist social workers with developing, organizing, and conducting programs to prevent and resolve problems relevant to substance abuse, human relationships, rehabilitation, or dependent care. Excludes “Rehabilitation Counselors” (21-1015), “Psychiatric Technicians” (29-2053), “Personal Care Aides” (31-1122), and “Eligibility Interviewers, Government Programs” (43-4061).','bls',NULL),(329,'2023-02-27 20:34:48.047290','21-1094','Community Health Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Community Health Workers','Promote health within a community by assisting individuals to adopt healthy behaviors. Serve as an advocate for the health needs of individuals by assisting community residents in effectively communicating with healthcare providers or social service agencies. Act as liaison or advocate and implement programs that promote, maintain, and improve individual and overall community health. May deliver health-related preventive services such as blood pressure, glaucoma, and hearing screenings. May collect data to help identify community health needs. Excludes “Health Education Specialists” (21-1091).','bls',NULL),(330,'2023-02-27 20:34:48.098827','21-1099','Community and Social Service Specialists, All Other','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Community and Social Service Specialists, All Other','All community and social service specialists not listed separately.','bls',NULL),(331,'2023-02-27 20:34:48.152727','21-2000','Religious Workers','Community and Social Service Occupations','Religious Workers',NULL,'Religious Workers','','bls',NULL),(332,'2023-02-27 20:34:48.194407','21-2010','Clergy','Community and Social Service Occupations','Religious Workers','Clergy','Clergy','','bls',NULL),(333,'2023-02-27 20:34:48.240082','21-2011','Clergy','Community and Social Service Occupations','Religious Workers','Clergy','Clergy','Conduct religious worship and perform other spiritual functions associated with beliefs and practices of religious faith or denomination. Provide spiritual and moral guidance and assistance to members.','bls',NULL),(334,'2023-02-27 20:34:48.286200','21-2020','Directors, Religious Activities and Education','Community and Social Service Occupations','Religious Workers','Directors, Religious Activities and Education','Directors, Religious Activities and Education','','bls',NULL),(335,'2023-02-27 20:34:48.329271','21-2021','Directors, Religious Activities and Education','Community and Social Service Occupations','Religious Workers','Directors, Religious Activities and Education','Directors, Religious Activities and Education','Coordinate or design programs and conduct outreach to promote the religious education or activities of a denominational group. May provide counseling, guidance, and leadership relative to marital, health, financial, and religious problems.','bls',NULL),(336,'2023-02-27 20:34:48.372785','21-2090','Miscellaneous Religious Workers','Community and Social Service Occupations','Religious Workers','Miscellaneous Religious Workers','Miscellaneous Religious Workers','','bls',NULL),(337,'2023-02-27 20:34:48.419398','21-2099','Religious Workers, All Other','Community and Social Service Occupations','Religious Workers','Miscellaneous Religious Workers','Religious Workers, All Other','All religious workers not listed separately.','bls',NULL),(338,'2023-02-27 20:34:48.465573','23-0000','Legal Occupations','Legal Occupations',NULL,NULL,'Legal Occupations','','bls',NULL),(339,'2023-02-27 20:34:48.513656','23-1000','Lawyers, Judges, and Related Workers','Legal Occupations','Lawyers, Judges, and Related Workers',NULL,'Lawyers, Judges, and Related Workers','','bls',NULL),(340,'2023-02-27 20:34:48.556334','23-1010','Lawyers and Judicial Law Clerks','Legal Occupations','Lawyers, Judges, and Related Workers','Lawyers and Judicial Law Clerks','Lawyers and Judicial Law Clerks','','bls',NULL),(341,'2023-02-27 20:34:48.598040','23-1011','Lawyers','Legal Occupations','Lawyers, Judges, and Related Workers','Lawyers and Judicial Law Clerks','Lawyers','Represent clients in criminal and civil litigation and other legal proceedings, draw up legal documents, or manage or advise clients on legal transactions. May specialize in a single area or may practice broadly in many areas of law.','bls',NULL),(342,'2023-02-27 20:34:48.643264','23-1012','Judicial Law Clerks','Legal Occupations','Lawyers, Judges, and Related Workers','Lawyers and Judicial Law Clerks','Judicial Law Clerks','Assist judges in court or by conducting research or preparing legal documents. Excludes “Lawyers” (23-1011) and “Paralegals and Legal Assistants” (23-2011).','bls',NULL),(343,'2023-02-27 20:34:48.691108','23-1020','Judges, Magistrates, and Other Judicial Workers','Legal Occupations','Lawyers, Judges, and Related Workers','Judges, Magistrates, and Other Judicial Workers','Judges, Magistrates, and Other Judicial Workers','','bls',NULL),(344,'2023-02-27 20:34:48.740404','23-1021','Administrative Law Judges, Adjudicators, and Hearing Officers','Legal Occupations','Lawyers, Judges, and Related Workers','Judges, Magistrates, and Other Judicial Workers','Administrative Law Judges, Adjudicators, and Hearing Officers','Conduct hearings to recommend or make decisions on claims concerning government programs or other government-related matters. Determine liability, sanctions, or penalties, or recommend the acceptance or rejection of claims or settlements. Excludes “Arbitrators, Mediators, and Conciliators” (23-1022).','bls',NULL),(345,'2023-02-27 20:34:48.790517','23-1022','Arbitrators, Mediators, and Conciliators','Legal Occupations','Lawyers, Judges, and Related Workers','Judges, Magistrates, and Other Judicial Workers','Arbitrators, Mediators, and Conciliators','Facilitate negotiation and conflict resolution through dialogue. Resolve conflicts outside of the court system by mutual consent of parties involved.','bls',NULL),(346,'2023-02-27 20:34:48.837141','23-1023','Judges, Magistrate Judges, and Magistrates','Legal Occupations','Lawyers, Judges, and Related Workers','Judges, Magistrates, and Other Judicial Workers','Judges, Magistrate Judges, and Magistrates','Arbitrate, advise, adjudicate, or administer justice in a court of law. May sentence defendant in criminal cases according to government statutes or sentencing guidelines. May determine liability of defendant in civil cases. May perform wedding ceremonies.','bls',NULL),(347,'2023-02-27 20:34:48.883673','23-2000','Legal Support Workers','Legal Occupations','Legal Support Workers',NULL,'Legal Support Workers','','bls',NULL),(348,'2023-02-27 20:34:48.938319','23-2010','Paralegals and Legal Assistants','Legal Occupations','Legal Support Workers','Paralegals and Legal Assistants','Paralegals and Legal Assistants','','bls',NULL),(349,'2023-02-27 20:34:48.984066','23-2011','Paralegals and Legal Assistants','Legal Occupations','Legal Support Workers','Paralegals and Legal Assistants','Paralegals and Legal Assistants','Assist lawyers by investigating facts, preparing legal documents, or researching legal precedent. Conduct research to support a legal proceeding, to formulate a defense, or to initiate legal action. Excludes “Legal Secretaries and Administrative Assistants” (43-6012).','bls',NULL),(350,'2023-02-27 20:34:49.029095','23-2090','Miscellaneous Legal Support Workers','Legal Occupations','Legal Support Workers','Miscellaneous Legal Support Workers','Miscellaneous Legal Support Workers','','bls',NULL),(351,'2023-02-27 20:34:49.075088','23-2093','Title Examiners, Abstractors, and Searchers','Legal Occupations','Legal Support Workers','Miscellaneous Legal Support Workers','Title Examiners, Abstractors, and Searchers','Search real estate records, examine titles, or summarize pertinent legal or insurance documents or details for a variety of purposes. May compile lists of mortgages, contracts, and other instruments pertaining to titles by searching public and private records for law firms, real estate agencies, or title insurance companies. Excludes “Loan Officers” (13-2072).','bls',NULL),(352,'2023-02-27 20:34:49.125655','23-2099','Legal Support Workers, All Other','Legal Occupations','Legal Support Workers','Miscellaneous Legal Support Workers','Legal Support Workers, All Other','All legal support workers not listed separately.','bls',NULL),(353,'2023-02-27 20:34:49.169099','25-0000','Educational Instruction and Library Occupations','Educational Instruction and Library Occupations',NULL,NULL,'Educational Instruction and Library Occupations','','bls',NULL),(354,'2023-02-27 20:34:49.210334','25-1000','Postsecondary Teachers','Educational Instruction and Library Occupations','Postsecondary Teachers',NULL,'Postsecondary Teachers','','bls',NULL),(355,'2023-02-27 20:34:49.255987','25-1010','Business Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Business Teachers, Postsecondary','Business Teachers, Postsecondary','','bls',NULL),(356,'2023-02-27 20:34:49.297498','25-1011','Business Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Business Teachers, Postsecondary','Business Teachers, Postsecondary','Teach courses in business administration and management, such as accounting, finance, human resources, labor and industrial relations, marketing, and operations research. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.','bls',NULL),(357,'2023-02-27 20:34:49.340867','25-1020','Math and Computer Science Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Math and Computer Science Teachers, Postsecondary','Math and Computer Science Teachers, Postsecondary','','bls',NULL),(358,'2023-02-27 20:34:49.389746','25-1021','Computer Science Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Math and Computer Science Teachers, Postsecondary','Computer Science Teachers, Postsecondary','Teach courses in computer science. May specialize in a field of computer science, such as the design and function of computers or operations and research analysis. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.','bls',NULL),(359,'2023-02-27 20:34:49.437591','25-1022','Mathematical Science Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Math and Computer Science Teachers, Postsecondary','Mathematical Science Teachers, Postsecondary','Teach courses pertaining to mathematical concepts, statistics, and actuarial science and to the application of original and standardized mathematical techniques in solving specific problems and situations. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.','bls',NULL),(360,'2023-02-27 20:34:49.483908','25-1030','Engineering and Architecture Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Engineering and Architecture Teachers, Postsecondary','Engineering and Architecture Teachers, Postsecondary','','bls',NULL),(361,'2023-02-27 20:34:49.527467','25-1031','Architecture Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Engineering and Architecture Teachers, Postsecondary','Architecture Teachers, Postsecondary','Teach courses in architecture and architectural design, such as architectural environmental design, interior architecture/design, and landscape architecture. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.','bls',NULL),(362,'2023-02-27 20:34:49.568338','25-1032','Engineering Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Engineering and Architecture Teachers, Postsecondary','Engineering Teachers, Postsecondary','Teach courses pertaining to the application of physical laws and principles of engineering for the development of machines, materials, instruments, processes, and services. Includes teachers of subjects such as chemical, civil, electrical, industrial, mechanical, mineral, and petroleum engineering. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research. Excludes “Computer Science Teachers, Postsecondary” (25-1021).','bls',NULL),(363,'2023-02-27 20:34:49.610637','25-1040','Life Sciences Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Life Sciences Teachers, Postsecondary','Life Sciences Teachers, Postsecondary','','bls',NULL),(364,'2023-02-27 20:34:49.651231','25-1041','Agricultural Sciences Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Life Sciences Teachers, Postsecondary','Agricultural Sciences Teachers, Postsecondary','Teach courses in the agricultural sciences. Includes teachers of agronomy, dairy sciences, fisheries management, horticultural sciences, poultry sciences, range management, and agricultural soil conservation. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research. Excludes “Forestry and Conservation Science Teachers, Postsecondary” (25-1043).','bls',NULL),(365,'2023-02-27 20:34:49.693314','25-1042','Biological Science Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Life Sciences Teachers, Postsecondary','Biological Science Teachers, Postsecondary','Teach courses in biological sciences. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research.','bls',NULL),(366,'2023-02-27 20:34:49.738680','25-1043','Forestry and Conservation Science Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Life Sciences Teachers, Postsecondary','Forestry and Conservation Science Teachers, Postsecondary','Teach courses in forestry and conservation science. Includes both teachers primarily engaged in teaching and those who do a combination of teaching and research. Excludes “Agricultural Science Teachers, Postsecondary” (25-1041) and “Environmental Science Teachers, Postsecondary” (25-1053).','bls',NULL),(367,'2023-02-27 20:34:49.783665','25-1050','Physical Sciences Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Physical Sciences Teachers, Postsecondary','Physical Sciences Teachers, Postsecondary','','bls',NULL),(368,'2023-02-27 20:34:49.825710','25-1051','Atmospheric, Earth, Marine, and Space Sciences Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Physical Sciences Teachers, Postsecondary','Atmospheric, Earth, Marine, and Space Sciences Teachers, Postsecondary','Teach courses in the physical sciences, except chemistry and physics. Includes both teachers primarily engaged in teaching, and those who do a combination of teaching and research.','bls',NULL),(369,'2023-02-27 20:34:49.866878','25-1052','Chemistry Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Physical Sciences Teachers, Postsecondary','Chemistry Teachers, Postsecondary','Teach courses pertaining to the chemical and physical properties and compositional changes of substances. Work may include providing instruction in the methods of qualitative and quantitative chemical analysis. Includes both teachers primarily engaged in teaching, and those who do a combination of teaching and research. Excludes “Biological Science Teachers, Postsecondary” (25-1042) who teach biochemistry.','bls',NULL),(370,'2023-02-27 20:34:49.912047','25-1053','Environmental Science Teachers, Postsecondary','Educational Instruction and Library Occupations','Postsecondary Teachers','Physical Sciences Teachers, Postsecondary','Environmental Science Teachers, Postsecondary','Teach courses in environmental science. Includes both teachers primarily engaged in teaching and those who do a combination of teachi