n a short-term basis as a temporary replacement for a regular classroom teacher, typically using the regular teacher’s lesson plan. Excludes long-term substitute teachers who perform all the duties of a regular teacher; these teachers are coded within the 25-1000 or 25-2000 minor groups.','bls',NULL),(428,'2023-02-27 20:34:52.593924','25-3040','Tutors','Educational Instruction and Library Occupations','Other Teachers and Instructors','Tutors','Tutors','','bls',NULL),(429,'2023-02-27 20:34:52.637544','25-3041','Tutors','Educational Instruction and Library Occupations','Other Teachers and Instructors','Tutors','Tutors','Instruct individual students or small groups of students in academic subjects to support formal class instruction or to prepare students for standardized or admissions tests. Excludes “Postsecondary Teachers” (25-1000), “Elementary, Middle, Secondary, and Special Education Teachers” (25-2000), “Adult Basic Education, Adult Secondary Education, and English as a Second Language Instructors” (25-3011), and “Self-Enrichment Teachers” (25-3021).','bls',NULL),(430,'2023-02-27 20:34:52.687841','25-3090','Miscellaneous Teachers and Instructors','Educational Instruction and Library Occupations','Other Teachers and Instructors','Miscellaneous Teachers and Instructors','Miscellaneous Teachers and Instructors','','bls',NULL),(431,'2023-02-27 20:34:52.726326','25-3099','Teachers and Instructors, All Other','Educational Instruction and Library Occupations','Other Teachers and Instructors','Miscellaneous Teachers and Instructors','Teachers and Instructors, All Other','All teachers and instructors not listed separately.','bls',NULL),(432,'2023-02-27 20:34:52.768072','25-4000','Librarians, Curators, and Archivists','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists',NULL,'Librarians, Curators, and Archivists','','bls',NULL),(433,'2023-02-27 20:34:52.806406','25-4010','Archivists, Curators, and Museum Technicians','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Archivists, Curators, and Museum Technicians','Archivists, Curators, and Museum Technicians','','bls',NULL),(434,'2023-02-27 20:34:52.851082','25-4011','Archivists','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Archivists, Curators, and Museum Technicians','Archivists','Appraise, edit, and direct safekeeping of permanent records and historically valuable documents. Participate in research activities based on archival materials.','bls',NULL),(435,'2023-02-27 20:34:52.894958','25-4012','Curators','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Archivists, Curators, and Museum Technicians','Curators','Administer collections, such as artwork, collectibles, historic items, or scientific specimens of museums or other institutions. May conduct instructional, research, or public service activities of institution.','bls',NULL),(436,'2023-02-27 20:34:52.945440','25-4013','Museum Technicians and Conservators','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Archivists, Curators, and Museum Technicians','Museum Technicians and Conservators','Restore, maintain, or prepare objects in museum collections for storage, research, or exhibit. May work with specimens such as fossils, skeletal parts, or botanicals; or artifacts, textiles, or art. May identify and record objects or install and arrange them in exhibits. Includes book or document conservators.','bls',NULL),(437,'2023-02-27 20:34:52.988670','25-4020','Librarians and Media Collections Specialists','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Librarians and Media Collections Specialists','Librarians and Media Collections Specialists','','bls',NULL),(438,'2023-02-27 20:34:53.034087','25-4022','Librarians and Media Collections Specialists','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Librarians and Media Collections Specialists','Librarians and Media Collections Specialists','Administer and maintain libraries or collections of information, for public or private access through reference or borrowing. Work in a variety of settings, such as educational institutions, museums, and corporations, and with various types of informational materials, such as books, periodicals, recordings, films, and databases. Tasks may include acquiring, cataloging, and circulating library materials, and user services such as locating and organizing information, providing instruction on how to access information, and setting up and operating a library’s media equipment.','bls',NULL),(439,'2023-02-27 20:34:53.086540','25-4030','Library Technicians','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Library Technicians','Library Technicians','','bls',NULL),(440,'2023-02-27 20:34:53.130858','25-4031','Library Technicians','Educational Instruction and Library Occupations','Librarians, Curators, and Archivists','Library Technicians','Library Technicians','Assist librarians by helping readers in the use of library catalogs, databases, and indexes to locate books and other materials; and by answering questions that require only brief consultation of standard reference. Compile records; sort and shelve books or other media; remove or repair damaged books or other media; register patrons; and check materials in and out of the circulation process. Replace materials in shelving area (stacks) or files. Includes bookmobile drivers who assist with providing services in mobile libraries.','bls',NULL),(441,'2023-02-27 20:34:53.174538','25-9000','Other Educational Instruction and Library Occupations','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations',NULL,'Other Educational Instruction and Library Occupations','','bls',NULL),(442,'2023-02-27 20:34:53.216751','25-9020','Farm and Home Management Educators','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Farm and Home Management Educators','Farm and Home Management Educators','','bls',NULL),(443,'2023-02-27 20:34:53.264506','25-9021','Farm and Home Management Educators','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Farm and Home Management Educators','Farm and Home Management Educators','Instruct and advise individuals and families engaged in agriculture, agricultural-related processes, or home management activities. Demonstrate procedures and apply research findings to advance agricultural and home management activities. May develop educational outreach programs. May instruct on either agricultural issues such as agricultural processes and techniques, pest management, and food safety, or on home management issues such as budgeting, nutrition, and child development. Excludes “Dietitians and Nutritionists” (29-1031).','bls',NULL),(444,'2023-02-27 20:34:53.315573','25-9030','Instructional Coordinators','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Instructional Coordinators','Instructional Coordinators','','bls',NULL),(445,'2023-02-27 20:34:53.369666','25-9031','Instructional Coordinators','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Instructional Coordinators','Instructional Coordinators','Develop instructional material, coordinate educational content, and incorporate current technology into instruction in order to provide guidelines to educators and instructors for developing curricula and conducting courses. May train and coach teachers. Includes educational consultants and specialists, and instructional material directors.','bls',NULL),(446,'2023-02-27 20:34:53.417272','25-9040','Teaching Assistants','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Teaching Assistants','Teaching Assistants','','bls',NULL),(447,'2023-02-27 20:34:53.463288','25-9042','Teaching Assistants, Preschool, Elementary, Middle, and Secondary School, Except Special Education','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Teaching Assistants','Teaching Assistants, Preschool, Elementary, Middle, and Secondary School, Except Special Education','Assist a preschool, elementary, middle, or secondary school teacher with instructional duties. Serve in a position for which a teacher has primary responsibility for the design and implementation of educational programs and services. Excludes “Teaching Assistants, Special Education” (25-9043).','bls',NULL),(448,'2023-02-27 20:34:53.511323','25-9043','Teaching Assistants, Special Education','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Teaching Assistants','Teaching Assistants, Special Education','Assist a preschool, elementary, middle, or secondary school teacher to provide academic, social, or life skills to students who have learning, emotional, or physical disabilities. Serve in a position for which a teacher has primary responsibility for the design and implementation of educational programs and services.','bls',NULL),(449,'2023-02-27 20:34:53.555761','25-9044','Teaching Assistants, Postsecondary','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Teaching Assistants','Teaching Assistants, Postsecondary','Assist faculty or other instructional staff in postsecondary institutions by performing instructional support activities, such as developing teaching materials, leading discussion groups, preparing and giving examinations, and grading examinations or papers. Graduate students who teach one or more full courses should be classified in the 25-1000 minor group.','bls',NULL),(450,'2023-02-27 20:34:53.601996','25-9049','Teaching Assistants, All Other','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Teaching Assistants','Teaching Assistants, All Other','All teaching assistants not listed separately.','bls',NULL),(451,'2023-02-27 20:34:53.657025','25-9090','Miscellaneous Educational Instruction and Library Workers','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Miscellaneous Educational Instruction and Library Workers','Miscellaneous Educational Instruction and Library Workers','','bls',NULL),(452,'2023-02-27 20:34:53.704804','25-9099','Educational Instruction and Library Workers, All Other','Educational Instruction and Library Occupations','Other Educational Instruction and Library Occupations','Miscellaneous Educational Instruction and Library Workers','Educational Instruction and Library Workers, All Other','All educational instruction and library workers not listed separately.','bls',NULL),(453,'2023-02-27 20:34:53.754371','27-0000','Arts, Design, Entertainment, Sports, and Media Occupations','Arts, Design, Entertainment, Sports, and Media Occupations',NULL,NULL,'Arts, Design, Entertainment, Sports, and Media Occupations','','bls',NULL),(454,'2023-02-27 20:34:53.802896','27-1000','Art and Design Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers',NULL,'Art and Design Workers','','bls',NULL),(455,'2023-02-27 20:34:53.850593','27-1010','Artists and Related Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Artists and Related Workers','Artists and Related Workers','','bls',NULL),(456,'2023-02-27 20:34:53.896431','27-1011','Art Directors','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Artists and Related Workers','Art Directors','Formulate design concepts and presentation approaches for visual productions and media, such as print, broadcasting, video, and film. Direct workers engaged in artwork or layout design. Excludes “Set and Exhibit Designers” (27-1027).','bls',NULL),(457,'2023-02-27 20:34:53.949606','27-1012','Craft Artists','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Artists and Related Workers','Craft Artists','Create or reproduce handmade objects for sale and exhibition using a variety of techniques, such as welding, weaving, pottery, and needlecraft.','bls',NULL),(458,'2023-02-27 20:34:53.996216','27-1013','Fine Artists, Including Painters, Sculptors, and Illustrators','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Artists and Related Workers','Fine Artists, Including Painters, Sculptors, and Illustrators','Create original artwork using any of a wide variety of media and techniques.','bls',NULL),(459,'2023-02-27 20:34:54.045465','27-1014','Special Effects Artists and Animators','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Artists and Related Workers','Special Effects Artists and Animators','Create special effects or animations using film, video, computers, or other electronic tools and media for use in products, such as computer games, movies, music videos, and commercials.','bls',NULL),(460,'2023-02-27 20:34:54.098537','27-1019','Artists and Related Workers, All Other','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Artists and Related Workers','Artists and Related Workers, All Other','All artists and related workers not listed separately.','bls',NULL),(461,'2023-02-27 20:34:54.139447','27-1020','Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Designers','','bls',NULL),(462,'2023-02-27 20:34:54.177326','27-1021','Commercial and Industrial Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Commercial and Industrial Designers','Design and develop manufactured products, such as cars, home appliances, and children’s toys. Combine artistic talent with research on product use, marketing, and materials to create the most functional and appealing product design.','bls',NULL),(463,'2023-02-27 20:34:54.218882','27-1022','Fashion Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Fashion Designers','Design clothing and accessories. Create original designs or adapt fashion trends.','bls',NULL),(464,'2023-02-27 20:34:54.259378','27-1023','Floral Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Floral Designers','Design, cut, and arrange live, dried, or artificial flowers and foliage.','bls',NULL),(465,'2023-02-27 20:34:54.299841','27-1024','Graphic Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Graphic Designers','Design or create graphics to meet specific commercial or promotional needs, such as packaging, displays, or logos. May use a variety of mediums to achieve artistic or decorative effects. Excludes “Web and Digital Interface Designers” (15-1255).','bls',NULL),(466,'2023-02-27 20:34:54.340963','27-1025','Interior Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Interior Designers','Plan, design, and furnish the internal space of rooms or buildings. Design interior environments or create physical layouts that are practical, aesthetic, and conducive to the intended purposes. May specialize in a particular field, style, or phase of interior design. Excludes “Merchandise Displayers and Window Trimmers” (27-1026).','bls',NULL),(467,'2023-02-27 20:34:54.386539','27-1026','Merchandise Displayers and Window Trimmers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Merchandise Displayers and Window Trimmers','Plan and erect commercial displays, such as those in windows and interiors of retail stores and at trade exhibitions.','bls',NULL),(468,'2023-02-27 20:34:54.428811','27-1027','Set and Exhibit Designers','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Set and Exhibit Designers','Design special exhibits and sets for film, video, television, and theater productions. May study scripts, confer with directors, and conduct research to determine appropriate architectural styles.','bls',NULL),(469,'2023-02-27 20:34:54.472354','27-1029','Designers, All Other','Arts, Design, Entertainment, Sports, and Media Occupations','Art and Design Workers','Designers','Designers, All Other','All designers not listed separately.','bls',NULL),(470,'2023-02-27 20:34:54.515851','27-2000','Entertainers and Performers, Sports and Related Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers',NULL,'Entertainers and Performers, Sports and Related Workers','','bls',NULL),(471,'2023-02-27 20:34:54.557325','27-2010','Actors, Producers, and Directors','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Actors, Producers, and Directors','Actors, Producers, and Directors','','bls',NULL),(472,'2023-02-27 20:34:54.605949','27-2011','Actors','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Actors, Producers, and Directors','Actors','Play parts in stage, television, radio, video, or film productions, or other settings for entertainment, information, or instruction. Interpret serious or comic role by speech, gesture, and body movement to entertain or inform audience. May dance and sing.','bls',NULL),(473,'2023-02-27 20:34:54.651758','27-2012','Producers and Directors','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Actors, Producers, and Directors','Producers and Directors','Produce or direct stage, television, radio, video, or film productions for entertainment, information, or instruction. Responsible for creative decisions, such as interpretation of script, choice of actors or guests, set design, sound, special effects, and choreography.','bls',NULL),(474,'2023-02-27 20:34:54.698278','27-2020','Athletes, Coaches, Umpires, and Related Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Athletes, Coaches, Umpires, and Related Workers','Athletes, Coaches, Umpires, and Related Workers','','bls',NULL),(475,'2023-02-27 20:34:54.749950','27-2021','Athletes and Sports Competitors','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Athletes, Coaches, Umpires, and Related Workers','Athletes and Sports Competitors','Compete in athletic events.','bls',NULL),(476,'2023-02-27 20:34:54.799500','27-2022','Coaches and Scouts','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Athletes, Coaches, Umpires, and Related Workers','Coaches and Scouts','Instruct or coach groups or individuals in the fundamentals of sports for the primary purpose of competition. Demonstrate techniques and methods of participation. May evaluate athletes’ strengths and weaknesses as possible recruits or to improve the athletes’ technique to prepare them for competition. Those required to hold teaching certifications should be reported in the appropriate teaching category. Excludes “Athletic Trainers” (29-9091).','bls',NULL),(477,'2023-02-27 20:34:54.853425','27-2023','Umpires, Referees, and Other Sports Officials','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Athletes, Coaches, Umpires, and Related Workers','Umpires, Referees, and Other Sports Officials','Officiate at competitive athletic or sporting events. Detect infractions of rules and decide penalties according to established regulations. Includes all sporting officials, referees, and competition judges.','bls',NULL),(478,'2023-02-27 20:34:54.910194','27-2030','Dancers and Choreographers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Dancers and Choreographers','Dancers and Choreographers','','bls',NULL),(479,'2023-02-27 20:34:54.952123','27-2031','Dancers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Dancers and Choreographers','Dancers','Perform dances. May perform on stage, for broadcasting, or for video recording.','bls',NULL),(480,'2023-02-27 20:34:54.990579','27-2032','Choreographers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Dancers and Choreographers','Choreographers','Create new dance routines. Rehearse performance of routines. May direct and stage presentations.','bls',NULL),(481,'2023-02-27 20:34:55.032966','27-2040','Musicians, Singers, and Related Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Musicians, Singers, and Related Workers','Musicians, Singers, and Related Workers','','bls',NULL),(482,'2023-02-27 20:34:55.075345','27-2041','Music Directors and Composers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Musicians, Singers, and Related Workers','Music Directors and Composers','Conduct, direct, plan, and lead instrumental or vocal performances by musical artists or groups, such as orchestras, bands, choirs, and glee clubs; or create original works of music.','bls',NULL),(483,'2023-02-27 20:34:55.115112','27-2042','Musicians and Singers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Musicians, Singers, and Related Workers','Musicians and Singers','Play one or more musical instruments or sing. May perform on stage, for broadcasting, or for sound or video recording.','bls',NULL),(484,'2023-02-27 20:34:55.157941','27-2090','Miscellaneous Entertainers and Performers, Sports and Related Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Miscellaneous Entertainers and Performers, Sports and Related Workers','Miscellaneous Entertainers and Performers, Sports and Related Workers','','bls',NULL),(485,'2023-02-27 20:34:55.203635','27-2091','Disc Jockeys, Except Radio','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Miscellaneous Entertainers and Performers, Sports and Related Workers','Disc Jockeys, Except Radio','Play prerecorded music for live audiences at venues or events such as clubs, parties, or wedding receptions. May use techniques such as mixing, cutting, or sampling to manipulate recordings. May also perform as emcee (master of ceremonies). Radio disc jockeys are included in “Broadcast Announcers and Radio Disc Jockeys” (27-3011). Excludes “Musicians and Singers” (27-2042), “Audio and Video Technicians” (27-4011), and “Sound Engineering Technicians” (27-4014).','bls',NULL),(486,'2023-02-27 20:34:55.249135','27-2099','Entertainers and Performers, Sports and Related Workers, All Other','Arts, Design, Entertainment, Sports, and Media Occupations','Entertainers and Performers, Sports and Related Workers','Miscellaneous Entertainers and Performers, Sports and Related Workers','Entertainers and Performers, Sports and Related Workers, All Other','All entertainers and performers, sports and related workers not listed separately.','bls',NULL),(487,'2023-02-27 20:34:55.292026','27-3000','Media and Communication Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers',NULL,'Media and Communication Workers','','bls',NULL),(488,'2023-02-27 20:34:55.343483','27-3010','Broadcast Announcers and Radio Disc Jockeys','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Broadcast Announcers and Radio Disc Jockeys','Broadcast Announcers and Radio Disc Jockeys','','bls',NULL),(489,'2023-02-27 20:34:55.392912','27-3011','Broadcast Announcers and Radio Disc Jockeys','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Broadcast Announcers and Radio Disc Jockeys','Broadcast Announcers and Radio Disc Jockeys','Speak or read from scripted materials, such as news reports or commercial messages, on radio, television, or other communications media. May play and queue music, announce artist or title of performance, identify station, or interview guests. Excludes “News Analysts, Reporters, and Journalists” (27-3023).','bls',NULL),(490,'2023-02-27 20:34:55.440368','27-3020','News Analysts, Reporters and Journalists','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','News Analysts, Reporters and Journalists','News Analysts, Reporters and Journalists','','bls',NULL),(491,'2023-02-27 20:34:55.493378','27-3023','News Analysts, Reporters, and Journalists','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','News Analysts, Reporters and Journalists','News Analysts, Reporters, and Journalists','Narrate or write news stories, reviews, or commentary for print, broadcast, or other communications media such as newspapers, magazines, radio, or television. May collect and analyze information through interview, investigation, or observation.','bls',NULL),(492,'2023-02-27 20:34:55.540221','27-3030','Public Relations Specialists','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Public Relations Specialists','Public Relations Specialists','','bls',NULL),(493,'2023-02-27 20:34:55.586291','27-3031','Public Relations Specialists','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Public Relations Specialists','Public Relations Specialists','Promote or create an intended public image for individuals, groups, or organizations. May write or select material for release to various communications media. May specialize in using social media.','bls',NULL),(494,'2023-02-27 20:34:55.630395','27-3040','Writers and Editors','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Writers and Editors','Writers and Editors','','bls',NULL),(495,'2023-02-27 20:34:55.671929','27-3041','Editors','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Writers and Editors','Editors','Plan, coordinate, revise, or edit written material. May review proposals and drafts for possible publication.','bls',NULL),(496,'2023-02-27 20:34:55.715531','27-3042','Technical Writers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Writers and Editors','Technical Writers','Write technical materials, such as equipment manuals, appendices, or operating and maintenance instructions. May assist in layout work.','bls',NULL),(497,'2023-02-27 20:34:55.767514','27-3043','Writers and Authors','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Writers and Editors','Writers and Authors','Originate and prepare written material, such as scripts, stories, advertisements, and other material. Excludes “News Analysts, Reporters, and Journalists” (27-3023), “Public Relations Specialists” (27-3031), and “Technical Writers” (27-3042).','bls',NULL),(498,'2023-02-27 20:34:55.814581','27-3090','Miscellaneous Media and Communication Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Miscellaneous Media and Communication Workers','Miscellaneous Media and Communication Workers','','bls',NULL),(499,'2023-02-27 20:34:55.862043','27-3091','Interpreters and Translators','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Miscellaneous Media and Communication Workers','Interpreters and Translators','Interpret oral or sign language, or translate written text from one language into another.','bls',NULL),(500,'2023-02-27 20:34:55.913379','27-3092','Court Reporters and Simultaneous Captioners','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Miscellaneous Media and Communication Workers','Court Reporters and Simultaneous Captioners','Use verbatim methods and equipment to capture, store, retrieve, and transcribe pretrial and trial proceedings or other information. Includes stenocaptioners who operate computerized stenographic captioning equipment to provide captions of live or prerecorded broadcasts for hearing-impaired viewers.','bls',NULL),(501,'2023-02-27 20:34:55.960919','27-3099','Media and Communication Workers, All Other','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Workers','Miscellaneous Media and Communication Workers','Media and Communication Workers, All Other','All media and communication workers not listed separately.','bls',NULL),(502,'2023-02-27 20:34:56.005235','27-4000','Media and Communication Equipment Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers',NULL,'Media and Communication Equipment Workers','','bls',NULL),(503,'2023-02-27 20:34:56.044821','27-4010','Broadcast, Sound, and Lighting Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Broadcast, Sound, and Lighting Technicians','','bls',NULL),(504,'2023-02-27 20:34:56.080946','27-4011','Audio and Video Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Audio and Video Technicians','Set up, maintain, and dismantle audio and video equipment, such as microphones, sound speakers, connecting wires and cables, sound and mixing boards, video cameras, video monitors and servers, and related electronic equipment for live or recorded events, such as concerts, meetings, conventions, presentations, podcasts, news conferences, and sporting events. Excludes “Sound Engineering Technicians” (27-4014), “Lighting Technicians” (27-4015), and “Audiovisual Equipment Installers and Repairers” (49-2097).','bls',NULL),(505,'2023-02-27 20:34:56.119936','27-4012','Broadcast Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Broadcast Technicians','Set up, operate, and maintain the electronic equipment used to acquire, edit, and transmit audio and video for radio or television programs. Control and adjust incoming and outgoing broadcast signals to regulate sound volume, signal strength, and signal clarity. Operate satellite, microwave, or other transmitter equipment to broadcast radio or television programs.','bls',NULL),(506,'2023-02-27 20:34:56.163244','27-4014','Sound Engineering Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Sound Engineering Technicians','Assemble and operate equipment to record, synchronize, mix, edit, or reproduce sound, including music, voices, or sound effects, for theater, video, film, television, podcasts, sporting events, and other productions. Excludes “Audio and Video Technicians” (27-4011).','bls',NULL),(507,'2023-02-27 20:34:56.208759','27-4015','Lighting Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Lighting Technicians','Set up, maintain, and dismantle light fixtures, lighting control devices, and the associated lighting electrical and rigging equipment used for photography, television, film, video, and live productions. May focus or operate light fixtures, or attach color filters or other lighting accessories. Excludes “Audio and Video Technicians” (27-4011).','bls',NULL),(508,'2023-02-27 20:34:56.255141','27-4020','Photographers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Photographers','Photographers','','bls',NULL),(509,'2023-02-27 20:34:56.298953','27-4021','Photographers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Photographers','Photographers','Photograph people, landscapes, merchandise, or other subjects. May use lighting equipment to enhance a subject’s appearance. May use editing software to produce finished images and prints. Includes commercial and industrial photographers, scientific photographers, and photojournalists. Excludes “Camera Operators, Television, Video, and Film” (27-4031).','bls',NULL),(510,'2023-02-27 20:34:56.343460','27-4030','Television, Video, and Film Camera Operators and Editors','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Television, Video, and Film Camera Operators and Editors','Television, Video, and Film Camera Operators and Editors','','bls',NULL),(511,'2023-02-27 20:34:56.390557','27-4031','Camera Operators, Television, Video, and Film','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Television, Video, and Film Camera Operators and Editors','Camera Operators, Television, Video, and Film','Operate television, video, or film camera to record images or scenes for television, video, or film productions.','bls',NULL),(512,'2023-02-27 20:34:56.435492','27-4032','Film and Video Editors','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Television, Video, and Film Camera Operators and Editors','Film and Video Editors','Edit moving images on film, video, or other media. May work with a producer or director to organize images for final production. May edit or synchronize soundtracks with images. Excludes “Sound Engineering Technicians” (27-4014).','bls',NULL),(513,'2023-02-27 20:34:56.482105','27-4090','Miscellaneous Media and Communication Equipment Workers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Miscellaneous Media and Communication Equipment Workers','Miscellaneous Media and Communication Equipment Workers','','bls',NULL),(514,'2023-02-27 20:34:56.526604','27-4099','Media and Communication Equipment Workers, All Other','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Miscellaneous Media and Communication Equipment Workers','Media and Communication Equipment Workers, All Other','All media and communication equipment workers not listed separately.','bls',NULL),(515,'2023-02-27 20:34:56.574710','29-0000','Healthcare Practitioners and Technical Occupations','Healthcare Practitioners and Technical Occupations',NULL,NULL,'Healthcare Practitioners and Technical Occupations','','bls',NULL),(516,'2023-02-27 20:34:56.616258','29-1000','Healthcare Diagnosing or Treating Practitioners','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Healthcare Diagnosing or Treating Practitioners','','bls',NULL),(517,'2023-02-27 20:34:56.658110','29-1010','Chiropractors','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Chiropractors','Chiropractors','','bls',NULL),(518,'2023-02-27 20:34:56.700435','29-1011','Chiropractors','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Chiropractors','Chiropractors','Assess, treat, and care for patients by manipulation of spine and musculoskeletal system. May provide spinal adjustment or address sacral or pelvic misalignment.','bls',NULL),(519,'2023-02-27 20:34:56.741294','29-1020','Dentists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Dentists','','bls',NULL),(520,'2023-02-27 20:34:56.779575','29-1021','Dentists, General','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Dentists, General','Examine, diagnose, and treat diseases, injuries, and malformations of teeth and gums. May treat diseases of nerve, pulp, and other dental tissues affecting oral hygiene and retention of teeth. May fit dental appliances or provide preventive care. Excludes “Oral and Maxillofacial Surgeons” (29-1022), “Orthodontists” (29-1023), “Prosthodontists” (29-1024), and “Dentists, All Other Specialists” (29-1029).','bls',NULL),(521,'2023-02-27 20:34:56.825298','29-1022','Oral and Maxillofacial Surgeons','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Oral and Maxillofacial Surgeons','Perform surgery and related procedures on the hard and soft tissues of the oral and maxillofacial regions to treat diseases, injuries, or defects. May diagnose problems of the oral and maxillofacial regions. May perform surgery to improve function or appearance.','bls',NULL),(522,'2023-02-27 20:34:56.865982','29-1023','Orthodontists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Orthodontists','Examine, diagnose, and treat dental malocclusions and oral cavity anomalies. Design and fabricate appliances to realign teeth and jaws to produce and maintain normal function and to improve appearance.','bls',NULL),(523,'2023-02-27 20:34:56.913677','29-1024','Prosthodontists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Prosthodontists','Diagnose, treat, rehabilitate, design, and fit prostheses that maintain oral function, health, and appearance for patients with clinical conditions associated with teeth, oral and maxillofacial tissues, or the jaw.','bls',NULL),(524,'2023-02-27 20:34:56.964062','29-1029','Dentists, All Other Specialists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Dentists, All Other Specialists','All dentists not listed separately.','bls',NULL),(525,'2023-02-27 20:34:57.010084','29-1030','Dietitians and Nutritionists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dietitians and Nutritionists','Dietitians and Nutritionists','','bls',NULL),(526,'2023-02-27 20:34:57.056613','29-1031','Dietitians and Nutritionists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dietitians and Nutritionists','Dietitians and Nutritionists','Plan and conduct food service or nutritional programs to assist in the promotion of health and control of disease. May supervise activities of a department providing quantity food services, counsel individuals, or conduct nutritional research.','bls',NULL),(527,'2023-02-27 20:34:57.103768','29-1040','Optometrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Optometrists','Optometrists','','bls',NULL),(528,'2023-02-27 20:34:57.142208','29-1041','Optometrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Optometrists','Optometrists','Diagnose, manage, and treat conditions and diseases of the human eye and visual system. Examine eyes and visual system, diagnose problems or impairments, prescribe corrective lenses, and provide treatment. May prescribe therapeutic drugs to treat specific eye conditions. Ophthalmologists are included in “Ophthalmologists, Except Pediatric” (29-1241).','bls',NULL),(529,'2023-02-27 20:34:57.182188','29-1050','Pharmacists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Pharmacists','Pharmacists','','bls',NULL),(530,'2023-02-27 20:34:57.226828','29-1051','Pharmacists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Pharmacists','Pharmacists','Dispense drugs prescribed by physicians and other health practitioners and provide information to patients about medications and their use. May advise physicians and other health practitioners on the selection, dosage, interactions, and side effects of medications.','bls',NULL),(531,'2023-02-27 20:34:57.263967','29-1070','Physician Assistants','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physician Assistants','Physician Assistants','','bls',NULL),(532,'2023-02-27 20:34:57.306683','29-1071','Physician Assistants','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physician Assistants','Physician Assistants','Provide healthcare services typically performed by a physician, under the supervision of a physician. Conduct complete physicals, provide treatment, and counsel patients. May, in some cases, prescribe medication. Must graduate from an accredited educational program for physician assistants. Excludes “Registered Nurses” (29-1141), “Nurse Anesthetists” (29-1151), “Nurse Midwives” (29-1161), “Nurse Practitioners” (29-1171), “Emergency Medical Technicians” (29-2042), “Paramedics” (29-2043), “Surgical Assistants” (29-9093), and “Medical Assistants” (31-9092).','bls',NULL),(533,'2023-02-27 20:34:57.357473','29-1080','Podiatrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Podiatrists','Podiatrists','','bls',NULL),(534,'2023-02-27 20:34:57.405018','29-1081','Podiatrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Podiatrists','Podiatrists','Diagnose and treat diseases and deformities of the human foot.','bls',NULL),(535,'2023-02-27 20:34:57.446885','29-1120','Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Therapists','','bls',NULL),(536,'2023-02-27 20:34:57.491113','29-1122','Occupational Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Occupational Therapists','Assess, plan, and organize rehabilitative programs that help build or restore vocational, homemaking, and daily living skills, as well as general independence, to persons with disabilities or developmental delays. Use therapeutic techniques, adapt the individual’s environment, teach skills, and modify specific tasks that present barriers to the individual. Excludes “Rehabilitation Counselors” (21-1015).','bls',NULL),(537,'2023-02-27 20:34:57.533457','29-1123','Physical Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Physical Therapists','Assess, plan, organize, and participate in rehabilitative programs that improve mobility, relieve pain, increase strength, and improve or correct disabling conditions resulting from disease or injury.','bls',NULL),(538,'2023-02-27 20:34:57.574626','29-1124','Radiation Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Radiation Therapists','Provide radiation therapy to patients as prescribed by a radiation oncologist according to established practices and standards. Duties may include reviewing prescription and diagnosis; acting as liaison with physician and supportive care personnel; preparing equipment, such as immobilization, treatment, and protection devices; and maintaining records, reports, and files. May assist in dosimetry procedures and tumor localization.','bls',NULL),(539,'2023-02-27 20:34:57.623303','29-1125','Recreational Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Recreational Therapists','Plan, direct, or coordinate medically-approved recreation programs for patients in hospitals, nursing homes, or other institutions. Activities include sports, trips, dramatics, social activities, and crafts. May assess a patient condition and recommend appropriate recreational activity. Excludes “Recreation Workers” (39-9032).','bls',NULL),(540,'2023-02-27 20:34:57.662418','29-1126','Respiratory Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Respiratory Therapists','Assess, treat, and care for patients with breathing disorders. Assume primary responsibility for all respiratory care modalities, including the supervision of respiratory therapy technicians. Initiate and conduct therapeutic procedures; maintain patient records; and select, assemble, check, and operate equipment.','bls',NULL),(541,'2023-02-27 20:34:57.703042','29-1127','Speech-Language Pathologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Speech-Language Pathologists','Assess and treat persons with speech, language, voice, and fluency disorders. May select alternative communication systems and teach their use. May perform research related to speech and language problems.','bls',NULL),(542,'2023-02-27 20:34:57.749261','29-1128','Exercise Physiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Exercise Physiologists','Assess, plan, or implement fitness programs that include exercise or physical activities such as those designed to improve cardiorespiratory function, body composition, muscular strength, muscular endurance, or flexibility. Excludes “Physical Therapists” (29-1123), “Athletic Trainers” (29-9091), and “Exercise Trainers and Group Fitness Instructors” (39-9031).','bls',NULL),(543,'2023-02-27 20:34:57.791925','29-1129','Therapists, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Therapists, All Other','All therapists not listed separately.','bls',NULL),(544,'2023-02-27 20:34:57.830823','29-1130','Veterinarians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Veterinarians','Veterinarians','','bls',NULL),(545,'2023-02-27 20:34:57.877209','29-1131','Veterinarians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Veterinarians','Veterinarians','Diagnose, treat, or research diseases and injuries of animals. Includes veterinarians who conduct research and development, inspect livestock, or care for pets and companion animals.','bls',NULL),(546,'2023-02-27 20:34:57.916452','29-1140','Registered Nurses','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','','bls',NULL),(547,'2023-02-27 20:34:57.955627','29-1141','Registered Nurses','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','Assess patient health problems and needs, develop and implement nursing care plans, and maintain medical records. Administer nursing care to ill, injured, convalescent, or disabled patients. May advise patients on health maintenance and disease prevention or provide case management. Licensing or registration required. Includes Clinical Nurse Specialists. Excludes “Nurse Anesthetists” (29-1151), “Nurse Midwives” (29-1161), and “Nurse Practitioners” (29-1171).','bls',NULL),(548,'2023-02-27 20:34:58.003656','29-1150','Nurse Anesthetists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Anesthetists','Nurse Anesthetists','','bls',NULL),(549,'2023-02-27 20:34:58.044272','29-1151','Nurse Anesthetists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Anesthetists','Nurse Anesthetists','Administer anesthesia, monitor patient’s vital signs, and oversee patient recovery from anesthesia. May assist anesthesiologists, surgeons, other physicians, or dentists. Must be registered nurses who have specialized graduate education.','bls',NULL),(550,'2023-02-27 20:34:58.084535','29-1160','Nurse Midwives','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Midwives','Nurse Midwives','','bls',NULL),(551,'2023-02-27 20:34:58.125189','29-1161','Nurse Midwives','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Midwives','Nurse Midwives','Diagnose and coordinate all aspects of the birthing process, either independently or as part of a healthcare team. May provide well-woman gynecological care. Must have specialized, graduate nursing education.','bls',NULL),(552,'2023-02-27 20:34:58.164745','29-1170','Nurse Practitioners','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Practitioners','Nurse Practitioners','','bls',NULL),(553,'2023-02-27 20:34:58.204202','29-1171','Nurse Practitioners','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Practitioners','Nurse Practitioners','Diagnose and treat acute, episodic, or chronic illness, independently or as part of a healthcare team. May focus on health promotion and disease prevention. May order, perform, or interpret diagnostic tests such as lab work and x rays. May prescribe medication. Must be registered nurses who have specialized graduate education.','bls',NULL),(554,'2023-02-27 20:34:58.248847','29-1180','Audiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Audiologists','Audiologists','','bls',NULL),(555,'2023-02-27 20:34:58.282182','29-1181','Audiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Audiologists','Audiologists','Assess and treat persons with hearing and related disorders. May fit hearing aids and provide auditory training. May perform research related to hearing problems.','bls',NULL),(556,'2023-02-27 20:34:58.315978','29-1210','Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Physicians','','bls',NULL),(557,'2023-02-27 20:34:58.352528','29-1211','Anesthesiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Anesthesiologists','Administer anesthetics and analgesics for pain management prior to, during, or after surgery.','bls',NULL),(558,'2023-02-27 20:34:58.394892','29-1212','Cardiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Cardiologists','Diagnose, treat, manage, and prevent diseases or conditions of the cardiovascular system. May further subspecialize in interventional procedures (e.g., balloon angioplasty and stent placement), echocardiography, or electrophysiology.','bls',NULL),(559,'2023-02-27 20:34:58.428155','29-1213','Dermatologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Dermatologists','Diagnose and treat diseases relating to the skin, hair, and nails. May perform both medical and dermatological surgery functions.','bls',NULL),(560,'2023-02-27 20:34:58.464941','29-1214','Emergency Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Emergency Medicine Physicians','Make immediate medical decisions and act to prevent death or further disability. Provide immediate recognition, evaluation, care, stabilization, and disposition of patients. May direct emergency medical staff in an emergency department.','bls',NULL),(561,'2023-02-27 20:34:58.498646','29-1215','Family Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Family Medicine Physicians','Diagnose, treat, and provide preventive care to individuals and families across the lifespan. May refer patients to specialists when needed for further diagnosis or treatment. Excludes “General Internal Medicine Physicians” (29-1216) and “Pediatricians, General” (29-1221).','bls',NULL),(562,'2023-02-27 20:34:58.533409','29-1216','General Internal Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','General Internal Medicine Physicians','Diagnose and provide nonsurgical treatment for a wide range of diseases and injuries of internal organ systems. Provide care mainly for adults and adolescents, and are based primarily in an outpatient care setting. Excludes “Family Medicine Physicians” (29-1215) and “Pediatricians, General” (29-1221).','bls',NULL),(563,'2023-02-27 20:34:58.570750','29-1217','Neurologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Neurologists','Diagnose, manage, and treat disorders and diseases of the brain, spinal cord, and peripheral nerves, with a primarily nonsurgical focus.','bls',NULL),(564,'2023-02-27 20:34:58.607440','29-1218','Obstetricians and Gynecologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Obstetricians and Gynecologists','Provide medical care related to pregnancy or childbirth. Diagnose, treat, and help prevent diseases of women, particularly those affecting the reproductive system. May also provide general care to women. May perform both medical and gynecological surgery functions.','bls',NULL),(565,'2023-02-27 20:34:58.646924','29-1221','Pediatricians, General','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Pediatricians, General','Diagnose, treat, and help prevent diseases and injuries in children. May refer patients to specialists for further diagnosis or treatment, as needed. Excludes “Family Medicine Physicians” (29-1215) and “General Internal Medicine Physicians” (29-1216).','bls',NULL),(566,'2023-02-27 20:34:58.684146','29-1222','Physicians, Pathologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, Pathologists','Diagnose diseases and conduct lab tests using organs, body tissues, and fluids. Includes medical examiners.','bls',NULL),(567,'2023-02-27 20:34:58.721205','29-1223','Psychiatrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Psychiatrists','Diagnose, treat, and help prevent mental disorders. Excludes “Clinical and Counseling Psychologists” (19-3033) and “School Psychologists” (19-3034).','bls',NULL),(568,'2023-02-27 20:34:58.756268','29-1224','Radiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Radiologists','Diagnose and treat diseases and injuries using medical imaging techniques, such as x rays, magnetic resonance imaging (MRI), nuclear medicine, and ultrasounds. May perform minimally invasive medical procedures and tests.','bls',NULL),(569,'2023-02-27 20:34:58.795320','29-1229','Physicians, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','All physicians not listed separately.','bls',NULL),(570,'2023-02-27 20:34:58.834534','29-1240','Surgeons','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Surgeons','','bls',NULL),(571,'2023-02-27 20:34:58.873381','29-1241','Ophthalmologists, Except Pediatric','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Ophthalmologists, Except Pediatric','Diagnose and perform surgery to treat and help prevent disorders and diseases of the eye. May also provide vision services for treatment including glasses and contacts. Excludes “Optometrists” (29-1041) and “Pediatric Surgeons” (29-1243).','bls',NULL),(572,'2023-02-27 20:34:58.915641','29-1242','Orthopedic Surgeons, Except Pediatric','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Orthopedic Surgeons, Except Pediatric','Diagnose and perform surgery to treat and prevent rheumatic and other diseases in the musculoskeletal system. Excludes “Pediatric Surgeons” (29-1243).','bls',NULL),(573,'2023-02-27 20:34:58.956518','29-1243','Pediatric Surgeons','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Pediatric Surgeons','Diagnose and perform surgery to treat fetal abnormalities and birth defects, diseases, and injuries in fetuses, premature and newborn infants, children, and adolescents. Includes all pediatric surgical specialties and subspecialties. Excludes “Oral and Maxillofacial Surgeons” (29-1022), “Ophthalmologists, Except Pediatric” (29-1241), and “Orthopedic Surgeons, Except Pediatric” (29-1242).','bls',NULL),(574,'2023-02-27 20:34:58.993047','29-1249','Surgeons, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Surgeons, All Other','All surgeons not listed separately. Excludes “Oral and Maxillofacial Surgeons” (29-1022).','bls',NULL),(575,'2023-02-27 20:34:59.030262','29-1290','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','','bls',NULL),(576,'2023-02-27 20:34:59.066037','29-1291','Acupuncturists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Acupuncturists','Diagnose, treat, and prevent disorders by stimulating specific acupuncture points within the body using acupuncture needles. May also use cups, nutritional supplements, therapeutic massage, acupressure, and other alternative health therapies. Excludes “Chiropractors” (29-1011).','bls',NULL),(577,'2023-02-27 20:34:59.103896','29-1292','Dental Hygienists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Dental Hygienists','Administer oral hygiene care to patients. Assess patient oral hygiene problems or needs and maintain health records. Advise patients on oral health maintenance and disease prevention. May provide advanced care such as providing fluoride treatment or administering topical anesthesia.','bls',NULL),(578,'2023-02-27 20:34:59.143969','29-1299','Healthcare Diagnosing or Treating Practitioners, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Healthcare Diagnosing or Treating Practitioners, All Other','All healthcare diagnosing or treating practitioners not listed separately.','bls',NULL),(579,'2023-02-27 20:34:59.184486','29-2000','Health Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians',NULL,'Health Technologists and Technicians','','bls',NULL),(580,'2023-02-27 20:34:59.217826','29-2010','Clinical Laboratory Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Clinical Laboratory Technologists and Technicians','','bls',NULL),(581,'2023-02-27 20:34:59.254626','29-2011','Medical and Clinical Laboratory Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technologists','Perform complex medical laboratory tests for diagnosis, treatment, and prevention of disease. May train or supervise staff.','bls',NULL),(582,'2023-02-27 20:34:59.292164','29-2012','Medical and Clinical Laboratory Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technicians','Perform routine medical laboratory tests for the diagnosis, treatment, and prevention of disease. May work under the supervision of a medical technologist.','bls',NULL),(583,'2023-02-27 20:34:59.328466','29-2030','Diagnostic Related Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Diagnostic Related Technologists and Technicians','','bls',NULL),(584,'2023-02-27 20:34:59.366240','29-2031','Cardiovascular Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Cardiovascular Technologists and Technicians','Conduct tests on pulmonary or cardiovascular systems of patients for diagnostic, therapeutic, or research purposes. May conduct or assist in electrocardiograms, cardiac catheterizations, pulmonary functions, lung capacity, and similar tests.','bls',NULL),(585,'2023-02-27 20:34:59.405268','29-2032','Diagnostic Medical Sonographers','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Diagnostic Medical Sonographers','Produce ultrasonic recordings of internal organs for use by physicians. Includes vascular technologists. Excludes “Cardiovascular Technologists and Technicians” (29-2031).','bls',NULL),(586,'2023-02-27 20:34:59.440089','29-2033','Nuclear Medicine Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Nuclear Medicine Technologists','Prepare, administer, and measure radioactive isotopes in therapeutic, diagnostic, and tracer studies using a variety of radioisotope equipment. Prepare stock solutions of radioactive materials and calculate doses to be administered by radiologists. Subject patients to radiation. Execute blood volume, red cell survival, and fat absorption studies following standard laboratory techniques.','bls',NULL),(587,'2023-02-27 20:34:59.482133','29-2034','Radiologic Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Radiologic Technologists and Technicians','Take x-rays and CAT scans or administer nonradioactive materials into patient’s bloodstream for diagnostic or research purposes. Includes radiologic technologists and technicians who specialize in other scanning modalities. Excludes “Diagnostic Medical Sonographers” (29-2032) and “Magnetic Resonance Imaging Technologists” (29-2035).','bls',NULL),(588,'2023-02-27 20:34:59.528738','29-2035','Magnetic Resonance Imaging Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Magnetic Resonance Imaging Technologists','Operate Magnetic Resonance Imaging (MRI) scanners. Monitor patient safety and comfort, and view images of area being scanned to ensure quality of pictures. May administer gadolinium contrast dosage intravenously. May interview patient, explain MRI procedures, and position patient on examining table. May enter into the computer data such as patient history, anatomical area to be scanned, orientation specified, and position of entry.','bls',NULL),(589,'2023-02-27 20:34:59.571908','29-2036','Medical Dosimetrists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Medical Dosimetrists','Generate radiation treatment plans, develop radiation dose calculations, communicate and supervise the treatment plan implementation, and consult with members of radiation oncology team.','bls',NULL),(590,'2023-02-27 20:34:59.616742','29-2040','Emergency Medical Technicians and Paramedics','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Emergency Medical Technicians and Paramedics','Emergency Medical Technicians and Paramedics','','bls',NULL),(591,'2023-02-27 20:34:59.658709','29-2042','Emergency Medical Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Emergency Medical Technicians and Paramedics','Emergency Medical Technicians','Assess injuries and illnesses and administer basic emergency medical care. May transport injured or sick persons to medical facilities. Excludes “Paramedics” (29-2043), “Firefighters” (33-2011), and “Ambulance Drivers and Attendants, Except Emergency Medical Technicians” (53-3011).','bls',NULL),(592,'2023-02-27 20:34:59.701829','29-2043','Paramedics','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Emergency Medical Technicians and Paramedics','Paramedics','Administer basic or advanced emergency medical care and assess injuries and illnesses. May administer medication intravenously, use equipment such as EKGs, or administer advanced life support to sick or injured individuals. Excludes “Emergency Medical Technicians” (29-2042) and “Ambulance Drivers and Attendants, Except Emergency Medical Technicians” (53-3011).','bls',NULL),(593,'2023-02-27 20:34:59.745686','29-2050','Health Practitioner Support Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Health Practitioner Support Technologists and Technicians','','bls',NULL),(594,'2023-02-27 20:34:59.791468','29-2051','Dietetic Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Dietetic Technicians','Assist in the provision of food service and nutritional programs, under the supervision of a dietitian. May plan and produce meals based on established guidelines, teach principles of food and nutrition, or counsel individuals.','bls',NULL),(595,'2023-02-27 20:34:59.830586','29-2052','Pharmacy Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Pharmacy Technicians','Prepare medications under the direction of a pharmacist. May measure, mix, count out, label, and record amounts and dosages of medications according to prescription orders.','bls',NULL),(596,'2023-02-27 20:34:59.871728','29-2053','Psychiatric Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Psychiatric Technicians','Care for individuals with mental or emotional conditions or disabilities, following the instructions of physicians or other health practitioners. Monitor patients’ physical and emotional well-being and report to medical staff. May participate in rehabilitation and treatment programs, help with personal hygiene, and administer oral or injectable medications.','bls',NULL),(597,'2023-02-27 20:34:59.917551','29-2055','Surgical Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Surgical Technologists','Assist in operations, under the supervision of surgeons, registered nurses, or other surgical personnel. May help set up operating room, prepare and transport patients for surgery, adjust lights and equipment, pass instruments and other supplies to surgeons and surgeons’ assistants, hold retractors, cut sutures, and help count sponges, needles, supplies, and instruments. Excludes “Surgical Assistants” (29-9093).','bls',NULL),(598,'2023-02-27 20:34:59.961418','29-2056','Veterinary Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Veterinary Technologists and Technicians','Perform medical tests in a laboratory environment for use in the treatment and diagnosis of diseases in animals. Prepare vaccines and serums for prevention of diseases. Prepare tissue samples, take blood samples, and execute laboratory tests, such as urinalysis and blood counts. Clean and sterilize instruments and materials and maintain equipment and machines. May assist a veterinarian during surgery.','bls',NULL),(599,'2023-02-27 20:35:00.004630','29-2057','Ophthalmic Medical Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Ophthalmic Medical Technicians','Assist ophthalmologists by performing ophthalmic clinical functions. May administer eye exams, administer eye medications, and instruct the patient in care and use of corrective lenses.','bls',NULL),(600,'2023-02-27 20:35:00.051566','29-2060','Licensed Practical and Licensed Vocational Nurses','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Licensed Practical and Licensed Vocational Nurses','Licensed Practical and Licensed Vocational Nurses','','bls',NULL),(601,'2023-02-27 20:35:00.089209','29-2061','Licensed Practical and Licensed Vocational Nurses','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Licensed Practical and Licensed Vocational Nurses','Licensed Practical and Licensed Vocational Nurses','Care for ill, injured, or convalescing patients or persons with disabilities in hospitals, nursing homes, clinics, private homes, group homes, and similar institutions. May work under the supervision of a registered nurse. Licensing required.','bls',NULL),(602,'2023-02-27 20:35:00.130340','29-2070','Medical Records Specialists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Medical Records Specialists','Medical Records Specialists','','bls',NULL),(603,'2023-02-27 20:35:00.171666','29-2072','Medical Records Specialists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Medical Records Specialists','Medical Records Specialists','Compile, process, and maintain medical records of hospital and clinic patients in a manner consistent with medical, administrative, ethical, legal, and regulatory requirements of the healthcare system. Classify medical and healthcare concepts, including diagnosis, procedures, medical services, and equipment, into the healthcare industry’s numerical coding system. Includes medical coders. Excludes “Health Information Technologists and Medical Registrars” (29-9021) and “File Clerks” (43-4071).','bls',NULL),(604,'2023-02-27 20:35:00.216437','29-2080','Opticians, Dispensing','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Opticians, Dispensing','Opticians, Dispensing','','bls',NULL),(605,'2023-02-27 20:35:00.256991','29-2081','Opticians, Dispensing','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Opticians, Dispensing','Opticians, Dispensing','Design, measure, fit, and adapt lenses and frames for client according to written optical prescription or specification. Assist client with inserting, removing, and caring for contact lenses. Assist client with selecting frames. Measure customer for size of eyeglasses and coordinate frames with facial and eye measurements and optical prescription. Prepare work order for optical laboratory containing instructions for grinding and mounting lenses in frames. Verify exactness of finished lens spectacles. Adjust frame and lens position to fit client. May shape or reshape frames. Includes contact lens opticians.','bls',NULL),(606,'2023-02-27 20:35:00.303383','29-2090','Miscellaneous Health Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','','bls',NULL),(607,'2023-02-27 20:35:00.338705','29-2091','Orthotists and Prosthetists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Orthotists and Prosthetists','Design, measure, fit, and adapt orthopedic braces, appliances or prostheses, such as limbs or facial parts for patients with disabling conditions.','bls',NULL),(608,'2023-02-27 20:35:00.382823','29-2092','Hearing Aid Specialists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Hearing Aid Specialists','Select and fit hearing aids for customers. Administer and interpret tests of hearing. Assess hearing instrument efficacy. Take ear impressions and prepare, design, and modify ear molds. Excludes “Audiologists” (29-1181).','bls',NULL),(609,'2023-02-27 20:35:00.426282','29-2099','Health Technologists and Technicians, All Other','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Health Technologists and Technicians, All Other','All health technologists and technicians not listed separately.','bls',NULL),(610,'2023-02-27 20:35:00.467065','29-9000','Other Healthcare Practitioners and Technical Occupations','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations',NULL,'Other Healthcare Practitioners and Technical Occupations','','bls',NULL),(611,'2023-02-27 20:35:00.509191','29-9020','Health Information Technologists and Medical Registrars','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Health Information Technologists and Medical Registrars','Health Information Technologists and Medical Registrars','','bls',NULL),(612,'2023-02-27 20:35:00.547464','29-9021','Health Information Technologists and Medical Registrars','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Health Information Technologists and Medical Registrars','Health Information Technologists and Medical Registrars','Apply knowledge of healthcare and information systems to assist in the design, development, and continued modification and analysis of computerized healthcare systems. Abstract, collect, and analyze treatment and followup information of patients. May educate staff and assist in problem solving to promote the implementation of the healthcare information system. May design, develop, test, and implement databases with complete history, diagnosis, treatment, and health status to help monitor diseases. Excludes “Medical Records Specialists” (29‐2072).','bls',NULL),(613,'2023-02-27 20:35:00.588918','29-9090','Miscellaneous Health Practitioners and Technical Workers','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Miscellaneous Health Practitioners and Technical Workers','','bls',NULL),(614,'2023-02-27 20:35:00.628866','29-9091','Athletic Trainers','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Athletic Trainers','Evaluate and treat musculoskeletal injuries or illnesses. Provide preventive, therapeutic, emergency, and rehabilitative care. Excludes “Physical Therapists” (29-1123).','bls',NULL),(615,'2023-02-27 20:35:00.672817','29-9092','Genetic Counselors','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Genetic Counselors','Assess individual or family risk for a variety of inherited conditions, such as genetic disorders and birth defects. Provide information to other healthcare providers or to individuals and families concerned with the risk of inherited conditions. Advise individuals and families to support informed decisionmaking and coping methods for those at risk. May help conduct research related to genetic conditions or genetic counseling.','bls',NULL),(616,'2023-02-27 20:35:00.711437','29-9093','Surgical Assistants','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Surgical Assistants','Assist in operations, under the supervision of surgeons. May, in accordance with state laws, help surgeons to make incisions and close surgical sites, manipulate or remove tissues, implant surgical devices or drains, suction the surgical site, place catheters, clamp or cauterize vessels or tissue, and apply dressings to surgical site. Excludes “Registered Nurses” (29-1141) and “Surgical Technologists” (29-2055).','bls',NULL),(617,'2023-02-27 20:35:00.755386','29-9099','Healthcare Practitioners and Technical Workers, All Other','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Healthcare Practitioners and Technical Workers, All Other','All healthcare practitioners and technical workers not listed separately.','bls',NULL),(618,'2023-02-27 20:35:00.798106','31-0000','Healthcare Support Occupations','Healthcare Support Occupations',NULL,NULL,'Healthcare Support Occupations','','bls',NULL),(619,'2023-02-27 20:35:00.836760','31-1100','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides',NULL,'Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','','bls',NULL),(620,'2023-02-27 20:35:00.879400','31-1120','Home Health and Personal Care Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Home Health and Personal Care Aides','Home Health and Personal Care Aides','','bls',NULL),(621,'2023-02-27 20:35:00.923228','31-1121','Home Health Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Home Health and Personal Care Aides','Home Health Aides','Monitor the health status of an individual with disabilities or illness, and address their health-related needs, such as changing bandages, dressing wounds, or administering medication. Work is performed under the direction of offsite or intermittent onsite licensed nursing staff. Provide assistance with routine healthcare tasks or activities of daily living, such as feeding, bathing, toileting, or ambulation. May also help with tasks such as preparing meals, doing light housekeeping, and doing laundry depending on the patient’s abilities.','bls',NULL),(622,'2023-02-27 20:35:00.967062','31-1122','Personal Care Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Home Health and Personal Care Aides','Personal Care Aides','Provide personalized assistance to individuals with disabilities or illness who require help with personal care and activities of daily living support (e.g., feeding, bathing, dressing, grooming, toileting, and ambulation). May also provide help with tasks such as preparing meals, doing light housekeeping, and doing laundry. Work is performed in various settings depending on the needs of the care recipient and may include locations such as their home, place of work, out in the community, or at a daytime nonresidential facility.','bls',NULL),(623,'2023-02-27 20:35:01.011649','31-1130','Nursing Assistants, Orderlies, and Psychiatric Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','','bls',NULL),(624,'2023-02-27 20:35:01.053161','31-1131','Nursing Assistants','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants','Provide or assist with basic care or support under the direction of onsite licensed nursing staff. Perform duties such as monitoring of health status, feeding, bathing, dressing, grooming, toileting, or ambulation of patients in a health or nursing facility. May include medication administration and other health-related tasks. Includes nursing care attendants, nursing aides, and nursing attendants. Excludes “Home Health Aides” (31-1121), “Personal Care Aides” (31-1122), “Orderlies” (31-1132), and “Psychiatric Aides” (31-1133).','bls',NULL),(625,'2023-02-27 20:35:01.094094','31-1132','Orderlies','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Orderlies','Transport patients to areas such as operating rooms or x-ray rooms using wheelchairs, stretchers, or moveable beds. May maintain stocks of supplies or clean and transport equipment. Excludes “Nursing Assistants” (31-1131). Psychiatric orderlies are included in “Psychiatric Aides” (31-1133).','bls',NULL),(626,'2023-02-27 20:35:01.135517','31-1133','Psychiatric Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Psychiatric Aides','Assist mentally impaired or emotionally disturbed patients, working under direction of nursing and medical staff. May assist with daily living activities, lead patients in educational and recreational activities, or accompany patients to and from examinations and treatments. May restrain violent patients. Includes psychiatric orderlies.','bls',NULL),(627,'2023-02-27 20:35:01.180653','31-2000','Occupational Therapy and Physical Therapist Assistants and Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides',NULL,'Occupational Therapy and Physical Therapist Assistants and Aides','','bls',NULL),(628,'2023-02-27 20:35:01.218730','31-2010','Occupational Therapy Assistants and Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Occupational Therapy Assistants and Aides','Occupational Therapy Assistants and Aides','','bls',NULL),(629,'2023-02-27 20:35:01.256033','31-2011','Occupational Therapy Assistants','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Occupational Therapy Assistants and Aides','Occupational Therapy Assistants','Assist occupational therapists in providing occupational therapy treatments and procedures. May, in accordance with state laws, assist in development of treatment plans, carry out routine functions, direct activity programs, and document the progress of treatments. Generally requires formal training.','bls',NULL),(630,'2023-02-27 20:35:01.304110','31-2012','Occupational Therapy Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Occupational Therapy Assistants and Aides','Occupational Therapy Aides','Under close supervision of an occupational therapist or occupational therapy assistant, perform only delegated, selected, or routine tasks in specific situations. These duties include preparing patient and treatment room.','bls',NULL),(631,'2023-02-27 20:35:01.346038','31-2020','Physical Therapist Assistants and Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Physical Therapist Assistants and Aides','Physical Therapist Assistants and Aides','','bls',NULL),(632,'2023-02-27 20:35:01.389359','31-2021','Physical Therapist Assistants','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Physical Therapist Assistants and Aides','Physical Therapist Assistants','Assist physical therapists in providing physical therapy treatments and procedures. May, in accordance with state laws, assist in the development of treatment plans, carry out routine functions, document the progress of treatment, and modify specific treatments in accordance with patient status and within the scope of treatment plans established by a physical therapist. Generally requires formal training.','bls',NULL),(633,'2023-02-27 20:35:01.435828','31-2022','Physical Therapist Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Physical Therapist Assistants and Aides','Physical Therapist Aides','Under close supervision of a physical therapist or physical therapy assistant, perform only delegated, selected, or routine tasks in specific situations. These duties include preparing the patient and the treatment area.','bls',NULL),(634,'2023-02-27 20:35:01.472745','31-9000','Other Healthcare Support Occupations','Healthcare Support Occupations','Other Healthcare Support Occupations',NULL,'Other Healthcare Support Occupations','','bls',NULL),(635,'2023-02-27 20:35:01.511675','31-9010','Massage Therapists','Healthcare Support Occupations','Other Healthcare Support Occupations','Massage Therapists','Massage Therapists','','bls',NULL),(636,'2023-02-27 20:35:01.553770','31-9011','Massage Therapists','Healthcare Support Occupations','Other Healthcare Support Occupations','Massage Therapists','Massage Therapists','Perform therapeutic massages of soft tissues and joints. May assist in the assessment of range of motion and muscle strength, or propose client therapy plans.','bls',NULL),(637,'2023-02-27 20:35:01.592256','31-9090','Miscellaneous Healthcare Support Occupations','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','','bls',NULL),(638,'2023-02-27 20:35:01.630429','31-9091','Dental Assistants','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Dental Assistants','Perform limited clinical duties under the direction of a dentist. Clinical duties may include equipment preparation and sterilization, preparing patients for treatment, assisting the dentist during treatment, and providing patients with instructions for oral healthcare procedures. May perform administrative duties such as scheduling appointments, maintaining medical records, billing, and coding information for insurance purposes.','bls',NULL),(639,'2023-02-27 20:35:01.672769','31-9092','Medical Assistants','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Medical Assistants','Perform administrative and certain clinical duties under the direction of a physician. Administrative duties may include scheduling appointments, maintaining medical records, billing, and coding information for insurance purposes. Clinical duties may include taking and recording vital signs and medical histories, preparing patients for examination, drawing blood, and administering medications as directed by physician. Excludes “Physician Assistants” (29-1071).','bls',NULL),(640,'2023-02-27 20:35:01.710005','31-9093','Medical Equipment Preparers','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Medical Equipment Preparers','Prepare, sterilize, install, or clean laboratory or healthcare equipment. May perform routine laboratory tasks and operate or inspect equipment.','bls',NULL),(641,'2023-02-27 20:35:01.752244','31-9094','Medical Transcriptionists','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Medical Transcriptionists','Transcribe medical reports recorded by physicians and other healthcare practitioners using various electronic devices, covering office visits, emergency room visits, diagnostic imaging studies, operations, chart reviews, and final summaries. Transcribe dictated reports and translate abbreviations into fully understandable form. Edit as necessary and return reports in either printed or electronic form for review and signature, or correction.','bls',NULL),(642,'2023-02-27 20:35:01.795216','31-9095','Pharmacy Aides','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Pharmacy Aides','Record drugs delivered to the pharmacy, store incoming merchandise, and inform the supervisor of stock needs. May operate cash register and accept prescriptions for filling.','bls',NULL),(643,'2023-02-27 20:35:01.831319','31-9096','Veterinary Assistants and Laboratory Animal Caretakers','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Veterinary Assistants and Laboratory Animal Caretakers','Feed, water, and examine pets and other nonfarm animals for signs of illness, disease, or injury in laboratories and animal hospitals and clinics. Clean and disinfect cages and work areas, and sterilize laboratory and surgical equipment. May provide routine postoperative care, administer medication orally or topically, or prepare samples for laboratory examination under the supervision of veterinary or laboratory animal technologists or technicians, veterinarians, or scientists. Excludes “Animal Caretakers” (39-2021).','bls',NULL),(644,'2023-02-27 20:35:01.870716','31-9097','Phlebotomists','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Phlebotomists','Draw blood for tests, transfusions, donations, or research. May explain the procedure to patients and assist in the recovery of patients with adverse reactions.','bls',NULL),(645,'2023-02-27 20:35:01.910926','31-9099','Healthcare Support Workers, All Other','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Healthcare Support Workers, All Other','All healthcare support workers not listed separately.','bls',NULL),(646,'2023-02-27 20:35:01.945861','33-0000','Protective Service Occupations','Protective Service Occupations',NULL,NULL,'Protective Service Occupations','','bls',NULL),(647,'2023-02-27 20:35:01.980971','33-1000','Supervisors of Protective Service Workers','Protective Service Occupations','Supervisors of Protective Service Workers',NULL,'Supervisors of Protective Service Workers','','bls',NULL),(648,'2023-02-27 20:35:02.018684','33-1010','First-Line Supervisors of Law Enforcement Workers','Protective Service Occupations','Supervisors of Protective Service Workers','First-Line Supervisors of Law Enforcement Workers','First-Line Supervisors of Law Enforcement Workers','','bls',NULL),(649,'2023-02-27 20:35:02.052930','33-1011','First-Line Supervisors of Correctional Officers','Protective Service Occupations','Supervisors of Protective Service Workers','First-Line Supervisors of Law Enforcement Workers','First-Line Supervisors of Correctional Officers','Directly supervise and coordinate activities of correctional officers and jailers.','bls',NULL),(650,'2023-02-27 20:35:02.091292','33-1012','First-Line Supervisors of Police and Detectives','Protective Service Occupations','Supervisors of Protective Service Workers','First-Line Supervisors of Law Enforcement Workers','First-Line Supervisors of Police and Detectives','Directly supervise and coordinate activities of members of police force.','bls',NULL),(651,'2023-02-27 20:35:02.