orkers',NULL,'Firefighting and Prevention Workers','','bls',NULL),(657,'2023-02-27 20:35:02.357379','33-2010','Firefighters','Protective Service Occupations','Firefighting and Prevention Workers','Firefighters','Firefighters','','bls',NULL),(658,'2023-02-27 20:35:02.392229','33-2011','Firefighters','Protective Service Occupations','Firefighting and Prevention Workers','Firefighters','Firefighters','Control and extinguish fires or respond to emergency situations where life, property, or the environment is at risk. Duties may include fire prevention, emergency medical service, hazardous material response, search and rescue, and disaster assistance.','bls',NULL),(659,'2023-02-27 20:35:02.432517','33-2020','Fire Inspectors','Protective Service Occupations','Firefighting and Prevention Workers','Fire Inspectors','Fire Inspectors','','bls',NULL),(660,'2023-02-27 20:35:02.471592','33-2021','Fire Inspectors and Investigators','Protective Service Occupations','Firefighting and Prevention Workers','Fire Inspectors','Fire Inspectors and Investigators','Inspect buildings to detect fire hazards and enforce local ordinances and state laws, or investigate and gather facts to determine cause of fires and explosions.','bls',NULL),(661,'2023-02-27 20:35:02.506665','33-2022','Forest Fire Inspectors and Prevention Specialists','Protective Service Occupations','Firefighting and Prevention Workers','Fire Inspectors','Forest Fire Inspectors and Prevention Specialists','Enforce fire regulations, inspect forest for fire hazards, and recommend forest fire prevention or control measures. May report forest fires and weather conditions.','bls',NULL),(662,'2023-02-27 20:35:02.545898','33-3000','Law Enforcement Workers','Protective Service Occupations','Law Enforcement Workers',NULL,'Law Enforcement Workers','','bls',NULL),(663,'2023-02-27 20:35:02.584841','33-3010','Bailiffs, Correctional Officers, and Jailers','Protective Service Occupations','Law Enforcement Workers','Bailiffs, Correctional Officers, and Jailers','Bailiffs, Correctional Officers, and Jailers','','bls',NULL),(664,'2023-02-27 20:35:02.621162','33-3011','Bailiffs','Protective Service Occupations','Law Enforcement Workers','Bailiffs, Correctional Officers, and Jailers','Bailiffs','Maintain order in courts of law.','bls',NULL),(665,'2023-02-27 20:35:02.655641','33-3012','Correctional Officers and Jailers','Protective Service Occupations','Law Enforcement Workers','Bailiffs, Correctional Officers, and Jailers','Correctional Officers and Jailers','Guard inmates in penal or rehabilitative institutions in accordance with established regulations and procedures. May guard prisoners in transit between jail, courtroom, prison, or other point. Includes deputy sheriffs and police who spend the majority of their time guarding prisoners in correctional institutions.','bls',NULL),(666,'2023-02-27 20:35:02.696712','33-3020','Detectives and Criminal Investigators','Protective Service Occupations','Law Enforcement Workers','Detectives and Criminal Investigators','Detectives and Criminal Investigators','','bls',NULL),(667,'2023-02-27 20:35:02.730364','33-3021','Detectives and Criminal Investigators','Protective Service Occupations','Law Enforcement Workers','Detectives and Criminal Investigators','Detectives and Criminal Investigators','Conduct investigations related to suspected violations of federal, state, or local laws to prevent or solve crimes. Excludes “Private Detectives and Investigators” (33-9021).','bls',NULL),(668,'2023-02-27 20:35:02.766062','33-3030','Fish and Game Wardens','Protective Service Occupations','Law Enforcement Workers','Fish and Game Wardens','Fish and Game Wardens','','bls',NULL),(669,'2023-02-27 20:35:02.805545','33-3031','Fish and Game Wardens','Protective Service Occupations','Law Enforcement Workers','Fish and Game Wardens','Fish and Game Wardens','Patrol assigned area to prevent fish and game law violations. Investigate reports of damage to crops or property by wildlife. Compile biological data.','bls',NULL),(670,'2023-02-27 20:35:02.840399','33-3040','Parking Enforcement Workers','Protective Service Occupations','Law Enforcement Workers','Parking Enforcement Workers','Parking Enforcement Workers','','bls',NULL),(671,'2023-02-27 20:35:02.874820','33-3041','Parking Enforcement Workers','Protective Service Occupations','Law Enforcement Workers','Parking Enforcement Workers','Parking Enforcement Workers','Patrol assigned area, such as public parking lot or city streets to issue tickets to overtime parking violators and illegally parked vehicles.','bls',NULL),(672,'2023-02-27 20:35:02.917009','33-3050','Police Officers','Protective Service Occupations','Law Enforcement Workers','Police Officers','Police Officers','','bls',NULL),(673,'2023-02-27 20:35:02.951828','33-3051','Police and Sheriff’s Patrol Officers','Protective Service Occupations','Law Enforcement Workers','Police Officers','Police and Sheriff’s Patrol Officers','Maintain order and protect life and property by enforcing local, tribal, state, or federal laws and ordinances. Perform a combination of the following duties: patrol a specific area; direct traffic; issue traffic summonses; investigate accidents; apprehend and arrest suspects, or serve legal processes of courts. Includes police officers working at educational institutions.','bls',NULL),(674,'2023-02-27 20:35:02.990116','33-3052','Transit and Railroad Police','Protective Service Occupations','Law Enforcement Workers','Police Officers','Transit and Railroad Police','Protect and police railroad and transit property, employees, or passengers.','bls',NULL),(675,'2023-02-27 20:35:03.029590','33-9000','Other Protective Service Workers','Protective Service Occupations','Other Protective Service Workers',NULL,'Other Protective Service Workers','','bls',NULL),(676,'2023-02-27 20:35:03.064850','33-9010','Animal Control Workers','Protective Service Occupations','Other Protective Service Workers','Animal Control Workers','Animal Control Workers','','bls',NULL),(677,'2023-02-27 20:35:03.100466','33-9011','Animal Control Workers','Protective Service Occupations','Other Protective Service Workers','Animal Control Workers','Animal Control Workers','Handle animals for the purpose of investigations of mistreatment, or control of abandoned, dangerous, or unattended animals.','bls',NULL),(678,'2023-02-27 20:35:03.147553','33-9020','Private Detectives and Investigators','Protective Service Occupations','Other Protective Service Workers','Private Detectives and Investigators','Private Detectives and Investigators','','bls',NULL),(679,'2023-02-27 20:35:03.193570','33-9021','Private Detectives and Investigators','Protective Service Occupations','Other Protective Service Workers','Private Detectives and Investigators','Private Detectives and Investigators','Gather, analyze, compile, and report information regarding individuals or organizations to clients, or detect occurrences of unlawful acts or infractions of rules in private establishment.','bls',NULL),(680,'2023-02-27 20:35:03.241617','33-9030','Security Guards and Gambling Surveillance Officers','Protective Service Occupations','Other Protective Service Workers','Security Guards and Gambling Surveillance Officers','Security Guards and Gambling Surveillance Officers','','bls',NULL),(681,'2023-02-27 20:35:03.286757','33-9031','Gambling Surveillance Officers and Gambling Investigators','Protective Service Occupations','Other Protective Service Workers','Security Guards and Gambling Surveillance Officers','Gambling Surveillance Officers and Gambling Investigators','Observe gambling operation for irregular activities such as cheating or theft by either employees or patrons. Investigate potential threats to gambling assets such as money, chips, and gambling equipment. Act as oversight and security agent for management and customers.','bls',NULL),(682,'2023-02-27 20:35:03.326474','33-9032','Security Guards','Protective Service Occupations','Other Protective Service Workers','Security Guards and Gambling Surveillance Officers','Security Guards','Guard, patrol, or monitor premises to prevent theft, violence, or infractions of rules. May operate x-ray and metal detector equipment. Excludes “Police Officers” (33-3050) and “Transportation Security Screeners” (33-9093).','bls',NULL),(683,'2023-02-27 20:35:03.366732','33-9090','Miscellaneous Protective Service Workers','Protective Service Occupations','Other Protective Service Workers','Miscellaneous Protective Service Workers','Miscellaneous Protective Service Workers','','bls',NULL),(684,'2023-02-27 20:35:03.409957','33-9091','Crossing Guards and Flaggers','Protective Service Occupations','Other Protective Service Workers','Miscellaneous Protective Service Workers','Crossing Guards and Flaggers','Guide or control vehicular or pedestrian traffic at such places as streets, schools, railroad crossings, or construction sites.','bls',NULL),(685,'2023-02-27 20:35:03.450751','33-9092','Lifeguards, Ski Patrol, and Other Recreational Protective Service Workers','Protective Service Occupations','Other Protective Service Workers','Miscellaneous Protective Service Workers','Lifeguards, Ski Patrol, and Other Recreational Protective Service Workers','Monitor recreational areas, such as pools, beaches, or ski slopes, to provide assistance and protection to participants.','bls',NULL),(686,'2023-02-27 20:35:03.494226','33-9093','Transportation Security Screeners','Protective Service Occupations','Other Protective Service Workers','Miscellaneous Protective Service Workers','Transportation Security Screeners','Conduct screening of passengers, baggage, or cargo to ensure compliance with Transportation Security Administration (TSA) regulations. May operate basic security equipment such as x-ray machines and hand wands at screening checkpoints.','bls',NULL),(687,'2023-02-27 20:35:03.542182','33-9094','School Bus Monitors','Protective Service Occupations','Other Protective Service Workers','Miscellaneous Protective Service Workers','School Bus Monitors','Maintain order among students on a school bus. Duties include helping students safely board and exit and communicating behavioral problems. May perform pretrip and posttrip inspections and prepare for and assist in emergency evacuations.','bls',NULL),(688,'2023-02-27 20:35:03.585460','33-9099','Protective Service Workers, All Other','Protective Service Occupations','Other Protective Service Workers','Miscellaneous Protective Service Workers','Protective Service Workers, All Other','All protective service workers not listed separately.','bls',NULL),(689,'2023-02-27 20:35:03.630013','35-0000','Food Preparation and Serving Related Occupations','Food Preparation and Serving Related Occupations',NULL,NULL,'Food Preparation and Serving Related Occupations','','bls',NULL),(690,'2023-02-27 20:35:03.673632','35-1000','Supervisors of Food Preparation and Serving Workers','Food Preparation and Serving Related Occupations','Supervisors of Food Preparation and Serving Workers',NULL,'Supervisors of Food Preparation and Serving Workers','','bls',NULL),(691,'2023-02-27 20:35:03.713710','35-1010','Supervisors of Food Preparation and Serving Workers','Food Preparation and Serving Related Occupations','Supervisors of Food Preparation and Serving Workers','Supervisors of Food Preparation and Serving Workers','Supervisors of Food Preparation and Serving Workers','','bls',NULL),(692,'2023-02-27 20:35:03.751991','35-1011','Chefs and Head Cooks','Food Preparation and Serving Related Occupations','Supervisors of Food Preparation and Serving Workers','Supervisors of Food Preparation and Serving Workers','Chefs and Head Cooks','Direct and may participate in the preparation, seasoning, and cooking of salads, soups, fish, meats, vegetables, desserts, or other foods. May plan and price menu items, order supplies, and keep records and accounts.','bls',NULL),(693,'2023-02-27 20:35:03.799754','35-1012','First-Line Supervisors of Food Preparation and Serving Workers','Food Preparation and Serving Related Occupations','Supervisors of Food Preparation and Serving Workers','Supervisors of Food Preparation and Serving Workers','First-Line Supervisors of Food Preparation and Serving Workers','Directly supervise and coordinate activities of workers engaged in preparing and serving food.','bls',NULL),(694,'2023-02-27 20:35:03.840231','35-2000','Cooks and Food Preparation Workers','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers',NULL,'Cooks and Food Preparation Workers','','bls',NULL),(695,'2023-02-27 20:35:03.881616','35-2010','Cooks','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks','','bls',NULL),(696,'2023-02-27 20:35:03.922715','35-2011','Cooks, Fast Food','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks, Fast Food','Prepare and cook food in a fast food restaurant with a limited menu. Duties of these cooks are limited to preparation of a few basic items and normally involve operating large-volume single-purpose cooking equipment.','bls',NULL),(697,'2023-02-27 20:35:03.969040','35-2012','Cooks, Institution and Cafeteria','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks, Institution and Cafeteria','Prepare and cook large quantities of food for institutions, such as schools, hospitals, or cafeterias.','bls',NULL),(698,'2023-02-27 20:35:04.010431','35-2013','Cooks, Private Household','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks, Private Household','Prepare meals in private homes. Includes personal chefs.','bls',NULL),(699,'2023-02-27 20:35:04.051698','35-2014','Cooks, Restaurant','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks, Restaurant','Prepare, season, and cook dishes such as soups, meats, vegetables, or desserts in restaurants. May order supplies, keep records and accounts, price items on menu, or plan menu.','bls',NULL),(700,'2023-02-27 20:35:04.099309','35-2015','Cooks, Short Order','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks, Short Order','Prepare and cook to order a variety of foods that require only a short preparation time. May take orders from customers and serve patrons at counters or tables. Excludes “Cooks, Fast Food” (35-2011).','bls',NULL),(701,'2023-02-27 20:35:04.140859','35-2019','Cooks, All Other','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Cooks','Cooks, All Other','All cooks not listed separately.','bls',NULL),(702,'2023-02-27 20:35:04.182418','35-2020','Food Preparation Workers','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Food Preparation Workers','Food Preparation Workers','','bls',NULL),(703,'2023-02-27 20:35:04.227587','35-2021','Food Preparation Workers','Food Preparation and Serving Related Occupations','Cooks and Food Preparation Workers','Food Preparation Workers','Food Preparation Workers','Perform a variety of food preparation duties other than cooking, such as preparing cold foods and shellfish, slicing meat, and brewing coffee or tea.','bls',NULL),(704,'2023-02-27 20:35:04.265496','35-3000','Food and Beverage Serving Workers','Food Preparation and Serving Related Occupations','Food and Beverage Serving Workers',NULL,'Food and Beverage Serving Workers','','bls',NULL),(705,'2023-02-27 20:35:04.305622','35-3010','Bartenders','Food Preparation and Serving Related Occupations','Food and Beverage Serving Workers','Bartenders','Bartenders','','bls',NULL),(706,'2023-02-27 20:35:04.341471','35-3011','Bartenders','Food Preparation and Serving Related Occupations','Food and Beverage Serving Workers','Bartenders','Bartenders','Mix and serve drinks to patrons, directly or through waitstaff.','b