r Sales Workers, News and Street Vendors, and Related Workers” (41-9091).','bls',NULL),(713,'2023-02-27 20:35:04.622270','35-9000','Other Food Preparation and Serving Related Workers','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers',NULL,'Other Food Preparation and Serving Related Workers','','bls',NULL),(714,'2023-02-27 20:35:04.664964','35-9010','Dining Room and Cafeteria Attendants and Bartender Helpers','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Dining Room and Cafeteria Attendants and Bartender Helpers','Dining Room and Cafeteria Attendants and Bartender Helpers','','bls',NULL),(715,'2023-02-27 20:35:04.711444','35-9011','Dining Room and Cafeteria Attendants and Bartender Helpers','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Dining Room and Cafeteria Attendants and Bartender Helpers','Dining Room and Cafeteria Attendants and Bartender Helpers','Facilitate food service. Clean tables; remove dirty dishes; replace soiled table linens; set tables; replenish supply of clean linens, silverware, glassware, and dishes; supply service bar with food; and serve items such as water, condiments, and coffee to patrons.','bls',NULL),(716,'2023-02-27 20:35:04.759994','35-9020','Dishwashers','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Dishwashers','Dishwashers','','bls',NULL),(717,'2023-02-27 20:35:04.804715','35-9021','Dishwashers','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Dishwashers','Dishwashers','Clean dishes, kitchen, food preparation equipment, or utensils.','bls',NULL),(718,'2023-02-27 20:35:04.848449','35-9030','Hosts and Hostesses, Restaurant, Lounge, and Coffee Shop','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Hosts and Hostesses, Restaurant, Lounge, and Coffee Shop','Hosts and Hostesses, Restaurant, Lounge, and Coffee Shop','','bls',NULL),(719,'2023-02-27 20:35:04.891191','35-9031','Hosts and Hostesses, Restaurant, Lounge, and Coffee Shop','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Hosts and Hostesses, Restaurant, Lounge, and Coffee Shop','Hosts and Hostesses, Restaurant, Lounge, and Coffee Shop','Welcome patrons, seat them at tables or in lounge, and help ensure quality of facilities and service.','bls',NULL),(720,'2023-02-27 20:35:04.937423','35-9090','Miscellaneous Food Preparation and Serving Related Workers','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Miscellaneous Food Preparation and Serving Related Workers','Miscellaneous Food Preparation and Serving Related Workers','','bls',NULL),(721,'2023-02-27 20:35:04.983484','35-9099','Food Preparation and Serving Related Workers, All Other','Food Preparation and Serving Related Occupations','Other Food Preparation and Serving Related Workers','Miscellaneous Food Preparation and Serving Related Workers','Food Preparation and Serving Related Workers, All Other','All food preparation and serving related workers not listed separately.','bls',NULL),(722,'2023-02-27 20:35:05.026664','37-0000','Building and Grounds Cleaning and Maintenance Occupations','Building and Grounds Cleaning and Maintenance Occupations',NULL,NULL,'Building and Grounds Cleaning and Maintenance Occupations','','bls',NULL),(723,'2023-02-27 20:35:05.066673','37-1000','Supervisors of Building and Grounds Cleaning and Maintenance Workers','Building and Grounds Cleaning and Maintenance Occupations','Supervisors of Building and Grounds Cleaning and Maintenance Workers',NULL,'Supervisors of Building and Grounds Cleaning and Maintenance Workers','','bls',NULL),(724,'2023-02-27 20:35:05.111734','37-1010','First-Line Supervisors of Building and Grounds Cleaning and Maintenance Workers','Building and Grounds Cleaning and Maintenance Occupations','Supervisors of Building and Grounds Cleaning and Maintenance Workers','First-Line Supervisors of Building and Grounds Cleaning and Maintenance Workers','First-Line Supervisors of Building and Grounds Cleaning and Maintenance Workers','','bls',NULL),(725,'2023-02-27 20:35:05.157457','37-1011','First-Line Supervisors of Housekeeping and Janitorial Workers','Building and Grounds Cleaning and Maintenance Occupations','Supervisors of Building and Grounds Cleaning and Maintenance Workers','First-Line Supervisors of Building and Grounds Cleaning and Maintenance Workers','First-Line Supervisors of Housekeeping and Janitorial Workers','Directly supervise and coordinate work activities of cleaning personnel in hotels, hospitals, offices, and other establishments.','bls',NULL),(726,'2023-02-27 20:35:05.203221','37-1012','First-Line Supervisors of Landscaping, Lawn Service, and Groundskeeping Workers','Building and Grounds Cleaning and Maintenance Occupations','Supervisors of Building and Grounds Cleaning and Maintenance Workers','First-Line Supervisors of Building and Grounds Cleaning and Maintenance Workers','First-Line Supervisors of Landscaping, Lawn Service, and Groundskeeping Workers','Directly supervise and coordinate activities of workers engaged in landscaping or groundskeeping activities. Work may involve reviewing contracts to ascertain service, machine, and workforce requirements; answering inquiries from potential customers regarding methods, material, and price ranges; and preparing estimates according to labor, material, and machine costs.','bls',NULL),(727,'2023-02-27 20:35:05.246639','37-2000','Building Cleaning and Pest Control Workers','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers',NULL,'Building Cleaning and Pest Control Workers','','bls',NULL),(728,'2023-02-27 20:35:05.286644','37-2010','Building Cleaning Workers','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers','Building Cleaning Workers','Building Cleaning Workers','','bls',NULL),(729,'2023-02-27 20:35:05.329187','37-2011','Janitors and Cleaners, Except Maids and Housekeeping Cleaners','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers','Building Cleaning Workers','Janitors and Cleaners, Except Maids and Housekeeping Cleaners','Keep buildings in clean and orderly condition. Perform heavy cleaning duties, such as cleaning floors, shampooing rugs, washing walls and glass, and removing rubbish. Duties may include tending furnace and boiler, performing routine maintenance activities, notifying management of need for repairs, and cleaning snow or debris from sidewalk.','bls',NULL),(730,'2023-02-27 20:35:05.377402','37-2012','Maids and Housekeeping Cleaners','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers','Building Cleaning Workers','Maids and Housekeeping Cleaners','Perform any combination of light cleaning duties to maintain private households or commercial establishments, such as hotels and hospitals, in a clean and orderly manner. Duties may include making beds, replenishing linens, cleaning rooms and halls, and vacuuming.','bls',NULL),(731,'2023-02-27 20:35:05.427522','37-2019','Building Cleaning Workers, All Other','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers','Building Cleaning Workers','Building Cleaning Workers, All Other','All building cleaning workers not listed separately.','bls',NULL),(732,'2023-02-27 20:35:05.476455','37-2020','Pest Control Workers','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers','Pest Control Workers','Pest Control Workers','','bls',NULL),(733,'2023-02-27 20:35:05.521500','37-2021','Pest Control Workers','Building and Grounds Cleaning and Maintenance Occupations','Building Cleaning and Pest Control Workers','Pest Control Workers','Pest Control Workers','Apply or release chemical solutions or toxic gases and set traps to kill or remove pests and vermin that infest buildings and surrounding areas.','bls',NULL),(734,'2023-02-27 20:35:05.562357','37-3000','Grounds Maintenance Workers','Building and Grounds Cleaning and Maintenance Occupations','Grounds Maintenance Workers',NULL,'Grounds Maintenance Workers','','bls',NULL),(735,'2023-02-27 20:35:05.602190','37-3010','Grounds Maintenance Workers','Building and Grounds Cleaning and Maintenance Occupations','Grounds Maintenance Workers','Grounds Maintenance Workers','Grounds Maintenance Workers','','bls',NULL),(736,'2023-02-27 20:35:05.646431','37-3011','Landscaping and Groundskeeping Workers','Building and Grounds Cleaning and Maintenance Occupations','Grounds Maintenance Workers','Grounds Maintenance Workers','Landscaping and Groundskeeping Workers','Landscape or maintain grounds of property using hand or power tools or equipment. Workers typically perform a variety of tasks, which may include any combination of the following: sod laying, mowing, trimming, planting, watering, fertilizing, digging, raking, sprinkler installation, and installation of mortarless segmental concrete masonry wall units. Excludes “Farmworkers and Laborers, Crop, Nursery, and Greenhouse” (45-2092).','bls',NULL),(737,'2023-02-27 20:35:05.692818','37-3012','Pesticide Handlers, Sprayers, and Applicators, Vegetation','Building and Grounds Cleaning and Maintenance Occupations','Grounds Maintenance Workers','Grounds Maintenance Workers','Pesticide Handlers, Sprayers, and Applicators, Vegetation','Mix or apply pesticides, herbicides, fungicides, or insecticides through sprays, dusts, vapors, soil incorporation, or chemical application on trees, shrubs, lawns, or crops. Usually requires specific training and state or federal certification. Crop dusters are included in “Commercial Pilots” (53-2012).','bls',NULL),(738,'2023-02-27 20:35:05.738635','37-3013','Tree Trimmers and Pruners','Building and Grounds Cleaning and Maintenance Occupations','Grounds Maintenance Workers','Grounds Maintenance Workers','Tree Trimmers and Pruners','Using sophisticated climbing and rigging techniques, cut away dead or excess branches from trees or shrubs to maintain right-of-way for roads, sidewalks, or utilities, or to improve appearance, health, and value of tree. Prune or treat trees or shrubs using handsaws, hand pruners, clippers, and power pruners. Works off the ground in the tree canopy and may use truck-mounted lifts. Excludes workers who primarily perform duties of “Landscaping and Groundskeeping Workers” (37-3011) and “Pesticide Handlers, Sprayers, and Applicators, Vegetation” (37-3012).','bls',NULL),(739,'2023-02-27 20:35:05.786172','37-3019','Grounds Maintenance Workers, All Other','Building and Grounds Cleaning and Maintenance Occupations','Grounds Maintenance Workers','Grounds Maintenance Workers','Grounds Maintenance Workers, All Other','All grounds maintenance workers not listed separately.','bls',NULL),(740,'2023-02-27 20:35:05.829700','39-0000','Personal Care and Service Occupations','Personal Care and Service Occupations',NULL,NULL,'Personal Care and Service Occupations','','bls',NULL),(741,'2023-02-27 20:35:05.876390','39-1000','Supervisors of Personal Care and Service Workers','Personal Care and Service Occupations','Supervisors of Personal Care and Service Workers',NULL,'Supervisors of Personal Care and Service Workers','','bls',NULL),(742,'2023-02-27 20:35:05.918798','39-1010','First-Line Supervisors of Entertainment and Recreation Workers','Personal Care and Service Occupations','Supervisors of Personal Care and Service Workers','First-Line Supervisors of Entertainment and Recreation Workers','First-Line Supervisors of Entertainment and Recreation Workers','','bls',NULL),(743,'2023-02-27 20:35:05.963535','39-1013','First-Line Supervisors of Gambling Services Workers','Personal Care and Service Occupations','Supervisors of Personal Care and Service Workers','First-Line Supervisors of Entertainment and Recreation Workers','First-Line Supervisors of Gambling Services Workers','Directly supervise and coordinate activities of workers in assigned gambling areas. May circulate among tables, observe operations, and ensure that stations and games are covered for each shift. May verify and pay off jackpots. May reset slot machines after payoffs and make repairs or adjustments to slot machines or recommend removal of slot machines for repair. May plan and organize activities and services for guests in hotels/casinos.','bls',NULL),(744,'2023-02-27 20:35:06.014681','39-1014','First-Line Supervisors of Entertainment and Recreation Workers, Except Gambling Services','Personal Care and Service Occupations','Supervisors of Personal Care and Service Workers','First-Line Supervisors of Entertainment and Recreation Workers','First-Line Supervisors of Entertainment and Recreation Workers, Except Gambling Services','Directly supervise and coordinate activities of entertainment and recreation related workers.','bls',NULL),(745,'2023-02-27 20:35:06.062494','39-1020','First-Line Supervisors of Personal Service Workers','Personal Care and Service Occupations','Supervisors of Personal Care and Service Workers','First-Line Supervisors of Personal Service Workers','First-Line Supervisors of Personal Service Workers','','bls',NULL),(746,'2023-02-27 20:35:06.106971','39-1022','First-Line Supervisors of Personal Service Workers','Personal Care and Service Occupations','Supervisors of Personal Care and Service Workers','First-Line Supervisors of Personal Service Workers','First-Line Supervisors of Personal Service Workers','Supervise and coordinate activities of personal service workers.','bls',NULL),(747,'2023-02-27 20:35:06.150739','39-2000','Animal Care and Service Workers','Personal Care and Service Occupations','Animal Care and Service Workers',NULL,'Animal Care and Service Workers','','bls',NULL),(748,'2023-02-27 20:35:06.195162','39-2010','Animal Trainers','Personal Care and Service Occupations','Animal Care and Service Workers','Animal Trainers','Animal Trainers','','bls',NULL),(749,'2023-02-27 20:35:06.235588','39-2011','Animal Trainers','Personal Care and Service Occupations','Animal Care and Service Workers','Animal Trainers','Animal Trainers','Train animals for riding, harness, security, performance, or obedience, or for assisting persons with disabilities. Accustom animals to human voice and contact, and condition animals to respond to commands. Train animals according to prescribed standards for show or competition. May train animals to carry pack loads or work as part of pack team.','bls',NULL),(750,'2023-02-27 20:35:06.280231','39-2020','Animal Caretakers','Personal Care and Service Occupations','Animal Care and Service Workers','Animal Caretakers','Animal Caretakers','','bls',NULL),(751,'2023-02-27 20:35:06.324315','39-2021','Animal Caretakers','Personal Care and Service Occupations','Animal Care and Service Workers','Animal Caretakers','Animal Caretakers','Feed, water, groom, bathe, exercise, or otherwise provide care to promote and maintain the well-being of pets and other animals that are not raised for consumption, such as dogs, cats, race horses, ornamental fish or birds, zoo animals, and mice. Work in settings such as kennels, animal shelters, zoos, circuses, and aquariums. May keep records of feedings, treatments, and animals received or discharged. May clean, disinfect, and repair cages, pens, or fish tanks. Excludes “Veterinary Assistants and Laboratory Animal Caretakers” (31-9096) and “Farmworkers, Farm, Ranch, and Aquacultural Animals” (45-2093).','bls',NULL),(752,'2023-02-27 20:35:06.370147','39-3000','Entertainment Attendants and Related Workers','Personal Care and Service Occupations','Entertainment Attendants and Related Workers',NULL,'Entertainment Attendants and Related Workers','','bls',NULL),(753,'2023-02-27 20:35:06.412075','39-3010','Gambling Services Workers','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Gambling Services Workers','Gambling Services Workers','','bls',NULL),(754,'2023-02-27 20:35:06.454481','39-3011','Gambling Dealers','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Gambling Services Workers','Gambling Dealers','Operate table games. Stand or sit behind table and operate games of chance by dispensing the appropriate number of cards or blocks to players, or operating other gambling equipment. Distribute winnings or collect players’ money or chips. May compare the house’s hand against players’ hands.','bls',NULL),(755,'2023-02-27 20:35:06.494452','39-3012','Gambling and Sports Book Writers and Runners','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Gambling Services Workers','Gambling and Sports Book Writers and Runners','Post information enabling patrons to wager on various races and sporting events. Assist in the operation of games such as keno and bingo. May operate random number-generating equipment and announce the numbers for patrons. Receive, verify, and record patrons’ wagers. Scan and process winning tickets presented by patrons and pay out winnings for those wagers.','bls',NULL),(756,'2023-02-27 20:35:06.539312','39-3019','Gambling Service Workers, All Other','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Gambling Services Workers','Gambling Service Workers, All Other','All gambling service workers not listed separately.','bls',NULL),(757,'2023-02-27 20:35:06.587474','39-3020','Motion Picture Projectionists','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Motion Picture Projectionists','Motion Picture Projectionists','','bls',NULL),(758,'2023-02-27 20:35:06.630086','39-3021','Motion Picture Projectionists','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Motion Picture Projectionists','Motion Picture Projectionists','Set up and operate motion picture projection and related sound reproduction equipment.','bls',NULL),(759,'2023-02-27 20:35:06.672356','39-3030','Ushers, Lobby Attendants, and Ticket Takers','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Ushers, Lobby Attendants, and Ticket Takers','Ushers, Lobby Attendants, and Ticket Takers','','bls',NULL),(760,'2023-02-27 20:35:06.715058','39-3031','Ushers, Lobby Attendants, and Ticket Takers','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Ushers, Lobby Attendants, and Ticket Takers','Ushers, Lobby Attendants, and Ticket Takers','Assist patrons at entertainment events by performing duties, such as collecting admission tickets and passes from patrons, assisting in finding seats, searching for lost articles, and helping patrons locate such facilities as restrooms and telephones.','bls',NULL),(761,'2023-02-27 20:35:06.753771','39-3090','Miscellaneous Entertainment Attendants and Related Workers','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Miscellaneous Entertainment Attendants and Related Workers','Miscellaneous Entertainment Attendants and Related Workers','','bls',NULL),(762,'2023-02-27 20:35:06.791523','39-3091','Amusement and Recreation Attendants','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Miscellaneous Entertainment Attendants and Related Workers','Amusement and Recreation Attendants','Perform a variety of attending duties at amusement or recreation facility. May schedule use of recreation facilities, maintain and provide equipment to participants of sporting events or recreational pursuits, or operate amusement concessions and rides.','bls',NULL),(763,'2023-02-27 20:35:06.834515','39-3092','Costume Attendants','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Miscellaneous Entertainment Attendants and Related Workers','Costume Attendants','Select, fit, and take care of costumes for cast members, and aid entertainers. May assist with multiple costume changes during performances.','bls',NULL),(764,'2023-02-27 20:35:06.872215','39-3093','Locker Room, Coatroom, and Dressing Room Attendants','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Miscellaneous Entertainment Attendants and Related Workers','Locker Room, Coatroom, and Dressing Room Attendants','Provide personal items to patrons or customers in locker rooms, dressing rooms, or coatrooms.','bls',NULL),(765,'2023-02-27 20:35:06.911719','39-3099','Entertainment Attendants and Related Workers, All Other','Personal Care and Service Occupations','Entertainment Attendants and Related Workers','Miscellaneous Entertainment Attendants and Related Workers','Entertainment Attendants and Related Workers, All Other','All entertainment attendants and related workers not listed separately.','bls',NULL),(766,'2023-02-27 20:35:06.954288','39-4000','Funeral Service Workers','Personal Care and Service Occupations','Funeral Service Workers',NULL,'Funeral Service Workers','','bls',NULL),(767,'2023-02-27 20:35:06.990134','39-4010','Embalmers and Crematory Operators','Personal Care and Service Occupations','Funeral Service Workers','Embalmers and Crematory Operators','Embalmers and Crematory Operators','','bls',NULL),(768,'2023-02-27 20:35:07.032146','39-4011','Embalmers','Personal Care and Service Occupations','Funeral Service Workers','Embalmers and Crematory Operators','Embalmers','Prepare bodies for interment in conformity with legal requirements.','bls',NULL),(769,'2023-02-27 20:35:07.076302','39-4012','Crematory Operators','Personal Care and Service Occupations','Funeral Service Workers','Embalmers and Crematory Operators','Crematory Operators','Operate crematory equipment to reduce human or animal remains to bone fragments in accordance with state and local regulations. Duties may include preparing the body for cremation and performing general maintenance on crematory equipment. May use traditional flame-based cremation, calcination, or alkaline hydrolysis.','bls',NULL),(770,'2023-02-27 20:35:07.119149','39-4020','Funeral Attendants','Personal Care and Service Occupations','Funeral Service Workers','Funeral Attendants','Funeral Attendants','','bls',NULL),(771,'2023-02-27 20:35:07.164564','39-4021','Funeral Attendants','Personal Care and Service Occupations','Funeral Service Workers','Funeral Attendants','Funeral Attendants','Perform a variety of tasks during funeral, such as placing casket in parlor or chapel prior to service, arranging floral offerings or lights around casket, directing or escorting mourners, closing casket, and issuing and storing funeral equipment.','bls',NULL),(772,'2023-02-27 20:35:07.207941','39-4030','Morticians, Undertakers, and Funeral Arrangers','Personal Care and Service Occupations','Funeral Service Workers','Morticians, Undertakers, and Funeral Arrangers','Morticians, Undertakers, and Funeral Arrangers','','bls',NULL),(773,'2023-02-27 20:35:07.252019','39-4031','Morticians, Undertakers, and Funeral Arrangers','Personal Care and Service Occupations','Funeral Service Workers','Morticians, Undertakers, and Funeral Arrangers','Morticians, Undertakers, and Funeral Arrangers','Perform various tasks to arrange and direct individual funeral services, such as coordinating transportation of body to mortuary, interviewing family or other authorized person to arrange details, selecting pallbearers, aiding with the selection of officials for religious rites, and providing transportation for mourners. Excludes “Funeral Home Managers” (11-9171).','bls',NULL),(774,'2023-02-27 20:35:07.295283','39-5000','Personal Appearance Workers','Personal Care and Service Occupations','Personal Appearance Workers',NULL,'Personal Appearance Workers','','bls',NULL),(775,'2023-02-27 20:35:07.337188','39-5010','Barbers, Hairdressers, Hairstylists and Cosmetologists','Personal Care and Service Occupations','Personal Appearance Workers','Barbers, Hairdressers, Hairstylists and Cosmetologists','Barbers, Hairdressers, Hairstylists and Cosmetologists','','bls',NULL),(776,'2023-02-27 20:35:07.373841','39-5011','Barbers','Personal Care and Service Occupations','Personal Appearance Workers','Barbers, Hairdressers, Hairstylists and Cosmetologists','Barbers','Provide barbering services, such as cutting, trimming, shampooing, and styling hair; trimming beards; or giving shaves.','bls',NULL),(777,'2023-02-27 20:35:07.414811','39-5012','Hairdressers, Hairstylists, and Cosmetologists','Personal Care and Service Occupations','Personal Appearance Workers','Barbers, Hairdressers, Hairstylists and Cosmetologists','Hairdressers, Hairstylists, and Cosmetologists','Provide beauty services, such as cutting, coloring, and styling hair, and massaging and treating scalp. May shampoo hair, apply makeup, dress wigs, remove hair, and provide nail and skincare services. Excludes “Makeup Artists, Theatrical and Performance” (39-5091), “Manicurists and Pedicurists” (39-5092), and “Skincare Specialists” (39-5094).','bls',NULL),(778,'2023-02-27 20:35:07.463226','39-5090','Miscellaneous Personal Appearance Workers','Personal Care and Service Occupations','Personal Appearance Workers','Miscellaneous Personal Appearance Workers','Miscellaneous Personal Appearance Workers','','bls',NULL),(779,'2023-02-27 20:35:07.505462','39-5091','Makeup Artists, Theatrical and Performance','Personal Care and Service Occupations','Personal Appearance Workers','Miscellaneous Personal Appearance Workers','Makeup Artists, Theatrical and Performance','Apply makeup to performers to reflect period, setting, and situation of their role.','bls',NULL),(780,'2023-02-27 20:35:07.543648','39-5092','Manicurists and Pedicurists','Personal Care and Service Occupations','Personal Appearance Workers','Miscellaneous Personal Appearance Workers','Manicurists and Pedicurists','Clean and shape customers’ fingernails and toenails. May polish or decorate nails.','bls',NULL),(781,'2023-02-27 20:35:07.583997','39-5093','Shampooers','Personal Care and Service Occupations','Personal Appearance Workers','Miscellaneous Personal Appearance Workers','Shampooers','Shampoo and rinse customers’ hair.','bls',NULL),(782,'2023-02-27 20:35:07.620274','39-5094','Skincare Specialists','Personal Care and Service Occupations','Personal Appearance Workers','Miscellaneous Personal Appearance Workers','Skincare Specialists','Provide skincare treatments to face and body to enhance an individual’s appearance. Includes electrologists and laser hair removal specialists.','bls',NULL),(783,'2023-02-27 20:35:07.659121','39-6000','Baggage Porters, Bellhops, and Concierges','Personal Care and Service Occupations','Baggage Porters, Bellhops, and Concierges',NULL,'Baggage Porters, Bellhops, and Concierges','','bls',NULL),(784,'2023-02-27 20:35:07.697027','39-6010','Baggage Porters, Bellhops, and Concierges','Personal Care and Service Occupations','Baggage Porters, Bellhops, and Concierges','Baggage Porters, Bellhops, and Concierges','Baggage Porters, Bellhops, and Concierges','','bls',NULL),(785,'2023-02-27 20:35:07.732840','39-6011','Baggage Porters and Bellhops','Personal Care and Service Occupations','Baggage Porters, Bellhops, and Concierges','Baggage Porters, Bellhops, and Concierges','Baggage Porters and Bellhops','Handle baggage for travelers at transportation terminals or for guests at hotels or similar establishments.','bls',NULL),(786,'2023-02-27 20:35:07.770476','39-6012','Concierges','Personal Care and Service Occupations','Baggage Porters, Bellhops, and Concierges','Baggage Porters, Bellhops, and Concierges','Concierges','Assist patrons at hotel, apartment, or office building with personal services. May take messages; arrange or give advice on transportation, business services, or entertainment; or monitor guest requests for housekeeping and maintenance.','bls',NULL),(787,'2023-02-27 20:35:07.809437','39-7000','Tour and Travel Guides','Personal Care and Service Occupations','Tour and Travel Guides',NULL,'Tour and Travel Guides','','bls',NULL),(788,'2023-02-27 20:35:07.841801','39-7010','Tour and Travel Guides','Personal Care and Service Occupations','Tour and Travel Guides','Tour and Travel Guides','Tour and Travel Guides','','bls',NULL),(789,'2023-02-27 20:35:07.879202','39-7011','Tour Guides and Escorts','Personal Care and Service Occupations','Tour and Travel Guides','Tour and Travel Guides','Tour Guides and Escorts','Escort individuals or groups on sightseeing tours or through places of interest, such as industrial establishments, public buildings, and art galleries.','bls',NULL),(790,'2023-02-27 20:35:07.922808','39-7012','Travel Guides','Personal Care and Service Occupations','Tour and Travel Guides','Tour and Travel Guides','Travel Guides','Plan, organize, and conduct long-distance travel, tours, and expeditions for individuals and groups.','bls',NULL),(791,'2023-02-27 20:35:07.962084','39-9000','Other Personal Care and Service Workers','Personal Care and Service Occupations','Other Personal Care and Service Workers',NULL,'Other Personal Care and Service Workers','','bls',NULL),(792,'2023-02-27 20:35:07.997437','39-9010','Childcare Workers','Personal Care and Service Occupations','Other Personal Care and Service Workers','Childcare Workers','Childcare Workers','','bls',NULL),(793,'2023-02-27 20:35:08.036696','39-9011','Childcare Workers','Personal Care and Service Occupations','Other Personal Care and Service Workers','Childcare Workers','Childcare Workers','Attend to children at schools, businesses, private households, and childcare institutions. Perform a variety of tasks, such as dressing, feeding, bathing, and overseeing play. Excludes “Preschool Teachers, Except Special Education” (25-2011) and “Teaching Assistants, Preschool, Elementary, Middle, and Secondary School, Except Special Education” (25-9042).','bls',NULL),(794,'2023-02-27 20:35:08.074570','39-9030','Recreation and Fitness Workers','Personal Care and Service Occupations','Other Personal Care and Service Workers','Recreation and Fitness Workers','Recreation and Fitness Workers','','bls',NULL),(795,'2023-02-27 20:35:08.111578','39-9031','Exercise Trainers and Group Fitness Instructors','Personal Care and Service Occupations','Other Personal Care and Service Workers','Recreation and Fitness Workers','Exercise Trainers and Group Fitness Instructors','Instruct or coach groups or individuals in exercise activities for the primary purpose of personal fitness. Demonstrate techniques and form, observe participants, and explain to them corrective measures necessary to improve their skills. Develop and implement individualized approaches to exercise. Excludes “Educational Instruction and Library Occupations” (25-0000), “Coaches and Scouts” (27-2022), and “Athletic Trainers” (29-9091).','bls',NULL),(796,'2023-02-27 20:35:08.157165','39-9032','Recreation Workers','Personal Care and Service Occupations','Other Personal Care and Service Workers','Recreation and Fitness Workers','Recreation Workers','Conduct recreation activities with groups in public, private, or volunteer agencies or recreation facilities. Organize and promote activities, such as arts and crafts, sports, games, music, dramatics, social recreation, camping, and hobbies, taking into account the needs and interests of individual members.','bls',NULL),(797,'2023-02-27 20:35:08.193554','39-9040','Residential Advisors','Personal Care and Service Occupations','Other Personal Care and Service Workers','Residential Advisors','Residential Advisors','','bls',NULL),(798,'2023-02-27 20:35:08.229021','39-9041','Residential Advisors','Personal Care and Service Occupations','Other Personal Care and Service Workers