ession proceedings or service disconnection, and keeping records of collection and status of accounts.','bls',NULL),(858,'2023-02-27 20:35:10.581072','43-3020','Billing and Posting Clerks','Office and Administrative Support Occupations','Financial Clerks','Billing and Posting Clerks','Billing and Posting Clerks','','bls',NULL),(859,'2023-02-27 20:35:10.619984','43-3021','Billing and Posting Clerks','Office and Administrative Support Occupations','Financial Clerks','Billing and Posting Clerks','Billing and Posting Clerks','Compile, compute, and record billing, accounting, statistical, and other numerical data for billing purposes. Prepare billing invoices for services rendered or for delivery or shipment of goods. Excludes “Medical Records Specialists” (29-2072).','bls',NULL),(860,'2023-02-27 20:35:10.660419','43-3030','Bookkeeping, Accounting, and Auditing Clerks','Office and Administrative Support Occupations','Financial Clerks','Bookkeeping, Accounting, and Auditing Clerks','Bookkeeping, Accounting, and Auditing Clerks','','bls',NULL),(861,'2023-02-27 20:35:10.698740','43-3031','Bookkeeping, Accounting, and Auditing Clerks','Office and Administrative Support Occupations','Financial Clerks','Bookkeeping, Accounting, and Auditing Clerks','Bookkeeping, Accounting, and Auditing Clerks','Compute, classify, and record numerical data to keep financial records complete. Perform any combination of routine calculating, posting, and verifying duties to obtain primary financial data for use in maintaining accounting records. May also check the accuracy of figures, calculations, and postings pertaining to business transactions recorded by other workers. Excludes “Payroll and Timekeeping Clerks” (43-3051).','bls',NULL),(862,'2023-02-27 20:35:10.739291','43-3040','Gambling Cage Workers','Office and Administrative Support Occupations','Financial Clerks','Gambling Cage Workers','Gambling Cage Workers','','bls',NULL),(863,'2023-02-27 20:35:10.787854','43-3041','Gambling Cage Worker