'Financial Clerks','Tellers','Tellers','','bls',NULL),(869,'2023-02-27 20:35:11.025014','43-3071','Tellers','Office and Administrative Support Occupations','Financial Clerks','Tellers','Tellers','Receive and pay out money. Keep records of money and negotiable instruments involved in a financial institution’s various transactions.','bls',NULL),(870,'2023-02-27 20:35:11.061700','43-3090','Miscellaneous Financial Clerks','Office and Administrative Support Occupations','Financial Clerks','Miscellaneous Financial Clerks','Miscellaneous Financial Clerks','','bls',NULL),(871,'2023-02-27 20:35:11.101413','43-3099','Financial Clerks, All Other','Office and Administrative Support Occupations','Financial Clerks','Miscellaneous Financial Clerks','Financial Clerks, All Other','All financial clerks not listed separately.','bls',NULL),(872,'2023-02-27 20:35:11.139287','43-4000','Information and Record Clerks','Office and Administrative Support Occupations','Information and Record Clerks',NULL,'Information and Record Clerks','','bls',NULL),(873,'2023-02-27 20:35:11.178555','43-4010','Brokerage Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Brokerage Clerks','Brokerage Clerks','','bls',NULL),(874,'2023-02-27 20:35:11.216492','43-4011','Brokerage Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Brokerage Clerks','Brokerage Clerks','Perform duties related to the purchase, sale, or holding of securities. Duties include writing orders for stock purchases or sales, computing transfer taxes, verifying stock transactions, accepting and delivering securities, tracking stock price fluctuations, computing equity, distributing dividends, and keeping records of daily transactions and holdings.','bls',NULL),(875,'2023-02-27 20:35:11.258399','43-4020','Correspondence Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Correspondence Clerks','Correspondence Clerks','','bls',NULL),(876,'2023-02-27 20:35:11.297633','43-4021','Correspondence Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Correspondence Clerks','Correspondence Clerks','Compose letters or electronic correspondence in reply to requests for merchandise, damage claims, credit and other information, delinquent accounts, incorrect billings, or unsatisfactory services. Duties may include gathering data to formulate reply and preparing correspondence.','bls',NULL),(877,'2023-02-27 20:35:11.336706','43-4030','Court, Municipal, and License Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Court, Municipal, and License Clerks','Court, Municipal, and License Clerks','','bls',NULL),(878,'2023-02-27 20:35:11.376505','43-4031','Court, Municipal, and License Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Court, Municipal, and License Clerks','Court, Municipal, and License Clerks','Perform clerical duties for courts of law, municipalities, or governmental licensing agencies and bureaus. May prepare docket of cases to be called; secure information for judges and court; prepare draft agendas or bylaws for town or city council; answer official correspondence; keep fiscal records and accounts; issue licenses or permits; and record data, administer tests, or collect fees. Clerks of Court are classified in “Managers, All Other” (11-9199).','bls',NULL),(879,'2023-02-27 20:35:11.416167','43-4040','Credit Authorizers, Checkers, and Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Credit Authorizers, Checkers, and Clerks','Credit Authorizers, Checkers, and Clerks','','bls',NULL),(880,'2023-02-27 20:35:11.456478','43-4041','Credit Authorizers, Checkers, and Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Credit Authorizers, Checkers, and Clerks','Credit Authorizers, Checkers, and Clerks','Authorize credit charges against customers’ accounts. Investigate history and credit standing of individuals or business establishments applying for credit. May interview applicants to obtain personal and financial data, determine credit worthiness, process applications, and notify customers of acceptance or rejection of credit.','bls',NULL),(881,'2023-02-27 20:35:11.503348','43-4050','Customer Service Representatives','Office and Administrative Support Occupations','Information and Record Clerks','Customer Service Representatives','Customer Service Representatives','','bls',NULL),(882,'2023-02-27 20:35:11.543638','43-4051','Customer Service Representatives','Office and Administrative Support Occupations','Information and Record Clerks','Customer Service Representatives','Customer Service Representatives','Interact with customers to provide basic or scripted information in response to routine inquiries about products and services. May handle and resolve general complaints. Excludes individuals whose duties are primarily installation, sales, repair, and technical support.','bls',NULL),(883,'2023-02-27 20:35:11.585460','43-4060','Eligibility Interviewers, Government Programs','Office and Administrative Support Occupations','Information and Record Clerks','Eligibility Interviewers, Government Programs','Eligibility Interviewers, Government Programs','','bls',NULL),(884,'2023-02-27 20:35:11.630013','43-4061','Eligibility Interviewers, Government Programs','Office and Administrative Support Occupations','Information and Record Clerks','Eligibility Interviewers, Government Programs','Eligibility Interviewers, Government Programs','Determine eligibility of persons applying to receive assistance from government programs and agency resources, such as welfare, unemployment benefits, social security, and public housing.','bls',NULL),(885,'2023-02-27 20:35:11.671951','43-4070','File Clerks','Office and Administrative Support Occupations','Information and Record Clerks','File Clerks','File Clerks','','bls',NULL),(886,'2023-02-27 20:35:11.710571','43-4071','File Clerks','Office and Administrative Support Occupations','Information and Record Clerks','File Clerks','File Clerks','File correspondence, cards, invoices, receipts, and other records in alphabetical or numerical order or according to the filing system used. Locate and remove material from file when requested.','bls',NULL),(887,'2023-02-27 20:35:11.752486','43-4080','Hotel, Motel, and Resort Desk Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Hotel, Motel, and Resort Desk Clerks','Hotel, Motel, and Resort Desk Clerks','','bls',NULL),(888,'2023-02-27 20:35:11.792080','43-4081','Hotel, Motel, and Resort Desk Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Hotel, Motel, and Resort Desk Clerks','Hotel, Motel, and Resort Desk Clerks','Accommodate hotel, motel, and resort patrons by registering and assigning rooms to guests, issuing room keys or cards, transmitting and receiving messages, keeping records of occupied rooms and guests’ accounts, making and confirming reservations, and presenting statements to and collecting payments from departing guests.','bls',NULL),(889,'2023-02-27 20:35:11.831707','43-4110','Interviewers, Except Eligibility and Loan','Office and Administrative Support Occupations','Information and Record Clerks','Interviewers, Except Eligibility and Loan','Interviewers, Except Eligibility and Loan','','bls',NULL),(890,'2023-02-27 20:35:11.873558','43-4111','Interviewers, Except Eligibility and Loan','Office and Administrative Support Occupations','Information and Record Clerks','Interviewers, Except Eligibility and Loan','Interviewers, Except Eligibility and Loan','Interview persons by telephone, mail, in person, or by other means for the purpose of completing forms, applications, or questionnaires. Ask specific questions, record answers, and assist persons with completing form. May sort, classify, and file forms.','bls',NULL),(891,'2023-02-27 20:35:11.910754','43-4120','Library Assistants, Clerical','Office and Administrative Support Occupations','Information and Record Clerks','Library Assistants, Clerical','Library Assistants, Clerical','','bls',NULL),(892,'2023-02-27 20:35:11.951800','43-4121','Library Assistants, Clerical','Office and Administrative Support Occupations','Information and Record Clerks','Library Assistants, Clerical','Library Assistants, Clerical','Compile records, and sort, shelve, issue, and receive library materials such as books, electronic media, pictures, cards, slides and microfilm. Locate library materials for loan and replace material in shelving area, stacks, or files according to identification number and title. Register patrons to permit them to borrow books, periodicals, and other library materials. Excludes “Library Technicians” (25-4031).','bls',NULL),(893,'2023-02-27 20:35:11.996540','43-4130','Loan Interviewers and Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Loan Interviewers and Clerks','Loan Interviewers and Clerks','','bls',NULL),(894,'2023-02-27 20:35:12.036873','43-4131','Loan Interviewers and Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Loan Interviewers and Clerks','Loan Interviewers and Clerks','Interview loan applicants to elicit information; investigate applicants’ backgrounds and verify references; prepare loan request papers; and forward findings, reports, and documents to appraisal department. Review loan papers to ensure completeness, and complete transactions between loan establishment, borrowers, and sellers upon approval of loan.','bls',NULL),(895,'2023-02-27 20:35:12.076801','43-4140','New Accounts Clerks','Office and Administrative Support Occupations','Information and Record Clerks','New Accounts Clerks','New Accounts Clerks','','bls',NULL),(896,'2023-02-27 20:35:12.117802','43-4141','New Accounts Clerks','Office and Administrative Support Occupations','Information and Record Clerks','New Accounts Clerks','New Accounts Clerks','Interview persons desiring to open accounts in financial institutions. Explain account services available to prospective customers and assist them in preparing applications.','bls',NULL),(897,'2023-02-27 20:35:12.161403','43-4150','Order Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Order Clerks','Order Clerks','','bls',NULL),(898,'2023-02-27 20:35:12.198240','43-4151','Order Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Order Clerks','Order Clerks','Receive and process incoming orders for materials, merchandise, classified ads, or services such as repairs, installations, or rental of facilities. Generally receives orders via mail, phone, fax, or other electronic means. Duties include informing customers of receipt, prices, shipping dates, and delays; preparing contracts; and handling complaints. Excludes “Dispatchers, Except Police, Fire, and Ambulance” (43-5032) who both dispatch and take orders for services.','bls',NULL),(899,'2023-02-27 20:35:12.240340','43-4160','Human Resources Assistants, Except Payroll and Timekeeping','Office and Administrative Support Occupations','Information and Record Clerks','Human Resources Assistants, Except Payroll and Timekeeping','Human Resources Assistants, Except Payroll and Timekeeping','','bls',NULL),(900,'2023-02-27 20:35:12.276434','43-4161','Human Resources Assistants, Except Payroll and Timekeeping','Office and Administrative Support Occupations','Information and Record Clerks','Human Resources Assistants, Except Payroll and Timekeeping','Human Resources Assistants, Except Payroll and Timekeeping','Compile and keep personnel records. Record data for each employee, such as address, weekly earnings, absences, amount of sales or production, supervisory reports, and date of and reason for termination. May prepare reports for employment records, file employment records, or search employee files and furnish information to authorized persons.','bls',NULL),(901,'2023-02-27 20:35:12.313973','43-4170','Receptionists and Information Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Receptionists and Information Clerks','Receptionists and Information Clerks','','bls',NULL),(902,'2023-02-27 20:35:12.354603','43-4171','Receptionists and Information Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Receptionists and Information Clerks','Receptionists and Information Clerks','Answer inquiries and provide information to the general public, customers, visitors, and other interested parties regarding activities conducted at establishment and location of departments, offices, and employees within the organization. Excludes “Switchboard Operators, Including Answering Service” (43-2011).','bls',NULL),(903,'2023-02-27 20:35:12.391695','43-4180','Reservation and Transportation Ticket Agents and Travel Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Reservation and Transportation Ticket Agents and Travel Clerks','Reservation and Transportation Ticket Agents and Travel Clerks','','bls',NULL),(904,'2023-02-27 20:35:12.429626','43-4181','Reservation and Transportation Ticket Agents and Travel Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Reservation and Transportation Ticket Agents and Travel Clerks','Reservation and Transportation Ticket Agents and Travel Clerks','Make and confirm reservations for transportation or lodging, or sell transportation tickets. May check baggage and direct passengers to designated concourse, pier, or track; deliver tickets and contact individuals and groups to inform them of package tours; or provide tourists with travel or transportation information. Excludes \"Cashiers” (41-2011), \"Travel Agents” (41-3041), and \"Hotel, Motel, and Resort Desk Clerks” (43-4081) who sell tickets for local transportation.','bls',NULL),(905,'2023-02-27 20:35:12.476058','43-4190','Miscellaneous Information and Record Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Miscellaneous Information and Record Clerks','Miscellaneous Information and Record Clerks','','bls',NULL),(906,'2023-02-27 20:35:12.511621','43-4199','Information and Record Clerks, All Other','Office and Administrative Support Occupations','Information and Record Clerks','Miscellaneous Information and Record Clerks','Information and Record Clerks, All Other','All information and record clerks not listed separately.','bls',NULL),(907,'2023-02-27 20:35:12.550652','43-5000','Material Recording, Scheduling, Dispatching, and Distributing Workers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers',NULL,'Material Recording, Scheduling, Dispatching, and Distributing Workers','','bls',NULL),(908,'2023-02-27 20:35:12.590890','43-5010','Cargo and Freight Agents','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Cargo and Freight Agents','Cargo and Freight Agents','','bls',NULL),(909,'2023-02-27 20:35:12.627218','43-5011','Cargo and Freight Agents','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Cargo and Freight Agents','Cargo and Freight Agents','Expedite and route movement of incoming and outgoing cargo and freight shipments in airline, train, and trucking terminals and shipping docks. Take orders from customers and arrange pickup of freight and cargo for delivery to loading platform. Prepare and examine bills of lading to determine shipping charges and tariffs.','bls',NULL),(910,'2023-02-27 20:35:12.665943','43-5020','Couriers and Messengers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Couriers and Messengers','Couriers and Messengers','','bls',NULL),(911,'2023-02-27 20:35:12.708787','43-5021','Couriers and Messengers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Couriers and Messengers','Couriers and Messengers','Pick up and deliver messages, documents, packages, and other items between offices or departments within an establishment or directly to other business concerns, traveling by foot, bicycle, motorcycle, automobile, or public conveyance. Excludes “Light Truck Drivers” (53-3033).','bls',NULL),(912,'2023-02-27 20:35:12.746344','43-5030','Dispatchers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Dispatchers','Dispatchers','','bls',NULL),(913,'2023-02-27 20:35:12.784475','43-5031','Public Safety Telecommunicators','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Dispatchers','Public Safety Telecommunicators','Operate telephone, radio, or other communication systems to receive and communicate requests for emergency assistance at 9-1-1 public safety answering points and emergency operations centers. Take information from the public and other sources regarding crimes, threats, disturbances, acts of terrorism, fires, medical emergencies, and other public safety matters. May coordinate and provide information to law enforcement and emergency response personnel. May access sensitive databases and other information sources as needed. May provide additional instructions to callers based on knowledge of and certification in law enforcement, fire, or emergency medical procedures.','bls',NULL),(914,'2023-02-27 20:35:12.829992','43-5032','Dispatchers, Except Police, Fire, and Ambulance','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Dispatchers','Dispatchers, Except Police, Fire, and Ambulance','Schedule and dispatch workers, work crews, equipment, or service vehicles for conveyance of materials, freight, or passengers, or for normal installation, service, or emergency repairs rendered outside the place of business. Duties may include using radio, telephone, or computer to transmit assignments and compiling statistics and reports on work progress.','bls',NULL),(915,'2023-02-27 20:35:12.866025','43-5040','Meter Readers, Utilities','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Meter Readers, Utilities','Meter Readers, Utilities','','bls',NULL),(916,'2023-02-27 20:35:12.914334','43-5041','Meter Readers, Utilities','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Meter Readers, Utilities','Meter Readers, Utilities','Read meter and record consumption of electricity, gas, water, or steam.','bls',NULL),(917,'2023-02-27 20:35:12.953691','43-5050','Postal Service Workers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Workers','','bls',NULL),(918,'2023-02-27 20:35:12.991324','43-5051','Postal Service Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Clerks','Perform any combination of tasks in a United States Postal Service (USPS) post office, such as receive letters and parcels; sell postage and revenue stamps, postal cards, and stamped envelopes; fill out and sell money orders; place mail in pigeon holes of mail rack or in bags; and examine mail for correct postage. Includes postal service clerks employed by USPS contractors.','bls',NULL),(919,'2023-02-27 20:35:13.032662','43-5052','Postal Service Mail Carriers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Mail Carriers','Sort and deliver mail for the United States Postal Service (USPS). Deliver mail on established route by vehicle or on foot. Includes postal service mail carriers employed by USPS contractors.','bls',NULL),(920,'2023-02-27 20:35:13.072944','43-5053','Postal Service Mail Sorters, Processors, and Processing Machine Operators','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Mail Sorters, Processors, and Processing Machine Operators','Prepare incoming and outgoing mail for distribution for the United States Postal Service (USPS). Examine, sort, and route mail. Load, operate, and occasionally adjust and repair mail processing, sorting, and canceling machinery. Keep records of shipments, pouches, and sacks, and perform other duties related to mail handling within the postal service. Includes postal service mail sorters and processors employed by USPS contractors. Excludes “Postal Service Clerks” (43-5051) and “Postal Service Mail Carriers” (43-5052).','bls',NULL),(921,'2023-02-27 20:35:13.113007','43-5060','Production, Planning, and Expediting Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Production, Planning, and Expediting Clerks','Production, Planning, and Expediting Clerks','','bls',NULL),(922,'2023-02-27 20:35:13.149852','43-5061','Production, Planning, and Expediting Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Production, Planning, and Expediting Clerks','Production, Planning, and Expediting Clerks','Coordinate and expedite the flow of work and materials within or between departments of an establishment according to production schedule. Duties include reviewing and distributing production, work, and shipment schedules; conferring with department supervisors to determine progress of work and completion dates; and compiling reports on progress of work, inventory levels, costs, and production problems. Excludes “Project Management Specialists” (13-1082) and “Weighers, Measurers, Checkers, and Samplers, Recordkeeping” (43-5111).','bls',NULL),(923,'2023-02-27 20:35:13.193002','43-5070','Shipping, Receiving, and Inventory Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Shipping, Receiving, and Inventory Clerks','Shipping, Receiving, and Inventory Clerks','','bls',NULL),(924,'2023-02-27 20:35:13.232601','43-5071','Shipping, Receiving, and Inventory Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Shipping, Receiving, and Inventory Clerks','Shipping, Receiving, and Inventory Clerks','Verify and maintain records on incoming and outgoing shipments involving inventory. Duties include verifying and recording incoming merchandise or material and arranging for the transportation of products. May prepare items for shipment. Excludes “Weighers, Measurers, Checkers, and Samplers, Recordkeeping” (43-5111), “Mail Clerks and Mail Machine Operators, except Postal Service” (43-9051), and “Stockers and Order Fillers” (53-7065).','bls',NULL),(925,'2023-02-27 20:35:13.268195','43-5110','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','','bls',NULL),(926,'2023-02-27 20:35:13.304417','43-5111','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Weigh, measure, and check materials, supplies, and equipment for the purpose of keeping relevant records. Duties are primarily clerical by nature. Includes workers who collect and keep record of samples of products or materials. Excludes “Inspectors, Testers, Sorters, Samplers, and Weighers” (51-9061).','bls',NULL),(927,'2023-02-27 20:35:13.343851','43-6000','Secretaries and Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants',NULL,'Secretaries and Administrative Assistants','','bls',NULL),(928,'2023-02-27 20:35:13.382151','43-6010','Secretaries and Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','','bls',NULL),(929,'2023-02-27 20:35:13.419071','43-6011','Executive Secretaries and Executive Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Executive Secretaries and Executive Administrative Assistants','Provide high-level administrative support by conducting research, preparing statistical reports, and handling information requests, as well as performing routine administrative functions such as preparing correspondence, receiving visitors, arranging conference calls, and scheduling meetings. May also train and supervise lower-level clerical staff. Excludes “Secretaries” (43-6012 through 43-6014).','bls',NULL),(930,'2023-02-27 20:35:13.460204','43-6012','Legal Secretaries and Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Legal Secretaries and Administrative Assistants','Perform secretarial duties using legal terminology, procedures, and documents. Prepare legal papers and correspondence, such as summonses, complaints, motions, and subpoenas. May also assist with legal research.','bls',NULL),(931,'2023-02-27 20:35:13.500351','43-6013','Medical Secretaries and Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Medical Secretaries and Administrative Assistants','Perform secretarial duties using specific knowledge of medical terminology and hospital, clinic, or laboratory procedures. Duties may include scheduling appointments, billing patients, and compiling and recording medical charts, reports, and correspondence.','bls',NULL),(932,'2023-02-27 20:35:13.540225','43-6014','Secretaries and Administrative Assistants, Except Legal, Medical, and Executive','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants, Except Legal, Medical, and Executive','Perform routine administrative functions such as drafting correspondence, scheduling appointments, organizing and maintaining paper and electronic files, or providing information to callers. Excludes legal, medical, and executive secretaries (43-6011 through 43-6013).','bls',NULL),(933,'2023-02-27 20:35:13.578457','43-9000','Other Office and Administrative Support Workers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers',NULL,'Other Office and Administrative Support Workers','','bls',NULL),(934,'2023-02-27 20:35:13.614951','43-9020','Data Entry and Information Processing Workers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Data Entry and Information Processing Workers','Data Entry and Information Processing Workers','','bls',NULL),(935,'2023-02-27 20:35:13.655934','43-9021','Data Entry Keyers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Data Entry and Information Processing Workers','Data Entry Keyers','Operate data entry device, such as keyboard or photo composing perforator. Duties may include verifying data and preparing materials for printing. Excludes “Word Processors and Typists” (43-9022).','bls',NULL),(936,'2023-02-27 20:35:13.703433','43-9022','Word Processors and Typists','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Data Entry and Information Processing Workers','Word Processors and Typists','Use word processor, computer, or typewriter to type letters, reports, forms, or other material from rough draft, corrected copy, or voice recording. May perform other clerical duties as assigned. Excludes “Court Reporters and Simultaneous Captioners” (27-3092), “Medical Transcriptionists” (31-9094), “Secretaries and Administrative Assistants” (43-6010), and “Data Entry Keyers” (43-9021).','bls',NULL),(937,'2023-02-27 20:35:13.740187','43-9030','Desktop Publishers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Desktop Publishers','Desktop Publishers','','bls',NULL),(938,'2023-02-27 20:35:13.776635','43-9031','Desktop Publishers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Desktop Publishers','Desktop Publishers','Format typescript and graphic elements using computer software to produce publication-ready material.','bls',NULL),(939,'2023-02-27 20:35:13.814528','43-9040','Insurance Claims and Policy Processing Clerks','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Insurance Claims and Policy Processing Clerks','Insurance Claims and Policy Processing Clerks','','bls',NULL),(940,'2023-02-27 20:35:13.854254','43-9041','Insurance Claims and Policy Processing Clerks','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Insurance Claims and Policy Processing Clerks','Insurance Claims and Policy Processing Clerks','Process new insurance policies, modifications to existing policies, and claims forms. Obtain information from policyholders to verify the accuracy and completeness of information on claims forms, applications and related documents, and company records. Update existing policies and company records to reflect changes requested by policyholders and insurance company representatives. Excludes “Claims Adjusters, Examiners, and Investigators” (13-1031).','bls',NULL),(941,'2023-02-27 20:35:13.897978','43-9050','Mail Clerks and Mail Machine Operators, Except Postal Service','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Mail Clerks and Mail Machine Operators, Except Postal Service','Mail Clerks and Mail Machine Operators, Except Postal Service','','bls',NULL),(942,'2023-02-27 20:35:13.941404','43-9051','Mail Clerks and Mail Machine Operators, Except Postal Service','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Mail Clerks and Mail Machine Operators, Except Postal Service','Mail Clerks and Mail Machine Operators, Except Postal Service','Prepare incoming and outgoing mail for distribution. Time-stamp, open, read, sort, and route incoming mail; and address, seal, stamp, fold, stuff, and affix postage to outgoing mail or packages. Duties may also include keeping necessary records and completed forms.','bls',NULL),(943,'2023-02-27 20:35:13.985092','43-9060','Office Clerks, General','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Office Clerks, General','Office Clerks, General','','bls',NULL),(944,'2023-02-27 20:35:14.025782','43-9061','Office Clerks, General','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Office Clerks, General','Office Clerks, General','Perform duties too varied and diverse to be classified in any specific office clerical occupation, requiring knowledge of office systems and procedures. Clerical duties may be assigned in accordance with the office procedures of individual establishments and may include a combination of answering telephones, bookkeeping, typing or word processing, office machine operation, and filing.','bls',NULL),(945,'2023-02-27 20:35:14.065845','43-9070','Office Machine Operators, Except Computer','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Office Machine Operators, Except Computer','Office Machine Operators, Except Computer','','bls',NULL),(946,'2023-02-27 20:35:14.108875','43-9071','Office Machine Operators, Except Computer','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Office Machine Operators, Except Computer','Office Machine Operators, Except Computer','Operate one or more of a variety of office machines, such as photocopying, photographic, and duplicating machines, or other office machines. Excludes “Billing and Posting Clerks” (43-3021) and “Mail Clerks and Mail Machine Operators, Except Postal Service” (43-9051).','bls',NULL),(947,'2023-02-27 20:35:14.154773','43-9080','Proofreaders and Copy Markers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Proofreaders and Copy Markers','Proofreaders and Copy Markers','','bls',NULL),(948,'2023-02-27 20:35:14.194901','43-9081','Proofreaders and Copy Markers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Proofreaders and Copy Markers','Proofreaders and Copy Markers','Read transcript or proof type setup to detect and mark for correction any grammatical, typographical, or compositional errors. Excludes workers whose primary duty is editing copy. Includes proofreaders of braille.','bls',NULL),(949,'2023-02-27 20:35:14.235635','43-9110','Statistical Assistants','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Statistical Assistants','Statistical Assistants','','bls',NULL),(950,'2023-02-27 20:35:14.271555','43-9111','Statistical Assistants','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Statistical Assistants','Statistical Assistants','Compile and compute data according to statistical formulas for use in statistical studies. May perform actuarial computations and compile charts and graphs for use by actuaries. Includes actuarial clerks.','bls',NULL),(951,'2023-02-27 20:35:14.312810','43-9190','Miscellaneous Office and Administrative Support Workers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Miscellaneous Office and Administrative Support Workers','Miscellaneous Office and Administrative Support Workers','','bls',NULL),(952,'2023-02-27 20:35:14.350809','43-9199','Office and Administrative Support Workers, All Other','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Miscellaneous Office and Administrative Support Workers','Office and Administrative Support Workers, All Other','All office and administrative support workers not listed separately.','bls',NULL),(953,'2023-02-27 20:35:14.402557','45-0000','Farming, Fishing, and Forestry Occupations','Farming, Fishing, and Forestry Occupations',NULL,NULL,'Farming, Fishing, and Forestry Occupations','','bls',NULL),(954,'2023-02-27 20:35:14.441515','45-1000','Supervisors of Farming, Fishing, and Forestry Workers','Farming, Fishing, and Forestry Occupations','Supervisors of Farming, Fishing, and Forestry Workers',NULL,'Supervisors of Farming, Fishing, and Forestry Workers','','bls',NULL),(955,'2023-02-27 20:35:14.480759','45-1010','First-Line Supervisors of Farming, Fishing, and Forestry Workers','Farming, Fishing, and Forestry Occupations','Supervisors of Farming, Fishing, and Forestry Workers','First-Line Supervisors of Farming, Fishing, and Forestry Workers','First-Line Supervisors of Farming, Fishing, and Forestry Workers','','bls',NULL),(956,'2023-02-27 20:35:14.519294','45-1011','First-Line Supervisors of Farming, Fishing, and Forestry Workers','Farming, Fishing, and Forestry Occupations','Supervisors of Farming, Fishing, and Forestry Workers','First-Line Supervisors of Farming, Fishing, and Forestry Workers','First-Line Supervisors of Farming, Fishing, and Forestry Workers','Directly supervise and coordinate the activities of agricultural, forestry, aquacultural, and related workers. Excludes “First-Line Supervisors of Landscaping, Lawn Service, and Groundskeeping Workers” (37-1012).','bls',NULL),(957,'2023-02-27 20:35:14.567450','45-2000','Agricultural Workers','Farming, Fishing, and Forestry Occupations','Agricultural Workers',NULL,'Agricultural Workers','','bls',NULL),(958,'2023-02-27 20:35:14.604420','45-2010','Agricultural Inspectors','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Agricultural Inspectors','Agricultural Inspectors','','bls',NULL),(959,'2023-02-27 20:35:14.645402','45-2011','Agricultural Inspectors','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Agricultural Inspectors','Agricultural Inspectors','Inspect agricultural commodities, processing equipment, and facilities, and fish and logging operations, to ensure compliance with regulations and laws governing health, quality, and safety.','bls',NULL),(960,'2023-02-27 20:35:14.688817','45-2020','Animal Breeders','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Animal Breeders','Animal Breeders','','bls',NULL),(961,'2023-02-27 20:35:14.731289','45-2021','Animal Breeders','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Animal Breeders','Animal Breeders','Select and breed animals according to their genealogy, characteristics, and offspring. May require knowledge of artificial insemination techniques and equipment use. May involve keeping records on heats, birth intervals, or pedigree. Excludes “Animal Scientists” (19-1011) whose primary function is research and “Animal Caretakers” (39-2021) who may occasionally breed animals as part of their other caretaking duties.','bls',NULL),(962,'2023-02-27 20:35:14.782790','45-2040','Graders and Sorters, Agricultural Products','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Graders and Sorters, Agricultural Products','Graders and Sorters, Agricultural Products','','bls',NULL),(963,'2023-02-27 20:35:14.819359','45-2041','Graders and Sorters, Agricultural Products','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Graders and Sorters, Agricultural Products','Graders and Sorters, Agricultural Products','Grade, sort, or classify unprocessed food and other agricultural products by size, weight, color, or condition. Excludes “Agricultural Inspectors” (45-2011).','bls',NULL),(964,'2023-02-27 20:35:14.859040','45-2090','Miscellaneous Agricultural Workers','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Miscellaneous Agricultural Workers','','bls',NULL),(965,'2023-02-27 20:35:14.904611','45-2091','Agricultural Equipment Operators','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Agricultural Equipment Operators','Drive and control equipment to support agricultural activities such as tilling soil; planting, cultivating, and harvesting crops; feeding and herding livestock; or removing animal waste. May perform tasks such as crop baling or hay bucking. May operate stationary equipment to perform post-harvest tasks such as husking, shelling, threshing, and ginning.','bls',NULL),(966,'2023-02-27 20:35:14.950457','45-2092','Farmworkers and Laborers, Crop, Nursery, and Greenhouse','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Farmworkers and Laborers, Crop, Nursery, and Greenhouse','Manually plant, cultivate, and harvest vegetables, fruits, nuts, horticultural specialties, and field crops. Use hand tools, such as shovels, trowels, hoes, tampers, pruning hooks, shears, and knives. Duties may include tilling soil and applying fertilizers; transplanting, weeding, thinning, or pruning crops; applying pesticides; or cleaning, grading, sorting, packing, and loading harvested products. May construct trellises, repair fences and farm buildings, or participate in irrigation activities. Excludes “Pesticide Handlers, Sprayers, and Applicators, Vegetation” (37-3012), “Graders and Sorters, Agricultural Products” (45-2041), and “Forest, Conservation, and Logging Workers” (45-4011 through 45-4029).','bls',NULL),(967,'2023-02-27 20:35:14.991068','45-2093','Farmworkers, Farm, Ranch, and Aquacultural Animals','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Farmworkers, Farm, Ranch, and Aquacultural Animals','Attend to live farm, ranch, open range or aquacultural animals that may include cattle, sheep, swine, goats, horses and other equines, poultry, rabbits, finfish, shellfish, and bees. Attend to animals produced for animal products, such as meat, fur, skins, feathers, eggs, milk, and honey. Duties may include feeding, watering, herding, grazing, milking, castrating, branding, de-beaking, weighing, catching, and loading animals. May maintain records on animals; examine animals to detect diseases and injuries; assist in birth deliveries; and administer medications, vaccinations, or insecticides as appropriate. May clean and maintain animal housing areas. Includes workers who shear wool from sheep and collect eggs in hatcheries.','bls',NULL),(968,'2023-02-27 20:35:15.040062','45-2099','Agricultural Workers, All Other','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Agricultural Workers, All Other','All agricultural workers not listed separately.','bls',NULL),(969,'2023-02-27 20:35:15.095031','45-3000','Fishing and Hunting Workers','Farming, Fishing, and Forestry Occupations','Fishing and Hunting Workers',NULL,'Fishing and Hunting Workers','','bls',NULL),(970,'2023-02-27 20:35:15.131760','45-3030','Fishing and Hunting Workers','Farming, Fishing, and Forestry Occupations','Fishing and Hunting Workers','Fishing and Hunting Workers','Fishing and Hunting Workers','','bls',NULL),(971,'2023-02-27 20:35:15.170348','45-3031','Fishing and Hunting Workers','Farming, Fishing, and Forestry Occupations','Fishing and Hunting Workers','Fishing and Hunting Workers','Fishing and Hunting Workers','Hunt, trap, catch, or gather wild animals or aquatic animals and plants. May use nets, traps, or other equipment. May haul catch onto ship or other vessel. Aquacultural laborers who work on fish farms are included in “Farmworkers, Farm, Ranch, and Aquacultural Animals” (45-2093).','bls',NULL),(972,'2023-02-27 20:35:15.212826','45-4000','Forest, Conservation, and Logging Workers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers',NULL,'Forest, Conservation, and Logging Workers','','bls',NULL),(973,'2023-02-27 20:35:15.248966','45-4010','Forest and Conservation Workers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Forest and Conservation Workers','Forest and Conservation Workers','','bls',NULL),(974,'2023-02-27 20:35:15.283777','45-4011','Forest and Conservation Workers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Forest and Conservation Workers','Forest and Conservation Workers','Under supervision, perform manual labor necessary to develop, maintain, or protect areas such as forests, forested areas, woodlands, wetlands, and rangelands through such activities as raising and transporting seedlings; combating insects, pests, and diseases harmful to plant life; and building structures to control water, erosion, and leaching of soil. Includes forester aides, seedling pullers, tree planters, and gatherers of nontimber forestry products such as pine straw.','bls',NULL),(975,'2023-02-27 20:35:15.327698','45-4020','Logging Workers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Logging Workers','','bls',NULL),(976,'2023-02-27 20:35:15.366859','45-4021','Fallers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Fallers','Use axes or chainsaws to fell trees using knowledge of tree characteristics and cutting techniques to control direction of fall and minimize tree damage.','bls',NULL),(977,'2023-02-27 20:35:15.406326','45-4022','Logging Equipment Operators','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Logging Equipment Operators','Drive logging tractor or wheeled vehicle equipped with one or more accessories, such as bulldozer blade, frontal shear, grapple, logging arch, cable winches, hoisting rack, or crane boom, to fell tree; to skid, load, unload, or stack logs; or to pull stumps or clear brush. Includes operating stand-alone logging machines, such as log chippers. Logging truck drivers are included in “Heavy and Tractor-Trailer Truck Drivers” (53-3032).','bls',NULL),(978,'2023-02-27 20:35:15.458146','45-4023','Log Graders and Scalers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Log Graders and Scalers','Grade logs or estimate the marketable content or value of logs or pulpwood in sorting yards, millpond, log deck, or similar locations. Inspect logs for defects or measure logs to determine volume. Excludes “Buyers and Purchasing Agents, Farm Products” (13-1021).','bls',NULL),(979,'2023-02-27 20:35:15.493546','45-4029','Logging Workers, All Other','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Logging Workers, All Other','All logging workers not listed separately.','bls',NULL),(980,'2023-02-27 20:35:15.528382','47-0000','Construction and Extraction Occupations','Construction and Extraction Occupations',NULL,NULL,'Construction and Extraction Occupations','','bls',NULL),(981,'2023-02-27 20:35:15.570629','47-1000','Supervisors of Construction and Extraction Workers','Construction and Extraction Occupations','Supervisors of Construction and Extraction Workers',NULL,'Supervisors of Construction and Extraction Workers','','bls',NULL),(982,'2023-02-27 20:35:15.610346','47-1010','First-Line Supervisors of Construction Trades and Extraction Workers','Construction and Extraction Occupations','Supervisors of Construction and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','','bls',NULL),(983,'2023-02-27 20:35:15.657050','47-1011','First-Line Supervisors of Construction Trades and Extraction Workers','Construction and Extraction Occupations','Supervisors of Construction and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','Directly supervise and coordinate activities of construction or extraction workers.','bls',NULL),(984,'2023-02-27 20:35:15.699050','47-2000','Construction Trades Workers','Construction and Extraction Occupations','Construction Trades Workers',NULL,'Construction Trades Workers','','bls',NULL),(985,'2023-02-27 20:35:15.730754','47-2010','Boilermakers','Construction and Extraction Occupations','Construction Trades Workers','Boilermakers','Boilermakers','','bls',NULL),(986,'2023-02-27 20:35:15.767026','47-2011','Boilermakers','Construction and Extraction Occupations','Construction Trades Workers','Boilermakers','Boilermakers','Construct, assemble, maintain, and repair stationary steam boilers and boiler house auxiliaries. Align structures or plate sections to assemble boiler frame tanks or vats, following blueprints. Work involves use of hand and power tools, plumb bobs, levels, wedges, dogs, or turnbuckles. Assist in testing assembled vessels. Direct cleaning of boilers and boiler furnaces. Inspect and repair boiler fittings, such as safety valves, regulators, automatic-control mechanisms, water columns, and auxiliary machines.','bls',NULL),(987,'2023-02-27 20:35:15.807333','47-2020','Brickmasons, Blockmasons, and Stonemasons','Construction and Extraction Occupations','Construction Trades Workers','Brickmasons, Blockmasons, and Stonemasons','Brickmasons, Blockmasons, and Stonemasons','','bls',NULL),(988,'2023-02-27 20:35:15.845588','47-2021','Brickmasons and Blockmasons','Construction and Extraction Occupations','Construction Trades Workers','Brickmasons, Blockmasons, and Stonemasons','Brickmasons and Blockmasons','Lay and bind building materials, such as brick, structural tile, concrete block, cinder block, glass block, and terra-cotta block, with mortar and other substances, to construct or repair walls, partitions, arches, sewers, and other structures. Installers of mortarless segmental concrete masonry wall units are classified in “Landscaping and Groundskeeping Workers” (37-3011). Excludes “Stonemasons” (47-2022).','bls',NULL),(989,'2023-02-27 20:35:15.893718','47-2022','Stonemasons','Construction and Extraction Occupations','Construction Trades Workers','Brickmasons, Blockmasons, and Stonemasons','Stonemasons','Build stone structures, such as piers, walls, and abutments. Lay walks, curbstones, or special types of masonry for vats, tanks, and floors.','bls',NULL),(990,'2023-02-27 20:35:15.939922','47-2030','Carpenters','Construction and Extraction Occupations','Construction Trades Workers','Carpenters','Carpenters','','bls',NULL),(991,'2023-02-27 20:35:15.981016','47-2031','Carpenters','Construction and Extraction Occupations','Construction Trades Workers','Carpenters','Carpenters','Construct, erect, install, or repair structures and fixtures made of wood and comparable materials, such as concrete forms; building frameworks, including partitions, joists, studding, and rafters; and wood stairways, window and door frames, and hardwood floors. May also install cabinets, siding, drywall, and batt or roll insulation. Includes brattice builders who build doors or brattices (ventilation walls or partitions) in underground passageways.','bls',NULL),(992,'2023-02-27 20:35:16.025871','47-2040','Carpet, Floor, and Tile Installers and Finishers','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Carpet, Floor, and Tile Installers and Finishers','','bls',NULL),(993,'2023-02-27 20:35:16.071278','47-2041','Carpet Installers','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Carpet Installers','Lay and install carpet from rolls or blocks on floors. Install padding and trim flooring materials. Excludes “Floor Layers, Except Carpet, Wood, and Hard Tiles” (47-2042).','bls',NULL),(994,'2023-02-27 20:35:16.119262','47-2042','Floor Layers, Except Carpet, Wood, and Hard Tiles','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Floor Layers, Except Carpet, Wood, and Hard Tiles','Apply blocks, strips, or sheets of shock-absorbing, sound-deadening, or decorative coverings to floors.','bls',NULL),(995,'2023-02-27 20:35:16.162047','47-2043','Floor Sanders and Finishers','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Floor Sanders and Finishers','Scrape and sand wooden floors to smooth surfaces using floor scraper and floor sanding machine, and apply coats of finish.','bls',NULL),(996,'2023-02-27 20:35:16.203593','47-2044','Tile and Stone Setters','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Tile and Stone Setters','Apply hard tile, stone, and comparable materials to walls, floors, ceilings, countertops, and roof decks.','bls',NULL),(997,'2023-02-27 20:35:16.240781','47-2050','Cement Masons, Concrete Finishers, and Terrazzo Workers','Construction and Extraction Occupations','Construction Trades Workers','Cement Masons, Concrete Finishers, and Terrazzo Workers','Cement Masons, Concrete Finishers, and Terrazzo Workers','','bls',NULL),(998,'2023-02-27 20:35:16.280420','47-2051','Cement Masons and Concrete Finishers','Construction and Extraction Occupations','Construction Trades Workers','Cement Masons, Concrete Finishers, and Terrazzo Workers','Cement Masons and Concrete Finishers','Smooth and finish surfaces of poured concrete, such as floors, walks, sidewalks, roads, or curbs using a variety of hand and power tools. Align forms for sidewalks, curbs, or gutters; patch voids; and use saws to cut expansion joints. Installers of mortarless segmental concrete masonry wall units are classified in “Landscaping and Groundskeeping Workers” (37-3011).','bls',NULL),(999,'2023-02-27 20:35:16.322188','47-2053','Terrazzo Workers and Finishers','Construction and Extraction Occupations','Construction Trades Workers','Cement Masons, Concrete Finishers, and Terrazzo Workers','Terrazzo Workers and Finishers','Apply a mixture of cement, sand, pigment, or marble chips to floors, stairways, and cabinet fixtures to fashion durable and decorative surfaces.','bls',NULL),(1000,'2023-02-27 20:35:16.363363','47-2060','Construction Laborers','Construction and Extraction Occupations','Construction Trades Workers','Construction Laborers','Construction Laborers','','bls',NULL),(1001,'2023-02-27 20:35:16.403028','47-2061','Construction Laborers','Construction and Extraction Occupations','Construction Trades Workers','Construction Laborers','Construction Laborers','Perform tasks involving physical labor at construction sites. May operate hand and power tools of all types: air hammers, earth tampers, cement mixers, small mechanical hoists, surveying and measuring equipment, and a variety of other equipment and instruments. May clean and prepare sites, dig trenches, set braces to support the sides of excavations, erect scaffolding, and clean up rubble, debris, and other waste materials. May assist other craft workers. Construction laborers who primarily assist a particular craft worker are classified under “Helpers, Construction Trades” (47-3010). Excludes “Hazardous Materials Removal Workers” (47-4041).','bls',NULL),(1002,'2023-02-27 20:35:16.453213','47-2070','Construction Equipment Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Construction Equipment Operators','','bls',NULL),(1003,'2023-02-27 20:35:16.485839','47-2071','Paving, Surfacing, and Tamping Equipment Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Paving, Surfacing, and Tamping Equipment Operators','Operate equipment used for applying concrete, asphalt, or other materials to road beds, parking lots, or airport runways and taxiways or for tamping gravel, dirt, or other materials. Includes concrete and asphalt paving machine operators, form tampers, tamping machine operators, and stone spreader operators.','bls',NULL),(1004,'2023-02-27 20:35:16.523153','47-2072','Pile Driver Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Pile Driver Operators','Operate pile drivers mounted on skids, barges, crawler treads, or locomotive cranes to drive pilings for retaining walls, bulkheads, and foundations of structures such as buildings, bridges, and piers.','bls',NULL),(1005,'2023-02-27 20:35:16.563869','47-2073','Operating Engineers and Other Construction Equipment Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Operating Engineers and Other Construction Equipment Operators','Operate one or several types of power construction equipment, such as motor graders, bulldozers, scrapers, compressors, pumps, derricks, shovels, tractors, or front-end loaders to excavate, move, and grade earth, erect structures, or pour concrete or other hard surface pavement. May repair and maintain equipment in addition to other duties. Excludes “Extraction Workers” (47-5000) and “Crane and Tower Operators” (53-7021).','bls',NULL),(1006,'2023-02-27 20:35:16.604128','47-2080','Drywall Installers, Ceiling Tile Installers, and Tapers','Construction and Extraction Occupations','Construction Trades Workers','Drywall Installers, Ceiling Tile Installers, and Tapers','Drywall Installers, Ceiling Tile Installers, and Tapers','','bls',NULL),(1007,'2023-02-27 20:35:16.646085','47-2081','Drywall and Ceiling Tile Installers','Construction and Extraction Occupations','Construction Trades Workers','Drywall Installers, Ceiling Tile Installers, and Tapers','Drywall and Ceiling Tile Installers','Apply plasterboard or other wallboard to ceilings or interior walls of buildings. Apply or mount acoustical tiles or blocks, strips, or sheets of shock-absorbing materials to ceilings and walls of buildings to reduce or reflect sound. Materials may be of decorative quality. Includes lathers who fasten wooden, metal, or rockboard lath to walls, ceilings, or partitions of buildings to provide support base for plaster, fireproofing, or acoustical material. Excludes “Carpenters” (47-2031), “Carpet Installers” (47-2041), and “Tile and Stone Setters” (47-2044).','bls',NULL),(1008,'2023-02-27 20:35:16.694815','47-2082','Tapers','Construction and Extraction Occupations','Construction Trades Workers','Drywall Installers, Ceiling Tile Installers, and Tapers','Tapers','Seal joints between plasterboard or other wallboard to prepare wall surface for painting or papering.','bls',NULL),(1009,'2023-02-27 20:35:16.730029','47-2110','Electricians','Construction and Extraction Occupations','Construction Trades Workers','Electricians','Electricians','','bls',NULL),(1010,'2023-02-27 20:35:16.766663','47-2111','Electricians','Construction and Extraction Occupations','Construction Trades Workers','Electricians','Electricians','Install, maintain, and repair electrical wiring, equipment, and fixtures. Ensure that work is in accordance with relevant codes. May install or service street lights, intercom systems, or electrical control systems. Excludes “Security and Fire Alarm Systems Installers” (49-2098).','bls',NULL),(1011,'2023-02-27 20:35:16.803724','47-2120','Glaziers','Construction and Extraction Occupations','Construction Trades Workers','Glaziers','Glaziers','','bls',NULL),(1012,'2023-02-27 20:35:16.838639','47-2121','Glaziers','Construction and Extraction Occupations','Construction Trades Workers','Glaziers','Glaziers','Install glass in windows, skylights, store fronts, and display cases, or on surfaces, such as building fronts, interior walls, ceilings, and tabletops.','bls',NULL),(1013,'2023-02-27 20:35:16.876706','47-2130','Insulation Workers','Construction and Extraction Occupations','Construction Trades Workers','Insulation Workers','Insulation Workers','','bls',NULL),(1014,'2023-02-27 20:35:16.918572','47-2131','Insulation Workers, Floor, Ceiling, and Wall','Construction and Extraction Occupations','Construction Trades Workers','Insulation Workers','Insulation Workers, Floor, Ceiling, and Wall','Line and cover structures with insulating materials. May work with batt, roll, or blown insulation materials.','bls',NULL),(1015,'2023-02-27 20:35:16.952140','47-2132','Insulation Workers, Mechanical','Construction and Extraction Occupations','Construction Trades Workers','Insulation Workers','Insulation Workers, Mechanical','Apply insulating materials to pipes or ductwork, or other mechanical systems in order to help control and maintain temperature.','bls',NULL),(1016,'2023-02-27 20:35:16.987461','47-2140','Painters and Paperhangers','Construction and Extraction Occupations','Construction Trades Workers','Painters and Paperhangers','Painters and Paperhangers','','bls',NULL),(1017,'2023-02-27 20:35:17.029184','47-2141','Painters, Construction and Maintenance','Construction and Extraction Occupations','Construction Trades Workers','Painters and Paperhangers','Painters, Construction and Maintenance','Paint walls, equipment, buildings, bridges, and other structural surfaces, using brushes, rollers, and spray guns. May remove old paint to prepare surface prior to painting. May mix colors or oils to obtain desired color or consistency. Excludes “Paperhangers” (47-2142).','bls',NULL),(1018,'2023-02-27 20:35:17.067367','47-2142','Paperhangers','Construction and Extraction Occupations','Construction Trades Workers','Painters and Paperhangers','Paperhangers','Cover interior walls or ceilings of rooms with decorative wallpaper or fabric, or attach advertising posters on surfaces such as walls and billboards. May remove old materials or prepare surfaces to be papered.','bls',NULL),(1019,'2023-02-27 20:35:17.107040','47-2150','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Construction and Extraction Occupations','Construction Trades Workers','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Pipelayers, Plumbers, Pipefitters, and Steamfitters','','bls',NULL),(1020,'2023-02-27 20:35:17.144048','47-2151','Pipelayers','Construction and Extraction Occupations','Construction Trades Workers','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Pipelayers','Lay pipe for storm or sanitation sewers, drains, and water mains. Perform any combination of the following tasks: grade trenches or culverts, position pipe, or seal joints. Excludes “Welders, Cutters, Solderers, and Brazers” (51-4121).','bls',NULL),(1021,'2023-02-27 20:35:17.187565','47-2152','Plumbers, Pipefitters, and Steamfitters','Construction and Extraction Occupations','Construction Trades Workers','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Plumbers, Pipefitters, and Steamfitters','Assemble, install, alter, and repair pipelines or pipe systems that carry water, steam, air, or other liquids or gases. May install heating and cooling equipment and mechanical control systems. Includes sprinkler fitters.','bls',NULL),(1022,'2023-02-27 20:35:17.228510','47-2160','Plasterers and Stucco Masons','Construction and Extraction Occupations','Construction Trades Workers','Plasterers and Stucco Masons','Plasterers and Stucco Masons','','bls',NULL),(1023,'2023-02-27 20:35:17.266976','47-2161','Plasterers and Stucco Masons','Construction and Extraction Occupations','Construction Trades Workers','Plasterers and Stucco Masons','Plasterers and Stucco Masons','Apply interior or exterior plaster, cement, stucco, or similar materials. May also set ornamental plaster.','bls',NULL),(1024,'2023-02-27 20:35:17.305100','47-2170','Reinforcing Iron and Rebar Workers','Construction and Extraction Occupations','Construction Trades Workers','Reinforcing Iron and Rebar Workers','Reinforcing Iron and Rebar Workers','','bls',NULL),(1025,'2023-02-27 20:35:17.343126','47-2171','Reinforcing Iron and Rebar Workers','Construction and Extraction Occupations','Construction Trades Workers','Reinforcing Iron and Rebar Workers','Reinforcing Iron and Rebar Workers','Position and secure steel bars or mesh in concrete forms in order to reinforce concrete. Use a variety of fasteners, rod-bending machines, blowtorches, and hand tools. Includes rod busters.','bls',NULL),(1026,'2023-02-27 20:35:17.387664','47-2180','Roofers','Construction and Extraction Occupations','Construction Trades Workers','Roofers','Roofers','','bls',NULL),(1027,'2023-02-27 20:35:17.425067','47-2181','Roofers','Construction and Extraction Occupations','Construction Trades Workers','Roofers','Roofers','Cover roofs of structures with shingles, slate, asphalt, aluminum, wood, or related materials. May spray roofs, sidings, and walls with material to bind, seal, insulate, or soundproof sections of structures.','bls',NULL),(1028,'2023-02-27 20:35:17.466261','47-2210','Sheet Metal Workers','Construction and Extraction Occupations','Construction Trades Workers','Sheet Metal Workers','Sheet Metal Workers','','bls',NULL),(1029,'2023-02-27 20:35:17.502462','47-2211','Sheet Metal Workers','Construction and Extraction Occupations','Construction Trades Workers','Sheet Metal Workers','Sheet Metal Workers','Fabricate, assemble, install, and repair sheet metal products and equipment, such as ducts, control boxes, drainpipes, and furnace casings. Work may involve any of the following: setting up and operating fabricating machines to cut, bend, and straighten sheet metal; shaping metal over anvils, blocks, or forms using hammer; operating soldering and welding equipment to join sheet metal parts; or inspecting, assembling, and smoothing seams and joints of burred surfaces. Includes sheet metal duct installers who install prefabricated sheet metal ducts used for heating, air conditioning, or other purposes.','bls',NULL),(1030,'2023-02-27 20:35:17.541942','47-2220','Structural Iron and Steel Workers','Construction and Extraction Occupations','Construction Trades Workers','Structural Iron and Steel Workers','Structural Iron and Steel Workers','','bls',NULL),(1031,'2023-02-27 20:35:17.581315','47-2221','Structural Iron and Steel Workers','Construction and Extraction Occupations','Construction Trades Workers','Structural Iron and Steel Workers','Structural Iron and Steel Workers','Raise, place, and unite iron or steel girders, columns, and other structural members to form completed structures or structural frameworks. May erect metal storage tanks and assemble prefabricated metal buildings. Excludes “Reinforcing Iron and Rebar Workers” (47-2171).','bls',NULL),(1032,'2023-02-27 20:35:17.626045','47-2230','Solar Photovoltaic Installers','Construction and Extraction Occupations','Construction Trades Workers','Solar Photovoltaic Installers','Solar Photovoltaic Installers','','bls',NULL),(1033,'2023-02-27 20:35:17.660737','47-2231','Solar Photovoltaic Installers','Construction and Extraction Occupations','Construction Trades Workers','Solar Photovoltaic Installers','Solar Photovoltaic Installers','Assemble, install, or maintain solar photovoltaic (PV) systems on roofs or other structures in compliance with site assessment and schematics. May include measuring, cutting, assembling, and bolting structural framing and solar modules. May perform minor electrical work such as current checks. Excludes solar PV electricians who are included in “Electricians” (47-2111) and solar thermal installers who are included in “Plumbers, Pipefitters, and Steamfitters” (47-2152).','bls',NULL),(1034,'2023-02-27 20:35:17.698926','47-3000','Helpers, Construction Trades','Construction and Extraction Occupations','Helpers, Construction Trades',NULL,'Helpers, Construction Trades','','bls',NULL),(1035,'2023-02-27 20:35:17.736374','47-3010','Helpers, Construction Trades','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers, Construction Trades','','bls',NULL),(1036,'2023-02-27 20:35:17.774223','47-3011','Helpers--Brickmasons, Blockmasons, Stonemasons, and Tile and Marble Setters','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Brickmasons, Blockmasons, Stonemasons, and Tile and Marble Setters','Help brickmasons, blockmasons, stonemasons, or tile and marble setters by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment. Construction laborers who do not primarily assist brickmasons, blockmasons, and stonemasons or tile and marble setters are classified under “Construction Laborers” (47-2061). Apprentice workers are classified with the appropriate skilled construction trade occupation (47-2011 through 47-2231).','bls',NULL),(1037,'2023-02-27 20:35:17.815091','47-3012','Helpers--Carpenters','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Carpenters','Help carpenters by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment. Construction laborers who do not primarily assist carpenters are classified under “Construction Laborers” (47-2061). Apprentice workers are classified with the appropriate skilled construction trade occupation (47-2011 through 47-2231).','bls',NULL),(1038,'2023-02-27 20:35:17.857207','47-3013','Helpers--Electricians','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Electricians','Help electricians by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment. Construction laborers who do not primarily assist electricians are classified under “Construction Laborers” (47-2061). Apprentice workers are classified with the appropriate skilled construction trade occupation (47-2011 through 47-2231).','bls',NULL),(1039,'2023-02-27 20:35:17.905704','47-3014','Helpers--Painters, Paperhangers, Plasterers, and Stucco Masons','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Painters, Paperhangers, Plasterers, and Stucco Masons','Help painters, paperhangers, plasterers, or stucco masons by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment. Construction laborers who do not primarily assist painters, paperhangers, plasterers, or stucco masons are classified under “Construction Laborers” (47-2061). Apprentice workers are classified with the appropriate skilled construction trade occupation (47-2011 through 47-2231).','bls',NULL),(1040,'2023-02-27 20:35:17.947274','47-3015','Helpers--Pipelayers, Plumbers, Pipefitters, and Steamfitters','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Pipelayers, Plumbers, Pipefitters, and Steamfitters','Help plumbers, pipefitters, steamfitters, or pipelayers by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment. Construction laborers who do not primarily assist plumbers, pipefitters, steamfitters, or pipelayers are classified under “Construction Laborers” (47-2061). Apprentice workers are classified with the appropriate skilled construction trade occupation (47-2011 through 47-2231).','bls',NULL),(1041,'2023-02-27 20:35:17.989875','47-3016','Helpers--Roofers','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Roofers','Help roofers by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment. Construction laborers who do not primarily assist roofers are classified under “Construction Laborers” (47-2061). Apprentice workers are classified with the appropriate skilled construction trade occupation (47-2011 through 47-2231).','bls',NULL),(1042,'2023-02-27 20:35:18.031396','47-3019','Helpers, Construction Trades, All Other','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers, Construction Trades, All Other','All construction trades helpers not listed separately.','bls',NULL),(1043,'2023-02-27 20:35:18.070872','47-4000','Other Construction and Related Workers','Construction and Extraction Occupations','Other Construction and Related Workers',NULL,'Other Construction and Related Workers','','bls',NULL),(1044,'2023-02-27 20:35:18.112044','47-4010','Construction and Building Inspectors','Construction and Extraction Occupations','Other Construction and Related Workers','Construction and Building Inspectors','Construction and Building Inspectors','','bls',NULL),(1045,'2023-02-27 20:35:18.151479','47-4011','Construction and Building Inspectors','Construction and Extraction Occupations','Other Construction and Related Workers','Construction and Building Inspectors','Construction and Building Inspectors','Inspect structures using engineering skills to determine structural soundness and compliance with specifications, building codes, and other regulations. Inspections may be general in nature or may be limited to a specific area, such as electrical systems or plumbing.','bls',NULL),(1046,'2023-02-27 20:35:18.191582','47-4020','Elevator and Escalator Installers and Repairers','Construction and Extraction Occupations','Other Construction and Related Workers','Elevator and Escalator Installers and Repairers','Elevator and Escalator Installers and Repairers','','bls',NULL),(1047,'2023-02-27 20:35:18.232396','47-4021','Elevator and Escalator Installers and Repairers','Construction and Extraction Occupations','Other Construction and Related Workers','Elevator and Escalator Installers and Repairers','Elevator and Escalator Installers and Repairers','Assemble, install, repair, or maintain electric or hydraulic freight or passenger elevators, escalators, or dumbwaiters.','bls',NULL),(1048,'2023-02-27 20:35:18.270281','47-4030','Fence Erectors','Construction and Extraction Occupations','Other Construction and Related Workers','Fence Erectors','Fence Erectors','','bls',NULL),(1049,'2023-02-27 20:35:18.312967','47-4031','Fence Erectors','Construction and Extraction Occupations','Other Construction and Related Workers','Fence Erectors','Fence Erectors','Erect and repair fences and fence gates, using hand and power tools.','bls',NULL),(1050,'2023-02-27 20:35:18.349869','47-4040','Hazardous Materials Removal Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Hazardous Materials Removal Workers','Hazardous Materials Removal Workers','','bls',NULL),(1051,'2023-02-27 20:35:18.389135','47-4041','Hazardous Materials Removal Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Hazardous Materials Removal Workers','Hazardous Materials Removal Workers','Identify, remove, pack, transport, or dispose of hazardous materials, including asbestos, lead-based paint, waste oil, fuel, transmission fluid, radioactive materials, or contaminated soil. Specialized training and certification in hazardous materials handling or a confined entry permit are generally required. May operate earth-moving equipment or trucks.','bls',NULL),(1052,'2023-02-27 20:35:18.431991','47-4050','Highway Maintenance Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Highway Maintenance Workers','Highway Maintenance Workers','','bls',NULL),(1053,'2023-02-27 20:35:18.468610','47-4051','Highway Maintenance Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Highway Maintenance Workers','Highway Maintenance Workers','Maintain highways, municipal and rural roads, airport runways, and rights-of-way. Duties include patching broken or eroded pavement and repairing guard rails, highway markers, and snow fences. May also mow or clear brush from along road, or plow snow from roadway. Excludes “Tree Trimmers and Pruners” (37-3013).','bls',NULL),(1054,'2023-02-27 20:35:18.516017','47-4060','Rail-Track Laying and Maintenance Equipment Operators','Construction and Extraction Occupations','Other Construction and Related Workers','Rail-Track Laying and Maintenance Equipment Operators','Rail-Track Laying and Maintenance Equipment Operators','','bls',NULL),(1055,'2023-02-27 20:35:18.554473','47-4061','Rail-Track Laying and Maintenance Equipment Operators','Construction and Extraction Occupations','Other Construction and Related Workers','Rail-Track Laying and Maintenance Equipment Operators','Rail-Track Laying and Maintenance Equipment Operators','Lay, repair, and maintain track for standard or narrow-gauge railroad equipment used in regular railroad service or in plant yards, quarries, sand and gravel pits, and mines. Includes ballast cleaning machine operators and railroad bed tamping machine operators.','bls',NULL),(1056,'2023-02-27 20:35:18.602369','47-4070','Septic Tank Servicers and Sewer Pipe Cleaners','Construction and Extraction Occupations','Other Construction and Related Workers','Septic Tank Servicers and Sewer Pipe Cleaners','Septic Tank Servicers and Sewer Pipe Cleaners','','bls',NULL),(1057,'2023-02-27 20:35:18.640452','47-4071','Septic Tank Servicers and Sewer Pipe Cleaners','Construction and Extraction Occupations','Other Construction and Related Workers','Septic Tank Servicers and Sewer Pipe Cleaners','Septic Tank Servicers and Sewer Pipe Cleaners','Clean and repair septic tanks, sewer lines, or drains. May patch walls and partitions of tank, replace damaged drain tile, or repair breaks in underground piping.','bls',NULL),(1058,'2023-02-27 20:35:18.682605','47-4090','Miscellaneous Construction and Related Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Miscellaneous Construction and Related Workers','Miscellaneous Construction and Related Workers','','bls',NULL),(1059,'2023-02-27 20:35:18.721846','47-4091','Segmental Pavers','Construction and Extraction Occupations','Other Construction and Related Workers','Miscellaneous Construction and Related Workers','Segmental Pavers','Lay out, cut, and place segmental paving units. Includes installers of bedding and restraining materials for the paving units.','bls',NULL),(1060,'2023-02-27 20:35:18.771326','47-4099','Construction and Related Workers, All Other','Construction and Extraction Occupations','Other Construction and Related Workers','Miscellaneous Construction and Related Workers','Construction and Related Workers, All Other','All construction and related workers not listed separately.','bls',NULL),(1061,'2023-02-27 20:35:18.810477','47-5000','Extraction Workers','Construction and Extraction Occupations','Extraction Workers',NULL,'Extraction Workers','','bls',NULL),(1062,'2023-02-27 20:35:18.850099','47-5010','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','','bls',NULL),(1063,'2023-02-27 20:35:18.885132','47-5011','Derrick Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Derrick Operators, Oil and Gas','Rig derrick equipment and operate pumps to circulate mud or fluid through drill hole.','bls',NULL),(1064,'2023-02-27 20:35:18.926209','47-5012','Rotary Drill Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Rotary Drill Operators, Oil and Gas','Set up or operate a variety of drills to remove underground oil and gas, or remove core samples for testing during oil and gas exploration. Excludes “Earth Drillers, Except Oil and Gas” (47-5023).','bls',NULL),(1065,'2023-02-27 20:35:18.967240','47-5013','Service Unit Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Service Unit Operators, Oil and Gas','Operate equipment to increase oil flow from producing wells or to remove stuck pipe, casing, tools, or other obstructions from drilling wells. Includes fishing-tool technicians.','bls',NULL),(1066,'2023-02-27 20:35:19.008978','47-5020','Surface Mining Machine Operators and Earth Drillers','Construction and Extraction Occupations','Extraction Workers','Surface Mining Machine Operators and Earth Drillers','Surface Mining Machine Operators and Earth Drillers','','bls',NULL),(1067,'2023-02-27 20:35:19.049117','47-5022','Excavating and Loading Machine and Dragline Operators, Surface Mining','Construction and Extraction Occupations','Extraction Workers','Surface Mining Machine Operators and Earth Drillers','Excavating and Loading Machine and Dragline Operators, Surface Mining','Operate or tend machinery at surface mining site, equipped with scoops, shovels, or buckets to excavate and load loose materials.','bls',NULL),(1068,'2023-02-27 20:35:19.090660','47-5023','Earth Drillers, Except Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Surface Mining Machine Operators and Earth Drillers','Earth Drillers, Except Oil and Gas','Operate a variety of drills such as rotary, churn, and pneumatic to tap subsurface water and salt deposits, to remove core samples during mineral exploration or soil testing, and to facilitate the use of explosives in mining or construction. Includes horizontal and earth boring machine operators.','bls',NULL),(1069,'2023-02-27 20:35:19.132396','47-5030','Explosives Workers, Ordnance Handling Experts, and Blasters','Construction and Extraction Occupations','Extraction Workers','Explosives Workers, Ordnance Handling Experts, and Blasters','Explosives Workers, Ordnance Handling Experts, and Blasters','','bls',NULL),(1070,'2023-02-27 20:35:19.170014','47-5032','Explosives Workers, Ordnance Handling Experts, and Blasters','Construction and Extraction Occupations','Extraction Workers','Explosives Workers, Ordnance Handling Experts, and Blasters','Explosives Workers, Ordnance Handling Experts, and Blasters','Place and detonate explosives to demolish structures or to loosen, remove, or displace earth, rock, or other materials. May perform specialized handling, storage, and accounting procedures.','bls',NULL),(1071,'2023-02-27 20:35:19.211220','47-5040','Underground Mining Machine Operators','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Underground Mining Machine Operators','','bls',NULL),(1072,'2023-02-27 20:35:19.246992','47-5041','Continuous Mining Machine Operators','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Continuous Mining Machine Operators','Operate self-propelled mining machines that rip coal, metal and nonmetal ores, rock, stone, or sand from the mine face and load it onto conveyors, shuttle cars, or trucks in a continuous operation.','bls',NULL),(1073,'2023-02-27 20:35:19.288928','47-5043','Roof Bolters, Mining','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Roof Bolters, Mining','Operate machinery to install roof support bolts in underground mine.','bls',NULL),(1074,'2023-02-27 20:35:19.332532','47-5044','Loading and Moving Machine Operators, Underground Mining','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Loading and Moving Machine Operators, Underground Mining','Operate underground loading or moving machine to load or move coal, ore, or rock using shuttle or mine car or conveyors. Equipment may include power shovels, hoisting engines equipped with cable-drawn scraper or scoop, or machines equipped with gathering arms and conveyor.','bls',NULL),(1075,'2023-02-27 20:35:19.371914','47-5049','Underground Mining Machine Operators, All Other','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Underground Mining Machine Operators, All 