4','Millwrights','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Industrial Machinery Installation, Repair, and Maintenance Workers','Millwrights','Install, dismantle, or move machinery and heavy equipment according to layout plans, blueprints, or other drawings.','bls',NULL),(1136,'2023-02-27 20:35:21.720934','49-9045','Refractory Materials Repairers, Except Brickmasons','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Industrial Machinery Installation, Repair, and Maintenance Workers','Refractory Materials Repairers, Except Brickmasons','Build or repair equipment such as furnaces, kilns, cupolas, boilers, converters, ladles, soaking pits, and ovens, using refractory materials.','bls',NULL),(1137,'2023-02-27 20:35:21.755372','49-9050','Line Installers and Repairers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Line Installers and Repairers','Line Installers and Repairers','','bls',NULL),(1138,'2023-02-27 20:35:21.791163','49-9051','Electrical Power-Line Installers and Repairers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Line Installers and Repairers','Electrical Power-Line Installers and Repairers','Install or repair cables or wires used in electrical power or distribution systems. May erect poles and light or heavy duty transmission towers. Excludes “Electrical and Electronics Repairers, Powerhouse, Substation, and Relay” (49-2095).','bls',NULL),(1139,'2023-02-27 20:35:21.828900','49-9052','Telecommunications Line Installers and Repairers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Line Installers and Repairers','Telecommunications Line Installers and Repairers','Install and repair telecommunications cable, including fiber optics.','bls',NULL