and mechanical timepiece repairers. Excludes \"Timing Device Assemblers and Adjusters” (51-2061).','bls',NULL),(1145,'2023-02-27 20:35:22.041883','49-9069','Precision Instrument and Equipment Repairers, All Other','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Precision Instrument and Equipment Repairers','Precision Instrument and Equipment Repairers, All Other','All precision instrument and equipment repairers not listed separately.','bls',NULL),(1146,'2023-02-27 20:35:22.080276','49-9070','Maintenance and Repair Workers, General','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Maintenance and Repair Workers, General','Maintenance and Repair Workers, General','','bls',NULL),(1147,'2023-02-27 20:35:22.110562','49-9071','Maintenance and Repair Workers, General','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Maintenance and Repair Workers, General','Maintenance and Repair Workers, General','Perform work involving the skills of two or more maintenance or craft occupations to keep machines, mechanical equipment, or the structure of a building in repair. Duties may involve pipe fitting; HVAC maintenance; insulating; welding; machining; carpentry; repairing electrical or mechanical equipment; installing, aligning, and balancing new equipment; and repairing buildings, floors, or stairs. Excludes “Facilities Managers” (11-3013) and “Maintenance Workers, Machinery” (49-9043).','bls',NULL),(1148,'2023-02-27 20:35:22.149413','49-9080','Wind Turbine Service Technicians','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Wind Turbine Service Technicians','Wind Turbine Service Technicians','','bls',NULL),(1149,'2023-02-27 20:35:22.183814','49-9081','Wind Turbine Service Technicians','Installation, Maintenance, and Repair Occupations'