rs','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Miscellaneous Installation, Maintenance, and Repair Workers','Locksmiths and Safe Repairers','Repair and open locks, make keys, change locks and safe combinations, and install and repair safes.','bls',NULL),(1154,'2023-02-27 20:35:22.370519','49-9095','Manufactured Building and Mobile Home Installers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Miscellaneous Installation, Maintenance, and Repair Workers','Manufactured Building and Mobile Home Installers','Move or install mobile homes or prefabricated buildings.','bls',NULL),(1155,'2023-02-27 20:35:22.406206','49-9096','Riggers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Miscellaneous Installation, Maintenance, and Repair Workers','Riggers','Set up or repair rigging for construction projects, manufacturing plants, logging yards, ships and shipyards, or for the entertainment industry.','bls',NULL),(1156,'2023-02-27 20:35:22.441541','49-9097','Signal and Track Switch Repairers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Miscellaneous Installation, Maintenance, and Repair Workers','Signal and Track Switch Repairers','Install, inspect, test, maintain, or repair electric gate crossings, signals, signal equipment, track switches, section lines, or intercommunications systems within a railroad system.','bls',NULL),(1157,'2023-02-27 20:35:22.480297','49-9098','Helpers--Installation, Maintenance, and Repair Workers','Installation, Maintenance, and Repair Occupations','Other Installation, Maintenance, and Repair Occupations','Miscellaneous Installation, Maintenance, and Repair Workers','Helpers--Installation, Maintenance, and Repair Workers','Help installation, maintenance, and repair workers in maintenance, parts 