 as computers, test equipment telemetering systems, electric motors, and batteries.','bls',NULL),(1169,'2023-02-27 20:35:22.923041','51-2023','Electromechanical Equipment Assemblers','Production Occupations','Assemblers and Fabricators','Electrical, Electronics, and Electromechanical Assemblers','Electromechanical Equipment Assemblers','Assemble or modify electromechanical equipment or devices, such as servomechanisms, gyros, dynamometers, magnetic drums, tape drives, brakes, control linkage, actuators, and appliances.','bls',NULL),(1170,'2023-02-27 20:35:22.960213','51-2030','Engine and Other Machine Assemblers','Production Occupations','Assemblers and Fabricators','Engine and Other Machine Assemblers','Engine and Other Machine Assemblers','','bls',NULL),(1171,'2023-02-27 20:35:22.995970','51-2031','Engine and Other Machine Assemblers','Production Occupations','Assemblers and Fabricators','Engine and Other Machine Assemblers','Engine and Other Machine Assemblers','Construct, assemble, or rebuild machines, such as engines, turbines, and similar equipment used in such industries as construction, extraction, textiles, and paper manufacturing.','bls',NULL),(1172,'2023-02-27 20:35:23.034854','51-2040','Structural Metal Fabricators and Fitters','Production Occupations','Assemblers and Fabricators','Structural Metal Fabricators and Fitters','Structural Metal Fabricators and Fitters','','bls',NULL),(1173,'2023-02-27 20:35:23.079638','51-2041','Structural Metal Fabricators and Fitters','Production Occupations','Assemblers and Fabricators','Structural Metal Fabricators and Fitters','Structural Metal Fabricators and Fitters','Fabricate, position, align, and fit parts of structural metal products. Shipfitters are included in “Layout Workers, Metal and Plastic” (51-4192).','bls',NULL),(1174,'2023-02-27 20:35:23.114159','51-2050','Fiberglass Laminators and Fabricators','Production Occupations','Assemblers and Fabricators','Fiberglass Laminators and Fabricators','Fiberglass Laminators and Fabricators','','bls',NULL),(1175,'2023-02-27 20:35:23.149684','51-2051','Fiberglass Laminators and Fabricators','Production Occupations','Assemblers and Fabricators','Fiberglass Laminators and Fabricators','Fiberglass Laminators and Fabricators','Laminate layers of fiberglass on molds to form boat decks and hulls, bodies for golf carts, automobiles, or other products.','bls',NULL),(1176,'2023-02-27 20:35:23.188537','51-2060','Timing Device Assemblers and Adjusters','Production Occupations','Assemblers and Fabricators','Timing Device Assemblers and Adjusters','Timing Device Assemblers and Adjusters','','bls',NULL),(1177,'2023-02-27 20:35:23.224872','51-2061','Timing Device Assemblers and Adjusters','Production Occupations','Assemblers and Fabricators','Timing Device Assemblers and Adjusters','Timing Device Assemblers and Adjusters','Perform precision assembling or adjusting, within narrow tolerances, of timing devices such as digital clocks or timing devices with electrical or electronic components. Watchmakers are included in “Watch and Clock Repairers” (49-9064).','bls',NULL),(1178,'2023-02-27 20:35:23.261653','51-2090','Miscellaneous Assemblers and Fabricators','Production Occupations','Assemblers and Fabricators','Miscellaneous Assemblers and Fabricators','Miscellaneous Assemblers and Fabricators','','bls',NULL),(1179,'2023-02-27 20:35:23.299990','51-2092','Team Assemblers','Production Occupations','Assemblers and Fabricators','Miscellaneous Assemblers and Fabricators','Team Assemblers','Work as part of a team having responsibility for assembling an entire product or component of a product. Team assemblers can perform all tasks conducted by the team in the assembly process and rotate through all or most of them, rather than being assigned to a specific task on a permanent basis. May participate in making management decisions affecting the work. Includes team leaders who work as part of the team. Assemblers who continuously perform the same task are classified elsewhere in 51-2000.','bls',NULL),(1180,'2023-02-27 20:35:23.340043','51-2099','Assemblers and Fabricators, All Other','Production Occupations','Assemblers and Fabricators','Miscellaneous Assemblers and Fabricators','Assemblers and Fabricators, All Other','All assemblers and fabricators not listed separately.','bls',NULL),(1181,'2023-02-27 20:35:23.375997','51-3000','Food Processing Workers','Production Occupations','Food Processing Workers',NULL,'Food Processing Workers','','bls',NULL),(1182,'2023-02-27 20:35:23.410278','51-3010','Bakers','Production Occupations','Food Processing Workers','Bakers','Bakers','','bls',NULL),(1183,'2023-02-27 20:35:23.444390','51-3011','Bakers','Production Occupations','Food Processing Workers','Bakers','Bakers','Mix and bake ingredients to produce breads, rolls, cookies, cakes, pies, pastries, or other baked goods. Pastry chefs in restaurants and hotels are included with “Chefs and Head Cooks” (35-1011).','bls',NULL),(1184,'2023-02-27 20:35:23.478100','51-3020','Butchers and Other Meat, Poultry, and Fish Processing Workers','Production Occupations','Food Processing Workers','Butchers and Other Meat, Poultry, and Fish Processing Workers','Butchers and Other Meat, Poultry, and Fish Processing Workers','','bls',NULL),(1185,'2023-02-27 20:35:23.517434','51-3021','Butchers and Meat Cutters','Production Occupations','Food Processing Workers','Butchers and Other Meat, Poultry, and Fish Processing Workers','Butchers and Meat Cutters','Cut, trim, or prepare consumer-sized portions of meat for use or sale in retail establishments.','bls',NULL),(1186,'2023-02-27 20:35:23.550717','51-3022','Meat, Poultry, and Fish Cutters and Trimmers','Production Occupations','Food Processing Workers','Butchers and Other Meat, Poultry, and Fish Processing Workers','Meat, Poultry, and Fish Cutters and Trimmers','Use hands or hand tools to perform routine cutting and trimming of meat, poultry, and seafood.','bls',NULL),(1187,'2023-02-27 20:35:23.591463','51-3023','Slaughterers and Meat Packers','Production Occupations','Food Processing Workers','Butchers and Other Meat, Poultry, and Fish Processing Workers','Slaughterers and Meat Packers','Perform nonroutine or precision functions involving the preparation of large portions of meat. Work may include specialized slaughtering tasks, cutting standard or premium cuts of meat for marketing, making sausage, or wrapping meats. Work typically occurs in slaughtering, meat packing, or wholesale establishments. Excludes “Meat, Poultry, and Fish Cutters and Trimmers” (51-3022) who perform routine meat cutting.','bls',NULL),(1188,'2023-02-27 20:35:23.634007','51-3090','Miscellaneous Food Processing Workers','Production Occupations','Food Processing Workers','Miscellaneous Food Processing Workers','Miscellaneous Food Processing Workers','','bls',NULL),(1189,'2023-02-27 20:35:23.669903','51-3091','Food and Tobacco Roasting, Baking, and Drying Machine Operators and Tenders','Production Occupations','Food Processing Workers','Miscellaneous Food Processing Workers','Food and Tobacco Roasting, Baking, and Drying Machine Operators and Tenders','Operate or tend food or tobacco roasting, baking, or drying equipment, including hearth ovens, kiln driers, roasters, char kilns, and vacuum drying equipment.','bls',NULL),(1190,'2023-02-27 20:35:23.711684','51-3092','Food Batchmakers','Production Occupations','Food Processing Workers','Miscellaneous Food Processing Workers','Food Batchmakers','Set up and operate equipment that mixes or blends ingredients used in the manufacturing of food products. Includes candy makers and cheese makers.','bls',NULL),(1191,'2023-02-27 20:35:23.748443','51-3093','Food Cooking Machine Operators and Tenders','Production Occupations','Food Processing Workers','Miscellaneous Food Processing Workers','Food Cooking Machine Operators and Tenders','Operate or tend cooking equipment, such as steam cooking vats, deep fry cookers, pressure cookers, kettles, and boilers, to