, apparel, and furnishings workers not listed separately.','bls',NULL),(1256,'2023-02-27 20:35:26.179322','51-7000','Woodworkers','Production Occupations','Woodworkers',NULL,'Woodworkers','','bls',NULL),(1257,'2023-02-27 20:35:26.214614','51-7010','Cabinetmakers and Bench Carpenters','Production Occupations','Woodworkers','Cabinetmakers and Bench Carpenters','Cabinetmakers and Bench Carpenters','','bls',NULL),(1258,'2023-02-27 20:35:26.249730','51-7011','Cabinetmakers and Bench Carpenters','Production Occupations','Woodworkers','Cabinetmakers and Bench Carpenters','Cabinetmakers and Bench Carpenters','Cut, shape, and assemble wooden articles or set up and operate a variety of woodworking machines, such as power saws, jointers, and mortisers to surface, cut, or shape lumber or to fabricate parts for wood products. Excludes “Woodworking Machine Setters, Operators, and Tenders” (51-7040).','bls',NULL),(1259,'2023-02-27 20:35:26.288755','51-7020','Furniture Finishers','Production Occupations','Woodworkers','Furniture Finishers','Furniture Finishers','','bls',NULL),(1260,'2023-02-27 20:35:26.324435','51-7021','Furniture Finishers','Production Occupations','Woodworkers','Furniture Finishers','Furniture Finishers','Shape, finish, and refinish damaged, worn, or used furniture or new high-grade furniture to specified color or finish.','bls',NULL),(1261,'2023-02-27 20:35:26.361119','51-7030','Model Makers and Patternmakers, Wood','Production Occupations','Woodworkers','Model Makers and Patternmakers, Wood','Model Makers and Patternmakers, Wood','','bls',NULL),(1262,'2023-02-27 20:35:26.395562','51-7031','Model Makers, Wood','Production Occupations','Woodworkers','Model Makers and Patternmakers, Wood','Model Makers, Wood','Construct full-size and scale wooden precision models of products. Includes wood jig builders and loft workers.','bls',NULL),(1263,'2023-02-27 20:35:26.433184','51-7032','Patternmakers, Wood','Production Occupations','Woodworkers','Model Makers and Patternmakers, Wood','Patternmakers, Wood','Plan, lay out, and construct wooden unit or sectional patterns used in forming sand molds for castings.','bls',NULL),(1264,'2023-02-27 20:35:26.469693','51-7040','Woodworking Machine Setters, Operators, and Tenders','Production Occupations','Woodworkers','Woodworking Machine Setters, Operators, and Tenders','Woodworking Machine Setters, Operators, and Tenders','','bls',NULL),(1265,'2023-02-27 20:35:26.502191','51-7041','Sawing Machine Setters, Operators, and Tenders, Wood','Production Occupations','Woodworkers','Woodworking Machine Setters, Operators, and Tenders','Sawing Machine Setters, Operators, and Tenders, Wood','Set up, operate, or tend wood sawing machines. May operate computer numerically controlled (CNC) equipment. Includes lead sawyers. Workers who primarily program or operate CNC equipment are classified in “Computer Numerically Controlled Tool Operators and Programmers” (51-9160).','bls',NULL),(1266,'2023-02-27 20:35:26.542093','51-7042','Woodworking Machine Setters, Operators, and Tenders, Except Sawing','Production Occupations','Woodworkers','Woodworking Machine Setters, Operators, and Tenders','Woodworking Machine Setters, Operators, and Tenders, Except Sawing','Set up, operate, or tend woodworking machines, such as drill presses, lathes, shapers, routers, sanders, planers, and wood nailing machines. May operate computer numerically controlled (CNC) equipment. Workers who primarily program or operate CNC equipment are classified in “Computer Numerically Controlled Tool Operators and Programmers” (51-9160).','bls',NULL),(1267,'2023-02-27 20:35:26.580805','51-7090','Miscellaneous Woodworkers','Production Occupations','Woodworkers','Miscellaneous Woodworkers','Miscellaneous Woodworkers','','bls',NULL),(1268,'2023-02-27 20:35:26.615486','51-7099','Woodworkers, All Other','Production Occupations','Woodworkers','Miscellaneous Woodworkers','Woodworkers, All Other','All woodworkers not listed separately.','bls',NULL),(1269,'2023-02-27 20:35:26.651450','51-8000','Plant and System Operators','Production Occupations','Plant and System Operators',NULL,'Plant and System Operators','','bls',NULL),(1270,'2023-02-27 20:35:26.687546','51-8010','Power Plant Operators, Distributors, and Dispatchers','Production Occupations','Plant and System Operators','Power Plant Operators, Distributors, and Dispatchers','Power Plant Operators, Distributors, and Dispatchers','','bls',NULL),(1271,'2023-02-27 20:35:26.727205','51-8011','Nuclear Power Reactor Operators','Production Occupations','Plant and System Operators','Power Plant Operators, Distributors, and Dispatchers','Nuclear Power Reactor Operators','Operate or control nuclear reactors. Move control rods, start and stop equipment, monitor and adjust controls, and record data in logs. Implement emergency procedures when needed. May respond to abnormalities, determine cause, and recommend corrective action.','bls',NULL),(1272,'2023-02-27 20:35:26.769409','51-8012','Power Distributors and Dispatchers','Production Occupations','Plant and System Operators','Power Plant Operators, Distributors, and Dispatchers','Power Distributors and Dispatchers','Coordinate, regulate, or distribute electricity or steam.','bls',NULL),(1273,'2023-02-27 20:35:26.805711','51-8013','Power Plant Operators','Production Occupations','Plant and System Operators','Power Plant Operators, Distributors, and Dispatchers','Power Plant Operators','Control, operate, or maintain machinery to generate electric power. Includes auxiliary equipment operators. Excludes “Nuclear Power Reactor Operators” (51-8011).','bls',NULL),(1274,'2023-02-27 20:35:26.848365','51-8020','Stationary Engineers and Boiler Operators','Production Occupations','Plant and System Operators','Stationary Engineers and Boiler Operators','Stationary Engineers and Boiler Operators','','bls',NULL),(1275,'2023-02-27 20:35:26.884377','51-8021','Stationary Engineers and Boiler Operators','Production Occupations','Plant and System Operators','Stationary Engineers and Boiler Operators','Stationary Engineers and Boiler Operators','Operate or maintain stationary engines, boilers, or other mechanical equipment to provide utilities for buildings or industrial processes. Operate equipment such as steam engines, generators, motors, turbines, and steam boilers.','bls',NULL),(1276,'2023-02-27 20:35:26.923037','51-8030','Water and Wastewater Treatment Plant and System Operators','Production Occupations','Plant and System Operators','Water and Wastewater Treatment Plant and System Operators','Water and Wastewater Treatment Plant and System Operators','','bls',NULL),(1277,'2023-02-27 20:35:26.957811','51-8031','Water and Wastewater Treatment Plant and System Operators','Production Occupations','Plant and System Operators','Water and Wastewater Treatment Plant and System Operators','Water and Wastewater Treatment Plant and System Operators','Operate or control an entire process or system of machines, often through the use of control boards, to transfer or treat water or wastewater.','bls',NULL),(1278,'2023-02-27 20:35:26.998201','51-8090','Miscellaneous Plant and System Operators','Production Occupations','Plant and System Operators','Miscellaneous Plant and System Operators','Miscellaneous Plant and System Operators','','bls',NULL),(1279,'2023-02-27 20:35:27.035977','51-8091','Chemical Plant and System Operators','Production Occupations','Plant and System Operators','Miscellaneous Plant and System Operators','Chemical Plant and System Operators','Control or operate entire chemical processes or system of machines.','bls',NULL),(1280,'2023-02-27 20:35:27.073529','51-8092','Gas Plant Operators','Production Occupations','Plant and System Operators','Miscellaneous Plant and System Operators','Gas Plant Operators','Distribute or process gas for utility companies and others by controlling compressors to maintain specified pressures on main pipelines.','bls',NULL),(1281,'2023-02-27 20:35:27.112317','51-8093','Petroleum Pump System Operators, Refinery Operators, and Gaugers','Production Occupations','Plant and System Operators','Miscellaneous Plant and System Operators','Petroleum Pump System Operators, Refinery Operators, and Gaugers','Operate or control petroleum refining or processing units. May specialize in controlling manifold and pumping systems, gauging or testing oil in storage tanks, or regulating the flow of oil into pipelines.','bls',NULL),(1282,'2023-02-27 20:35:27.149771','51-8099','Plant and System Operators, All Other','Production Occupations','Plant and System Operators','Miscellaneous Plant and System Operators','Plant and System Operators, All Other','All plant and system operators not listed separately.','bls',NULL),(1283,'2023-02-27 20:35:27.186105','51-9000','Other Production Occupations','Production Occupations','Other Production Occupations',NULL,'Other Production Occupations','','bls',NULL),(1284,'2023-02-27 20:35:27.221573','51-9010','Chemical Processing Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Chemical Processing Machine Setters, Operators, and Tenders','Chemical Processing Machine Setters, Operators, and Tenders','','bls',NULL),(1285,'2023-02-27 20:35:27.259947','51-9011','Chemical Equipment Operators and Tenders','Production Occupations','Other Production Occupations','Chemical Processing Machine Setters, Operators, and Tenders','Chemical Equipment Operators and Tenders','Operate or tend equipment to control chemical changes or reactions in the processing of industrial or consumer products. Equipment used includes devulcanizers, steam-jacketed kettles, and reactor vessels. Excludes “Chemical Plant and System Operators” (51-8091).','bls',NULL),(1286,'2023-02-27 20:35:27.297644','51-9012','Separating, Filtering, Clarifying, Precipitating, and Still Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Chemical Processing Machine Setters, Operators, and Tenders','Separating, Filtering, Clarifying, Precipitating, and Still Machine Setters, Operators, and Tenders','Set up, operate, or tend continuous flow or vat-type equipment; filter presses; shaker screens; centrifuges; condenser tubes; precipitating, fermenting, or evaporating tanks; scrubbing towers; or batch stills. These machines extract, sort, or separate liquids, gases, or solids from other materials to recover a refined product. Includes dairy processing equipment operators. Excludes “Chemical Equipment Operators and Tenders” (51-9011).','bls',NULL),(1287,'2023-02-27 20:35:27.337202','51-9020','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Crushing, Grinding, Polishing, Mixing, and Blending Workers','','bls',NULL),(1288,'2023-02-27 20:35:27.375780','51-9021','Crushing, Grinding, and Polishing Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Crushing, Grinding, and Polishing Machine Setters, Operators, and Tenders','Set up, operate, or tend machines to crush, grind, or polish materials, such as coal, glass, grain, stone, food, or rubber.','bls',NULL),(1289,'2023-02-27 20:35:27.413597','51-9022','Grinding and Polishing Workers, Hand','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Grinding and Polishing Workers, Hand','Grind, sand, or polish, using hand tools or hand-held power tools, a variety of metal, wood, stone, clay, plastic, or glass objects. Includes chippers, buffers, and finishers.','bls',NULL),(1290,'2023-02-27 20:35:27.454760','51-9023','Mixing and Blending Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Mixing and Blending Machine Setters, Operators, and Tenders','Set up, operate, or tend machines to mix or blend materials, such as chemicals, tobacco, liquids, color pigments, or explosive ingredients. Excludes “Food Batchmakers” (51-3092).','bls',NULL),(1291,'2023-02-27 20:35:27.496355','51-9030','Cutting Workers','Production Occupations','Other Production Occupations','Cutting Workers','Cutting Workers','','bls',NULL),(1292,'2023-02-27 20:35:27.529190','51-9031','Cutters and Trimmers, Hand','Production Occupations','Other Production Occupations','Cutting Workers','Cutters and Trimmers, Hand','Use hand tools or hand-held power tools to cut and trim a variety of manufactured items, such as carpet, fabric, stone, glass, or rubber.','bls',NULL),(1293,'2023-02-27 20:35:27.565544','51-9032','Cutting and Slicing Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Cutting Workers','Cutting and Slicing Machine Setters, Operators, and Tenders','Set up, operate, or tend machines that cut or slice materials, such as glass, stone, cork, rubber, tobacco, food, paper, or insulating material. Excludes “Cutting, Punching, and Press Machine Setters, Operators, and Tenders, Metal and Plastic” (51-4031), “Textile Cutting Machine Setters, Operators, and Tenders” (51-6062), and “Woodworking Machine Setters, Operators, and Tenders” (51-7040).','bls',NULL),(1294,'2023-02-27 20:35:27.606353','51-9040','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','','bls',NULL),(1295,'2023-02-27 20:35:27.643974','51-9041','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Set up, operate, or tend machines, such as glass-forming machines, plodder machines, and tuber machines, to shape and form products such as glassware, food, rubber, soap, brick, tile, clay, wax, tobacco, or cosmetics. Excludes “Shoe Machine Operators and Tenders” (51-6042) and “Paper Goods Machine Setters, Operators, and Tenders” (51-9196).','bls',NULL),(1296,'2023-02-27 20:35:27.682540','51-9050','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Production Occupations','Other Production Occupations','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','','bls',NULL),(1297,'2023-02-27 20:35:27.724474','51-9051','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Production Occupations','Other Production Occupations','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Operate or tend heating equipment other than basic metal, plastic, or food processing equipment. Includes activities such as annealing glass, drying lumber, curing rubber, removing moisture from materials, or boiling soap.','bls',NULL),(1298,'2023-02-27 20:35:27.762066','51-9060','Inspectors, Testers, Sorters, Samplers, and Weighers','Production Occupations','Other Production Occupations','Inspectors, Testers, Sorters, Samplers, and Weighers','Inspectors, Testers, Sorters, Samplers, and Weighers','','bls',NULL),(1299,'2023-02-27 20:35:27.799404','51-9061','Inspectors, Testers, Sorters, Samplers, and Weighers','Production Occupations','Other Production Occupations','Inspectors, Testers, Sorters, Samplers, and Weighers','Inspectors, Testers, Sorters, Samplers, and Weighers','Inspect, test, sort, sample, or weigh nonagricultural raw materials or processed, machined, fabricated, or assembled parts or products for defects, wear, and deviations from specifications. May use precision measuring instruments and complex test equipment.','bls',NULL),(1300,'2023-02-27 20:35:27.841646','51-9070','Jewelers and Precious Stone and Metal Workers','Production Occupations','Other Production Occupations','Jewelers and Precious Stone and Metal Workers','Jewelers and Precious Stone and Metal Workers','','bls',NULL),(1301,'2023-02-27 20:35:27.876814','51-9071','Jewelers and Precious Stone and Metal Workers','Production Occupations','Other Production Occupations','Jewelers and Precious Stone and Metal Workers','Jewelers and Precious Stone and Metal Workers','Design, fabricate, adjust, repair, or appraise jewelry, gold, silver, other precious metals, or gems. Includes diamond polishers and gem cutters, and persons who perform precision casting and modeling of molds, casting metal in molds, or setting precious and semiprecious stones for jewelry and related products.','bls',NULL),(1302,'2023-02-27 20:35:27.914929','51-9080','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','','bls',NULL),(1303,'2023-02-27 20:35:27.952629','51-9081','Dental Laboratory Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Dental Laboratory Technicians','Construct and repair full or partial dentures or dental appliances. Excludes “Dental Assistants” (31-9091).','bls',NULL),(1304,'2023-02-27 20:35:27.989203','51-9082','Medical Appliance Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Medical Appliance Technicians','Construct, maintain, or repair medical supportive devices such as braces, orthotics and prosthetic devices, joints, arch supports, and other surgical and medical appliances.','bls',NULL),(1305,'2023-02-27 20:35:28.028420','51-9083','Ophthalmic Laboratory Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Ophthalmic Laboratory Technicians','Cut, grind, and polish eyeglasses, contact lenses, or other precision optical elements. Assemble and mount lenses into frames or process other optical elements. Includes precision lens polishers or grinders, centerer-edgers, and lens mounters. Excludes “Opticians, Dispensing ” (29-2081).','bls',NULL),(1306,'2023-02-27 20:35:28.068881','51-9110','Packaging and Filling Machine Operators and Tenders','Production Occupations','Other Production Occupations','Packaging and Filling Machine Operators and Tenders','Packaging and Filling Machine Operators and Tenders','','bls',NULL),(1307,'2023-02-27 20:35:28.104188','51-9111','Packaging and Filling Machine Operators and Tenders','Production Occupations','Other Production Occupations','Packaging and Filling Machine Operators and Tenders','Packaging and Filling Machine Operators and Tenders','Operate or tend machines to prepare industrial or consumer products for storage or shipment. Includes cannery workers who pack food products.','bls',NULL),(1308,'2023-02-27 20:35:28.144105','51-9120','Painting Workers','Production Occupations','Other Production Occupations','Painting Workers','Painting Workers','','bls',NULL),(1309,'2023-02-27 20:35:28.180600','51-9123','Painting, Coating, and Decorating Workers','Production Occupations','Other Production Occupations','Painting Workers','Painting, Coating, and Decorating Workers','Paint, coat, or decorate articles, such as furniture, glass, plateware, pottery, jewelry, toys, books, or leather. Excludes “Artists and Related Workers\" (27-1010), “Designers” (27-1020), “Photographic Process Workers and Processing Machine Operators” (51-9151), and “Etchers and Engravers” (51-9194).','bls',NULL),(1310,'2023-02-27 20:35:28.215177','51-9124','Coating, Painting, and Spraying Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Painting Workers','Coating, Painting, and Spraying Machine Setters, Operators, and Tenders','Set up, operate, or tend spraying or rolling machines to coat or paint any of a wide variety of products, including glassware, cloth, ceramics, metal, plastic, paper, or wood, with lacquer, silver, copper, rubber, varnish, glaze, enamel, oil, or rust-proofing materials. Includes painters of transportation vehicles such as painters in auto body repair facilities. Excludes “Plating Machine Setters, Operators, and Tenders, Metal and Plastic” (51-4193).','bls',NULL),(1311,'2023-02-27 20:35:28.254181','51-9140','Semiconductor Processing Technicians','Production Occupations','Other Production Occupations','Semiconductor Processing Technicians','Semiconductor Processing Technicians','','bls',NULL),(1312,'2023-02-27 20:35:28.291056','51-9141','Semiconductor Processing Technicians','Production Occupations','Other Production Occupations','Semiconductor Processing Technicians','Semiconductor Processing Technicians','Perform any or all of the following functions in the manufacture of electronic semiconductors: load semiconductor material into furnace; saw formed ingots into segments; load individual segment into crystal growing chamber and monitor controls; locate crystal axis in ingot using x-ray equipment and saw ingots into wafers; and clean, polish, and load wafers into series of special purpose furnaces, chemical baths, and equipment used to form circuitry and change conductive properties.','bls',NULL),(1313,'2023-02-27 20:35:28.327618','51-9150','Photographic Process Workers and Processing Machine Operators','Production Occupations','Other Production Occupations','Photographic Process Workers and Processing Machine Operators','Photographic Process Workers and Processing Machine Operators','','bls',NULL),(1314,'2023-02-27 20:35:28.363316','51-9151','Photographic Process Workers and Processing Machine Operators','Production Occupations','Other Production Occupations','Photographic Process Workers and Processing Machine Operators','Photographic Process Workers and Processing Machine Operators','Perform work involved in developing and processing photographic images from film or digital media. May perform precision tasks such as editing photographic negatives and prints.','bls',NULL),(1315,'2023-02-27 20:35:28.405008','51-9160','Computer Numerically Controlled Tool Operators and Programmers','Production Occupations','Other Production Occupations','Computer Numerically Controlled Tool Operators and Programmers','Computer Numerically Controlled Tool Operators and Programmers','','bls',NULL),(1316,'2023-02-27 20:35:28.441822','51-9161','Computer Numerically Controlled Tool Operators','Production Occupations','Other Production Occupations','Computer Numerically Controlled Tool Operators and Programmers','Computer Numerically Controlled Tool Operators','Operate computer-controlled tools, machines, or robots to machine or process parts, tools, or other work pieces made of metal, plastic, wood, stone, or other materials. May also set up and maintain equipment.','bls',NULL),(1317,'2023-02-27 20:35:28.479152','51-9162','Computer Numerically Controlled Tool Programmers','Production Occupations','Other Production Occupations','Computer Numerically Controlled Tool Operators and Programmers','Computer Numerically Controlled Tool Programmers','Develop programs to control machining or processing of materials by automatic machine tools, equipment, or systems. May also set up, operate, or maintain equipment.','bls',NULL),(1318,'2023-02-27 20:35:28.517518','51-9190','Miscellaneous Production Workers','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Miscellaneous Production Workers','','bls',NULL),(1319,'2023-02-27 20:35:28.554754','51-9191','Adhesive Bonding Machine Operators and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Adhesive Bonding Machine Operators and Tenders','Operate or tend bonding machines that use adhesives to join items for further processing or to form a completed product. Processes include joining veneer sheets into plywood; gluing paper; or joining rubber and rubberized fabric parts, plastic, simulated leather, or other materials. Excludes “Shoe Machine Operators and Tenders” (51-6042).','bls',NULL),(1320,'2023-02-27 20:35:28.594265','51-9192','Cleaning, Washing, and Metal Pickling Equipment Operators and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Cleaning, Washing, and Metal Pickling Equipment Operators and Tenders','Operate or tend machines to wash or clean products, such as barrels or kegs, glass items, tin plate, food, pulp, coal, plastic, or rubber, to remove impurities.','bls',NULL),(1321,'2023-02-27 20:35:28.634688','51-9193','Cooling and Freezing Equipment Operators and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Cooling and Freezing Equipment Operators and Tenders','Operate or tend equipment such as cooling and freezing units, refrigerators, batch freezers, and freezing tunnels, to cool or freeze products, food, blood plasma, and chemicals.','bls',NULL),(1322,'2023-02-27 20:35:28.674988','51-9194','Etchers and Engravers','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Etchers and Engravers','Engrave or etch metal, wood, rubber, or other materials. Includes such workers as etcher-circuit processors, pantograph engravers, and silk screen etchers. Photoengravers are included in “Prepress Technicians and Workers” (51-5111).','bls',NULL),(1323,'2023-02-27 20:35:28.711809','51-9195','Molders, Shapers, and Casters, Except Metal and Plastic','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Molders, Shapers, and Casters, Except Metal and Plastic','Mold, shape, form, cast, or carve products such as food products, figurines, tile, pipes, and candles consisting of clay, glass, plaster, concrete, stone, or combinations of materials.','bls',NULL),(1324,'2023-02-27 20:35:28.755774','51-9196','Paper Goods Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Paper Goods Machine Setters, Operators, and Tenders','Set up, operate, or tend paper goods machines that perform a variety of functions, such as converting, sawing, corrugating, banding, wrapping, boxing, stitching, forming, or sealing paper or paperboard sheets into products.','bls',NULL),(1325,'2023-02-27 20:35:28.792821','51-9197','Tire Builders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Tire Builders','Operate machines to build tires.','bls',NULL),(1326,'2023-02-27 20:35:28.828717','51-9198','Helpers--Production Workers','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Helpers--Production Workers','Help production workers by performing duties requiring less skill. Duties include supplying or holding materials or tools, and cleaning work area and equipment. Apprentice workers are classified in the appropriate production occupations (51-0000).','bls',NULL),(1327,'2023-02-27 20:35:28.870095','51-9199','Production Workers, All Other','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Production Workers, All Other','All production workers not listed separately. Excludes “Packers and Packagers, Hand” (53-7064).','bls',NULL),(1328,'2023-02-27 20:35:28.907650','53-0000','Transportation and Material Moving Occupations','Transportation and Material Moving Occupations',NULL,NULL,'Transportation and Material Moving Occupations','','bls',NULL),(1329,'2023-02-27 20:35:28.941562','53-1000','Supervisors of Transportation and Material Moving Workers','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers',NULL,'Supervisors of Transportation and Material Moving Workers','','bls',NULL),(1330,'2023-02-27 20:35:28.978675','53-1040','First-Line Supervisors of Transportation and Material Moving Workers','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','','bls',NULL),(1331,'2023-02-27 20:35:29.021364','53-1041','Aircraft Cargo Handling Supervisors','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','Aircraft Cargo Handling Supervisors','Supervise and coordinate the activities of ground crew in the loading, unloading, securing, and staging of aircraft cargo or baggage. May determine the quantity and orientation of cargo and compute aircraft center of gravity. May accompany aircraft as member of flight crew and monitor and handle cargo in flight, and assist and brief passengers on safety and emergency procedures. Includes loadmasters.','bls',NULL),(1332,'2023-02-27 20:35:29.062768','53-1042','First-Line Supervisors of Helpers, Laborers, and Material Movers, Hand','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Helpers, Laborers, and Material Movers, Hand','Directly supervise and coordinate the activities of helpers, laborers, or material movers, hand.','bls',NULL),(1333,'2023-02-27 20:35:29.101877','53-1043','First-Line Supervisors of Material-Moving Machine and Vehicle Operators','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Material-Moving Machine and Vehicle Operators','Directly supervise and coordinate activities of material-moving machine and vehicle operators and helpers.','bls',NULL),(1334,'2023-02-27 20:35:29.138173','53-1044','First-Line Supervisors of Passenger Attendants','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Passenger Attendants','Supervise and coordinate activities of passenger attendants. Includes supervisors of “Flight Attendants” (53-2031).','bls',NULL),(1335,'2023-02-27 20:35:29.176853','53-1049','First-Line Supervisors of Transportation Workers, All Other','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation Workers, All Other','All first-line supervisors of transportation workers not listed separately.','bls',NULL),(1336,'2023-02-27 20:35:29.215743','53-2000','Air Transportation Workers','Transportation and Material Moving Occupations','Air Transportation Workers',NULL,'Air Transportation Workers','','bls',NULL),(1337,'2023-02-27 20:35:29.250804','53-2010','Aircraft Pilots and Flight Engineers','Transportation and Material Moving Occupations','Air Transportation Workers','Aircraft Pilots and Flight Engineers','Aircraft Pilots and Flight Engineers','','bls',NULL),(1338,'2023-02-27 20:35:29.288677','53-2011','Airline Pilots, Copilots, and Flight Engineers','Transportation and Material Moving Occupations','Air Transportation Workers','Aircraft Pilots and Flight Engineers','Airline Pilots, Copilots, and Flight Engineers','Pilot and navigate the flight of fixed-wing aircraft, usually on scheduled air carrier routes, for the transport of passengers and cargo. Requires Federal Air Transport certificate and rating for specific aircraft type used. Includes regional, national, and international airline pilots and flight instructors of airline pilots. Excludes “Electro-Mechanical and Mechatronics Technologists and Technicians” (17-3024).','bls',NULL),(1339,'2023-02-27 20:35:29.340742','53-2012','Commercial Pilots','Transportation and Material Moving Occupations','Air Transportation Workers','Aircraft Pilots and Flight Engineers','Commercial Pilots','Pilot and navigate the flight of fixed-wing aircraft on nonscheduled air carrier routes, or helicopters. Requires Commercial Pilot certificate. Includes charter pilots with similar certification, and air ambulance and air tour pilots. Excludes regional, national, and international airline pilots. Excludes “Electro-Mechanical and Mechatronics Technologists and Technicians” (17-3024).','bls',NULL),(1340,'2023-02-27 20:35:29.376765','53-2020','Air Traffic Controllers and Airfield Operations Specialists','Transportation and Material Moving Occupations','Air Transportation Workers','Air Traffic Controllers and Airfield Operations Specialists','Air Traffic Controllers and Airfield Operations Specialists','','bls',NULL),(1341,'2023-02-27 20:35:29.409487','53-2021','Air Traffic Controllers','Transportation and Material Moving Occupations','Air Transportation Workers','Air Traffic Controllers and Airfield Operations Specialists','Air Traffic Controllers','Control air traffic on and within vicinity of airport, and movement of air traffic between altitude sectors and control centers, according to established procedures and policies. Authorize, regulate, and control commercial airline flights according to government or company regulations to expedite and ensure flight safety.','bls',NULL),(1342,'2023-02-27 20:35:29.449669','53-2022','Airfield Operations Specialists','Transportation and Material Moving Occupations','Air Transportation Workers','Air Traffic Controllers and Airfield Operations Specialists','Airfield Operations Specialists','Ensure the safe takeoff and landing of commercial and military aircraft. Duties include coordination between air-traffic control and maintenance personnel, dispatching, using airfield landing and navigational aids, implementing airfield safety procedures, monitoring and maintaining flight records, and applying knowledge of weather information.','bls',NULL),(1343,'2023-02-27 20:35:29.487920','53-2030','Flight Attendants','Transportation and Material Moving Occupations','Air Transportation Workers','Flight Attendants','Flight Attendants','','bls',NULL),(1344,'2023-02-27 20:35:29.522507','53-2031','Flight Attendants','Transportation and Material Moving Occupations','Air Transportation Workers','Flight Attendants','Flight Attendants','Monitor safety of the aircraft cabin. Provide services to airline passengers, explain safety information, serve food and beverages, and respond to emergency incidents.','bls',NULL),(1345,'2023-02-27 20:35:29.562076','53-3000','Motor Vehicle Operators','Transportation and Material Moving Occupations','Motor Vehicle Operators',NULL,'Motor Vehicle Operators','','bls',NULL),(1346,'2023-02-27 20:35:29.596994','53-3010','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Transportation and Material Moving Occupations','Motor Vehicle Operators','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','','bls',NULL),(1347,'2023-02-27 20:35:29.634939','53-3011','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Transportation and Material Moving Occupations','Motor Vehicle Operators','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Drive ambulance or assist ambulance driver in transporting sick, injured, or convalescent persons. Assist in lifting patients.','bls',NULL),(1348,'2023-02-27 20:35:29.675337','53-3030','Driver/Sales Workers and Truck Drivers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Driver/Sales Workers and Truck Drivers','Driver/Sales Workers and Truck Drivers','','bls',NULL),(1349,'2023-02-27 20:35:29.712823','53-3031','Driver/Sales Workers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Driver/Sales Workers and Truck Drivers','Driver/Sales Workers','Drive truck or other vehicle over established routes or within an established territory and sell or deliver goods, such as food products, including restaurant take-out items, or pick up or deliver items such as commercial laundry. May also take orders, collect payment, or stock merchandise at point of delivery. Excludes “Coin, Vending, and Amusement Machine Servicers and Repairers” (49-9091) and “Light Truck Drivers” (53-3033).','bls',NULL),(1350,'2023-02-27 20:35:29.752825','53-3032','Heavy and Tractor-Trailer Truck Drivers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Driver/Sales Workers and Truck Drivers','Heavy and Tractor-Trailer Truck Drivers','Drive a tractor-trailer combination or a truck with a capacity of at least 26,001 pounds Gross Vehicle Weight (GVW). May be required to unload truck. Requires commercial drivers’ license. Includes tow truck drivers. Excludes “Refuse and Recyclable Material Collectors” (53-7081).','bls',NULL),(1351,'2023-02-27 20:35:29.792168','53-3033','Light Truck Drivers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Driver/Sales Workers and Truck Drivers','Light Truck Drivers','Drive a light vehicle, such as a truck or van, with a capacity of less than 26,001 pounds Gross Vehicle Weight (GVW), primarily to pick up merchandise or packages from a distribution center and deliver. May load and unload vehicle. Excludes “Couriers and Messengers” (43-5021) and “Driver/Sales Workers” (53-3031).','bls',NULL),(1352,'2023-02-27 20:35:29.830627','53-3050','Passenger Vehicle Drivers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Passenger Vehicle Drivers','Passenger Vehicle Drivers','','bls',NULL),(1353,'2023-02-27 20:35:29.865367','53-3051','Bus Drivers, School','Transportation and Material Moving Occupations','Motor Vehicle Operators','Passenger Vehicle Drivers','Bus Drivers, School','Drive a school bus to transport students. Ensure adherence to safety rules. May assist students in boarding or exiting.','bls',NULL),(1354,'2023-02-27 20:35:29.905640','53-3052','Bus Drivers, Transit and Intercity','Transportation and Material Moving Occupations','Motor Vehicle Operators','Passenger Vehicle Drivers','Bus Drivers, Transit and Intercity','Drive bus or motor coach, including regular route operations, charters, and private carriage. May assist passengers with baggage. May collect fares or tickets.','bls',NULL),(1355,'2023-02-27 20:35:29.949166','53-3053','Shuttle Drivers and Chauffeurs','Transportation and Material Moving Occupations','Motor Vehicle Operators','Passenger Vehicle Drivers','Shuttle Drivers and Chauffeurs','Drive a motor vehicle to transport passengers on a planned or scheduled basis. May collect a fare. Includes nonemergency medical transporters and hearse drivers. Excludes “Ambulance Drivers and Attendants, Except Emergency Medical Technicians” (53-3011) and “Taxi Drivers” (53-3054).','bls',NULL),(1356,'2023-02-27 20:35:29.986749','53-3054','Taxi Drivers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Passenger Vehicle Drivers','Taxi Drivers','Drive a motor vehicle to transport passengers on an unplanned basis and charge a fare, usually based on a meter. Excludes “Shuttle Drivers and Chauffeurs” (53-3053).','bls',NULL),(1357,'2023-02-27 20:35:30.025011','53-3090','Miscellaneous Motor Vehicle Operators','Transportation and Material Moving Occupations','Motor Vehicle Operators','Miscellaneous Motor Vehicle Operators','Miscellaneous Motor Vehicle Operators','','bls',NULL),(1358,'2023-02-27 20:35:30.064487','53-3099','Motor Vehicle Operators, All Other','Transportation and Material Moving Occupations','Motor Vehicle Operators','Miscellaneous Motor Vehicle Operators','Motor Vehicle Operators, All Other','All motor vehicle operators not listed separately.','bls',NULL),(1359,'2023-02-27 20:35:30.101668','53-4000','Rail Transportation Workers','Transportation and Material Moving Occupations','Rail Transportation Workers',NULL,'Rail Transportation Workers','','bls',NULL),(1360,'2023-02-27 20:35:30.138077','53-4010','Locomotive Engineers and Operators','Transportation and Material Moving Occupations','Rail Transportation Workers','Locomotive Engineers and Operators','Locomotive Engineers and Operators','','bls',NULL),(1361,'2023-02-27 20:35:30.179564','53-4011','Locomotive Engineers','Transportation and Material Moving Occupations','Rail Transportation Workers','Locomotive Engineers and Operators','Locomotive Engineers','Drive electric, diesel-electric, steam, or gas-turbine-electric locomotives to transport passengers or freight. Interpret train orders, electronic or manual signals, and railroad rules and regulations. Excludes “Engineers” (17-2011 through 17-2199).','bls',NULL),(1362,'2023-02-27 20:35:30.217531','53-4013','Rail Yard Engineers, Dinkey Operators, and Hostlers','Transportation and Material Moving Occupations','Rail Transportation Workers','Locomotive Engineers and Operators','Rail Yard Engineers, Dinkey Operators, and Hostlers','Drive switching or other locomotive or dinkey engines within railroad yard, industrial plant, quarry, construction project, or similar location.','bls',NULL),(1363,'2023-02-27 20:35:30.259197','53-4020','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Transportation and Material Moving Occupations','Rail Transportation Workers','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','','bls',NULL),(1364,'2023-02-27 20:35:30.298210','53-4022','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Transportation and Material Moving Occupations','Rail Transportation Workers','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Operate or monitor railroad track switches or locomotive instruments. May couple or uncouple rolling stock to make up or break up trains. Watch for and relay traffic signals. May inspect couplings, air hoses, journal boxes, and hand brakes. May watch for dragging equipment or obstacles on rights-of-way.','bls',NULL),(1365,'2023-02-27 20:35:30.337555','53-4030','Railroad Conductors and Yardmasters','Transportation and Material Moving Occupations','Rail Transportation Workers','Railroad Conductors and Yardmasters','Railroad Conductors and Yardmasters','','bls',NULL),(1366,'2023-02-27 20:35:30.374084','53-4031','Railroad Conductors and Yardmasters','Transportation and Material Moving Occupations','Rail Transportation Workers','Railroad Conductors and Yardmasters','Railroad Conductors and Yardmasters','Coordinate activities of switch-engine crew within railroad yard, industrial plant, or similar location. Conductors coordinate activities of train crew on passenger or freight trains. Yardmasters review train schedules and switching orders and coordinate activities of workers engaged in railroad traffic operations, such as the makeup or breakup of trains and yard switching.','bls',NULL),(1367,'2023-02-27 20:35:30.413166','53-4040','Subway and Streetcar Operators','Transportation and Material Moving Occupations','Rail Transportation Workers','Subway and Streetcar Operators','Subway and Streetcar Operators','','bls',NULL),(1368,'2023-02-27 20:35:30.449246','53-4041','Subway and Streetcar Operators','Transportation and Material Moving Occupations','Rail Transportation Workers','Subway and Streetcar Operators','Subway and Streetcar Operators','Operate subway or elevated suburban trains with no separate locomotive, or electric-powered streetcar, to transport passengers. May handle fares.','bls',NULL),(1369,'2023-02-27 20:35:30.487299','53-4090','Miscellaneous Rail Transportation Workers','Transportation and Material Moving Occupations','Rail Transportation Workers','Miscellaneous Rail Transportation Workers','Miscellaneous Rail Transportation Workers','','bls',NULL),(1370,'2023-02-27 20:35:30.525554','53-4099','Rail Transportation Workers, All Other','Transportation and Material Moving Occupations','Rail Transportation Workers','Miscellaneous Rail Transportation Workers','Rail Transportation Workers, All Other','All rail transportation workers not listed separately.','bls',NULL),(1371,'2023-02-27 20:35:30.562506','53-5000','Water Transportation Workers','Transportation and Material Moving Occupations','Water Transportation Workers',NULL,'Water Transportation Workers','','bls',NULL),(1372,'2023-02-27 20:35:30.603502','53-5010','Sailors and Marine Oilers','Transportation and Material Moving Occupations','Water Transportation Workers','Sailors and Marine Oilers','Sailors and Marine Oilers','','bls',NULL),(1373,'2023-02-27 20:35:30.640765','53-5011','Sailors and Marine Oilers','Transportation and Material Moving Occupations','Water Transportation Workers','Sailors and Marine Oilers','Sailors and Marine Oilers','Stand watch to look for obstructions in path of vessel, measure water depth, turn wheel on bridge, or use emergency equipment as directed by captain, mate, or pilot. Break out, rig, overhaul, and store cargo-handling gear, stationary rigging, and running gear. Perform a variety of maintenance tasks to preserve the painted surface of the ship and to maintain line and ship equipment. Must hold government-issued certification and tankerman certification when working aboard liquid-carrying vessels. Includes able seamen and ordinary seamen.','bls',NULL),(1374,'2023-02-27 20:35:30.678995','53-5020','Ship and Boat Captains and Operators','Transportation and Material Moving Occupations','Water Transportation Workers','Ship and Boat Captains and Operators','Ship and Boat Captains and Operators','','bls',NULL),(1375,'2023-02-27 20:35:30.714370','53-5021','Captains, Mates, and Pilots of Water Vessels','Transportation and Material Moving Occupations','Water Transportation Workers','Ship and Boat Captains and Operators','Captains, Mates, and Pilots of Water Vessels','Command or supervise operations of ships and water vessels, such as tugboats and ferryboats. Required to hold license issued by U.S. Coast Guard. Excludes “Motorboat Operators” (53-5022).','bls',NULL),(1376,'2023-02-27 20:35:30.755323','53-5022','Motorboat Operators','Transportation and Material Moving Occupations','Water Transportation Workers','Ship and Boat Captains and Operators','Motorboat Operators','Operate small motor-driven boats. May assist in navigational activities.','bls',NULL),(1377,'2023-02-27 20:35:30.792747','53-5030','Ship Engineers','Transportation and Material Moving Occupations','Water Transportation Workers','Ship Engineers','Ship Engineers','','bls',NULL),(1378,'2023-02-27 20:35:30.829241','53-5031','Ship Engineers','Transportation and Material Moving Occupations','Water Transportation Workers','Ship Engineers','Ship Engineers','Supervise and coordinate activities of crew engaged in operating and maintaining engines, boilers, deck machinery, and electrical, sanitary, and refrigeration equipment aboard ship. Excludes “Engineers” (17-2000).','bls',NULL),(1379,'2023-02-27 20:35:30.867486','53-6000','Other Transportation Workers','Transportation and Material Moving Occupations','Other Transportation Workers',NULL,'Other Transportation Workers','','bls',NULL),(1380,'2023-02-27 20:35:30.903394','53-6010','Bridge and Lock Tenders','Transportation and Material Moving Occupations','Other Transportation Workers','Bridge and Lock Tenders','Bridge and Lock Tenders','','bls',NULL),(1381,'2023-02-27 20:35:30.939839','53-6011','Bridge and Lock Tenders','Transportation and Material Moving Occupations','Other Transportation Workers','Bridge and Lock Tenders','Bridge and Lock Tenders','Operate and tend bridges, canal locks, and lighthouses to permit marine passage on inland waterways, near shores, and at danger points in waterway passages. May supervise such operations. Includes drawbridge operators, lock operators, and slip bridge operators.','bls',NULL),(1382,'2023-02-27 20:35:30.983705','53-6020','Parking Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Parking Attendants','Parking Attendants','','bls',NULL),(1383,'2023-02-27 20:35:31.022021','53-6021','Parking Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Parking Attendants','Parking Attendants','Park vehicles or issue tickets for customers in a parking lot or garage. May park or tend vehicles in environments such as a car dealership or rental car facility. May collect fee.','bls',NULL),(1384,'2023-02-27 20:35:31.061372','53-6030','Transportation Service Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Service Attendants','Transportation Service Attendants','','bls',NULL),(1385,'2023-02-27 20:35:31.100773','53-6031','Automotive and Watercraft Service Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Service Attendants','Automotive and Watercraft Service Attendants','Service automobiles, buses, trucks, boats, and other automotive or marine vehicles with fuel, lubricants, and accessories. Collect payment for services and supplies. May lubricate vehicle, change motor oil, refill antifreeze, or replace lights or other accessories, such as windshield wiper blades or fan belts. May repair or replace tires. Excludes “Cashiers” (41-2011).','bls',NULL),(1386,'2023-02-27 20:35:31.138020','53-6032','Aircraft Service Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Service Attendants','Aircraft Service Attendants','Service aircraft with fuel. May de-ice aircraft, refill water and cooling agents, empty sewage tanks, service air and oxygen systems, or clean and polish exterior.','bls',NULL),(1387,'2023-02-27 20:35:31.175141','53-6040','Traffic Technicians','Transportation and Material Moving Occupations','Other Transportation Workers','Traffic Technicians','Traffic Technicians','','bls',NULL),(1388,'2023-02-27 20:35:31.212978','53-6041','Traffic Technicians','Transportation and Material Moving Occupations','Other Transportation Workers','Traffic Technicians','Traffic Technicians','Conduct field studies to determine traffic volume, speed, effectiveness of signals, adequacy of lighting, and other factors influencing traffic conditions, under direction of traffic engineer.','bls',NULL),(1389,'2023-02-27 20:35:31.249761','53-6050','Transportation Inspectors','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Inspectors','Transportation Inspectors','','bls',NULL),(1390,'2023-02-27 20:35:31.288843','53-6051','Transportation Inspectors','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Inspectors','Transportation Inspectors','Inspect equipment or goods in connection with the safe transport of cargo or people. Includes rail transportation inspectors, such as freight inspectors, rail inspectors, and other inspectors of transportation vehicles not elsewhere classified. Excludes “Transportation Security Screeners” (33-9093).','bls',NULL),(1391,'2023-02-27 20:35:31.330415','53-6060','Passenger Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Passenger Attendants','Passenger Attendants','','bls',NULL),(1392,'2023-02-27 20:35:31.364757','53-6061','Passenger Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Passenger Attendants','Passenger Attendants','Provide services to ensure the safety of passengers aboard ships, buses, trains, or within the station or terminal. Perform duties such as explaining the use of safety equipment, serving meals or beverages, or answering questions related to travel. Excludes “Baggage Porters and Bellhops” (39-6011) and “Flight Attendants” (53-2031).','bls',NULL),(1393,'2023-02-27 20:35:31.403735','53-6090','Miscellaneous Transportation Workers','Transportation and Material Moving Occupations','Other Transportation Workers','Miscellaneous Transportation Workers','Miscellaneous Transportation Workers','','bls',NULL),(1394,'2023-02-27 20:35:31.442249','53-6099','Transportation Workers, All Other','Transportation and Material Moving Occupations','Other Transportation Workers','Miscellaneous Transportation Workers','Transportation Workers, All Other','All transportation workers not listed separately.','bls',NULL),(1395,'2023-02-27 20:35:31.478229','53-7000','Material Moving Workers','Transportation and Material Moving Occupations','Material Moving Workers',NULL,'Material Moving Workers','','bls',NULL),(1396,'2023-02-27 20:35:31.514715','53-7010','Conveyor Operators and Tenders','Transportation and Material Moving Occupations','Material Moving Workers','Conveyor Operators and Tenders','Conveyor Operators and Tenders','','bls',NULL),(1397,'2023-02-27 20:35:31.554779','53-7011','Conveyor Operators and Tenders','Transportation and Material Moving Occupations','Material Moving Workers','Conveyor Operators and Tenders','Conveyor Operators and Tenders','Control or tend conveyors or conveyor systems that move materials or products to and from stockpiles, processing stations, departments, or vehicles. May control speed and routing of materials or products.','bls',NULL),(1398,'2023-02-27 20:35:31.593700','53-7020','Crane and Tower Operators','Transportation and Material Moving Occupations','Material Moving Workers','Crane and Tower Operators','Crane and Tower Operators','','bls',NULL),(1399,'2023-02-27 20:35:31.630843','53-7021','Crane and Tower Operators','Transportation and Material Moving Occupations','Material Moving Workers','Crane and Tower Operators','Crane and Tower Operators','Operate mechanical boom and cable or tower and cable equipment to lift and move materials, machines, or products in many directions.','bls',NULL),(1400,'2023-02-27 20:35:31.668473','53-7030','Dredge Operators','Transportation and Material Moving Occupations','Material Moving Workers','Dredge Operators','Dredge Operators','','bls',NULL),(1401,'2023-02-27 20:35:31.704209','53-7031','Dredge Operators','Transportation and Material Moving Occupations','Material Moving Workers','Dredge Operators','Dredge Operators','Operate dredge to remove sand, gravel, or other materials in order to excavate and maintain navigable channels in waterways.','bls',NULL),(1402,'2023-02-27 20:35:31.741946','53-7040','Hoist and Winch Operators','Transportation and Material Moving Occupations','Material Moving Workers','Hoist and Winch Operators','Hoist and Winch Operators','','bls',NULL),(1403,'2023-02-27 20:35:31.781864','53-7041','Hoist and Winch Operators','Transportation and Material Moving Occupations','Material Moving Workers','Hoist and Winch Operators','Hoist and Winch Operators','Operate or tend hoists or winches to lift and pull loads using power-operated cable equipment. Excludes “Crane and Tower Operators” (53-7021).','bls',NULL),(1404,'2023-02-27 20:35:31.819006','53-7050','Industrial Truck and Tractor Operators','Transportation and Material Moving Occupations','Material Moving Workers','Industrial Truck and Tractor Operators','Industrial Truck and Tractor Operators','','bls',NULL),(1405,'2023-02-27 20:35:31.857015','53-7051','Industrial Truck and Tractor Operators','Transportation and Material Moving Occupations','Material Moving Workers','Industrial Truck and Tractor Operators','Industrial Truck and Tractor Operators','Operate industrial trucks or tractors equipped to move materials around a warehouse, storage yard, factory, construction site, or similar location. Excludes “Logging Equipment Operators” (45-4022).','bls',NULL),(1406,'2023-02-27 20:35:31.899023','53-7060','Laborers and Material Movers','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Laborers and Material Movers','','bls',NULL),(1407,'2023-02-27 20:35:31.938815','53-7061','Cleaners of Vehicles and Equipment','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Cleaners of Vehicles and Equipment','Wash or otherwise clean vehicles, machinery, and other equipment. Use such materials as water, cleaning agents, brushes, cloths, and hoses. Excludes “Janitors and Cleaners, Except Maids and Housekeeping Cleaners” (37-2011).','bls',NULL),(1408,'2023-02-27 20:35:31.978535','53-7062','Laborers and Freight, Stock, and Material Movers, Hand','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Laborers and Freight, Stock, and Material Movers, Hand','Manually move freight, stock, luggage, or other materials, or perform other general labor. Includes all manual laborers not elsewhere classified. Excludes “Construction Laborers” (47-2061) and “Helpers, Construction Trades” (47-3011 through 47-3019). Excludes “Material Moving Workers” (53-7011 through 53-7199) who use power equipment.','bls',NULL),(1409,'2023-02-27 20:35:32.021097','53-7063','Machine Feeders and Offbearers','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Machine Feeders and Offbearers','Feed materials into or remove materials from machines or equipment that is automatic or tended by other workers.','bls',NULL),(1410,'2023-02-27 20:35:32.056926','53-7064','Packers and Packagers, Hand','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Packers and Packagers, Hand','Pack or package by hand a wide variety of products and materials.','bls',NULL),(1411,'2023-02-27 20:35:32.094461','53-7065','Stockers and Order Fillers','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Stockers and Order Fillers','Receive, store, and issue merchandise, materials, equipment, and other items from stockroom, warehouse, or storage yard to fill shelves, racks, tables, or customers’ orders. May operate power equipment to fill orders. May mark prices on merchandise and set up sales displays. Excludes “Shipping, Receiving, and Inventory Clerks” (43-5071), “Laborers and Freight, Stock, and Material Movers, Hand” (53-7062), and “Packers and Packagers, Hand” (53-7064).','bls',NULL),(1412,'2023-02-27 20:35:32.136760','53-7070','Pumping Station Operators','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Pumping Station Operators','','bls',NULL),(1413,'2023-02-27 20:35:32.174328','53-7071','Gas Compressor and Gas Pumping Station Operators','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Gas Compressor and Gas Pumping Station Operators','Operate steam-, gas-, electric motor-, or internal combustion-engine driven compressors. Transmit, compress, or recover gases, such as butane, nitrogen, hydrogen, and natural gas.','bls',NULL),(1414,'2023-02-27 20:35:32.209636','53-7072','Pump Operators, Except Wellhead Pumpers','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Pump Operators, Except Wellhead Pumpers','Tend, control, or operate power-driven, stationary, or portable pumps and manifold systems to transfer gases, oil, other liquids, slurries, or powdered materials to and from various vessels and processes.','bls',NULL),(1415,'2023-02-27 20:35:32.249389','53-7073','Wellhead Pumpers','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Wellhead Pumpers','Operate power pumps and auxiliary equipment to produce flow of oil or gas from wells in oil field.','bls',NULL),(1416,'2023-02-27 20:35:32.285101','53-7080','Refuse and Recyclable Material Collectors','Transportation and Material Moving Occupations','Material Moving Workers','Refuse and Recyclable Material Collectors','Refuse and Recyclable Material Collectors','','bls',NULL),(1417,'2023-02-27 20:35:32.322703','53-7081','Refuse and Recyclable Material Collectors','Transportation and Material Moving Occupations','Material Moving Workers','Refuse and Recyclable Material Collectors','Refuse and Recyclable Material Collectors','Collect and dump refuse or recyclable materials from containers into truck. May drive truck.','bls',NULL),(1418,'2023-02-27 20:35:32.362937','53-7120','Tank Car, Truck, and Ship Loaders','Transportation and Material Moving Occupations','Material Moving Workers','Tank Car, Truck, and Ship Loaders','Tank Car, Truck, and Ship Loaders','','bls',NULL),(1419,'2023-02-27 20:35:32.400533','53-7121','Tank Car, Truck, and Ship Loaders','Transportation and Material Moving Occupations','Material Moving Workers','Tank Car, Truck, and Ship Loaders','Tank Car, Truck, and Ship Loaders','Load and unload chemicals and bulk solids, such as coal, sand, and grain, into or from tank cars, trucks, or ships, using material moving equipment. May perform a variety of other tasks relating to shipment of products. May gauge or sample shipping tanks and test them for leaks.','bls',NULL),(1420,'2023-02-27 20:35:32.440222','53-7190','Miscellaneous Material Moving Workers','Transportation and Material Moving Occupations','Material Moving Workers','Miscellaneous Material Moving Workers','Miscellaneous Material Moving Workers','','bls',NULL),(1421,'2023-02-27 20:35:32.478993','53-7199','Material Moving Workers, All Other','Transportation and Material Moving Occupations','Material Moving Workers','Miscellaneous Material Moving Workers','Material Moving Workers, All Other','All material moving workers not listed separately.','bls',NULL),(1422,'2023-02-27 20:35:32.516478','55-0000','Military Specific Occupations','Military Specific Occupations',NULL,NULL,'Military Specific Occupations','','bls',NULL),(1423,'2023-02-27 20:35:32.551181','55-1000','Military Officer Special and Tactical Operations Leaders','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders',NULL,'Military Officer Special and Tactical Operations Leaders','','bls',NULL),(1424,'2023-02-27 20:35:32.591430','55-1010','Military Officer Special and Tactical Operations Leaders','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','','bls',NULL),(1425,'2023-02-27 20:35:32.627635','55-1011','Air Crew Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Air Crew Officers','Perform and direct in-flight duties to ensure the successful completion of combat, reconnaissance, transport, and search and rescue missions. Duties include operating aircraft communications and radar equipment, such as establishing satellite linkages and jamming enemy communications capabilities; operating aircraft weapons and defensive systems; conducting preflight, in-flight, and postflight inspections of onboard equipment; and directing cargo and personnel drops.','bls',NULL),(1426,'2023-02-27 20:35:32.667823','55-1012','Aircraft Launch and Recovery Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Aircraft Launch and Recovery Officers','Plan and direct the operation and maintenance of catapults, arresting gear, and associated mechanical, hydraulic, and control systems involved primarily in aircraft carrier takeoff and landing operations. Duties include supervision of readiness and safety of arresting gear, launching equipment, barricades, and visual landing aid systems; planning and coordinating the design, development, and testing of launch and recovery systems; preparing specifications for catapult and arresting gear installations; evaluating design proposals; determining handling equipment needed for new aircraft; preparing technical data and instructions for operation of landing aids; and training personnel in carrier takeoff and landing procedures.','bls',NULL),(1427,'2023-02-27 20:35:32.712403','55-1013','Armored Assault Vehicle Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Armored Assault Vehicle Officers','Direct the operation of tanks, light armor, and amphibious assault vehicle units during combat situations on land or in aquatic environments. Duties include directing crew members in the operation of targeting and firing systems; coordinating the operation of advanced onboard communications and navigation equipment; directing the transport of personnel and equipment during combat; formulating and implementing battle plans, including the tactical employment of armored vehicle units; and coordinating with infantry, artillery, and air support units.','bls',NULL),(1428,'2023-02-27 20:35:32.753057','55-1014','Artillery and Missile Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Artillery and Missile Officers','Manage personnel and weapons operations to destroy enemy positions, aircraft, and vessels. Duties include planning, targeting, and coordinating the tactical deployment of field artillery and air defense artillery missile systems units; directing the establishment and operation of fire control communications systems; targeting and launching intercontinental ballistic missiles; directing the storage and handling of nuclear munitions and components; overseeing security of weapons storage and launch facilities; and managing maintenance of weapons systems.','bls',NULL),(1429,'2023-02-27 20:35:32.792982','55-1015','Command and Control Center Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Command and Control Center Officers','Manage the operation of communications, detection, and weapons systems essential for controlling air, ground, and naval operations. Duties include managing critical communication links between air, naval, and ground forces; formulating and implementing emergency plans for natural and wartime disasters; coordinating emergency response teams and agencies; evaluating command center information and need for high-level military and government reporting; managing the operation of surveillance and detection systems; providing technical information and advice on capabilities and operational readiness; and directing operation of weapons targeting, firing, and launch computer systems.','bls',NULL),(1430,'2023-02-27 20:35:32.835539','55-1016','Infantry Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Infantry Officers','Direct, train, and lead infantry units in ground combat operations. Duties include directing deployment of infantry weapons, vehicles, and equipment; directing location, construction, and camouflage of infantry positions and equipment; managing field communications operations; coordinating with armor, artillery, and air support units; performing strategic and tactical planning, including battle plan development; and leading basic reconnaissance operations.','bls',NULL),(1431,'2023-02-27 20:35:32.873177','55-1017','Special Forces Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Special Forces Officers','Lead elite teams that implement unconventional operations by air, land, or sea during combat or peacetime. These activities include offensive raids, demolitions, reconnaissance, search and rescue, and counterterrorism. In addition to their combat training, special forces officers often have specialized training in swimming, diving, parachuting, survival, emergency medicine, and foreign languages. Duties include directing advanced reconnaissance operations and evaluating intelligence information; recruiting, training, and equipping friendly forces; leading raids and invasions on enemy territories; training personnel to implement individual missions and contingency plans; performing strategic and tactical planning for politically sensitive missions; and operating sophisticated communications equipment.','bls',NULL),(1432,'2023-02-27 20:35:32.917213','55-1019','Military Officer Special and Tactical Operations Leaders, All Other','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders, All Other','All military officer special and tactical operations leaders not listed separately.','bls',NULL),(1433,'2023-02-27 20:35:32.958950','55-2000','First-Line Enlisted Military Supervisors','Military Specific Occupations','First-Line Enlisted Military Supervisors',NULL,'First-Line Enlisted Military Supervisors','','bls',NULL),(1434,'2023-02-27 20:35:32.994744','55-2010','First-Line Enlisted Military Supervisors','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','','bls',NULL),(1435,'2023-02-27 20:35:33.032426','55-2011','First-Line Supervisors of Air Crew Members','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Supervisors of Air Crew Members','Supervise and coordinate the activities of air crew members. Supervisors may also perform the same activities as the workers they supervise.','bls',NULL),(1436,'2023-02-27 20:35:33.073376','55-2012','First-Line Supervisors of Weapons Specialists/Crew Members','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Supervisors of Weapons Specialists/Crew Members','Supervise and coordinate the activities of weapons specialists/crew members. Supervisors may also perform the same activities as the workers they supervise.','bls',NULL),(1437,'2023-02-27 20:35:33.109502','55-2013','First-Line Supervisors of All Other Tactical Operations Specialists','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Supervisors of All Other Tactical Operations Specialists','Supervise and coordinate the activities of all other tactical operations specialists not classified separately above. Supervisors may also perform the same activities as the workers they supervise.','bls',NULL),(1438,'2023-02-27 20:35:33.148518','55-3000','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members',NULL,'Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','','bls',NULL),(1439,'2023-02-27 20:35:33.189226','55-3010','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','','bls',NULL),(1440,'2023-02-27 20:35:33.226886','55-3011','Air Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Air Crew Members','Perform in-flight duties to ensure the successful completion of combat, reconnaissance, transport, and search and rescue missions. Duties include operating aircraft communications and detection equipment, including establishing satellite linkages and jamming enemy communications capabilities; conducting preflight, in-flight, and postflight inspections of onboard equipment; operating and maintaining aircraft weapons and defensive systems; operating and maintaining aircraft in-flight refueling systems; executing aircraft safety and emergency procedures; computing and verifying passenger, cargo, fuel, and emergency and special equipment weight and balance data; and conducting cargo and personnel drops.','bls',NULL),(1441,'2023-02-27 20:35:33.266760','55-3012','Aircraft Launch and Recovery Specialists','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Aircraft Launch and Recovery Specialists','Operate and maintain catapults, arresting gear, and associated mechanical, hydraulic, and control systems involved primarily in aircraft carrier takeoff and landing operations. Duties include installing and maintaining visual landing aids; testing and maintaining launch and recovery equipment using electric and mechanical test equipment and hand tools; activating airfield arresting systems, such as crash barriers and cables, during emergency landing situations; directing aircraft launch and recovery operations using hand or light signals; and maintaining logs of airplane launches, recoveries, and equipment maintenance.','bls',NULL),(1442,'2023-02-27 20:35:33.309548','55-3013','Armored Assault Vehicle Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Armored Assault Vehicle Crew Members','Operate tanks, light armor, and amphibious assault vehicles during combat situations on land or in aquatic environments. Duties include driving armored vehicles that require specialized training; operating and maintaining targeting and firing systems; operating and maintaining advanced onboard communications and navigation equipment; transporting personnel and equipment in a combat environment; and operating and maintaining auxiliary weapons, including machine guns and grenade launchers.','bls',NULL),(1443,'2023-02-27 20:35:33.349372','55-3014','Artillery and Missile Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Artillery and Missile Crew Members','Target, fire, and maintain weapons used to destroy enemy positions, aircraft, and vessels. Field artillery crew members predominantly use guns, cannons, and howitzers in ground combat operations, while air defense artillery crew members predominantly use missiles and rockets. Naval artillery crew members predominantly use torpedoes and missiles launched from a ship or submarine. Duties include testing, inspecting, and storing ammunition, missiles, and torpedoes; conducting preventive and routine maintenance on weapons and related equipment; establishing and maintaining radio and wire communications; and operating weapons targeting, firing, and launch computer systems.','bls',NULL),(1444,'2023-02-27 20:35:33.393259','55-3015','Command and Control Center Specialists','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Command and Control Center Specialists','Operate and monitor communications, detection, and weapons systems essential for controlling air, ground, and naval operations. Duties include maintaining and relaying critical communications between air, naval, and ground forces; implementing emergency plans for natural and wartime disasters; relaying command center information to high-level military and government decisionmakers; monitoring surveillance and detection systems, such as air defense; interpreting and evaluating tactical situations and making recommendations to superiors; and operating weapons targeting, firing, and launch computer systems.','bls',NULL),(1445,'2023-02-27 20:35:33.436684','55-3016','Infantry','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Infantry','Operate weapons and equipment in ground combat operations. Duties include operating and maintaining weapons, such as rifles, machine guns, mortars, and hand grenades; locating, constructing, and camouflaging infantry positions and equipment; evaluating terrain and recording topographical information; operating and maintaining field communications equipment; assessing need for and directing supporting fire; placing explosives and performing minesweeping activities on land; and participating in basic reconnaissance operations.','bls',NULL),(1446,'2023-02-27 20:35:33.476807','55-3018','Special Forces','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Special Forces','Implement unconventional operations by air, land, or sea during combat or peacetime as members of elite teams. These activities include offensive raids, demolitions, reconnaissance, search and rescue, and counterterrorism. In addition to their combat training, special forces members often have specialized training in swimming, diving, parachuting, survival, emergency medicine, and foreign languages. Duties include conducting advanced reconnaissance operations and collecting intelligence information; recruiting, training, and equipping friendly forces; conducting raids and invasions on enemy territories; laying and detonating explosives for demolition targets; locating, identifying, defusing, and disposing of ordnance; and operating and maintaining sophisticated communications equipment.','bls',NULL),(1447,'2023-02-27 20:35:33.516687','55-3019','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members, All Other','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members, All Other','All military enlisted tactical operations and air/weapons specialists and crewmembers not listed separately.','bls',NULL),(1448,'2023-02-27 20:35:59.490361','11-1011.00','Chief Executives','Management Occupations','Top Executives','Chief Executives','Chief Executives','Determine and formulate policies and provide overall direction of companies or private and public sector organizations within guidelines set up by a board of directors or similar governing body. Plan, direct, or coordinate operational activities at the highest level of management with the help of subordinate executives and staff managers.','o*net',NULL),(1449,'2023-02-27 20:35:59.641571','11-1011.03','Chief Sustainability Officers','Management Occupations','Top Executives','Chief Executives','Chief Executives','Communicate and coordinate with management, shareholders, customers, and employees to address sustainability issues. Enact or oversee a corporate sustainability strategy.','o*net',NULL),(1450,'2023-02-27 20:35:59.673559','11-1021.00','General and Operations Managers','Management Occupations','Top Executives','General and Operations Managers','General and Operations Managers','Plan, direct, or coordinate the operations of public or private sector organizations, overseeing multiple departments or locations. Duties and responsibilities include formulating policies, managing daily operations, and planning the use of materials and human resources, but are too diverse and general in nature to be classified in any one functional area of management or administration, such as personnel, purchasing, or administrative services. Usually manage through subordinate supervisors. Excludes First-Line Supervisors.','o*net',NULL),(1451,'2023-02-27 20:35:59.706625','11-1031.00','Legislators','Management Occupations','Top Executives','Legislators','Legislators','Develop, introduce, or enact laws and statutes at the local, tribal, state, or federal level. Includes only workers in elected positions.','o*net',NULL),(1452,'2023-02-27 20:35:59.737008','11-2011.00','Advertising and Promotions Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Advertising and Promotions Managers','Advertising and Promotions Managers','Plan, direct, or coordinate advertising policies and programs or produce collateral materials, such as posters, contests, coupons, or giveaways, to create extra interest in the purchase of a product or service for a department, an entire organization, or on an account basis.','o*net',NULL),(1453,'2023-02-27 20:35:59.770932','11-2021.00','Marketing Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Marketing and Sales Managers','Marketing Managers','Plan, direct, or coordinate marketing policies and programs, such as determining the demand for products and services offered by a firm and its competitors, and identify potential customers. Develop pricing strategies with the goal of maximizing the firm\'s profits or share of the market while ensuring the firm\'s customers are satisfied. Oversee product development or monitor trends that indicate the need for new products and services.','o*net',NULL),(1454,'2023-02-27 20:35:59.805974','11-2022.00','Sales Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Marketing and Sales Managers','Sales Managers','Plan, direct, or coordinate the actual distribution or movement of a product or service to the customer. Coordinate sales distribution by establishing sales territories, quotas, and goals and establish training programs for sales representatives. Analyze sales statistics gathered by staff to determine sales potential and inventory requirements and monitor the preferences of customers.','o*net',NULL),(1455,'2023-02-27 20:35:59.840128','11-2032.00','Public Relations Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Public Relations and Fundraising Managers','Public Relations Managers','Plan, direct, or coordinate activities designed to create or maintain a favorable public image or raise issue awareness for their organization or client.','o*net',NULL),(1456,'2023-02-27 20:35:59.873202','11-2033.00','Fundraising Managers','Management Occupations','Advertising, Marketing, Promotions, Public Relations, and Sales Managers','Public Relations and Fundraising Managers','Fundraising Managers','Plan, direct, or coordinate activities to solicit and maintain funds for special projects or nonprofit organizations.','o*net',NULL),(1457,'2023-02-27 20:35:59.904494','11-3012.00','Administrative Services Managers','Management Occupations','Operations Specialties Managers','Administrative Services and Facilities Managers','Administrative Services Managers','Plan, direct, or coordinate one or more administrative services of an organization, such as records and information management, mail distribution, and other office support services.','o*net',NULL),(1458,'2023-02-27 20:35:59.938544','11-3013.00','Facilities Managers','Management Occupations','Operations Specialties Managers','Administrative Services and Facilities Managers','Facilities Managers','Plan, direct, or coordinate operations and functionalities of facilities and buildings. May include surrounding grounds or multiple facilities of an organization\'s campus.','o*net',NULL),(1459,'2023-02-27 20:35:59.972087','11-3013.01','Security Managers','Management Occupations','Operations Specialties Managers','Administrative Services and Facilities Managers','Facilities Managers','Direct an organization\'s security functions, including physical security and safety of employees and facilities.','o*net',NULL),(1460,'2023-02-27 20:36:00.004497','11-3021.00','Computer and Information Systems Managers','Management Occupations','Operations Specialties Managers','Computer and Information Systems Managers','Computer and Information Systems Managers','Plan, direct, or coordinate activities in such fields as electronic data processing, information systems, systems analysis, and computer programming.','o*net',NULL),(1461,'2023-02-27 20:36:00.040619','11-3031.00','Financial Managers','Management Occupations','Operations Specialties Managers','Financial Managers','Financial Managers','Plan, direct, or coordinate accounting, investing, banking, insurance, secur