elors, Social Workers, and Other Community and Social Service Specialists','Counselors','Marriage and Family Therapists','Diagnose and treat mental and emotional disorders, whether cognitive, affective, or behavioral, within the context of marriage and family systems. Apply psychotherapeutic and family systems theories and techniques in the delivery of services to individuals, couples, and families for the purpose of treating such diagnosed nervous and mental disorders.','o*net',NULL),(1723,'2023-02-27 20:36:07.436529','21-1014.00','Mental Health Counselors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Mental Health Counselors','Counsel and advise individuals and groups to promote optimum mental and emotional health, with an emphasis on prevention. May help individuals deal with a broad range of mental health issues, such as those associated with addictions and substance abuse; family, parenting, and marital problems; stress management; self-esteem; or aging.','o*net',NULL),(1724,'2023-02-27 20:36:07.461979','21-1015.00','Rehabilitation Counselors','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Rehabilitation Counselors','Counsel individuals to maximize the independence and employability of persons coping with personal, social, and vocational difficulties that result from birth defects, illness, disease, accidents, aging, or the stress of daily life. Coordinate activities for residents of care and treatment facilities. Assess client needs and design and implement rehabilitation programs that may include personal and vocational counseling, training, and job placement.','o*net',NULL),(1725,'2023-02-27 20:36:07.491848','21-1019.00','Counselors, All Other','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Counselors','Counselors, All Other','All counselors not listed separately.','o*net',NULL),(1726,'2023-02-27 20:36:07.518253','21-1021.00','Child, Family, and School Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Child, Family, and School Social Workers','Provide social services and assistance to improve the social and psychological functioning of children and their families and to maximize the family well-being and the academic functioning of children. May assist parents, arrange adoptions, and find foster homes for abandoned or abused children. In schools, they address such problems as teenage pregnancy, misbehavior, and truancy. May also advise teachers.','o*net',NULL),(1727,'2023-02-27 20:36:07.548463','21-1022.00','Healthcare Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Healthcare Social Workers','Provide individuals, families, and groups with the psychosocial support needed to cope with chronic, acute, or terminal illnesses. Services include advising family caregivers. Provide patients with information and counseling, and make referrals for other services. May also provide case and care management or interventions designed to promote health, prevent disease, and address barriers to access to healthcare.','o*net',NULL),(1728,'2023-02-27 20:36:07.575441','21-1023.00','Mental Health and Substance Abuse Social Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Mental Health and Substance Abuse Social Workers','Assess and treat individuals with mental, emotional, or substance abuse problems, including abuse of alcohol, tobacco, and/or other drugs. Activities may include individual and group therapy, crisis intervention, case management, client advocacy, prevention, and education.','o*net',NULL),(1729,'2023-02-27 20:36:07.604830','21-1029.00','Social Workers, All Other','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Social Workers','Social Workers, All Other','All social workers not listed separately.','o*net',NULL),(1730,'2023-02-27 20:36:07.631952','21-1091.00','Health Education Specialists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Health Education Specialists','Provide and manage health education programs that help individuals, families, and their communities maximize and maintain healthy lifestyles. Use data to identify community needs prior to planning, implementing, monitoring, and evaluating programs designed to encourage healthy lifestyles, policies, and environments. May link health systems, health providers, insurers, and patients to address individual and population health needs. May serve as resource to assist individuals, other health professionals, or the community, and may administer fiscal resources for health education programs.','o*net',NULL),(1731,'2023-02-27 20:36:07.663752','21-1092.00','Probation Officers and Correctional Treatment Specialists','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Probation Officers and Correctional Treatment Specialists','Provide social services to assist in rehabilitation of law offenders in custody or on probation or parole. Make recommendations for actions involving formulation of rehabilitation plan and treatment of offender, including conditional release and education and employment stipulations.','o*net',NULL),(1732,'2023-02-27 20:36:07.692412','21-1093.00','Social and Human Service Assistants','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Social and Human Service Assistants','Assist other social and human service providers in providing client services in a wide variety of fields, such as psychology, rehabilitation, or social work, including support for families. May assist clients in identifying and obtaining available benefits and social and community services. May assist social workers with developing, organizing, and conducting programs to prevent and resolve problems relevant to substance abuse, human relationships, rehabilitation, or dependent care.','o*net',NULL),(1733,'2023-02-27 20:36:07.720275','21-1094.00','Community Health Workers','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Community Health Workers','Promote health within a community by assisting individuals to adopt healthy behaviors. Serve as an advocate for the health needs of individuals by assisting community residents in effectively communicating with healthcare providers or social service agencies. Act as liaison or advocate and implement programs that promote, maintain, and improve individual and overall community health. May deliver health-related preventive services such as blood pressure, glaucoma, and hearing screenings. May collect data to help identify community health needs.','o*net',NULL),(1734,'2023-02-27 20:36:07.748734','21-1099.00','Community and Social Service Specialists, All Other','Community and Social Service Occupations','Counselors, Social Workers, and Other Community and Social Service Specialists','Miscellaneous Community and Social Service Specialists','Community and Social Service Specialists, All Other','All community and social service specialists not listed separately.','o*net',NULL),(1735,'2023-02-27 20:36:07.776