,(1851,'2023-02-27 20:36:10.926728','27-4011.00','Audio and Video Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Audio and Video Technicians','Set up, maintain, and dismantle audio and video equipment, such as microphones, sound speakers, connecting wires and cables, sound and mixing boards, video cameras, video monitors and servers, and related electronic equipment for live or recorded events, such as concerts, meetings, conventions, presentations, podcasts, news conferences, and sporting events.','o*net',NULL),(1852,'2023-02-27 20:36:10.953448','27-4012.00','Broadcast Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Broadcast Technicians','Set up, operate, and maintain the electronic equipment used to acquire, edit, and transmit audio and video for radio or television programs. Control and adjust incoming and outgoing broadcast signals to regulate sound volume, signal strength, and signal clarity. Operate satellite, microwave, or other transmitter equipment to broadcast radio or television programs.','o*net',NULL),(1853,'2023-02-27 20:36:10.979913','27-4014.00','Sound Engineering Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Sound Engineering Technicians','Assemble and operate equipment to record, synchronize, mix, edit, or reproduce sound, including music, voices, or sound effects, for theater, video, film, television, podcasts, sporting events, and other productions.','o*net',NULL),(1854,'2023-02-27 20:36:11.011812','27-4015.00','Lighting Technicians','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Broadcast, Sound, and Lighting Technicians','Lighting Technicians','Set up, maintain, and dismantle light fixtures, lighting control devices, and the associated lighting electrical and rigging equipment used for photography, television, film, video, and live productions. May focus or operate light fixtures, or attach color filters or other lighting accessories.','o*net',NULL),(1855,'2023-02-27 20:36:11.035393','27-4021.00','Photographers','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Photographers','Photographers','Photograph people, landscapes, merchandise, or other subjects. May use lighting equipment to enhance a subject\'s appearance. May use editing software to produce finished images and prints. Includes commercial and industrial photographers, scientific photographers, and photojournalists.','o*net',NULL),(1856,'2023-02-27 20:36:11.061464','27-4031.00','Camera Operators, Television, Video, and Film','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Television, Video, and Film Camera Operators and Editors','Camera Operators, Television, Video, and Film','Operate television, video, or film camera to record images or scenes for television, video, or film productions.','o*net',NULL),(1857,'2023-02-27 20:36:11.089216','27-4032.00','Film and Video Editors','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Television, Video, and Film Camera Operators and Editors','Film and Video Editors','Edit moving images on film, video, or other media. May work with a producer or director to organize images for final production. May edit or synchronize soundtracks with images.','o*net',NULL),(1858,'2023-02-27 20:36:11.117302','27-4099.00','Media and Communication Equipment Workers, All Other','Arts, Design, Entertainment, Sports, and Media Occupations','Media and Communication Equipment Workers','Miscellaneous Media and Communication Equipment Workers','Media and Communication Equipment Workers, All Other','All media and communication equipment workers not listed separately.','o*net',NULL),(1859,'2023-02-27 20:36:11.143475','29-1011.00','Chiropractors','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Chiropractors','Chiropractors','Assess, treat, and care for patients by manipulation of spine and musculoskeletal system. May provide spinal adjustment or address sacral or pelvic misalignment.','o*net',NULL),(1860,'2023-02-27 20:36:11.168540','29-1021.00','Dentists, General','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Dentists, General','Examine, diagnose, and treat diseases, injuries, and malformations of teeth and gums. May treat diseases of nerve, pulp, and other dental tissues affecting oral hygiene and retention of teeth. May fit dental appliances or provide preventive care.','o*net',NULL),(1861,'2023-02-27 20:36:11.197414','29-1022.00','Oral and Maxillofacial Surgeons','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Oral and Maxillofacial Surgeons','Perform surgery and related procedures on the hard and soft tissues of the oral and maxillofacial regions to treat diseases, injuries, or defects. May diagnose problems of the oral and maxillofacial regions. May perform surgery to improve function or appearance.','o*net',NULL),(1862,'2023-02-27 20:36:11.226193','29-1023.00','Orthodontists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Orthodontists','Examine, diagnose, and treat dental malocclusions and oral cavity anomalies. Design and fabricate appliances to realign teeth and jaws to produce and maintain normal function and to improve appearance.','o*net',NULL),(1863,'2023-02-27 20:36:11.258951','29-1024.00','Prosthodontists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Prosthodontists','Diagnose, treat, rehabilitate, design, and fit prostheses that maintain oral function, health, and appearance for patients with clinical conditions associated with teeth, oral and maxillofacial tissues, or the jaw.','o*net',NULL),(1864,'2023-02-27 20:36:11.282819','29-1029.00','Dentists, All Other Specialists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dentists','Dentists, All Other Specialists','All dentists not listed separately.','o*net',NULL),(1865,'2023-02-27 20:36:11.309053','29-1031.00','Dietitians and Nutritionists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Dietitians and Nutritionists','Dietitians and Nutritionists','Plan and conduct food service or nutritional programs to assist in the promotion of health and control of disease. May supervise activities of a department providing quantity food services, counsel individuals, or conduct nutritional research.','o*net',NULL),(1866,'2023-02-27 20:36:11.333990','29-1041.00','Optometrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Optometrists','Optometrists','Diagnose, manage, and treat conditions and diseases of the human eye and visual system. Examine eyes and visual system, diagnose problems or impairments, prescribe corrective lenses, and provide treatment. May prescribe therapeutic drugs to treat specific eye conditions.','o*net',NULL),(1867,'2023-02-27 20:36:11.363190','29-1051.00','Pharmacists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Pharmacists','Pharmacists','Dispense drugs prescribed by physicians and other health practitioners and provide information to patients about medications and their use. May advise physicians and other health practitioners on the selection, dosage, interactions, and side effects of medications.','o*net',NULL),(1868,'2023-02-27 20:36:11.392529','29-1071.00','Physician Assistants','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physician Assistants','Physician Assistants','Provide healthcare services typically performed by a physician, under the supervision of a physician. Conduct complete physicals, provide treatment, and counsel patients. May, in some cases, prescribe medication. Must graduate from an accredited educational program for physician assistants.','o*net',NULL),(1869,'2023-02-27 20:36:11.416277','29-1071.01','Anesthesiologist Assistants','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physician Assistants','Physician Assistants','Assist anesthesiologists in the administration of anesthesia for surgical and non-surgical procedures. Monitor patient status and provide patient care during surgical treatment.','o*net',NULL),(1870,'2023-02-27 20:36:11.442049','29-1081.00','Podiatrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Podiatrists','Podiatrists','Diagnose and treat diseases and deformities of the human foot.','o*net',NULL),(1871,'2023-02-27 20:36:11.467019','29-1122.00','Occupational Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Occupational Therapists','Assess, plan, and organize rehabilitative programs that help build or restore vocational, homemaking, and daily living skills, as well as general independence, to persons with disabilities or developmental delays. Use therapeutic techniques, adapt the individual\'s environment, teach skills, and modify specific tasks that present barriers to the individual.','o*net',NULL),(1872,'2023-02-27 20:36:11.496440','29-1122.01','Low Vision Therapists, Orientation and Mobility Specialists, and Vision Rehabilitation Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Occupational Therapists','Provide therapy to patients with visual impairments to improve their functioning in daily life activities. May train patients in activities such as computer use, communication skills, or home management skills.','o*net',NULL),(1873,'2023-02-27 20:36:11.520941','29-1123.00','Physical Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Physical Therapists','Assess, plan, organize, and participate in rehabilitative programs that improve mobility, relieve pain, increase strength, and improve or correct disabling conditions resulting from disease or injury.','o*net',NULL),(1874,'2023-02-27 20:36:11.550273','29-1124.00','Radiation Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Radiation Therapists','Provide radiation therapy to patients as prescribed by a radiation oncologist according to established practices and standards. Duties may include reviewing prescription and diagnosis; acting as liaison with physician and supportive care personnel; preparing equipment, such as immobilization, treatment, and protection devices; and maintaining records, reports, and files. May assist in dosimetry procedures and tumor localization.','o*net',NULL),(1875,'2023-02-27 20:36:11.576352','29-1125.00','Recreational Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Recreational Therapists','Plan, direct, or coordinate medically-approved recreation programs for patients in hospitals, nursing homes, or other institutions. Activities include sports, trips, dramatics, social activities, and crafts. May assess a patient condition and recommend appropriate recreational activity.','o*net',NULL),(1876,'2023-02-27 20:36:11.605373','29-1126.00','Respiratory Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Respiratory Therapists','Assess, treat, and care for patients with breathing disorders. Assume primary responsibility for all respiratory care modalities, including the supervision of respiratory therapy technicians. Initiate and conduct therapeutic procedures; maintain patient records; and select, assemble, check, and operate equipment.','o*net',NULL),(1877,'2023-02-27 20:36:11.634428','29-1127.00','Speech-Language Pathologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Speech-Language Pathologists','Assess and treat persons with speech, language, voice, and fluency disorders. May select alternative communication systems and teach their use. May perform research related to speech and language problems.','o*net',NULL),(1878,'2023-02-27 20:36:11.666138','29-1128.00','Exercise Physiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Exercise Physiologists','Assess, plan, or implement fitness programs that include exercise or physical activities such as those designed to improve cardiorespiratory function, body composition, muscular strength, muscular endurance, or flexibility.','o*net',NULL),(1879,'2023-02-27 20:36:11.691930','29-1129.00','Therapists, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Therapists, All Other','All therapists not listed separately.','o*net',NULL),(1880,'2023-02-27 20:36:11.721473','29-1129.01','Art Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Therapists, All Other','Plan or conduct art therapy sessions or programs to improve clients\' physical, cognitive, or emotional well-being.','o*net',NULL),(1881,'2023-02-27 20:36:11.750818','29-1129.02','Music Therapists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Therapists','Therapists, All Other','Plan, organize, direct, or assess clinical and evidenced-based music therapy interventions to positively influence individuals\' physical, psychological, cognitive, or behavioral status.','o*net',NULL),(1882,'2023-02-27 20:36:11.773073','29-1131.00','Veterinarians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Veterinarians','Veterinarians','Diagnose, treat, or research diseases and injuries of animals. Includes veterinarians who conduct research and development, inspect livestock, or care for pets and companion animals.','o*net',NULL),(1883,'2023-02-27 20:36:11.800053','29-1141.00','Registered Nurses','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','Assess patient health problems and needs, develop and implement nursing care plans, and maintain medical records. Administer nursing care to ill, injured, convalescent, or disabled patients. May advise patients on health maintenance and disease prevention or provide case management. Licensing or registration required.','o*net',NULL),(1884,'2023-02-27 20:36:11.824218','29-1141.01','Acute Care Nurses','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','Provide advanced nursing care for patients with acute conditions such as heart attacks, respiratory distress syndrome, or shock. May care for pre- and post-operative patients or perform advanced, invasive diagnostic or therapeutic procedures.','o*net',NULL),(1885,'2023-02-27 20:36:11.850889','29-1141.02','Advanced Practice Psychiatric Nurses','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','Assess, diagnose, and treat individuals and families with mental health or substance use disorders or the potential for such disorders. Apply therapeutic activities, including the prescription of medication, per state regulations, and the administration of psychotherapy.','o*net',NULL),(1886,'2023-02-27 20:36:11.876281','29-1141.03','Critical Care Nurses','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','Provide specialized nursing care for patients in critical or coronary care units.','o*net',NULL),(1887,'2023-02-27 20:36:11.903304','29-1141.04','Clinical Nurse Specialists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Registered Nurses','Registered Nurses','Direct nursing staff in the provision of patient care in a clinical practice setting, such as a hospital, hospice, clinic, or home. Ensure adherence to established clinical policies, protocols, regulations, and standards.','o*net',NULL),(1888,'2023-02-27 20:36:11.927649','29-1151.00','Nurse Anesthetists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Anesthetists','Nurse Anesthetists','Administer anesthesia, monitor patient\'s vital signs, and oversee patient recovery from anesthesia. May assist anesthesiologists, surgeons, other physicians, or dentists. Must be registered nurses who have specialized graduate education.','o*net',NULL),(1889,'2023-02-27 20:36:11.954413','29-1161.00','Nurse Midwives','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Midwives','Nurse Midwives','Diagnose and coordinate all aspects of the birthing process, either independently or as part of a healthcare team. May provide well-woman gynecological care. Must have specialized, graduate nursing education.','o*net',NULL),(1890,'2023-02-27 20:36:11.981652','29-1171.00','Nurse Practitioners','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Nurse Practitioners','Nurse Practitioners','Diagnose and treat acute, episodic, or chronic illness, independently or as part of a healthcare team. May focus on health promotion and disease prevention. May order, perform, or interpret diagnostic tests such as lab work and x rays. May prescribe medication. Must be registered nurses who have specialized graduate education.','o*net',NULL),(1891,'2023-02-27 20:36:12.011280','29-1181.00','Audiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Audiologists','Audiologists','Assess and treat persons with hearing and related disorders. May fit hearing aids and provide auditory training. May perform research related to hearing problems.','o*net',NULL),(1892,'2023-02-27 20:36:12.038258','29-1211.00','Anesthesiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Anesthesiologists','Administer anesthetics and analgesics for pain management prior to, during, or after surgery.','o*net',NULL),(1893,'2023-02-27 20:36:12.068659','29-1212.00','Cardiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Cardiologists','Diagnose, treat, manage, and prevent diseases or conditions of the cardiovascular system. May further subspecialize in interventional procedures (e.g., balloon angioplasty and stent placement), echocardiography, or electrophysiology.','o*net',NULL),(1894,'2023-02-27 20:36:12.098850','29-1213.00','Dermatologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Dermatologists','Diagnose and treat diseases relating to the skin, hair, and nails. May perform both medical and dermatological surgery functions.','o*net',NULL),(1895,'2023-02-27 20:36:12.125756','29-1214.00','Emergency Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Emergency Medicine Physicians','Make immediate medical decisions and act to prevent death or further disability. Provide immediate recognition, evaluation, care, stabilization, and disposition of patients. May direct emergency medical staff in an emergency department.','o*net',NULL),(1896,'2023-02-27 20:36:12.148674','29-1215.00','Family Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Family Medicine Physicians','Diagnose, treat, and provide preventive care to individuals and families across the lifespan. May refer patients to specialists when needed for further diagnosis or treatment.','o*net',NULL),(1897,'2023-02-27 20:36:12.171829','29-1216.00','General Internal Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','General Internal Medicine Physicians','Diagnose and provide nonsurgical treatment for a wide range of diseases and injuries of internal organ systems. Provide care mainly for adults and adolescents, and are based primarily in an outpatient care setting.','o*net',NULL),(1898,'2023-02-27 20:36:12.196160','29-1217.00','Neurologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Neurologists','Diagnose, manage, and treat disorders and diseases of the brain, spinal cord, and peripheral nerves, with a primarily nonsurgical focus.','o*net',NULL),(1899,'2023-02-27 20:36:12.219776','29-1218.00','Obstetricians and Gynecologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Physicians','Obstetricians and Gynecologists','Provide medical care related to pregnancy or childbirth. Diagnose, treat, and help prevent diseases of women, particularly those affecting the reproductive system. May also provide general care to women. May perform both medical and gynecological surgery functions.','o*net',NULL),(1900,'2023-02-27 20:36:12.244052','29-1221.00','Pediatricians, General','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Pediatricians, General','Diagnose, treat, and help prevent diseases and injuries in children. May refer patients to specialists for further diagnosis or treatment, as needed.','o*net',NULL),(1901,'2023-02-27 20:36:12.268727','29-1222.00','Physicians, Pathologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, Pathologists','Diagnose diseases and conduct lab tests using organs, body tissues, and fluids. Includes medical examiners.','o*net',NULL),(1902,'2023-02-27 20:36:12.294285','29-1223.00','Psychiatrists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Psychiatrists','Diagnose, treat, and help prevent mental disorders.','o*net',NULL),(1903,'2023-02-27 20:36:12.324055','29-1224.00','Radiologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Radiologists','Diagnose and treat diseases and injuries using medical imaging techniques, such as x rays, magnetic resonance imaging (MRI), nuclear medicine, and ultrasounds. May perform minimally invasive medical procedures and tests.','o*net',NULL),(1904,'2023-02-27 20:36:12.353187','29-1229.00','Physicians, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','All physicians not listed separately.','o*net',NULL),(1905,'2023-02-27 20:36:12.377926','29-1229.01','Allergists and Immunologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','Diagnose, treat, and help prevent allergic diseases and disease processes affecting the immune system.','o*net',NULL),(1906,'2023-02-27 20:36:12.405446','29-1229.02','Hospitalists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','Provide inpatient care predominantly in settings such as medical wards, acute care units, intensive care units, rehabilitation centers, or emergency rooms. Manage and coordinate patient care throughout treatment.','o*net',NULL),(1907,'2023-02-27 20:36:12.434727','29-1229.03','Urologists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','Diagnose, treat, and help prevent benign and malignant medical and surgical disorders of the genitourinary system and the renal glands.','o*net',NULL),(1908,'2023-02-27 20:36:12.462703','29-1229.04','Physical Medicine and Rehabilitation Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','Diagnose and treat disorders requiring physiotherapy to provide physical, mental, and occupational rehabilitation.','o*net',NULL),(1909,'2023-02-27 20:36:12.493693','29-1229.05','Preventive Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','Apply knowledge of general preventive medicine and public health issues to promote health care to groups or individuals, and aid in the prevention or reduction of risk of disease, injury, disability, or death. May practice population-based medicine or diagnose and treat patients in the context of clinical health promotion and disease prevention.','o*net',NULL),(1910,'2023-02-27 20:36:12.517364','29-1229.06','Sports Medicine Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners',NULL,'Physicians, All Other','Diagnose, treat, and help prevent injuries that occur during sporting events, athletic training, and physical activities.','o*net',NULL),(1911,'2023-02-27 20:36:12.543071','29-1241.00','Ophthalmologists, Except Pediatric','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Ophthalmologists, Except Pediatric','Diagnose and perform surgery to treat and help prevent disorders and diseases of the eye. May also provide vision services for treatment including glasses and contacts.','o*net',NULL),(1912,'2023-02-27 20:36:12.568053','29-1242.00','Orthopedic Surgeons, Except Pediatric','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Orthopedic Surgeons, Except Pediatric','Diagnose and perform surgery to treat and prevent rheumatic and other diseases in the musculoskeletal system.','o*net',NULL),(1913,'2023-02-27 20:36:12.595741','29-1243.00','Pediatric Surgeons','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Pediatric Surgeons','Diagnose and perform surgery to treat fetal abnormalities and birth defects, diseases, and injuries in fetuses, premature and newborn infants, children, and adolescents. Includes all pediatric surgical specialties and subspecialties.','o*net',NULL),(1914,'2023-02-27 20:36:12.620493','29-1249.00','Surgeons, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Surgeons','Surgeons, All Other','All surgeons not listed separately.','o*net',NULL),(1915,'2023-02-27 20:36:12.649263','29-1291.00','Acupuncturists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Acupuncturists','Diagnose, treat, and prevent disorders by stimulating specific acupuncture points within the body using acupuncture needles. May also use cups, nutritional supplements, therapeutic massage, acupressure, and other alternative health therapies.','o*net',NULL),(1916,'2023-02-27 20:36:12.675784','29-1292.00','Dental Hygienists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Dental Hygienists','Administer oral hygiene care to patients. Assess patient oral hygiene problems or needs and maintain health records. Advise patients on oral health maintenance and disease prevention. May provide advanced care such as providing fluoride treatment or administering topical anesthesia.','o*net',NULL),(1917,'2023-02-27 20:36:12.706313','29-1299.00','Healthcare Diagnosing or Treating Practitioners, All Other','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Healthcare Diagnosing or Treating Practitioners, All Other','All healthcare diagnosing or treating practitioners not listed separately.','o*net',NULL),(1918,'2023-02-27 20:36:12.733989','29-1299.01','Naturopathic Physicians','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Healthcare Diagnosing or Treating Practitioners, All Other','Diagnose, treat, and help prevent diseases using a system of practice that is based on the natural healing capacity of individuals. May use physiological, psychological or mechanical methods. May also use natural medicines, prescription or legend drugs, foods, herbs, or other natural remedies.','o*net',NULL),(1919,'2023-02-27 20:36:12.762974','29-1299.02','Orthoptists','Healthcare Practitioners and Technical Occupations','Healthcare Diagnosing or Treating Practitioners','Miscellaneous Healthcare Diagnosing or Treating Practitioners','Healthcare Diagnosing or Treating Practitioners, All Other','Diagnose and treat visual system disorders such as binocular vision and eye movement impairments.','o*net',NULL),(1920,'2023-02-27 20:36:12.791130','29-2011.00','Medical and Clinical Laboratory Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technologists','Perform complex medical laboratory tests for diagnosis, treatment, and prevention of disease. May train or supervise staff.','o*net',NULL),(1921,'2023-02-27 20:36:12.818676','29-2011.01','Cytogenetic Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technologists','Analyze chromosomes or chromosome segments found in biological specimens, such as amniotic fluids, bone marrow, solid tumors, and blood to aid in the study, diagnosis, classification, or treatment of inherited or acquired genetic diseases. Conduct analyses through classical cytogenetic, fluorescent in situ hybridization (FISH) or array comparative genome hybridization (aCGH) techniques.','o*net',NULL),(1922,'2023-02-27 20:36:12.847021','29-2011.02','Cytotechnologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technologists','Stain, mount, and study cells to detect evidence of cancer, hormonal abnormalities, and other pathological conditions following established standards and practices.','o*net',NULL),(1923,'2023-02-27 20:36:12.873436','29-2011.04','Histotechnologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technologists','Apply knowledge of health and disease causes to evaluate new laboratory techniques and procedures to examine tissue samples. Process and prepare histological slides from tissue sections for microscopic examination and diagnosis by pathologists. May solve technical or instrument problems or assist with research studies.','o*net',NULL),(1924,'2023-02-27 20:36:12.899551','29-2012.00','Medical and Clinical Laboratory Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technicians','Perform routine medical laboratory tests for the diagnosis, treatment, and prevention of disease. May work under the supervision of a medical technologist.','o*net',NULL),(1925,'2023-02-27 20:36:12.924910','29-2012.01','Histology Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Clinical Laboratory Technologists and Technicians','Medical and Clinical Laboratory Technicians','Prepare histological slides from tissue sections for microscopic examination and diagnosis by pathologists. May assist with research studies.','o*net',NULL),(1926,'2023-02-27 20:36:12.952808','29-2031.00','Cardiovascular Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Cardiovascular Technologists and Technicians','Conduct tests on pulmonary or cardiovascular systems of patients for diagnostic, therapeutic, or research purposes. May conduct or assist in electrocardiograms, cardiac catheterizations, pulmonary functions, lung capacity, and similar tests.','o*net',NULL),(1927,'2023-02-27 20:36:12.977289','29-2032.00','Diagnostic Medical Sonographers','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Diagnostic Medical Sonographers','Produce ultrasonic recordings of internal organs for use by physicians. Includes vascular technologists.','o*net',NULL),(1928,'2023-02-27 20:36:13.003890','29-2033.00','Nuclear Medicine Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Nuclear Medicine Technologists','Prepare, administer, and measure radioactive isotopes in therapeutic, diagnostic, and tracer studies using a variety of radioisotope equipment. Prepare stock solutions of radioactive materials and calculate doses to be administered by radiologists. Subject patients to radiation. Execute blood volume, red cell survival, and fat absorption studies following standard laboratory techniques.','o*net',NULL),(1929,'2023-02-27 20:36:13.028588','29-2034.00','Radiologic Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Radiologic Technologists and Technicians','Take x-rays and CAT scans or administer nonradioactive materials into patient\'s bloodstream for diagnostic or research purposes. Includes radiologic technologists and technicians who specialize in other scanning modalities.','o*net',NULL),(1930,'2023-02-27 20:36:13.058404','29-2035.00','Magnetic Resonance Imaging Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Magnetic Resonance Imaging Technologists','Operate Magnetic Resonance Imaging (MRI) scanners. Monitor patient safety and comfort, and view images of area being scanned to ensure quality of pictures. May administer gadolinium contrast dosage intravenously. May interview patient, explain MRI procedures, and position patient on examining table. May enter into the computer data such as patient history, anatomical area to be scanned, orientation specified, and position of entry.','o*net',NULL),(1931,'2023-02-27 20:36:13.083274','29-2036.00','Medical Dosimetrists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Diagnostic Related Technologists and Technicians','Medical Dosimetrists','Generate radiation treatment plans, develop radiation dose calculations, communicate and supervise the treatment plan implementation, and consult with members of radiation oncology team.','o*net',NULL),(1932,'2023-02-27 20:36:13.111004','29-2042.00','Emergency Medical Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Emergency Medical Technicians and Paramedics','Emergency Medical Technicians','Assess injuries and illnesses and administer basic emergency medical care. May transport injured or sick persons to medical facilities.','o*net',NULL),(1933,'2023-02-27 20:36:13.138027','29-2043.00','Paramedics','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Emergency Medical Technicians and Paramedics','Paramedics','Administer basic or advanced emergency medical care and assess injuries and illnesses. May administer medication intravenously, use equipment such as EKGs, or administer advanced life support to sick or injured individuals.','o*net',NULL),(1934,'2023-02-27 20:36:13.168929','29-2051.00','Dietetic Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Dietetic Technicians','Assist in the provision of food service and nutritional programs, under the supervision of a dietitian. May plan and produce meals based on established guidelines, teach principles of food and nutrition, or counsel individuals.','o*net',NULL),(1935,'2023-02-27 20:36:13.196430','29-2052.00','Pharmacy Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Pharmacy Technicians','Prepare medications under the direction of a pharmacist. May measure, mix, count out, label, and record amounts and dosages of medications according to prescription orders.','o*net',NULL),(1936,'2023-02-27 20:36:13.225496','29-2053.00','Psychiatric Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Psychiatric Technicians','Care for individuals with mental or emotional conditions or disabilities, following the instructions of physicians or other health practitioners. Monitor patients\' physical and emotional well-being and report to medical staff. May participate in rehabilitation and treatment programs, help with personal hygiene, and administer oral or injectable medications.','o*net',NULL),(1937,'2023-02-27 20:36:13.251258','29-2055.00','Surgical Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Surgical Technologists','Assist in operations, under the supervision of surgeons, registered nurses, or other surgical personnel. May help set up operating room, prepare and transport patients for surgery, adjust lights and equipment, pass instruments and other supplies to surgeons and surgeons\' assistants, hold retractors, cut sutures, and help count sponges, needles, supplies, and instruments.','o*net',NULL),(1938,'2023-02-27 20:36:13.275049','29-2056.00','Veterinary Technologists and Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Veterinary Technologists and Technicians','Perform medical tests in a laboratory environment for use in the treatment and diagnosis of diseases in animals. Prepare vaccines and serums for prevention of diseases. Prepare tissue samples, take blood samples, and execute laboratory tests, such as urinalysis and blood counts. Clean and sterilize instruments and materials and maintain equipment and machines. May assist a veterinarian during surgery.','o*net',NULL),(1939,'2023-02-27 20:36:13.303132','29-2057.00','Ophthalmic Medical Technicians','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Health Practitioner Support Technologists and Technicians','Ophthalmic Medical Technicians','Assist ophthalmologists by performing ophthalmic clinical functions. May administer eye exams, administer eye medications, and instruct the patient in care and use of corrective lenses.','o*net',NULL),(1940,'2023-02-27 20:36:13.345963','29-2061.00','Licensed Practical and Licensed Vocational Nurses','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Licensed Practical and Licensed Vocational Nurses','Licensed Practical and Licensed Vocational Nurses','Care for ill, injured, or convalescing patients or persons with disabilities in hospitals, nursing homes, clinics, private homes, group homes, and similar institutions. May work under the supervision of a registered nurse. Licensing required.','o*net',NULL),(1941,'2023-02-27 20:36:13.371818','29-2072.00','Medical Records Specialists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Medical Records Specialists','Medical Records Specialists','Compile, process, and maintain medical records of hospital and clinic patients in a manner consistent with medical, administrative, ethical, legal, and regulatory requirements of the healthcare system. Classify medical and healthcare concepts, including diagnosis, procedures, medical services, and equipment, into the healthcare industry\'s numerical coding system. Includes medical coders.','o*net',NULL),(1942,'2023-02-27 20:36:13.399402','29-2081.00','Opticians, Dispensing','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Opticians, Dispensing','Opticians, Dispensing','Design, measure, fit, and adapt lenses and frames for client according to written optical prescription or specification. Assist client with inserting, removing, and caring for contact lenses. Assist client with selecting frames. Measure customer for size of eyeglasses and coordinate frames with facial and eye measurements and optical prescription. Prepare work order for optical laboratory containing instructions for grinding and mounting lenses in frames. Verify exactness of finished lens spectacles. Adjust frame and lens position to fit client. May shape or reshape frames. Includes contact lens opticians.','o*net',NULL),(1943,'2023-02-27 20:36:13.426711','29-2091.00','Orthotists and Prosthetists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Orthotists and Prosthetists','Design, measure, fit, and adapt orthopedic braces, appliances or prostheses, such as limbs or facial parts for patients with disabling conditions.','o*net',NULL),(1944,'2023-02-27 20:36:13.454880','29-2092.00','Hearing Aid Specialists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Hearing Aid Specialists','Select and fit hearing aids for customers. Administer and interpret tests of hearing. Assess hearing instrument efficacy. Take ear impressions and prepare, design, and modify ear molds.','o*net',NULL),(1945,'2023-02-27 20:36:13.481969','29-2099.00','Health Technologists and Technicians, All Other','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Health Technologists and Technicians, All Other','All health technologists and technicians not listed separately.','o*net',NULL),(1946,'2023-02-27 20:36:13.508617','29-2099.01','Neurodiagnostic Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Health Technologists and Technicians, All Other','Conduct electroneurodiagnostic (END) tests such as electroencephalograms, evoked potentials, polysomnograms, or electronystagmograms. May perform nerve conduction studies.','o*net',NULL),(1947,'2023-02-27 20:36:13.532574','29-2099.05','Ophthalmic Medical Technologists','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Health Technologists and Technicians, All Other','Assist ophthalmologists by performing ophthalmic clinical functions and ophthalmic photography. Provide instruction and supervision to other ophthalmic personnel. Assist with minor surgical procedures, applying aseptic techniques and preparing instruments. May perform eye exams, administer eye medications, and instruct patients in care and use of corrective lenses.','o*net',NULL),(1948,'2023-02-27 20:36:13.562797','29-2099.08','Patient Representatives','Healthcare Practitioners and Technical Occupations','Health Technologists and Technicians','Miscellaneous Health Technologists and Technicians','Health Technologists and Technicians, All Other','Assist patients in obtaining services, understanding policies and making health care decisions.','o*net',NULL),(1949,'2023-02-27 20:36:13.595390','29-9021.00','Health Information Technologists and Medical Registrars','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Health Information Technologists and Medical Registrars','Health Information Technologists and Medical Registrars','Apply knowledge of healthcare and information systems to assist in the design, development, and continued modification and analysis of computerized healthcare systems. Abstract, collect, and analyze treatment and followup information of patients. May educate staff and assist in problem solving to promote the implementation of the healthcare information system. May design, develop, test, and implement databases with complete history, diagnosis, treatment, and health status to help monitor diseases.','o*net',NULL),(1950,'2023-02-27 20:36:13.620930','29-9091.00','Athletic Trainers','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Athletic Trainers','Evaluate and treat musculoskeletal injuries or illnesses. Provide preventive, therapeutic, emergency, and rehabilitative care.','o*net',NULL),(1951,'2023-02-27 20:36:13.646331','29-9092.00','Genetic Counselors','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Genetic Counselors','Assess individual or family risk for a variety of inherited conditions, such as genetic disorders and birth defects. Provide information to other healthcare providers or to individuals and families concerned with the risk of inherited conditions. Advise individuals and families to support informed decisionmaking and coping methods for those at risk. May help conduct research related to genetic conditions or genetic counseling.','o*net',NULL),(1952,'2023-02-27 20:36:13.671330','29-9093.00','Surgical Assistants','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Surgical Assistants','Assist in operations, under the supervision of surgeons. May, in accordance with state laws, help surgeons to make incisions and close surgical sites, manipulate or remove tissues, implant surgical devices or drains, suction the surgical site, place catheters, clamp or cauterize vessels or tissue, and apply dressings to surgical site.','o*net',NULL),(1953,'2023-02-27 20:36:13.698858','29-9099.00','Healthcare Practitioners and Technical Workers, All Other','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Healthcare Practitioners and Technical Workers, All Other','All healthcare practitioners and technical workers not listed separately.','o*net',NULL),(1954,'2023-02-27 20:36:13.724024','29-9099.01','Midwives','Healthcare Practitioners and Technical Occupations','Other Healthcare Practitioners and Technical Occupations','Miscellaneous Health Practitioners and Technical Workers','Healthcare Practitioners and Technical Workers, All Other','Provide prenatal care and childbirth assistance.','o*net',NULL),(1955,'2023-02-27 20:36:13.749502','31-1121.00','Home Health Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Home Health and Personal Care Aides','Home Health Aides','Monitor the health status of an individual with disabilities or illness, and address their health-related needs, such as changing bandages, dressing wounds, or administering medication. Work is performed under the direction of offsite or intermittent onsite licensed nursing staff. Provide assistance with routine healthcare tasks or activities of daily living, such as feeding, bathing, toileting, or ambulation. May also help with tasks such as preparing meals, doing light housekeeping, and doing laundry depending on the patient\'s abilities.','o*net',NULL),(1956,'2023-02-27 20:36:13.776732','31-1122.00','Personal Care Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Home Health and Personal Care Aides','Personal Care Aides','Provide personalized assistance to individuals with disabilities or illness who require help with personal care and activities of daily living support (e.g., feeding, bathing, dressing, grooming, toileting, and ambulation). May also provide help with tasks such as preparing meals, doing light housekeeping, and doing laundry. Work is performed in various settings depending on the needs of the care recipient and may include locations such as their home, place of work, out in the community, or at a daytime nonresidential facility.','o*net',NULL),(1957,'2023-02-27 20:36:13.809490','31-1131.00','Nursing Assistants','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants','Provide or assist with basic care or support under the direction of onsite licensed nursing staff. Perform duties such as monitoring of health status, feeding, bathing, dressing, grooming, toileting, or ambulation of patients in a health or nursing facility. May include medication administration and other health-related tasks. Includes nursing care attendants, nursing aides, and nursing attendants.','o*net',NULL),(1958,'2023-02-27 20:36:13.835585','31-1132.00','Orderlies','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Orderlies','Transport patients to areas such as operating rooms or x-ray rooms using wheelchairs, stretchers, or moveable beds. May maintain stocks of supplies or clean and transport equipment. Psychiatric orderlies are included in Psychiatric Aides.','o*net',NULL),(1959,'2023-02-27 20:36:13.864605','31-1133.00','Psychiatric Aides','Healthcare Support Occupations','Home Health and Personal Care Aides; and Nursing Assistants, Orderlies, and Psychiatric Aides','Nursing Assistants, Orderlies, and Psychiatric Aides','Psychiatric Aides','Assist mentally impaired or emotionally disturbed patients, working under direction of nursing and medical staff. May assist with daily living activities, lead patients in educational and recreational activities, or accompany patients to and from examinations and treatments. May restrain violent patients. Includes psychiatric orderlies.','o*net',NULL),(1960,'2023-02-27 20:36:13.890775','31-2011.00','Occupational Therapy Assistants','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Occupational Therapy Assistants and Aides','Occupational Therapy Assistants','Assist occupational therapists in providing occupational therapy treatments and procedures. May, in accordance with state laws, assist in development of treatment plans, carry out routine functions, direct activity programs, and document the progress of treatments. Generally requires formal training.','o*net',NULL),(1961,'2023-02-27 20:36:13.918966','31-2012.00','Occupational Therapy Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Occupational Therapy Assistants and Aides','Occupational Therapy Aides','Under close supervision of an occupational therapist or occupational therapy assistant, perform only delegated, selected, or routine tasks in specific situations. These duties include preparing patient and treatment room.','o*net',NULL),(1962,'2023-02-27 20:36:13.947142','31-2021.00','Physical Therapist Assistants','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Physical Therapist Assistants and Aides','Physical Therapist Assistants','Assist physical therapists in providing physical therapy treatments and procedures. May, in accordance with state laws, assist in the development of treatment plans, carry out routine functions, document the progress of treatment, and modify specific treatments in accordance with patient status and within the scope of treatment plans established by a physical therapist. Generally requires formal training.','o*net',NULL),(1963,'2023-02-27 20:36:13.972920','31-2022.00','Physical Therapist Aides','Healthcare Support Occupations','Occupational Therapy and Physical Therapist Assistants and Aides','Physical Therapist Assistants and Aides','Physical Therapist Aides','Under close supervision of a physical therapist or physical therapy assistant, perform only delegated, selected, or routine tasks in specific situations. These duties include preparing the patient and the treatment area.','o*net',NULL),(1964,'2023-02-27 20:36:14.003145','31-9011.00','Massage Therapists','Healthcare Support Occupations','Other Healthcare Support Occupations','Massage Therapists','Massage Therapists','Perform therapeutic massages of soft tissues and joints. May assist in the assessment of range of motion and muscle strength, or propose client therapy plans.','o*net',NULL),(1965,'2023-02-27 20:36:14.026012','31-9091.00','Dental Assistants','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Dental Assistants','Perform limited clinical duties under the direction of a dentist. Clinical duties may include equipment preparation and sterilization, preparing patients for treatment, assisting the dentist during treatment, and providing patients with instructions for oral healthcare procedures. May perform administrative duties such as scheduling appointments, maintaining medical records, billing, and coding information for insurance purposes.','o*net',NULL),(1966,'2023-02-27 20:36:14.054996','31-9092.00','Medical Assistants','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Medical Assistants','Perform administrative and certain clinical duties under the direction of a physician. Administrative duties may include scheduling appointments, maintaining medical records, billing, and coding information for insurance purposes. Clinical duties may include taking and recording vital signs and medical histories, preparing patients for examination, drawing blood, and administering medications as directed by physician.','o*net',NULL),(1967,'2023-02-27 20:36:14.080900','31-9093.00','Medical Equipment Preparers','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Medical Equipment Preparers','Prepare, sterilize, install, or clean laboratory or healthcare equipment. May perform routine laboratory tasks and operate or inspect equipment.','o*net',NULL),(1968,'2023-02-27 20:36:14.107299','31-9094.00','Medical Transcriptionists','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Medical Transcriptionists','Transcribe medical reports recorded by physicians and other healthcare practitioners using various electronic devices, covering office visits, emergency room visits, diagnostic imaging studies, operations, chart reviews, and final summaries. Transcribe dictated reports and translate abbreviations into fully understandable form. Edit as necessary and return reports in either printed or electronic form for review and signature, or correction.','o*net',NULL),(1969,'2023-02-27 20:36:14.132804','31-9095.00','Pharmacy Aides','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Pharmacy Aides','Record drugs delivered to the pharmacy, store incoming merchandise, and inform the supervisor of stock needs. May operate cash register and accept prescriptions for filling.','o*net',NULL),(1970,'2023-02-27 20:36:14.161270','31-9096.00','Veterinary Assistants and Laboratory Animal Caretakers','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Veterinary Assistants and Laboratory Animal Caretakers','Feed, water, and examine pets and other nonfarm animals for signs of illness, disease, or injury in laboratories and animal hospitals and clinics. Clean and disinfect cages and work areas, and sterilize laboratory and surgical equipment. May provide routine postoperative care, administer medication orally or topically, or prepare samples for laboratory examination under the supervision of veterinary or laboratory animal technologists or technicians, veterinarians, or scientists.','o*net',NULL),(1971,'2023-02-27 20:36:14.190984','31-9097.00','Phlebotomists','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Phlebotomists','Draw blood for tests, transfusions, donations, or research. May explain the procedure to patients and assist in the recovery of patients with adverse reactions.','o*net',NULL),(1972,'2023-02-27 20:36:14.214849','31-9099.00','Healthcare Support Workers, All Other','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Healthcare Support Workers, All Other','All healthcare support workers not listed separately.','o*net',NULL),(1973,'2023-02-27 20:36:14.243410','31-9099.01','Speech-Language Pathology Assistants','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Healthcare Support Workers, All Other','Assist speech-language pathologists in the assessment and treatment of speech, language, voice, and fluency disorders. Implement speech and language programs or activities as planned and directed by speech-language pathologists. Monitor the use of alternative communication devices and systems.','o*net',NULL),(1974,'2023-02-27 20:36:14.268752','31-9099.02','Endoscopy Technicians','Healthcare Support Occupations','Other Healthcare Support Occupations','Miscellaneous Healthcare Support Occupations','Healthcare Support Workers, All Other','Maintain a sterile field to provide support for physicians and nurses during endoscopy procedures. Prepare and maintain instruments and equipment. May obtain specimens.','o*net',NULL),(1975,'2023-02-27 20:36:14.299189','33-1011.00','First-Line Supervisors of Correctional Officers','Protective Service Occupations','Supervisors of Protective Service Workers','First-Line Supervisors of Law Enforcement Workers','First-Line Supervisors of Correctional Officers','Directly supervise and coordinate activities of correctional officers and jailers.','o*net',NULL),(1976,'2023-02-27 20:36:14.323604','33-1012.00','First-Line Supervisors of Police and Detectives','Protective Service Occupations','Supervisors of Protective Service Workers','First-Line Supervisors of Law Enforcement Workers','First-Line Supervisors of Police and Detectives','Directly supervise and coordinate activities of members of police force.','o*net',NULL),(1977,'2023-02-27 20:36:14.354525','33-1021.00','First-Line Supervisors of Firefighting and Prevention Workers','Protective Service Occupations','Supervisors of Protective Service Workers','First-Line Supervisors of Firefighting and Prevention Workers','First-Line Supervisors of Firefighting and Prevention Workers','Directly supervise and coordinate activities of workers engaged in firefighting and fire prevention and control.','o*net',NULL),(1978,'2023-02-27 20:36:14.377873','33-1091.00','First-Line Supervisors of Security Workers','Protective Service Occupations','Supervisors of Protective Service Workers','Miscellaneous First-Line Supervisors, Protective Service Workers','First-Line Supervisors of Security Workers','Directly supervise and coordinate activities of security workers and security guards.','o*net',NULL),(1979,'2023-02-27 20:36:14.404875','33-1099.00','First-Line Supervisors of Protective Service Workers, All Other','Protective Service Occupations','Supervisors of Protective Service Workers','Miscellaneous First-Line Supervisors, Protective Service Workers','First-Line Supervisors of Protective Service Workers, All Other','All protective service supervisors not listed separately above.','o*net',NULL),(1980,'2023-02-27 20:36:14.433568','33-2011.00','Firefighters','Protective Service Occupations','Firefighting and Prevention Workers','Firefighters','Firefighters','Control and extinguish fires or respond to emergency situations where life, property, or the environment is at risk. Duties may include fire prevention, emergency medical service, hazardous material response, search and rescue, and disaster assistance.','o*net',NULL),(1981,'2023-02-27 20:36:14.460635','33-2021.00','Fire Inspectors and Investigators','Protective Service Occupations','Firefighting and Prevention Workers','Fire Inspectors','Fire Inspectors and Investigators','Inspect buildings to detect fire hazards and enforce local ordinances and state laws, or investigate and gather facts to determine cause of fires and explosions.','o*net',NULL),(1982,'2023-02-27 20:36:14.486415','33-2022.00','Forest Fire Inspectors and Prevention Specialists','Protective Service Occupations','Firefighting and Prevention Workers','Fire Inspectors','Forest Fire Inspectors and Prevention Specialists','Enforce fire regulations, inspect forest for fire hazards, and recommend forest fire prevention or control measures. May report forest fires and weather conditions.','o*net',NULL),(1983,'2023-02-27 20:36:14.512464','33-3011.00','Bailiffs','Protective Service Occupations','Law Enforcement Workers','Bailiffs, Correctional Officers, and Jailers','Bailiffs','Maintain order in courts of law.','o*net',NULL),(1984,'2023-02-27 20:36:14.541224','33-3012.00','Correctional Officers and Jailers','Protective Service Occupations','Law Enforcement Workers','Bailiffs, Correctional Officers, and Jailers','Correctional Officers and Jailers','Guard inmates in penal or rehabilitative institutions in accorda