otel, and Resort Desk Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Hotel, Motel, and Resort Desk Clerks','Hotel, Motel, and Resort Desk Clerks','Accommodate hotel, motel, and resort patrons by registering and assigning rooms to guests, issuing room keys or cards, transmitting and receiving messages, keeping records of occupied rooms and guests\' accounts, making and confirming reservations, and presenting statements to and collecting payments from departing guests.','o*net',NULL),(2108,'2023-02-27 20:36:17.821140','43-4111.00','Interviewers, Except Eligibility and Loan','Office and Administrative Support Occupations','Information and Record Clerks','Interviewers, Except Eligibility and Loan','Interviewers, Except Eligibility and Loan','Interview persons by telephone, mail, in person, or by other means for the purpose of completing forms, applications, or questionnaires. Ask specific questions, record answers, and assist persons with completing form. May sort, classify, and file forms.','o*net',NULL),(2109,'2023-02-27 20:36:17.848466','43-4121.00','Library Assistants, Clerical','Office and Administrative Support Occupations','Information and Record Clerks','Library Assistants, Clerical','Library Assistants, Clerical','Compile records, and sort, shelve, issue, and receive library materials such as books, electronic media, pictures, cards, slides and microfilm. Locate library materials for loan and replace material in shelving area, stacks, or files according to identification number and title. Register patrons to permit them to borrow books, periodicals, and other library materials.','o*net',NULL),(2110,'2023-02-27 20:36:17.876247','43-4131.00','Loan Interviewers and Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Loan Interviewers and Clerks','Loan Interviewers and Clerks','Interview loan applicants to elicit information; investigate applicants\' backgrounds and verify references; prepare loan request papers; and forward findings, reports, and documents to appraisal department. Review loan papers to ensure completeness, and complete transactions between loan establishment, borrowers, and sellers upon approval of loan.','o*net',NULL),(2111,'2023-02-27 20:36:17.908660','43-4141.00','New Accounts Clerks','Office and Administrative Support Occupations','Information and Record Clerks','New Accounts Clerks','New Accounts Clerks','Interview persons desiring to open accounts in financial institutions. Explain account services available to prospective customers and assist them in preparing applications.','o*net',NULL),(2112,'2023-02-27 20:36:17.931582','43-4151.00','Order Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Order Clerks','Order Clerks','Receive and process incoming orders for materials, merchandise, classified ads, or services such as repairs, installations, or rental of facilities. Generally receives orders via mail, phone, fax, or other electronic means. Duties include informing customers of receipt, prices, shipping dates, and delays; preparing contracts; and handling complaints.','o*net',NULL),(2113,'2023-02-27 20:36:17.958149','43-4161.00','Human Resources Assistants, Except Payroll and Timekeeping','Office and Administrative Support Occupations','Information and Record Clerks','Human Resources Assistants, Except Payroll and Timekeeping','Human Resources Assistants, Except Payroll and Timekeeping','Compile and keep personnel records. Record data for each employee, such as address, weekly earnings, absences, amount of sales or production, supervisory reports, and date of and reason for termination. May prepare reports for employment records, file employment records, or search employee files and furnish information to authorized persons.','o*net',NULL),(2114,'2023-02-27 20:36:17.982365','43-4171.00','Receptionists and Information Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Receptionists and Information Clerks','Receptionists and Information Clerks','Answer inquiries and provide information to the general public, customers, visitors, and other interested parties regarding activities conducted at establishment and location of departments, offices, and employees within the organization.','o*net',NULL),(2115,'2023-02-27 20:36:18.010036','43-4181.00','Reservation and Transportation Ticket Agents and Travel Clerks','Office and Administrative Support Occupations','Information and Record Clerks','Reservation and Transportation Ticket Agents and Travel Clerks','Reservation and Transportation Ticket Agents and Travel Clerks','Make and confirm reservations for transportation or lodging, or sell transportation tickets. May check baggage and direct passengers to designated concourse, pier, or track; deliver tickets and contact individuals and groups to inform them of package tours; or provide tourists with travel or transportation information.','o*net',NULL),(2116,'2023-02-27 20:36:18.035193','43-4199.00','Information and Record Clerks, All Other','Office and Administrative Support Occupations','Information and Record Clerks','Miscellaneous Information and Record Clerks','Information and Record Clerks, All Other','All information and record clerks not listed separately.','o*net',NULL),(2117,'2023-02-27 20:36:18.063004','43-5011.00','Cargo and Freight Agents','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Cargo and Freight Agents','Cargo and Freight Agents','Expedite and route movement of incoming and outgoing cargo and freight shipments in airline, train, and trucking terminals and shipping docks. Take orders from customers and arrange pickup of freight and cargo for delivery to loading platform. Prepare and examine bills of lading to determine shipping charges and tariffs.','o*net',NULL),(2118,'2023-02-27 20:36:18.085940','43-5011.01','Freight Forwarders','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Cargo and Freight Agents','Cargo and Freight Agents','Research rates, routings, or modes of transport for shipment of products. Maintain awareness of regulations affecting the international movement of cargo. Make arrangements for additional services, such as storage or inland transportation.','o*net',NULL),(2119,'2023-02-27 20:36:18.113322','43-5021.00','Couriers and Messengers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Couriers and Messengers','Couriers and Messengers','Pick up and deliver messages, documents, packages, and other items between offices or departments within an establishment or directly to other business concerns, traveling by foot, bicycle, motorcycle, automobile, or public conveyance.','o*net',NULL),(2120,'2023-02-27 20:36:18.139142','43-5031.00','Public Safety Telecommunicators','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Dispatchers','Public Safety Telecommunicators','Operate telephone, radio, or other communication systems to receive and communicate requests for emergency assistance at 9-1-1 public safety answering points and emergency operations centers. Take information from the public and other sources regarding crimes, threats, disturbances, acts of terrorism, fires, medical emergencies, and other public safety matters. May coordinate and provide information to law enforcement and emergency response personnel. May access sensitive databases and other information sources as needed. May provide additional instructions to callers based on knowledge of and certification in law enforcement, fire, or emergency medical procedures.','o*net',NULL),(2121,'2023-02-27 20:36:18.167906','43-5032.00','Dispatchers, Except Police, Fire, and Ambulance','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Dispatchers','Dispatchers, Except Police, Fire, and Ambulance','Schedule and dispatch workers, work crews, equipment, or service vehicles for conveyance of materials, freight, or passengers, or for normal installation, service, or emergency repairs rendered outside the place of business. Duties may include using radio, telephone, or computer to transmit assignments and compiling statistics and reports on work progress.','o*net',NULL),(2122,'2023-02-27 20:36:18.194648','43-5041.00','Meter Readers, Utilities','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Meter Readers, Utilities','Meter Readers, Utilities','Read meter and record consumption of electricity, gas, water, or steam.','o*net',NULL),(2123,'2023-02-27 20:36:18.227693','43-5051.00','Postal Service Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Clerks','Perform any combination of tasks in a United States Postal Service (USPS) post office, such as receive letters and parcels; sell postage and revenue stamps, postal cards, and stamped envelopes; fill out and sell money orders; place mail in pigeon holes of mail rack or in bags; and examine mail for correct postage. Includes postal service clerks employed by USPS contractors.','o*net',NULL),(2124,'2023-02-27 20:36:18.259890','43-5052.00','Postal Service Mail Carriers','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Mail Carriers','Sort and deliver mail for the United States Postal Service (USPS). Deliver mail on established route by vehicle or on foot. Includes postal service mail carriers employed by USPS contractors.','o*net',NULL),(2125,'2023-02-27 20:36:18.283321','43-5053.00','Postal Service Mail Sorters, Processors, and Processing Machine Operators','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Postal Service Workers','Postal Service Mail Sorters, Processors, and Processing Machine Operators','Prepare incoming and outgoing mail for distribution for the United States Postal Service (USPS). Examine, sort, and route mail. Load, operate, and occasionally adjust and repair mail processing, sorting, and canceling machinery. Keep records of shipments, pouches, and sacks, and perform other duties related to mail handling within the postal service. Includes postal service mail sorters and processors employed by USPS contractors.','o*net',NULL),(2126,'2023-02-27 20:36:18.312322','43-5061.00','Production, Planning, and Expediting Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Production, Planning, and Expediting Clerks','Production, Planning, and Expediting Clerks','Coordinate and expedite the flow of work and materials within or between departments of an establishment according to production schedule. Duties include reviewing and distributing production, work, and shipment schedules; conferring with department supervisors to determine progress of work and completion dates; and compiling reports on progress of work, inventory levels, costs, and production problems.','o*net',NULL),(2127,'2023-02-27 20:36:18.337810','43-5071.00','Shipping, Receiving, and Inventory Clerks','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Shipping, Receiving, and Inventory Clerks','Shipping, Receiving, and Inventory Clerks','Verify and maintain records on incoming and outgoing shipments involving inventory. Duties include verifying and recording incoming merchandise or material and arranging for the transportation of products. May prepare items for shipment.','o*net',NULL),(2128,'2023-02-27 20:36:18.368433','43-5111.00','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Office and Administrative Support Occupations','Material Recording, Scheduling, Dispatching, and Distributing Workers','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Weighers, Measurers, Checkers, and Samplers, Recordkeeping','Weigh, measure, and check materials, supplies, and equipment for the purpose of keeping relevant records. Duties are primarily clerical by nature. Includes workers who collect and keep record of samples of products or materials.','o*net',NULL),(2129,'2023-02-27 20:36:18.394007','43-6011.00','Executive Secretaries and Executive Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Executive Secretaries and Executive Administrative Assistants','Provide high-level administrative support by conducting research, preparing statistical reports, and handling information requests, as well as performing routine administrative functions such as preparing correspondence, receiving visitors, arranging conference calls, and scheduling meetings. May also train and supervise lower-level clerical staff.','o*net',NULL),(2130,'2023-02-27 20:36:18.417319','43-6012.00','Legal Secretaries and Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Legal Secretaries and Administrative Assistants','Perform secretarial duties using legal terminology, procedures, and documents. Prepare legal papers and correspondence, such as summonses, complaints, motions, and subpoenas. May also assist with legal research.','o*net',NULL),(2131,'2023-02-27 20:36:18.441920','43-6013.00','Medical Secretaries and Administrative Assistants','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Medical Secretaries and Administrative Assistants','Perform secretarial duties using specific knowledge of medical terminology and hospital, clinic, or laboratory procedures. Duties may include scheduling appointments, billing patients, and compiling and recording medical charts, reports, and correspondence.','o*net',NULL),(2132,'2023-02-27 20:36:18.470455','43-6014.00','Secretaries and Administrative Assistants, Except Legal, Medical, and Executive','Office and Administrative Support Occupations','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants','Secretaries and Administrative Assistants, Except Legal, Medical, and Executive','Perform routine administrative functions such as drafting correspondence, scheduling appointments, organizing and maintaining paper and electronic files, or providing information to callers.','o*net',NULL),(2133,'2023-02-27 20:36:18.497650','43-9021.00','Data Entry Keyers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Data Entry and Information Processing Workers','Data Entry Keyers','Operate data entry device, such as keyboard or photo composing perforator. Duties may include verifying data and preparing materials for printing.','o*net',NULL),(2134,'2023-02-27 20:36:18.520560','43-9022.00','Word Processors and Typists','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Data Entry and Information Processing Workers','Word Processors and Typists','Use word processor, computer, or typewriter to type letters, reports, forms, or other material from rough draft, corrected copy, or voice recording. May perform other clerical duties as assigned.','o*net',NULL),(2135,'2023-02-27 20:36:18.545240','43-9031.00','Desktop Publishers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Desktop Publishers','Desktop Publishers','Format typescript and graphic elements using computer software to produce publication-ready material.','o*net',NULL),(2136,'2023-02-27 20:36:18.569677','43-9041.00','Insurance Claims and Policy Processing Clerks','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Insurance Claims and Policy Processing Clerks','Insurance Claims and Policy Processing Clerks','Process new insurance policies, modifications to existing policies, and claims forms. Obtain information from policyholders to verify the accuracy and completeness of information on claims forms, applications and related documents, and company records. Update existing policies and company records to reflect changes requested by policyholders and insurance company representatives.','o*net',NULL),(2137,'2023-02-27 20:36:18.596497','43-9051.00','Mail Clerks and Mail Machine Operators, Except Postal Service','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Mail Clerks and Mail Machine Operators, Except Postal Service','Mail Clerks and Mail Machine Operators, Except Postal Service','Prepare incoming and outgoing mail for distribution. Time-stamp, open, read, sort, and route incoming mail; and address, seal, stamp, fold, stuff, and affix postage to outgoing mail or packages. Duties may also include keeping necessary records and completed forms.','o*net',NULL),(2138,'2023-02-27 20:36:18.621893','43-9061.00','Office Clerks, General','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Office Clerks, General','Office Clerks, General','Perform duties too varied and diverse to be classified in any specific office clerical occupation, requiring knowledge of office systems and procedures. Clerical duties may be assigned in accordance with the office procedures of individual establishments and may include a combination of answering telephones, bookkeeping, typing or word processing, office machine operation, and filing.','o*net',NULL),(2139,'2023-02-27 20:36:18.648191','43-9071.00','Office Machine Operators, Except Computer','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Office Machine Operators, Except Computer','Office Machine Operators, Except Computer','Operate one or more of a variety of office machines, such as photocopying, photographic, and duplicating machines, or other office machines.','o*net',NULL),(2140,'2023-02-27 20:36:18.672080','43-9081.00','Proofreaders and Copy Markers','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Proofreaders and Copy Markers','Proofreaders and Copy Markers','Read transcript or proof type setup to detect and mark for correction any grammatical, typographical, or compositional errors. Excludes workers whose primary duty is editing copy. Includes proofreaders of braille.','o*net',NULL),(2141,'2023-02-27 20:36:18.698333','43-9111.00','Statistical Assistants','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Statistical Assistants','Statistical Assistants','Compile and compute data according to statistical formulas for use in statistical studies. May perform actuarial computations and compile charts and graphs for use by actuaries. Includes actuarial clerks.','o*net',NULL),(2142,'2023-02-27 20:36:18.724594','43-9199.00','Office and Administrative Support Workers, All Other','Office and Administrative Support Occupations','Other Office and Administrative Support Workers','Miscellaneous Office and Administrative Support Workers','Office and Administrative Support Workers, All Other','All office and administrative support workers not listed separately.','o*net',NULL),(2143,'2023-02-27 20:36:18.746357','45-1011.00','First-Line Supervisors of Farming, Fishing, and Forestry Workers','Farming, Fishing, and Forestry Occupations','Supervisors of Farming, Fishing, and Forestry Workers','First-Line Supervisors of Farming, Fishing, and Forestry Workers','First-Line Supervisors of Farming, Fishing, and Forestry Workers','Directly supervise and coordinate the activities of agricultural, forestry, aquacultural, and related workers.','o*net',NULL),(2144,'2023-02-27 20:36:18.767831','45-2011.00','Agricultural Inspectors','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Agricultural Inspectors','Agricultural Inspectors','Inspect agricultural commodities, processing equipment, and facilities, and fish and logging operations, to ensure compliance with regulations and laws governing health, quality, and safety.','o*net',NULL),(2145,'2023-02-27 20:36:18.792099','45-2021.00','Animal Breeders','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Animal Breeders','Animal Breeders','Select and breed animals according to their genealogy, characteristics, and offspring. May require knowledge of artificial insemination techniques and equipment use. May involve keeping records on heats, birth intervals, or pedigree.','o*net',NULL),(2146,'2023-02-27 20:36:18.820625','45-2041.00','Graders and Sorters, Agricultural Products','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Graders and Sorters, Agricultural Products','Graders and Sorters, Agricultural Products','Grade, sort, or classify unprocessed food and other agricultural products by size, weight, color, or condition.','o*net',NULL),(2147,'2023-02-27 20:36:18.845349','45-2091.00','Agricultural Equipment Operators','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Agricultural Equipment Operators','Drive and control equipment to support agricultural activities such as tilling soil; planting, cultivating, and harvesting crops; feeding and herding livestock; or removing animal waste. May perform tasks such as crop baling or hay bucking. May operate stationary equipment to perform post-harvest tasks such as husking, shelling, threshing, and ginning.','o*net',NULL),(2148,'2023-02-27 20:36:18.869088','45-2092.00','Farmworkers and Laborers, Crop, Nursery, and Greenhouse','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Farmworkers and Laborers, Crop, Nursery, and Greenhouse','Manually plant, cultivate, and harvest vegetables, fruits, nuts, horticultural specialties, and field crops. Use hand tools, such as shovels, trowels, hoes, tampers, pruning hooks, shears, and knives. Duties may include tilling soil and applying fertilizers; transplanting, weeding, thinning, or pruning crops; applying pesticides; or cleaning, grading, sorting, packing, and loading harvested products. May construct trellises, repair fences and farm buildings, or participate in irrigation activities.','o*net',NULL),(2149,'2023-02-27 20:36:18.894573','45-2093.00','Farmworkers, Farm, Ranch, and Aquacultural Animals','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Farmworkers, Farm, Ranch, and Aquacultural Animals','Attend to live farm, ranch, open range or aquacultural animals that may include cattle, sheep, swine, goats, horses and other equines, poultry, rabbits, finfish, shellfish, and bees. Attend to animals produced for animal products, such as meat, fur, skins, feathers, eggs, milk, and honey. Duties may include feeding, watering, herding, grazing, milking, castrating, branding, de-beaking, weighing, catching, and loading animals. May maintain records on animals; examine animals to detect diseases and injuries; assist in birth deliveries; and administer medications, vaccinations, or insecticides as appropriate. May clean and maintain animal housing areas. Includes workers who shear wool from sheep and collect eggs in hatcheries.','o*net',NULL),(2150,'2023-02-27 20:36:18.921866','45-2099.00','Agricultural Workers, All Other','Farming, Fishing, and Forestry Occupations','Agricultural Workers','Miscellaneous Agricultural Workers','Agricultural Workers, All Other','All agricultural workers not listed separately.','o*net',NULL),(2151,'2023-02-27 20:36:18.949017','45-3031.00','Fishing and Hunting Workers','Farming, Fishing, and Forestry Occupations','Fishing and Hunting Workers','Fishing and Hunting Workers','Fishing and Hunting Workers','Hunt, trap, catch, or gather wild animals or aquatic animals and plants. May use nets, traps, or other equipment. May haul catch onto ship or other vessel.','o*net',NULL),(2152,'2023-02-27 20:36:18.970930','45-4011.00','Forest and Conservation Workers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Forest and Conservation Workers','Forest and Conservation Workers','Under supervision, perform manual labor necessary to develop, maintain, or protect areas such as forests, forested areas, woodlands, wetlands, and rangelands through such activities as raising and transporting seedlings; combating insects, pests, and diseases harmful to plant life; and building structures to control water, erosion, and leaching of soil. Includes forester aides, seedling pullers, tree planters, and gatherers of nontimber forestry products such as pine straw.','o*net',NULL),(2153,'2023-02-27 20:36:18.995785','45-4021.00','Fallers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Fallers','Use axes or chainsaws to fell trees using knowledge of tree characteristics and cutting techniques to control direction of fall and minimize tree damage.','o*net',NULL),(2154,'2023-02-27 20:36:19.019801','45-4022.00','Logging Equipment Operators','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Logging Equipment Operators','Drive logging tractor or wheeled vehicle equipped with one or more accessories, such as bulldozer blade, frontal shear, grapple, logging arch, cable winches, hoisting rack, or crane boom, to fell tree; to skid, load, unload, or stack logs; or to pull stumps or clear brush. Includes operating stand-alone logging machines, such as log chippers.','o*net',NULL),(2155,'2023-02-27 20:36:19.046775','45-4023.00','Log Graders and Scalers','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Log Graders and Scalers','Grade logs or estimate the marketable content or value of logs or pulpwood in sorting yards, millpond, log deck, or similar locations. Inspect logs for defects or measure logs to determine volume.','o*net',NULL),(2156,'2023-02-27 20:36:19.073644','45-4029.00','Logging Workers, All Other','Farming, Fishing, and Forestry Occupations','Forest, Conservation, and Logging Workers','Logging Workers','Logging Workers, All Other','All logging workers not listed separately.','o*net',NULL),(2157,'2023-02-27 20:36:19.098438','47-1011.00','First-Line Supervisors of Construction Trades and Extraction Workers','Construction and Extraction Occupations','Supervisors of Construction and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','Directly supervise and coordinate activities of construction or extraction workers.','o*net',NULL),(2158,'2023-02-27 20:36:19.122326','47-1011.03','Solar Energy Installation Managers','Construction and Extraction Occupations','Supervisors of Construction and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','First-Line Supervisors of Construction Trades and Extraction Workers','Direct work crews installing residential or commercial solar photovoltaic or thermal systems.','o*net',NULL),(2159,'2023-02-27 20:36:19.147707','47-2011.00','Boilermakers','Construction and Extraction Occupations','Construction Trades Workers','Boilermakers','Boilermakers','Construct, assemble, maintain, and repair stationary steam boilers and boiler house auxiliaries. Align structures or plate sections to assemble boiler frame tanks or vats, following blueprints. Work involves use of hand and power tools, plumb bobs, levels, wedges, dogs, or turnbuckles. Assist in testing assembled vessels. Direct cleaning of boilers and boiler furnaces. Inspect and repair boiler fittings, such as safety valves, regulators, automatic-control mechanisms, water columns, and auxiliary machines.','o*net',NULL),(2160,'2023-02-27 20:36:19.175099','47-2021.00','Brickmasons and Blockmasons','Construction and Extraction Occupations','Construction Trades Workers','Brickmasons, Blockmasons, and Stonemasons','Brickmasons and Blockmasons','Lay and bind building materials, such as brick, structural tile, concrete block, cinder block, glass block, and terra-cotta block, with mortar and other substances, to construct or repair walls, partitions, arches, sewers, and other structures.','o*net',NULL),(2161,'2023-02-27 20:36:19.198233','47-2022.00','Stonemasons','Construction and Extraction Occupations','Construction Trades Workers','Brickmasons, Blockmasons, and Stonemasons','Stonemasons','Build stone structures, such as piers, walls, and abutments. Lay walks, curbstones, or special types of masonry for vats, tanks, and floors.','o*net',NULL),(2162,'2023-02-27 20:36:19.222780','47-2031.00','Carpenters','Construction and Extraction Occupations','Construction Trades Workers','Carpenters','Carpenters','Construct, erect, install, or repair structures and fixtures made of wood and comparable materials, such as concrete forms; building frameworks, including partitions, joists, studding, and rafters; and wood stairways, window and door frames, and hardwood floors. May also install cabinets, siding, drywall, and batt or roll insulation. Includes brattice builders who build doors or brattices (ventilation walls or partitions) in underground passageways.','o*net',NULL),(2163,'2023-02-27 20:36:19.246580','47-2041.00','Carpet Installers','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Carpet Installers','Lay and install carpet from rolls or blocks on floors. Install padding and trim flooring materials.','o*net',NULL),(2164,'2023-02-27 20:36:19.272429','47-2042.00','Floor Layers, Except Carpet, Wood, and Hard Tiles','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Floor Layers, Except Carpet, Wood, and Hard Tiles','Apply blocks, strips, or sheets of shock-absorbing, sound-deadening, or decorative coverings to floors.','o*net',NULL),(2165,'2023-02-27 20:36:19.298072','47-2043.00','Floor Sanders and Finishers','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Floor Sanders and Finishers','Scrape and sand wooden floors to smooth surfaces using floor scraper and floor sanding machine, and apply coats of finish.','o*net',NULL),(2166,'2023-02-27 20:36:19.322286','47-2044.00','Tile and Stone Setters','Construction and Extraction Occupations','Construction Trades Workers','Carpet, Floor, and Tile Installers and Finishers','Tile and Stone Setters','Apply hard tile, stone, and comparable materials to walls, floors, ceilings, countertops, and roof decks.','o*net',NULL),(2167,'2023-02-27 20:36:19.344521','47-2051.00','Cement Masons and Concrete Finishers','Construction and Extraction Occupations','Construction Trades Workers','Cement Masons, Concrete Finishers, and Terrazzo Workers','Cement Masons and Concrete Finishers','Smooth and finish surfaces of poured concrete, such as floors, walks, sidewalks, roads, or curbs using a variety of hand and power tools. Align forms for sidewalks, curbs, or gutters; patch voids; and use saws to cut expansion joints.','o*net',NULL),(2168,'2023-02-27 20:36:19.371143','47-2053.00','Terrazzo Workers and Finishers','Construction and Extraction Occupations','Construction Trades Workers','Cement Masons, Concrete Finishers, and Terrazzo Workers','Terrazzo Workers and Finishers','Apply a mixture of cement, sand, pigment, or marble chips to floors, stairways, and cabinet fixtures to fashion durable and decorative surfaces.','o*net',NULL),(2169,'2023-02-27 20:36:19.394646','47-2061.00','Construction Laborers','Construction and Extraction Occupations','Construction Trades Workers','Construction Laborers','Construction Laborers','Perform tasks involving physical labor at construction sites. May operate hand and power tools of all types: air hammers, earth tampers, cement mixers, small mechanical hoists, surveying and measuring equipment, and a variety of other equipment and instruments. May clean and prepare sites, dig trenches, set braces to support the sides of excavations, erect scaffolding, and clean up rubble, debris, and other waste materials. May assist other craft workers.','o*net',NULL),(2170,'2023-02-27 20:36:19.422720','47-2071.00','Paving, Surfacing, and Tamping Equipment Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Paving, Surfacing, and Tamping Equipment Operators','Operate equipment used for applying concrete, asphalt, or other materials to road beds, parking lots, or airport runways and taxiways or for tamping gravel, dirt, or other materials. Includes concrete and asphalt paving machine operators, form tampers, tamping machine operators, and stone spreader operators.','o*net',NULL),(2171,'2023-02-27 20:36:19.444742','47-2072.00','Pile Driver Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Pile Driver Operators','Operate pile drivers mounted on skids, barges, crawler treads, or locomotive cranes to drive pilings for retaining walls, bulkheads, and foundations of structures such as buildings, bridges, and piers.','o*net',NULL),(2172,'2023-02-27 20:36:19.470658','47-2073.00','Operating Engineers and Other Construction Equipment Operators','Construction and Extraction Occupations','Construction Trades Workers','Construction Equipment Operators','Operating Engineers and Other Construction Equipment Operators','Operate one or several types of power construction equipment, such as motor graders, bulldozers, scrapers, compressors, pumps, derricks, shovels, tractors, or front-end loaders to excavate, move, and grade earth, erect structures, or pour concrete or other hard surface pavement. May repair and maintain equipment in addition to other duties.','o*net',NULL),(2173,'2023-02-27 20:36:19.495744','47-2081.00','Drywall and Ceiling Tile Installers','Construction and Extraction Occupations','Construction Trades Workers','Drywall Installers, Ceiling Tile Installers, and Tapers','Drywall and Ceiling Tile Installers','Apply plasterboard or other wallboard to ceilings or interior walls of buildings. Apply or mount acoustical tiles or blocks, strips, or sheets of shock-absorbing materials to ceilings and walls of buildings to reduce or reflect sound. Materials may be of decorative quality. Includes lathers who fasten wooden, metal, or rockboard lath to walls, ceilings, or partitions of buildings to provide support base for plaster, fireproofing, or acoustical material.','o*net',NULL),(2174,'2023-02-27 20:36:19.524761','47-2082.00','Tapers','Construction and Extraction Occupations','Construction Trades Workers','Drywall Installers, Ceiling Tile Installers, and Tapers','Tapers','Seal joints between plasterboard or other wallboard to prepare wall surface for painting or papering.','o*net',NULL),(2175,'2023-02-27 20:36:19.548562','47-2111.00','Electricians','Construction and Extraction Occupations','Construction Trades Workers','Electricians','Electricians','Install, maintain, and repair electrical wiring, equipment, and fixtures. Ensure that work is in accordance with relevant codes. May install or service street lights, intercom systems, or electrical control systems.','o*net',NULL),(2176,'2023-02-27 20:36:19.573393','47-2121.00','Glaziers','Construction and Extraction Occupations','Construction Trades Workers','Glaziers','Glaziers','Install glass in windows, skylights, store fronts, and display cases, or on surfaces, such as building fronts, interior walls, ceilings, and tabletops.','o*net',NULL),(2177,'2023-02-27 20:36:19.602515','47-2131.00','Insulation Workers, Floor, Ceiling, and Wall','Construction and Extraction Occupations','Construction Trades Workers','Insulation Workers','Insulation Workers, Floor, Ceiling, and Wall','Line and cover structures with insulating materials. May work with batt, roll, or blown insulation materials.','o*net',NULL),(2178,'2023-02-27 20:36:19.628968','47-2132.00','Insulation Workers, Mechanical','Construction and Extraction Occupations','Construction Trades Workers','Insulation Workers','Insulation Workers, Mechanical','Apply insulating materials to pipes or ductwork, or other mechanical systems in order to help control and maintain temperature.','o*net',NULL),(2179,'2023-02-27 20:36:19.654458','47-2141.00','Painters, Construction and Maintenance','Construction and Extraction Occupations','Construction Trades Workers','Painters and Paperhangers','Painters, Construction and Maintenance','Paint walls, equipment, buildings, bridges, and other structural surfaces, using brushes, rollers, and spray guns. May remove old paint to prepare surface prior to painting. May mix colors or oils to obtain desired color or consistency.','o*net',NULL),(2180,'2023-02-27 20:36:19.677569','47-2142.00','Paperhangers','Construction and Extraction Occupations','Construction Trades Workers','Painters and Paperhangers','Paperhangers','Cover interior walls or ceilings of rooms with decorative wallpaper or fabric, or attach advertising posters on surfaces such as walls and billboards. May remove old materials or prepare surfaces to be papered.','o*net',NULL),(2181,'2023-02-27 20:36:19.699993','47-2151.00','Pipelayers','Construction and Extraction Occupations','Construction Trades Workers','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Pipelayers','Lay pipe for storm or sanitation sewers, drains, and water mains. Perform any combination of the following tasks: grade trenches or culverts, position pipe, or seal joints.','o*net',NULL),(2182,'2023-02-27 20:36:19.726809','47-2152.00','Plumbers, Pipefitters, and Steamfitters','Construction and Extraction Occupations','Construction Trades Workers','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Plumbers, Pipefitters, and Steamfitters','Assemble, install, alter, and repair pipelines or pipe systems that carry water, steam, air, or other liquids or gases. May install heating and cooling equipment and mechanical control systems. Includes sprinkler fitters.','o*net',NULL),(2183,'2023-02-27 20:36:19.752601','47-2152.04','Solar Thermal Installers and Technicians','Construction and Extraction Occupations','Construction Trades Workers','Pipelayers, Plumbers, Pipefitters, and Steamfitters','Plumbers, Pipefitters, and Steamfitters','Install or repair solar energy systems designed to collect, store, and circulate solar-heated water for residential, commercial or industrial use.','o*net',NULL),(2184,'2023-02-27 20:36:19.777332','47-2161.00','Plasterers and Stucco Masons','Construction and Extraction Occupations','Construction Trades Workers','Plasterers and Stucco Masons','Plasterers and Stucco Masons','Apply interior or exterior plaster, cement, stucco, or similar materials. May also set ornamental plaster.','o*net',NULL),(2185,'2023-02-27 20:36:19.798479','47-2171.00','Reinforcing Iron and Rebar Workers','Construction and Extraction Occupations','Construction Trades Workers','Reinforcing Iron and Rebar Workers','Reinforcing Iron and Rebar Workers','Position and secure steel bars or mesh in concrete forms in order to reinforce concrete. Use a variety of fasteners, rod-bending machines, blowtorches, and hand tools. Includes rod busters.','o*net',NULL),(2186,'2023-02-27 20:36:19.823079','47-2181.00','Roofers','Construction and Extraction Occupations','Construction Trades Workers','Roofers','Roofers','Cover roofs of structures with shingles, slate, asphalt, aluminum, wood, or related materials. May spray roofs, sidings, and walls with material to bind, seal, insulate, or soundproof sections of structures.','o*net',NULL),(2187,'2023-02-27 20:36:19.846080','47-2211.00','Sheet Metal Workers','Construction and Extraction Occupations','Construction Trades Workers','Sheet Metal Workers','Sheet Metal Workers','Fabricate, assemble, install, and repair sheet metal products and equipment, such as ducts, control boxes, drainpipes, and furnace casings. Work may involve any of the following: setting up and operating fabricating machines to cut, bend, and straighten sheet metal; shaping metal over anvils, blocks, or forms using hammer; operating soldering and welding equipment to join sheet metal parts; or inspecting, assembling, and smoothing seams and joints of burred surfaces. Includes sheet metal duct installers who install prefabricated sheet metal ducts used for heating, air conditioning, or other purposes.','o*net',NULL),(2188,'2023-02-27 20:36:19.876700','47-2221.00','Structural Iron and Steel Workers','Construction and Extraction Occupations','Construction Trades Workers','Structural Iron and Steel Workers','Structural Iron and Steel Workers','Raise, place, and unite iron or steel girders, columns, and other structural members to form completed structures or structural frameworks. May erect metal storage tanks and assemble prefabricated metal buildings.','o*net',NULL),(2189,'2023-02-27 20:36:19.899517','47-2231.00','Solar Photovoltaic Installers','Construction and Extraction Occupations','Construction Trades Workers','Solar Photovoltaic Installers','Solar Photovoltaic Installers','Assemble, install, or maintain solar photovoltaic (PV) systems on roofs or other structures in compliance with site assessment and schematics. May include measuring, cutting, assembling, and bolting structural framing and solar modules. May perform minor electrical work such as current checks.','o*net',NULL),(2190,'2023-02-27 20:36:19.925837','47-3011.00','Helpers--Brickmasons, Blockmasons, Stonemasons, and Tile and Marble Setters','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Brickmasons, Blockmasons, Stonemasons, and Tile and Marble Setters','Help brickmasons, blockmasons, stonemasons, or tile and marble setters by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment.','o*net',NULL),(2191,'2023-02-27 20:36:19.949308','47-3012.00','Helpers--Carpenters','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Carpenters','Help carpenters by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment.','o*net',NULL),(2192,'2023-02-27 20:36:19.977638','47-3013.00','Helpers--Electricians','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Electricians','Help electricians by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment.','o*net',NULL),(2193,'2023-02-27 20:36:19.998225','47-3014.00','Helpers--Painters, Paperhangers, Plasterers, and Stucco Masons','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Painters, Paperhangers, Plasterers, and Stucco Masons','Help painters, paperhangers, plasterers, or stucco masons by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment.','o*net',NULL),(2194,'2023-02-27 20:36:20.024432','47-3015.00','Helpers--Pipelayers, Plumbers, Pipefitters, and Steamfitters','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Pipelayers, Plumbers, Pipefitters, and Steamfitters','Help plumbers, pipefitters, steamfitters, or pipelayers by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment.','o*net',NULL),(2195,'2023-02-27 20:36:20.046924','47-3016.00','Helpers--Roofers','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers--Roofers','Help roofers by performing duties requiring less skill. Duties include using, supplying, or holding materials or tools, and cleaning work area and equipment.','o*net',NULL),(2196,'2023-02-27 20:36:20.073487','47-3019.00','Helpers, Construction Trades, All Other','Construction and Extraction Occupations','Helpers, Construction Trades','Helpers, Construction Trades','Helpers, Construction Trades, All Other','All construction trades helpers not listed separately.','o*net',NULL),(2197,'2023-02-27 20:36:20.097845','47-4011.00','Construction and Building Inspectors','Construction and Extraction Occupations','Other Construction and Related Workers','Construction and Building Inspectors','Construction and Building Inspectors','Inspect structures using engineering skills to determine structural soundness and compliance with specifications, building codes, and other regulations. Inspections may be general in nature or may be limited to a specific area, such as electrical systems or plumbing.','o*net',NULL),(2198,'2023-02-27 20:36:20.124503','47-4011.01','Energy Auditors','Construction and Extraction Occupations','Other Construction and Related Workers','Construction and Building Inspectors','Construction and Building Inspectors','Conduct energy audits of buildings, building systems, or process systems. May also conduct investment grade audits of buildings or systems.','o*net',NULL),(2199,'2023-02-27 20:36:20.148572','47-4021.00','Elevator and Escalator Installers and Repairers','Construction and Extraction Occupations','Other Construction and Related Workers','Elevator and Escalator Installers and Repairers','Elevator and Escalator Installers and Repairers','Assemble, install, repair, or maintain electric or hydraulic freight or passenger elevators, escalators, or dumbwaiters.','o*net',NULL),(2200,'2023-02-27 20:36:20.176658','47-4031.00','Fence Erectors','Construction and Extraction Occupations','Other Construction and Related Workers','Fence Erectors','Fence Erectors','Erect and repair fences and fence gates, using hand and power tools.','o*net',NULL),(2201,'2023-02-27 20:36:20.201703','47-4041.00','Hazardous Materials Removal Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Hazardous Materials Removal Workers','Hazardous Materials Removal Workers','Identify, remove, pack, transport, or dispose of hazardous materials, including asbestos, lead-based paint, waste oil, fuel, transmission fluid, radioactive materials, or contaminated soil. Specialized training and certification in hazardous materials handling or a confined entry permit are generally required. May operate earth-moving equipment or trucks.','o*net',NULL),(2202,'2023-02-27 20:36:20.228007','47-4051.00','Highway Maintenance Workers','Construction and Extraction Occupations','Other Construction and Related Workers','Highway Maintenance Workers','Highway Maintenance Workers','Maintain highways, municipal and rural roads, airport runways, and rights-of-way. Duties include patching broken or eroded pavement and repairing guard rails, highway markers, and snow fences. May also mow or clear brush from along road, or plow snow from roadway.','o*net',NULL),(2203,'2023-02-27 20:36:20.252608','47-4061.00','Rail-Track Laying and Maintenance Equipment Operators','Construction and Extraction Occupations','Other Construction and Related Workers','Rail-Track Laying and Maintenance Equipment Operators','Rail-Track Laying and Maintenance Equipment Operators','Lay, repair, and maintain track for standard or narrow-gauge railroad equipment used in regular railroad service or in plant yards, quarries, sand and gravel pits, and mines. Includes ballast cleaning machine operators and railroad bed tamping machine operators.','o*net',NULL),(2204,'2023-02-27 20:36:20.278418','47-4071.00','Septic Tank Servicers and Sewer Pipe Cleaners','Construction and Extraction Occupations','Other Construction and Related Workers','Septic Tank Servicers and Sewer Pipe Cleaners','Septic Tank Servicers and Sewer Pipe Cleaners','Clean and repair septic tanks, sewer lines, or drains. May patch walls and partitions of tank, replace damaged drain tile, or repair breaks in underground piping.','o*net',NULL),(2205,'2023-02-27 20:36:20.305813','47-4091.00','Segmental Pavers','Construction and Extraction Occupations','Other Construction and Related Workers','Miscellaneous Construction and Related Workers','Segmental Pavers','Lay out, cut, and place segmental paving units. Includes installers of bedding and restraining materials for the paving units.','o*net',NULL),(2206,'2023-02-27 20:36:20.332527','47-4099.00','Construction and Related Workers, All Other','Construction and Extraction Occupations','Other Construction and Related Workers','Miscellaneous Construction and Related Workers','Construction and Related Workers, All Other','All construction and related workers not listed separately.','o*net',NULL),(2207,'2023-02-27 20:36:20.357021','47-4099.03','Weatherization Installers and Technicians','Construction and Extraction Occupations','Other Construction and Related Workers','Miscellaneous Construction and Related Workers','Construction and Related Workers, All Other','Perform a variety of activities to weatherize homes and make them more energy efficient. Duties include repairing windows, insulating ducts, and performing heating, ventilating, and air-conditioning (HVAC) work. May perform energy audits and advise clients on energy conservation measures.','o*net',NULL),(2208,'2023-02-27 20:36:20.380816','47-5011.00','Derrick Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Derrick Operators, Oil and Gas','Rig derrick equipment and operate pumps to circulate mud or fluid through drill hole.','o*net',NULL),(2209,'2023-02-27 20:36:20.406539','47-5012.00','Rotary Drill Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Rotary Drill Operators, Oil and Gas','Set up or operate a variety of drills to remove underground oil and gas, or remove core samples for testing during oil and gas exploration.','o*net',NULL),(2210,'2023-02-27 20:36:20.430591','47-5013.00','Service Unit Operators, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Derrick, Rotary Drill, and Service Unit Operators, Oil and Gas','Service Unit Operators, Oil and Gas','Operate equipment to increase oil flow from producing wells or to remove stuck pipe, casing, tools, or other obstructions from drilling wells. Includes fishing-tool technicians.','o*net',NULL),(2211,'2023-02-27 20:36:20.455796','47-5022.00','Excavating and Loading Machine and Dragline Operators, Surface Mining','Construction and Extraction Occupations','Extraction Workers','Surface Mining Machine Operators and Earth Drillers','Excavating and Loading Machine and Dragline Operators, Surface Mining','Operate or tend machinery at surface mining site, equipped with scoops, shovels, or buckets to excavate and load loose materials.','o*net',NULL),(2212,'2023-02-27 20:36:20.478147','47-5023.00','Earth Drillers, Except Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Surface Mining Machine Operators and Earth Drillers','Earth Drillers, Except Oil and Gas','Operate a variety of drills such as rotary, churn, and pneumatic to tap subsurface water and salt deposits, to remove core samples during mineral exploration or soil testing, and to facilitate the use of explosives in mining or construction. Includes horizontal and earth boring machine operators.','o*net',NULL),(2213,'2023-02-27 20:36:20.503723','47-5032.00','Explosives Workers, Ordnance Handling Experts, and Blasters','Construction and Extraction Occupations','Extraction Workers','Explosives Workers, Ordnance Handling Experts, and Blasters','Explosives Workers, Ordnance Handling Experts, and Blasters','Place and detonate explosives to demolish structures or to loosen, remove, or displace earth, rock, or other materials. May perform specialized handling, storage, and accounting procedures.','o*net',NULL),(2214,'2023-02-27 20:36:20.531600','47-5041.00','Continuous Mining Machine Operators','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Continuous Mining Machine Operators','Operate self-propelled mining machines that rip coal, metal and nonmetal ores, rock, stone, or sand from the mine face and load it onto conveyors, shuttle cars, or trucks in a continuous operation.','o*net',NULL),(2215,'2023-02-27 20:36:20.559103','47-5043.00','Roof Bolters, Mining','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Roof Bolters, Mining','Operate machinery to install roof support bolts in underground mine.','o*net',NULL),(2216,'2023-02-27 20:36:20.581085','47-5044.00','Loading and Moving Machine Operators, Underground Mining','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Loading and Moving Machine Operators, Underground Mining','Operate underground loading or moving machine to load or move coal, ore, or rock using shuttle or mine car or conveyors. Equipment may include power shovels, hoisting engines equipped with cable-drawn scraper or scoop, or machines equipped with gathering arms and conveyor.','o*net',NULL),(2217,'2023-02-27 20:36:20.605330','47-5049.00','Underground Mining Machine Operators, All Other','Construction and Extraction Occupations','Extraction Workers','Underground Mining Machine Operators','Underground Mining Machine Operators, All Other','All underground mining machine operators not listed separately.','o*net',NULL),(2218,'2023-02-27 20:36:20.631223','47-5051.00','Rock Splitters, Quarry','Construction and Extraction Occupations','Extraction Workers','Rock Splitters, Quarry','Rock Splitters, Quarry','Separate blocks of rough dimension stone from quarry mass using jackhammers, wedges, or chop saws.','o*net',NULL),(2219,'2023-02-27 20:36:20.658821','47-5071.00','Roustabouts, Oil and Gas','Construction and Extraction Occupations','Extraction Workers','Roustabouts, Oil and Gas','Roustabouts, Oil and Gas','Assemble or repair oil field equipment using hand and power tools. Perform other tasks as needed.','o*net',NULL),(2220,'2023-02-27 20:36:20.683391','47-5081.00','Helpers--Extraction Workers','Construction and Extraction Occupations','Extraction Workers','Helpers--Extraction Workers','Helpers--Extraction Workers','Help extraction craft workers, such as earth drillers, blasters and explosives workers, derrick operators, and mining machine operators, by performing duties requiring less skill. Duties include supplying equipment or cleaning work area.','o*net',NULL),(2221,'2023-02-27 20:36:20.709329','47-5099.00','Extraction Workers, All Other','Construction and Extraction Occupations','Extraction Workers','Miscellaneous Extraction Workers','Extraction Workers, All Other','All extraction workers not listed separately.','o*net',NULL),(2222,'2023-02-27 20:36:20.733599','49-1011.00','First-Line Supervisors of Mechanics, Installers, and Repairers','Installation, M