 process vessels and monitor production process. Perform, and keep records of, plant maintenance, repairs, and safety inspections.','o*net',NULL),(2354,'2023-02-27 20:36:24.065191','51-9011.00','Chemical Equipment Operators and Tenders','Production Occupations','Other Production Occupations','Chemical Processing Machine Setters, Operators, and Tenders','Chemical Equipment Operators and Tenders','Operate or tend equipment to control chemical changes or reactions in the processing of industrial or consumer products. Equipment used includes devulcanizers, steam-jacketed kettles, and reactor vessels.','o*net',NULL),(2355,'2023-02-27 20:36:24.089883','51-9012.00','Separating, Filtering, Clarifying, Precipitating, and Still Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Chemical Processing Machine Setters, Operators, and Tenders','Separating, Filtering, Clarifying, Precipitating, and Still Machine Setters, Operators, and Tenders','Set up, operate, or tend continuous flow or vat-type equipment; filter presses; shaker screens; centrifuges; condenser tubes; precipitating, fermenting, or evaporating tanks; scrubbing towers; or batch stills. These machines extract, sort, or separate liquids, gases, or solids from other materials to recover a refined product. Includes dairy processing equipment operators.','o*net',NULL),(2356,'2023-02-27 20:36:24.116552','51-9021.00','Crushing, Grinding, and Polishing Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Crushing, Grinding, and Polishing Machine Setters, Operators, and Tenders','Set up, operate, or tend machines to crush, grind, or polish materials, such as coal, glass, grain, stone, food, or rubber.','o*net',NULL),(2357,'2023-02-27 20:36:24.139488','51-9022.00','Grinding and Polishing Workers, Hand','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Grinding and Polishing Workers, Hand','Grind, sand, or polish, using hand tools or hand-held power tools, a variety of metal, wood, stone, clay, plastic, or glass objects. Includes chippers, buffers, and finishers.','o*net',NULL),(2358,'2023-02-27 20:36:24.166803','51-9023.00','Mixing and Blending Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Crushing, Grinding, Polishing, Mixing, and Blending Workers','Mixing and Blending Machine Setters, Operators, and Tenders','Set up, operate, or tend machines to mix or blend materials, such as chemicals, tobacco, liquids, color pigments, or explosive ingredients.','o*net',NULL),(2359,'2023-02-27 20:36:24.190003','51-9031.00','Cutters and Trimmers, Hand','Production Occupations','Other Production Occupations','Cutting Workers','Cutters and Trimmers, Hand','Use hand tools or hand-held power tools to cut and trim a variety of manufactured items, such as carpet, fabric, stone, glass, or rubber.','o*net',NULL),(2360,'2023-02-27 20:36:24.215151','51-9032.00','Cutting and Slicing Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Cutting Workers','Cutting and Slicing Machine Setters, Operators, and Tenders','Set up, operate, or tend machines that cut or slice materials, such as glass, stone, cork, rubber, tobacco, food, paper, or insulating material.','o*net',NULL),(2361,'2023-02-27 20:36:24.242151','51-9041.00','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Extruding, Forming, Pressing, and Compacting Machine Setters, Operators, and Tenders','Set up, operate, or tend machines, such as glass-forming machines, plodder machines, and tuber machines, to shape and form products such as glassware, food, rubber, soap, brick, tile, clay, wax, tobacco, or cosmetics.','o*net',NULL),(2362,'2023-02-27 20:36:24.268935','51-9051.00','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Production Occupations','Other Production Occupations','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Furnace, Kiln, Oven, Drier, and Kettle Operators and Tenders','Operate or tend heating equipment other than basic metal, plastic, or food processing equipment. Includes activities such as annealing glass, drying lumber, curing rubber, removing moisture from materials, or boiling soap.','o*net',NULL),(2363,'2023-02-27 20:36:24.291831','51-9061.00','Inspectors, Testers, Sorters, Samplers, and Weighers','Production Occupations','Other Production Occupations','Inspectors, Testers, Sorters, Samplers, and Weighers','Inspectors, Testers, Sorters, Samplers, and Weighers','Inspect, test, sort, sample, or weigh nonagricultural raw materials or processed, machined, fabricated, or assembled parts or products for defects, wear, and deviations from specifications. May use precision measuring instruments and complex test equipment.','o*net',NULL),(2364,'2023-02-27 20:36:24.318671','51-9071.00','Jewelers and Precious Stone and Metal Workers','Production Occupations','Other Production Occupations','Jewelers and Precious Stone and Metal Workers','Jewelers and Precious Stone and Metal Workers','Design, fabricate, adjust, repair, or appraise jewelry, gold, silver, other precious metals, or gems.','o*net',NULL),(2365,'2023-02-27 20:36:24.344337','51-9071.06','Gem and Diamond Workers','Production Occupations','Other Production Occupations','Jewelers and Precious Stone and Metal Workers','Jewelers and Precious Stone and Metal Workers','Fabricate, finish, or evaluate the quality of gems and diamonds used in jewelry or industrial tools.','o*net',NULL),(2366,'2023-02-27 20:36:24.370498','51-9081.00','Dental Laboratory Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Dental Laboratory Technicians','Construct and repair full or partial dentures or dental appliances.','o*net',NULL),(2367,'2023-02-27 20:36:24.393239','51-9082.00','Medical Appliance Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Medical Appliance Technicians','Construct, maintain, or repair medical supportive devices such as braces, orthotics and prosthetic devices, joints, arch supports, and other surgical and medical appliances.','o*net',NULL),(2368,'2023-02-27 20:36:24.419626','51-9083.00','Ophthalmic Laboratory Technicians','Production Occupations','Other Production Occupations','Dental and Ophthalmic Laboratory Technicians and Medical Appliance Technicians','Ophthalmic Laboratory Technicians','Cut, grind, and polish eyeglasses, contact lenses, or other precision optical elements. Assemble and mount lenses into frames or process other optical elements. Includes precision lens polishers or grinders, centerer-edgers, and lens mounters.','o*net',NULL),(2369,'2023-02-27 20:36:24.445750','51-9111.00','Packaging and Filling Machine Operators and Tenders','Production Occupations','Other Production Occupations','Packaging and Filling Machine Operators and Tenders','Packaging and Filling Machine Operators and Tenders','Operate or tend machines to prepare industrial or consumer products for storage or shipment. Includes cannery workers who pack food products.','o*net',NULL),(2370,'2023-02-27 20:36:24.475521','51-9123.00','Painting, Coating, and Decorating Workers','Production Occupations','Other Production Occupations','Painting Workers','Painting, Coating, and Decorating Workers','Paint, coat, or decorate articles, such as furniture, glass, plateware, pottery, jewelry, toys, books, or leather.','o*net',NULL),(2371,'2023-02-27 20:36:24.499570','51-9124.00','Coating, Painting, and Spraying Machine Setters, Operators, and Tenders','Production Occupations','Other Production Occupations','Painting Workers','Coating, Painting, and Spraying Machine Setters, Operators, and Tenders','Set up, operate, or tend spraying or rolling machines to coat or paint any of a wide variety of products, including glassware, cloth, ceramics, metal, plastic, paper, or wood, with lacquer, silver, copper, rubber, varnish, glaze, enamel, oil, or rust-proofing materials. Includes painters of transportation vehicles such as painters in auto body repair facilities.','o*net',NULL),(2372,'2023-02-27 20:36:24.526867','51-9141.00','Semiconductor Processing Technicians','Production Occupations','Other Production Occupations','Semiconductor Processing Technicians','Semiconductor Processing Technicians','Perform any or all of the following functions in the manufacture of electronic semiconductors: load semiconductor material into furnace; saw formed ingots into segments; load individual segment into crystal growing chamber and monitor controls; locate crystal axis in ingot using x-ray equipment and saw ingots into wafers; and clean, polish, and load wafers into series of special purpose furnaces, chemical baths, and equipment used to form circuitry and change conductive properties.','o*net',NULL),(2373,'2023-02-27 20:36:24.551919','51-9151.00','Photographic Process Workers and Processing Machine Operators','Production Occupations','Other Production Occupations','Photographic Process Workers and Processing Machine Operators','Photographic Process Workers and Processing Machine Operators','Perform work involved in developing and processing photographic images from film or digital media. May perform precision tasks such as editing photographic negatives and prints.','o*net',NULL),(2374,'2023-02-27 20:36:24.580302','51-9161.00','Computer Numerically Controlled Tool Operators','Production Occupations','Other Production Occupations','Computer Numerically Controlled Tool Operators and Programmers','Computer Numerically Controlled Tool Operators','Operate computer-controlled tools, machines, or robots to machine or process parts, tools, or other work pieces made of metal, plastic, wood, stone, or other materials. May also set up and maintain equipment.','o*net',NULL),(2375,'2023-02-27 20:36:24.602648','51-9162.00','Computer Numerically Controlled Tool Programmers','Production Occupations','Other Production Occupations','Computer Numerically Controlled Tool Operators and Programmers','Computer Numerically Controlled Tool Programmers','Develop programs to control machining or processing of materials by automatic machine tools, equipment, or systems. May also set up, operate, or maintain equipment.','o*net',NULL),(2376,'2023-02-27 20:36:24.629116','51-9191.00','Adhesive Bonding Machine Operators and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Adhesive Bonding Machine Operators and Tenders','Operate or tend bonding machines that use adhesives to join items for further processing or to form a completed product. Processes include joining veneer sheets into plywood; gluing paper; or joining rubber and rubberized fabric parts, plastic, simulated leather, or other materials.','o*net',NULL),(2377,'2023-02-27 20:36:24.652177','51-9192.00','Cleaning, Washing, and Metal Pickling Equipment Operators and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Cleaning, Washing, and Metal Pickling Equipment Operators and Tenders','Operate or tend machines to wash or clean products, such as barrels or kegs, glass items, tin plate, food, pulp, coal, plastic, or rubber, to remove impurities.','o*net',NULL),(2378,'2023-02-27 20:36:24.678636','51-9193.00','Cooling and Freezing Equipment Operators and Tenders','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Cooling and Freezing Equipment Operators and Tenders','Operate or tend equipment such as cooling and freezing units, refrigerators, batch freezers, and freezing tunnels, to cool or freeze products, food, blood plasma, and chemicals.','o*net',NULL),(2379,'2023-02-27 20:36:24.704258','51-9194.00','Etchers and Engravers','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Etchers and Engravers','Engrave or etch metal, wood, rubber, or other materials. Includes such workers as etcher-circuit processors, pantograph engravers, and silk screen etchers.','o*net',NULL),(2380,'2023-02-27 20:36:24.730084','51-9195.00','Molders, Shapers, and Casters, Except Metal and Plastic','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Molders, Shapers, and Casters, Except Metal and Plastic','Mold, shape, form, cast, or carve products such as food products, figurines, tile, pipes, and candles consisting of clay, glass, plaster, concrete, stone, or combinations of materials.','o*net',NULL),(2381,'2023-02-27 20:36:24.753729','51-9195.03','Stone Cutters and Carvers, Manufacturing','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Molders, Shapers, and Casters, Except Metal and Plastic','Cut or carve stone according to diagrams and patterns.','o*net',NULL),(2382,'2023-02-27 20:36:24.780544','51-9195.04','Glass Blowers, Molders, Benders, and Finishers','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Molders, Shapers, and Casters, Except Metal and Plastic','Shape molten glass according to patterns.','o*net',NULL),(2383,'2023-02-27 20:36:24.806274','51-9195.05','Potters, Manufacturing','Production Occupations','Other Production Occupations','Miscellaneous Production Workers','Molders, Shapers, and Casters, Except Metal and Plastic','Operate production machines such as pug mill, jigger machine, or potter\'s wheel to process clay in manufacture of ceramic, pottery and stoneware products.','o*net',NULL),(2384,'2023-02-27 20:36:24