cedures. Includes loadmasters.','o*net',NULL),(2389,'2023-02-27 20:36:24.965072','53-1042.00','First-Line Supervisors of Helpers, Laborers, and Material Movers, Hand','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Helpers, Laborers, and Material Movers, Hand','Directly supervise and coordinate the activities of helpers, laborers, or material movers, hand.','o*net',NULL),(2390,'2023-02-27 20:36:24.989509','53-1042.01','Recycling Coordinators','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Helpers, Laborers, and Material Movers, Hand','Supervise curbside and drop-off recycling programs for municipal governments or private firms.','o*net',NULL),(2391,'2023-02-27 20:36:25.014211','53-1043.00','First-Line Supervisors of Material-Moving Machine and Vehicle Operators','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Material-Moving Machine and Vehicle Operators','Directly supervise and coordinate activities of material-moving machine and vehicle operators and helpers.','o*net',NULL),(2392,'2023-02-27 20:36:25.037573','53-1044.00','First-Line Supervisors of Passenger Attendants','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Passenger Attendants','Supervise and coordinate activities of passenger attendants.','o*net',NULL),(2393,'2023-02-27 20:36:25.065493','53-1049.00','First-Line Supervisors of Transportation Workers, All Other','Transportation and Material Moving Occupations','Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation and Material Moving Workers','First-Line Supervisors of Transportation Workers, All Other','All first-line supervisors of transportation workers not listed separately.','o*net',NULL),(2394,'2023-02-27 20:36:25.091961','53-2011.00','Airline Pilots, Copilots, and Flight Engineers','Transportation and Material Moving Occupations','Air Transportation Workers','Aircraft Pilots and Flight Engineers','Airline Pilots, Copilots, and Flight Engineers','Pilot and navigate the flight of fixed-wing aircraft, usually on scheduled air carrier routes, for the transport of passengers and cargo. Requires Federal Air Transport certificate and rating for specific aircraft type used. Includes regional, national, and international airline pilots and flight instructors of airline pilots.','o*net',NULL),(2395,'2023-02-27 20:36:25.117675','53-2012.00','Commercial Pilots','Transportation and Material Moving Occupations','Air Transportation Workers','Aircraft Pilots and Flight Engineers','Commercial Pilots','Pilot and navigate the flight of fixed-wing aircraft on nonscheduled air carrier routes, or helicopters. Requires Commercial Pilot certificate. Includes charter pilots with similar certification, and air ambulance and air tour pilots. Excludes regional, national, and international airline pilots.','o*net',NULL),(2396,'2023-02-27 20:36:25.140645','53-2021.00','Air Traffic Controllers','Transportation and Material Moving Occupations','Air Transportation Workers','Air Traffic Controllers and Airfield Operations Specialists','Air Traffic Controllers','Control air traffic on and within vicinity of airport, and movement of air traffic between altitude sectors and control centers, according to established procedures and policies. Authorize, regulate, and control commercial airline flights according to government or company regulations to expedite and ensure flight safety.','o*net',NULL),(2397,'2023-02-27 20:36:25.168859','53-2022.00','Airfield Operations Specialists','Transportation and Material Moving Occupations','Air Transportation Workers','Air Traffic Controllers and Airfield Operations Specialists','Airfield Operations Specialists','Ensure the safe takeoff and landing of commercial and military aircraft. Duties include coordination between air-traffic control and maintenance personnel, dispatching, using airfield landing and navigational aids, implementing airfield safety procedures, monitoring and maintaining flight records, and applying knowledge of weather information.','o*net',NULL),(2398,'2023-02-27 20:36:25.192187','53-2031.00','Flight Attendants','Transportation and Material Moving Occupations','Air Transportation Workers','Flight Attendants','Flight Attendants','Monitor safety of the aircraft cabin. Provide services to airline passengers, explain safety information, serve food and beverages, and respond to emergency incidents.','o*net',NULL),(2399,'2023-02-27 20:36:25.217077','53-3011.00','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Transportation and Material Moving Occupations','Motor Vehicle Operators','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Ambulance Drivers and Attendants, Except Emergency Medical Technicians','Drive ambulance or assist ambulance driver in transporting sick, injured, or convalescent persons. Assist in lifting patients.','o*net',NULL),(2400,'2023-02-27 20:36:25.240621','53-3031.00','Driver/Sales Workers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Driver/Sales Workers and Truck Drivers','Driver/Sales Workers','Drive truck or other vehicle over established routes or within an established territory and sell or deliver goods, such as food products, including restaurant take-out items, or pick up or deliver items such as commercial laundry. May also take orders, collect payment, or stock merchandise at