 May collect a fare. Includes nonemergency medical transporters and hearse drivers.','o*net',NULL),(2406,'2023-02-27 20:36:25.394283','53-3054.00','Taxi Drivers','Transportation and Material Moving Occupations','Motor Vehicle Operators','Passenger Vehicle Drivers','Taxi Drivers','Drive a motor vehicle to transport passengers on an unplanned basis and charge a fare, usually based on a meter.','o*net',NULL),(2407,'2023-02-27 20:36:25.419608','53-3099.00','Motor Vehicle Operators, All Other','Transportation and Material Moving Occupations','Motor Vehicle Operators','Miscellaneous Motor Vehicle Operators','Motor Vehicle Operators, All Other','All motor vehicle operators not listed separately.','o*net',NULL),(2408,'2023-02-27 20:36:25.442670','53-4011.00','Locomotive Engineers','Transportation and Material Moving Occupations','Rail Transportation Workers','Locomotive Engineers and Operators','Locomotive Engineers','Drive electric, diesel-electric, steam, or gas-turbine-electric locomotives to transport passengers or freight. Interpret train orders, electronic or manual signals, and railroad rules and regulations.','o*net',NULL),(2409,'2023-02-27 20:36:25.469065','53-4013.00','Rail Yard Engineers, Dinkey Operators, and Hostlers','Transportation and Material Moving Occupations','Rail Transportation Workers','Locomotive Engineers and Operators','Rail Yard Engineers, Dinkey Operators, and Hostlers','Drive switching or other locomotive or dinkey engines within railroad yard, industrial plant, quarry, construction project, or similar location.','o*net',NULL),(2410,'2023-02-27 20:36:25.494483','53-4022.00','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Transportation and Material Moving Occupations','Rail Transportation Workers','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Railroad Brake, Signal, and Switch Operators and Locomotive Firers','Operate or monitor railroad track switches or locomotive instruments. May couple or uncouple rolling stock to make up or break up trains. Watch for and relay traffic signals. May inspect couplings, air hoses, journal boxes, and hand brakes. May watch for dragging equipment or obstacles on rights-of-way.','o*net',NULL),(2411,'2023-02-27 20:36:25.523044','53-4031.00','Railroad Conductors and Yardmasters','Transportation and Material Moving Occupations','Rail Transportation Workers','Railroad Conductors and Yardmasters','Railroad Conductors and Yardmasters','Coordinate activities of switch-engine crew within railroad yard, industrial plant, or similar location. Conductors coordinate activities of train crew on passenger or freight trains. Yardmasters review train schedules and switching orders and coordinate activities of workers engaged in railroad traffic operations, such as the makeup or breakup of trains and yard switching.','o*net',NULL),(2412,'2023-02-27 20:36:25.548431','53-4041.00','Subway and Streetcar Operators','Transportation and Material Moving Occupations','Rail Transportation Workers','Subway and Streetcar Operators','Subway and Streetcar Operators','Operate subway or elevated suburban trains with no separate locomotive, or electric-powered streetcar, to transport passengers. May handle fares.','o*net',NULL),(2413,'2023-02-27 20:36:25.575445','53-4099.00','Rail Transportation Workers, All Other','Transportation and Material Moving Occupations','Rail Transportation Workers','Miscellaneous Rail Transportation Workers','Rail Transportation Workers, All Other','All rail transportation workers not listed separately.','o*net',NULL),(2414,'2023-02-27 20:36:25.598739','53-5011.00','Sailors and Marine Oilers','Transportation and Material Moving Occupations','Water Transportation Workers','Sailors and Marine Oilers','Sailors and Marine Oilers','Stand watch to look for obstructions in path of vessel, measure water depth, turn wheel on bridge, or use emergency equipment as directed by captain, mate, or pilot. Break out, rig, overhaul, and store cargo-handling gear, stationary rigging, and running gear. Perform a variety of maintenance tasks to preserve the painted surface of the ship and to maintain line and ship equipment. Must hold government-issued certification and tankerman certification when working aboard liquid-carrying vessels. Includes able seamen and ordinary seamen.','o*net',NULL),(2415,'2023-02-27 20:36:25.628768','53-5021.00','Captains, Mates, and Pilots of Water Vessels','Transportation and Material Moving Occupations','Water Transportation Workers','Ship and Boat Captains and Operators','Captains, Mates, and Pilots of Water Vessels','Command or supervise operations of ships and water vessels, such as tugboats and ferryboats. Required to hold license issued by U.S. Coast Guard.','o*net',NULL),(2416,'2023-02-27 20:36:25.652751','53-5022.00','Motorboat Operators','Transportation and Material Moving Occupations','Water Transportation Workers','Ship and Boat Captains and Operators','Motorboat Operators','Operate small motor-driven boats. May assist in navigational activities.','o*net',NULL),(2417,'2023-02-27 20:36:25.679036','53-5031.00','Ship Engineers','Transportation and Material Moving Occupations','Water Transportation Workers','Ship Engineers','Ship Engineers','Supervise and coordinate activities of crew engaged in operating and maintaining engines, boilers, deck machinery, and electrical, sanitary, and refrigeration equipment aboard ship.','o*net',NULL),(2418,'2023-02-27 20:36:25.701860','53-6011.00','Bridge and Lock Tenders','Transportation and Material Moving Occupations','Other Transportation Workers','Bridge and Lock Tenders','Bridge and Lock Tenders','Operate and tend bridges, canal locks, and lighthouses to permit marine passage on inland waterways, near shores, and at danger points in waterway passages. May supervise such operations. Includes drawbridge operators, lock operators, and slip bridge operators.','o*net',NULL),(2419,'2023-02-27 20:36:25.729578','53-6021.00','Parking Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Parking Attendants','Parking Attendants','Park vehicles or issue tickets for customers in a parking lot or garage. May park or tend vehicles in environments such as a car dealership or rental car facility. May collect fee.','o*net',NULL),(2420,'2023-02-27 20:36:25.757828','53-6031.00','Automotive and Watercraft Service Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Service Attendants','Automotive and Watercraft Service Attendants','Service automobiles, buses, trucks, boats, and other automotive or marine vehicles with fuel, lubricants, and accessories. Collect payment for services and supplies. May lubricate vehicle, change motor oil, refill antifreeze, or replace lights or other accessories, such as windshield wiper blades or fan belts. May repair or replace tires.','o*net',NULL),(2421,'2023-02-27 20:36:25.786020','53-6032.00','Aircraft Service Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Service Attendants','Aircraft Service Attendants','Service aircraft with fuel. May de-ice aircraft, refill water and cooling agents, empty sewage tanks, service air and oxygen systems, or clean and polish exterior.','o*net',NULL),(2422,'2023-02-27 20:36:25.818312','53-6041.00','Traffic Technicians','Transportation and Material Moving Occupations','Other Transportation Workers','Traffic Technicians','Traffic Technicians','Conduct field studies to determine traffic volume, speed, effectiveness of signals, adequacy of lighting, and other factors influencing traffic conditions, under direction of traffic engineer.','o*net',NULL);
INSERT INTO `JobCode` (`id`, `creationDate`, `code`, `name`, `major`, `minor`, `broad`, `detailed`, `description`, `framework`, `url`) VALUES (2423,'2023-02-27 20:36:25.842483','53-6051.00','Transportation Inspectors','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Inspectors','Transportation Inspectors','Inspect equipment or goods in connection with the safe transport of cargo or people. Includes rail transportation inspectors, such as freight inspectors, rail inspectors, and other inspectors of transportation vehicles not elsewhere classified.','o*net',NULL),(2424,'2023-02-27 20:36:25.871818','53-6051.01','Aviation Inspectors','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Inspectors','Transportation Inspectors','Inspect aircraft, maintenance procedures, air navigational aids, air traffic controls, and communications equipment to ensure conformance with Federal safety regulations.','o*net',NULL),(2425,'2023-02-27 20:36:25.898323','53-6051.07','Transportation Vehicle, Equipment and Systems Inspectors, Except Aviation','Transportation and Material Moving Occupations','Other Transportation Workers','Transportation Inspectors','Transportation Inspectors','Inspect and monitor transportation equipment, vehicles, or systems to ensure compliance with regulations and safety standards.','o*net',NULL),(2426,'2023-02-27 20:36:25.925479','53-6061.00','Passenger Attendants','Transportation and Material Moving Occupations','Other Transportation Workers','Passenger Attendants','Passenger Attendants','Provide services to ensure the safety of passengers aboard ships, buses, trains, or within the station or terminal. Perform duties such as explaining the use of safety equipment, serving meals or beverages, or answering questions related to travel.','o*net',NULL),(2427,'2023-02-27 20:36:25.950173','53-6099.00','Transportation Workers, All Other','Transportation and Material Moving Occupations','Other Transportation Workers','Miscellaneous Transportation Workers','Transportation Workers, All Other','All transportation workers not listed separately.','o*net',NULL),(2428,'2023-02-27 20:36:25.977184','53-7011.00','Conveyor Operators and Tenders','Transportation and Material Moving Occupations','Material Moving Workers','Conveyor Operators and Tenders','Conveyor Operators and Tenders','Control or tend conveyors or conveyor systems that move materials or products to and from stockpiles, processing stations, departments, or vehicles. May control speed and routing of materials or products.','o*net',NULL),(2429,'2023-02-27 20:36:26.004978','53-7021.00','Crane and Tower Operators','Transportation and Material Moving Occupations','Material Moving Workers','Crane and Tower Operators','Crane and Tower Operators','Operate mechanical boom and cable or tower and cable equipment to lift and move materials, machines, or products in many directions.','o*net',NULL),(2430,'2023-02-27 20:36:26.030710','53-7031.00','Dredge Operators','Transportation and Material Moving Occupations','Material Moving Workers','Dredge Operators','Dredge Operators','Operate dredge to remove sand, gravel, or other materials in order to excavate and maintain navigable channels in waterways.','o*net',NULL),(2431,'2023-02-27 20:36:26.054201','53-7041.00','Hoist and Winch Operators','Transportation and Material Moving Occupations','Material Moving Workers','Hoist and Winch Operators','Hoist and Winch Operators','Operate or tend hoists or winches to lift and pull loads using power-operated cable equipment.','o*net',NULL),(2432,'2023-02-27 20:36:26.080606','53-7051.00','Industrial Truck and Tractor Operators','Transportation and Material Moving Occupations','Material Moving Workers','Industrial Truck and Tractor Operators','Industrial Truck and Tractor Operators','Operate industrial trucks or tractors equipped to move materials around a warehouse, storage yard, factory, construction site, or similar location.','o*net',NULL),(2433,'2023-02-27 20:36:26.106377','53-7061.00','Cleaners of Vehicles and Equipment','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Cleaners of Vehicles and Equipment','Wash or otherwise clean vehicles, machinery, and other equipment. Use such materials as water, cleaning agents, brushes, cloths, and hoses.','o*net',NULL),(2434,'2023-02-27 20:36:26.135340','53-7062.00','Laborers and Freight, Stock, and Material Movers, Hand','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Laborers and Freight, Stock, and Material Movers, Hand','Manually move freight, stock, luggage, or other materials, or perform other general labor. Includes all manual laborers not elsewhere classified.','o*net',NULL),(2435,'2023-02-27 20:36:26.160686','53-7062.04','Recycling and Reclamation Workers','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Laborers and Freight, Stock, and Material Movers, Hand','Prepare and sort materials or products for recycling. Identify and remove hazardous substances. Dismantle components of products such as appliances.','o*net',NULL),(2436,'2023-02-27 20:36:26.185213','53-7063.00','Machine Feeders and Offbearers','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Machine Feeders and Offbearers','Feed materials into or remove materials from machines or equipment that is automatic or tended by other workers.','o*net',NULL),(2437,'2023-02-27 20:36:26.214370','53-7064.00','Packers and Packagers, Hand','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Packers and Packagers, Hand','Pack or package by hand a wide variety of products and materials.','o*net',NULL),(2438,'2023-02-27 20:36:26.240978','53-7065.00','Stockers and Order Fillers','Transportation and Material Moving Occupations','Material Moving Workers','Laborers and Material Movers','Stockers and Order Fillers','Receive, store, and issue merchandise, materials, equipment, and other items from stockroom, warehouse, or storage yard to fill shelves, racks, tables, or customers\' orders. May operate power equipment to fill orders. May mark prices on merchandise and set up sales displays.','o*net',NULL),(2439,'2023-02-27 20:36:26.269053','53-7071.00','Gas Compressor and Gas Pumping Station Operators','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Gas Compressor and Gas Pumping Station Operators','Operate steam-, gas-, electric motor-, or internal combustion-engine driven compressors. Transmit, compress, or recover gases, such as butane, nitrogen, hydrogen, and natural gas.','o*net',NULL),(2440,'2023-02-27 20:36:26.292553','53-7072.00','Pump Operators, Except Wellhead Pumpers','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Pump Operators, Except Wellhead Pumpers','Tend, control, or operate power-driven, stationary, or portable pumps and manifold systems to transfer gases, oil, other liquids, slurries, or powdered materials to and from various vessels and processes.','o*net',NULL),(2441,'2023-02-27 20:36:26.318198','53-7073.00','Wellhead Pumpers','Transportation and Material Moving Occupations','Material Moving Workers','Pumping Station Operators','Wellhead Pumpers','Operate power pumps and auxiliary equipment to produce flow of oil or gas from wells in oil field.','o*net',NULL),(2442,'2023-02-27 20:36:26.341882','53-7081.00','Refuse and Recyclable Material Collectors','Transportation and Material Moving Occupations','Material Moving Workers','Refuse and Recyclable Material Collectors','Refuse and Recyclable Material Collectors','Collect and dump refuse or recyclable materials from containers into truck. May drive truck.','o*net',NULL),(2443,'2023-02-27 20:36:26.370088','53-7121.00','Tank Car, Truck, and Ship Loaders','Transportation and Material Moving Occupations','Material Moving Workers','Tank Car, Truck, and Ship Loaders','Tank Car, Truck, and Ship Loaders','Load and unload chemicals and bulk solids, such as coal, sand, and grain, into or from tank cars, trucks, or ships, using material moving equipment. May perform a variety of other tasks relating to shipment of products. May gauge or sample shipping tanks and test them for leaks.','o*net',NULL),(2444,'2023-02-27 20:36:26.394090','53-7199.00','Material Moving Workers, All Other','Transportation and Material Moving Occupations','Material Moving Workers','Miscellaneous Material Moving Workers','Material Moving Workers, All Other','All material moving workers not listed separately.','o*net',NULL),(2445,'2023-02-27 20:36:26.418015','55-1011.00','Air Crew Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Air Crew Officers','Perform and direct in-flight duties to ensure the successful completion of combat, reconnaissance, transport, and search and rescue missions. Duties include operating aircraft communications and radar equipment, such as establishing satellite linkages and jamming enemy communications capabilities; operating aircraft weapons and defensive systems; conducting preflight, in-flight, and postflight inspections of onboard equipment; and directing cargo and personnel drops.','o*net',NULL),(2446,'2023-02-27 20:36:26.443920','55-1012.00','Aircraft Launch and Recovery Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Aircraft Launch and Recovery Officers','Plan and direct the operation and maintenance of catapults, arresting gear, and associated mechanical, hydraulic, and control systems involved primarily in aircraft carrier takeoff and landing operations. Duties include supervision of readiness and safety of arresting gear, launching equipment, barricades, and visual landing aid systems; planning and coordinating the design, development, and testing of launch and recovery systems; preparing specifications for catapult and arresting gear installations; evaluating design proposals; determining handling equipment needed for new aircraft; preparing technical data and instructions for operation of landing aids; and training personnel in carrier takeoff and landing procedures.','o*net',NULL),(2447,'2023-02-27 20:36:26.472273','55-1013.00','Armored Assault Vehicle Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Armored Assault Vehicle Officers','Direct the operation of tanks, light armor, and amphibious assault vehicle units during combat situations on land or in aquatic environments. Duties include directing crew members in the operation of targeting and firing systems; coordinating the operation of advanced onboard communications and navigation equipment; directing the transport of personnel and equipment during combat; formulating and implementing battle plans, including the tactical employment of armored vehicle units; and coordinating with infantry, artillery, and air support units.','o*net',NULL),(2448,'2023-02-27 20:36:26.498723','55-1014.00','Artillery and Missile Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Artillery and Missile Officers','Manage personnel and weapons operations to destroy enemy positions, aircraft, and vessels. Duties include planning, targeting, and coordinating the tactical deployment of field artillery and air defense artillery missile systems units; directing the establishment and operation of fire control communications systems; targeting and launching intercontinental ballistic missiles; directing the storage and handling of nuclear munitions and components; overseeing security of weapons storage and launch facilities; and managing maintenance of weapons systems.','o*net',NULL),(2449,'2023-02-27 20:36:26.523932','55-1015.00','Command and Control Center Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Command and Control Center Officers','Manage the operation of communications, detection, and weapons systems essential for controlling air, ground, and naval operations. Duties include managing critical communication links between air, naval, and ground forces; formulating and implementing emergency plans for natural and wartime disasters; coordinating emergency response teams and agencies; evaluating command center information and need for high-level military and government reporting; managing the operation of surveillance and detection systems; providing technical information and advice on capabilities and operational readiness; and directing operation of weapons targeting, firing, and launch computer systems.','o*net',NULL),(2450,'2023-02-27 20:36:26.546831','55-1016.00','Infantry Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Infantry Officers','Direct, train, and lead infantry units in ground combat operations. Duties include directing deployment of infantry weapons, vehicles, and equipment; directing location, construction, and camouflage of infantry positions and equipment; managing field communications operations; coordinating with armor, artillery, and air support units; performing strategic and tactical planning, including battle plan development; and leading basic reconnaissance operations.','o*net',NULL),(2451,'2023-02-27 20:36:26.571592','55-1017.00','Special Forces Officers','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Special Forces Officers','Lead elite teams that implement unconventional operations by air, land, or sea during combat or peacetime. These activities include offensive raids, demolitions, reconnaissance, search and rescue, and counterterrorism. In addition to their combat training, special forces officers often have specialized training in swimming, diving, parachuting, survival, emergency medicine, and foreign languages. Duties include directing advanced reconnaissance operations and evaluating intelligence information; recruiting, training, and equipping friendly forces; leading raids and invasions on enemy territories; training personnel to implement individual missions and contingency plans; performing strategic and tactical planning for politically sensitive missions; and operating sophisticated communications equipment.','o*net',NULL),(2452,'2023-02-27 20:36:26.597433','55-1019.00','Military Officer Special and Tactical Operations Leaders, All Other','Military Specific Occupations','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders','Military Officer Special and Tactical Operations Leaders, All Other','All military officer special and tactical operations leaders not listed separately.','o*net',NULL),(2453,'2023-02-27 20:36:26.623052','55-2011.00','First-Line Supervisors of Air Crew Members','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Supervisors of Air Crew Members','Supervise and coordinate the activities of air crew members. Supervisors may also perform the same activities as the workers they supervise.','o*net',NULL),(2454,'2023-02-27 20:36:26.649290','55-2012.00','First-Line Supervisors of Weapons Specialists/Crew Members','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Supervisors of Weapons Specialists/Crew Members','Supervise and coordinate the activities of weapons specialists/crew members. Supervisors may also perform the same activities as the workers they supervise.','o*net',NULL),(2455,'2023-02-27 20:36:26.680610','55-2013.00','First-Line Supervisors of All Other Tactical Operations Specialists','Military Specific Occupations','First-Line Enlisted Military Supervisors','First-Line Enlisted Military Supervisors','First-Line Supervisors of All Other Tactical Operations Specialists','Supervise and coordinate the activities of all other tactical operations specialists not classified separately above. Supervisors may also perform the same activities as the workers they supervise.','o*net',NULL),(2456,'2023-02-27 20:36:26.712407','55-3011.00','Air Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Air Crew Members','Perform in-flight duties to ensure the successful completion of combat, reconnaissance, transport, and search and rescue missions. Duties include operating aircraft communications and detection equipment, including establishing satellite linkages and jamming enemy communications capabilities; conducting preflight, in-flight, and postflight inspections of onboard equipment; operating and maintaining aircraft weapons and defensive systems; operating and maintaining aircraft in-flight refueling systems; executing aircraft safety and emergency procedures; computing and verifying passenger, cargo, fuel, and emergency and special equipment weight and balance data; and conducting cargo and personnel drops.','o*net',NULL),(2457,'2023-02-27 20:36:26.741084','55-3012.00','Aircraft Launch and Recovery Specialists','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Aircraft Launch and Recovery Specialists','Operate and maintain catapults, arresting gear, and associated mechanical, hydraulic, and control systems involved primarily in aircraft carrier takeoff and landing operations. Duties include installing and maintaining visual landing aids; testing and maintaining launch and recovery equipment using electric and mechanical test equipment and hand tools; activating airfield arresting systems, such as crash barriers and cables, during emergency landing situations; directing aircraft launch and recovery operations using hand or light signals; and maintaining logs of airplane launches, recoveries, and equipment maintenance.','o*net',NULL),(2458,'2023-02-27 20:36:26.772360','55-3013.00','Armored Assault Vehicle Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Armored Assault Vehicle Crew Members','Operate tanks, light armor, and amphibious assault vehicles during combat situations on land or in aquatic environments. Duties include driving armored vehicles that require specialized training; operating and maintaining targeting and firing systems; operating and maintaining advanced onboard communications and navigation equipment; transporting personnel and equipment in a combat environment; and operating and maintaining auxiliary weapons, including machine guns and grenade launchers.','o*net',NULL),(2459,'2023-02-27 20:36:26.802169','55-3014.00','Artillery and Missile Crew Members','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Artillery and Missile Crew Members','Target, fire, and maintain weapons used to destroy enemy positions, aircraft, and vessels. Field artillery crew members predominantly use guns, cannons, and howitzers in ground combat operations, while air defense artillery crew members predominantly use missiles and rockets. Naval artillery crew members predominantly use torpedoes and missiles launched from a ship or submarine. Duties include testing, inspecting, and storing ammunition, missiles, and torpedoes; conducting preventive and routine maintenance on weapons and related equipment; establishing and maintaining radio and wire communications; and operating weapons targeting, firing, and launch computer systems.','o*net',NULL),(2460,'2023-02-27 20:36:26.833639','55-3015.00','Command and Control Center Specialists','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Command and Control Center Specialists','Operate and monitor communications, detection, and weapons systems essential for controlling air, ground, and naval operations. Duties include maintaining and relaying critical communications between air, naval, and ground forces; implementing emergency plans for natural and wartime disasters; relaying command center information to high-level military and government decisionmakers; monitoring surveillance and detection systems, such as air defense; interpreting and evaluating tactical situations and making recommendations to superiors; and operating weapons targeting, firing, and launch computer systems.','o*net',NULL),(2461,'2023-02-27 20:36:26.860665','55-3016.00','Infantry','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Infantry','Operate weapons and equipment in ground combat operations. Duties include operating and maintaining weapons, such as rifles, machine guns, mortars, and hand grenades; locating, constructing, and camouflaging infantry positions and equipment; evaluating terrain and recording topographical information; operating and maintaining field communications equipment; assessing need for and directing supporting fire; placing explosives and performing minesweeping activities on land; and participating in basic reconnaissance operations.','o*net',NULL),(2462,'2023-02-27 20:36:26.888690','55-3018.00','Special Forces','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Special Forces','Implement unconventional operations by air, land, or sea during combat or peacetime as members of elite teams. These activities include offensive raids, demolitions, reconnaissance, search and rescue, and counterterrorism. In addition to their combat training, special forces members often have specialized training in swimming, diving, parachuting, survival, emergency medicine, and foreign languages. Duties include conducting advanced reconnaissance operations and collecting intelligence information; recruiting, training, and equipping friendly forces; conducting raids and invasions on enemy territories; laying and detonating explosives for demolition targets; locating, identifying, defusing, and disposing of ordnance; and operating and maintaining sophisticated communications equipment.','o*net',NULL),(2463,'2023-02-27 20:36:26.916417','55-3019.00','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members, All Other','Military Specific Occupations','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members','Military Enlisted Tactical Operations and Air/Weapons Specialists and Crew Members, All Other','All military enlisted tactical operations and air/weapons specialists and crewmembers not listed separately.','o*net',NULL),(2464,'2023-02-27 21:01:13.168460','31-9095.1141',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2465,'2023-02-27 21:01:14.310516','15-1256',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2466,'2023-02-27 21:01:14.321946','15-1257',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2467,'2023-02-27 21:01:20.893219','39-1011',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2468,'2023-02-27 21:01:22.228659','11-9198',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2469,'2023-02-27 21:01:23.298444','25-9010',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2470,'2023-02-27 21:01:23.330949','25-9011',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2471,'2023-02-27 21:02:01.124559','15-1000',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2472,'2023-02-27 21:02:01.151359','15-1120',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2473,'2023-02-27 21:02:01.189880','15-1122',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2474,'2023-02-27 21:02:01.236321','11-3031.02',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2475,'2023-02-27 21:02:01.250056','13-2011.01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2476,'2023-02-27 21:02:01.260575','15-1122.00',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2477,'2023-02-27 21:02:01.269842','17-2081.01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2478,'2023-02-27 21:02:01.281881','17-2111.01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2479,'2023-02-27 21:02:01.292125','17-2111.03',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2480,'2023-02-27 21:02:01.303025','17-2199.01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2481,'2023-02-27 21:02:01.311330','17-2199.02',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2482,'2023-02-27 21:02:01.321992','17-2199.04',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2483,'2023-02-27 21:02:01.339230','17-3023.01',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2484,'2023-02-27 21:02:01.348252','17-3023.03',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2485,'2023-02-27 21:02:01.360993',